(2, 'test', '# Rentrée 2025\n\n### Lundi 1 septembre 2025 :\n\nLes élèves de 6ème feront leur rentrée à 8h et sortiront à 17h.\n\nLes élèves de 5ème, 4ème et 3ème sont libérés.\n\n \n\n### Mardi 2 septembre 2025 :\n\nLes élèves de 5ème 4ème et 3ème feront leur rentrée de 8h à 12h. L\'après-midi cours selon l\'EDT.\n\nLes élèves de 6ème ont cours toute la journée selon leur EDT.\n\n------------------------------------------------\n\n[Fournitures Scolaires (lien)](https://google.com)\n\n-------------------------------------------------\n\n## Réunion de rentrée pour les parents de 6ème  :\n\nLundi 15 septembre 18h  (la salle sera indiquée sur place).\n\n \n\n## Réunion de rentrée pour les parents de 5ème  4ème 3ème :\n\nLundi 22 septembre 18h  (la salle sera indiquée sur place).\n\n \n\n-------------------------------------------------------------------------\n\nStage 3ème : du lundi 1er décembre au samedi 6 décembre 2025\n\n-------------------------------------------------------------------------', 'markdown', 1, '2025-09-01 19:41:35', '2025-09-01 19:41:35', NULL, 'brouillon', 'https://clg-jferry-beaune.eclat-bfc.fr/ressources-layout.do?ID_RESSOURCE=656&ID_PAGE=40', 'test123456yt', '[\"test\"]', 0, 1),
