INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1, 'Minecraft', 'Une plateforme d\'apprentissage basée sur le jeu assistant des milliers d\'enseignants dans plus de 100 pays. Regardez la vidéo d\'exemple de jeu Minecraft.', 'https://play-lh.googleusercontent.com/27O5tpaYE82W6m30rJ_MX3-UvshlDM6O8oXDxb6GseYW2T7P8UNT19727MGmz-0q3w', 'minecraft.unlockshy.xyz', 0, 'plus', 1, 'Windows', 'OS: Windows 10 64-bit\r\nCPU: Intel Core i5-3470 / AMD FX-8350\r\nRAM: 8 GB\r\nGPU: NVIDIA GTX 660 2GB / AMD HD 7870 2GB\r\nStorage: 72 GB', 2013, '2025-08-26 10:12:39', '2025-09-08 16:27:03', 1, 3, 213),
(4, 'Windows 10', 'À partir de cette page, vous pouvez télécharger une image disque (fichier ISO) qui peut être utilisée pour installer ou réinstaller Windows 10. L\'image peut ...', 'https://cdn.futura-sciences.com/buildsv6/images/wide1920/d/1/f/d1f14667b3_50157125_4f15d3ad9d-50144980-windowslight.jpg', 'taiwebs.com', 0, 'free', 11, 'Windows', '# DOWNLOAD ME', 2024, '2025-08-31 13:40:37', '2025-09-08 16:25:39', NULL, NULL, 5),
(831, 'Adobe Acrobat Pro 2025', 'Adobe Acrobat Pro vous permet de bénéficier d\'outils PDF entièrement remaniés et accessibles, où que vous soyez. Désormais, Adobe Acrobat intègre un assistant IA qui vous permet d\'optimiser et de créer du contenu à partir de vos propres sources', 'https://content.avito.ma/classifieds/images/10132849527?t=images', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', NULL, 830, 0),
(832, 'James Cameron’s Avatar The Game', 'James Cameron\'s Avatar: The Game est un jeu vidéo d\'action-aventure sorti en 2009 pour PlayStation 3, Xbox 360, Windows, Wii, DS et PlayStation Portable, développé et édité par Ubisoft. L\'action se déroule dans l\'univers d\'Avatar, quelques années avant le premier film', 'https://shared.fastly.steamstatic.com/store_item_assets/steam/apps/33280/header.jpg?t=1447352375', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', NULL, 831, 0),
(833, 'Parisian Brasserie Simulator', 'Gérez votre propre brasserie à Paris et transformez-la en un lieu incontournable ! Créez des menus, servez les clients et développez votre restaurant. Gérez les approvisionnements, assurez un service impeccable et marquez la ville de votre empreinte. Serez-vous la prochaine institution parisienne ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3058360/e7b9d29c5d3c9d41c06f37671c25956513cee3c0/header.jpg?t=1756883005', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 832, 0),
(834, 'LEGO® Indiana Jones™: The Original Adventures', 'Essayez de sortir du pétrin ! Jouez aux films classiques d\'Indiana Jones™ et revivez les aventures d\'Indy dans le monde des LEGO®. Explorez et partez à la découverte - Combattez des ennemis, résolvez des énigmes et recherchez les trésors les plus convoités.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/32330/header.jpg?t=1699055876', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 833, 0),
(835, 'Furnish Master', 'Furnish Master est un jeu relaxant qui consiste à décorer des appartements, maisons, zones commerciales et même des lieux extérieurs ! Créer les designs de vos rêves !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2004080/header.jpg?t=1755432007', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 834, 0),
(836, 'White Knuckle', 'White Knuckle is a first-person roguelite speed-climbing game. Ascend through the guts of SUB-STRUCTURE 17 using precision movement mechanics. Sharp reflexes and resource management will bring you out from under ten thousand meters of concrete and decay.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3195790/header.jpg?t=1744909095', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 835, 0),
(837, 'NBA 2K14', 'NBA 2K14 est un jeu vidéo de basket-ball développé par Visual Concepts et édité par 2K Sports sorti le 1ᵉʳ octobre 2013 sur Xbox 360 et PlayStation 3 ; les versions sur PlayStation 4 et Xbox One sont sorties en novembre de la même année', 'https://gaming-cdn.com/images/products/245/orig/nba-2k14-pc-steam-cover.jpg?v=1752058548', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 2, 836, 0),
(838, 'SolidWorks 2025 ', 'SOLIDWORKS 2025 est conçu pour accélérer et simplifier votre processus de développement produit, du concept jusqu\'à la fabrication, grâce à des améliorations centrées utilisateur dans tous les aspects de la conception 3D : modélisation, gestion des données, simulation, conception électrique, tôlerie, collaboration, et plus encore.', 'https://media.invisioncic.com/n315104/monthly_2025_07/event2F4f5d75d7-fe6f-42c5-ae88-69a7e8ded98f2Fresources2FNyoRpTt8TVaCrq9uvvUh_solidworks-2025.png.d067afbee8cfbcbf2724eb4d982414cc.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', NULL, 837, 0),
(839, 'Stellar Settlers: Space Base Builder', 'Stellar Settlers est un jeu de simulation de construction de base spatiale et de colonie. Avec un gameplay de construction de base vertical et horizontal unique, prenez le contrôle d\'une colonie, construisez votre propre colonie prospère sur 5 planètes hostiles qui veulent vous détruire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2628570/cb48aed6efae35b4a3cb2ae640b1941e5880c3b5/header.jpg?t=1756360955', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 838, 0),
(840, 'Pixologic ZBrush', 'Pixologic ZBrush est un logiciel de sculpture et de modélisation 3D de référence, largement utilisé dans les domaines du cinéma, du jeu vidéo, de l’illustration et du design. Il se distingue par son approche artistique, qui permet aux créateurs de travailler comme s’ils modelaient de l’argile numérique, grâce à des outils intuitifs de sculpture haute résolution.', 'https://www.mojomojo.design/wp-content/uploads/2019/05/compspeczbrush.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', NULL, 839, 0),
(841, 'Serious Sam Fusion 2017 (beta)', 'Serious Sam Fusion is a central hub for several existing Serious Sam games developed by Croteam. Cool new features, engine upgrades, patches and updates will be released to existing owners for FREE!', 'https://cfinder.xyz/uploads/SeriousSamFusion2017beta.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 840, 0),
(842, '3ds Max', 'Coopération et trahison dans l\'espace ! Dans ce jeu multijoueur PC et VR, l\'équipage collabore pour terminer toutes les tâches avant qu\'un ou plusieurs imposteurs ne tuent tout le monde. Trahison et supercherie sont toujours au rendez-vous. Découvrez Among US, à présent en 3D.', 'https://cdn.itoosoft.com/media/cache/news_full/67e3da899bef5/3dsmax2026splashscreen.jpg?version=v215', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', NULL, 841, 0),
(843, 'Frogmonster', 'Discover some of the most charming and challenging soulslike bosses in Frogmonster, a Metroidvania FPS adventure where you explore a lively world filled with creatures, bugs, and beasts.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1853760/header.jpg?t=1752335701', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 842, 0),
(844, 'Resident Evil 6', 'Mêlant action et survival horror, Resident Evil 6 s\'annonce comme l\'expérience horrifique de 2013.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/221040/header.jpg?t=1700452901', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 843, 0),
(845, 'SimCity', 'Il s\'agit d\'une nouvelle simcité qui offre une profondeur de simulation sans précédent. Le monde et les détails de type modèle de la simulation en font la simcité la plus réactive et la plus personnelle de tous les temps. Il s\'agit également du jeu de gestion de la ville le plus vaste à ce jour où vous pouvez contrôler une région qui offre une véritable échelle multi-villes et jouer une seule ville ou jusqu\'à 16 villes à la fois avec différentes spécialisations. Le multijoueur est également une première pour la série, ce qui ajoute une nouvelle dimension à votre jeu car vos décisions ont un impact sur votre ville et votre région et crée de nouvelles façons de jouer en collaborant ou en compétition pour gagner des réalisations.', '//images.igdb.com/igdb/image/upload/t_screenshot_big/co1y6x.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 844, 0),
(846, 'Cabin Crew Life Simulator', 'Bienvenue sur Cabin Crew Life Simulator, le simulateur révolutionnaire d\'agent de bord par SOGA Std. Plongez dans le monde glamour de l\'aviation et démarrez votre carrière en assurant la satisfaction et la sécurité des passagers.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2959610/6f359d807a780bfb251e8c55fa8d3c5f766ca4cd/header_alt_assets_1.jpg?t=1756788617', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 845, 0),
(847, 'The LEGO® Movie - Videogame', 'Rejoignez Emmet et un groupe improbable de combattants de la résistance dans leur quête héroïque pour contrecarrer les plans maléfiques de Lord Business, une mission pour laquelle Emmet n’est désespérément et drôlement pas préparé.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/267530/header.jpg?t=1729804839', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 846, 0),
(848, 'Serious Sam Classics: Revolution', 'Serious Sam is a high-adrenaline arcade-action shooter heavily focused on frantic action. In a world where cyberpunk meets fantasy-fiction and advanced technology is mixed with black magic and psycho-powers, Sam travels through four beautiful worlds, confronting countless foes on his way to Mental\'s base.', 'https://cfinder.xyz/uploads/SeriousSamClassicsRevolution.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 2, 847, 0),
(849, 'Overlord™: Raising Hell', 'Êtes-vous démoniaque ?Découvrez quel est votre niveau de corruption dans Overlord, l\'aventure dans laquelle vous incarnez le mal (ou même pire que le mal). Vous allez faire l\'expérience, par le biais de ce jeu, de la corruption que le pouvoir peut engendrer.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/12710/header.jpg?t=1729270521', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 848, 0),
(850, 'NBA 2K23', 'Série développée par Visual Concepts et éditée par 2K. NBA 2K23 mets l’univers du basketball entre vos mains. Jouez contre les meilleurs joueurs du monde et démontrez vos talents dans le mode Ma CARRIERE. Assemblez les Stars d’aujourd’hui avec les Légendes d’hier dans MyTEAM. Construisez votre propre Dynastie dans MyGM ou prenez les rênes de la NBA dans MyLEAGUE. Jouez avec les équipes de la NBA ou WNBA dans le mode JOUER et vivez une expérience de jeu ultra réaliste. Comment répondrez-vous à l’Appel ?', 'https://lebetatesteur.ca/wp-content/uploads/2022/09/NBA2K23_CrossGenEditionWide-scaled.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', NULL, 849, 0),
(851, 'Anger Foot', 'Anger Foot est un FPS ultra-rapide dans lequel les seules choses plus dures que vos pieds sont les basses qui tabassent.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1978590/header.jpg?t=1728952662', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 850, 0),
(852, 'Tour de France 2025', 'Le jeu officiel prend une nouvelle dimension grâce à de nouveaux graphismes pour une immersion accrue. Lancez-vous à l’assaut des routes du Tour de France 2025, sprintez, grimpez, et tentez de remporter le mythique Maillot Jaune.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2511320/8938f599ed45e5cca4d77ce301d7e3635570d8fc/header.jpg?t=1749217231', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 851, 0),
(853, 'Hollow Knight: Silksong', 'Découvrez un vaste royaume maudit dans Hollow Knight: Silksong ! Explorez, combattez et survivez tout en grimpant jusqu\'au sommet de terres maudites par la soie et les mélodies.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1030300/7983574d464e6559ac7e24275727f73a8bcca1f3/header.jpg?t=1756994410', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', NULL, 852, 0),
(854, 'Cyber Warrior', 'Cyber Warrior is a hacking simulator where you play as an ex retired bureau agent recruited back to take on a powerful criminal organization. Explore dozens of interactive desktops, navigate 200+ in-game websites, solve puzzles, customize your setup and make decisions that will shape a new cyber age', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/726980/e606ba96659ba4da2b4657077443b88fa1ec201d/header.jpg?t=1750873690', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 853, 0),
(855, 'Yes, Your Grace 2: Snowfall', 'Dirigez un royaume affaibli et essayez de satisfaire les petits besoins de vos gens dans ce RPG cinématique de gestion. Équilibrez vos ressources, collectez des taxes, recrutez des agents et faites des choix cornéliens qui vous mèneront à la prospérité ou à l’échec.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1373090/header.jpg?t=1755778104', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 854, 0),
(856, 'Yes, Your Grace', 'Votre Grâce, en ces temps troublés, les insignifiantes requêtes des pétitionnaires exigent plus que ce que nos ressources limitées permettent de leur allouer... sans oublier la guerre ! Un délicat équilibre se doit d\'être établi. Votre trône vous attend.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1115690/header.jpg?t=1746714206', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 855, 0),
(857, 'The Wolf Among Us', 'From the makers of the 2012 Game of the Year: The Walking Dead, comes a thriller based on the award-winning Fables comic books. As Bigby Wolf you will discover that a brutal, bloody murder is just a taste of things to come in a game series where your every decision can have enormous consequences.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/250320/header.jpg?t=1734104991', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 856, 0),
(858, 'Car Mechanic Simulator 2018', 'Dans les nouveaux modules „Trouvailles de la grange” et „ À la ferraille”, tu trouveras des classiques mais aussi des véhicules uniques. Avec l\'option „Éditeur de voitures”, tu peux même ajouter ta propre voiture, une voiture que tu auras créé toi-même.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/645630/header.jpg?t=1750426586', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 857, 0),
(859, 'Colony Ship: A Post-Earth Role Playing Game', 'Colony Ship is a turn-based, party-based role-playing game set aboard a generation ship launched to Proxima Centauri. The game features a detailed skill-based character system, multiple ways to handle quests, choices & consequences, and branching dialogue trees.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/648410/header.jpg?t=1753967361', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 858, 0),
(860, 'Wondershare Filmora 14', 'Filmora 14 est un logiciel de montage vidéo développé par Wondershare. Il permet de créer et d’éditer facilement des vidéos grâce à une interface intuitive et à de nombreux outils modernes. Cette version intègre notamment des fonctions d’intelligence artificielle (amélioration vidéo et audio, sous-titres, détourage, synchronisation labiale), ainsi que des options avancées comme le montage multi-caméras et l’animation fluide des éléments. Accessible aux débutants comme aux utilisateurs plus expérimentés, Filmora 14 combine simplicité et puissance pour réaliser des montages professionnels.', 'https://mma.prnewswire.com/media/2521402/Wondershare_Filmora_14.jpg?w=300', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', NULL, 859, 0),
(861, 'NBA 2K16', 'Votre honneur est en jeu dans Ma CARRIÈRE, MyTEAM, Ma NBA, The W et Partie rapide. Montrez tous les moves hyper réalistes que vous maîtrisez, propulsés par ProPLAY™, défiez vos amis ou vos rivaux dans les modes compétitifs NBA 2K26 et ne doutez jamais que c’est vous le king avec Leave no doubt.', 'https://gaming-cdn.com/images/products/833/orig/nba-2k16-pc-jeu-steam-cover.jpg?v=1650543743', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 2, 860, 0),
(862, 'Heading Out', 'Surmontez vos peurs et écrivez ton histoire. Arpentez les mythiques autoroutes américaines, où les choix sont lourds de conséquences et le danger toujours dans le rétroviseur. Créez votre propre légende avec des itinéraires roguelike, des ressources limitées et des courses effrénées.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1640630/header.jpg?t=1756721617', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 861, 0),
(863, 'Shamania', 'Shamania is an open world survival game where you can CRAFT, FIGHT, and EXPLORE a vibrant sandbox world with friends in CO-OP. Expand your base as a hub for survival, gather resources, and master professions to unlock new tools and opportunities!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2868100/4d7ca9fe47b488329b8cc197db6ad3d546c8a1d5/header.jpg?t=1756797206', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 862, 0),
(864, 'Lego Batman 2', 'Coopération et trahison dans l\'espace ! Dans ce jeu multijoueur PC et VR, l\'équipage collabore pour terminer toutes les tâches avant qu\'un ou plusieurs imposteurs ne tuent tout le monde. Trahison et supercherie sont toujours au rendez-vous. Découvrez Among US, à présent en 3D.', 'https://cfinder.xyz/uploads/LegoBatman2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', NULL, 863, 0),
(865, 'Omega Crafter', 'Plonge dans un vaste monde ouvert de création et de survie avec ton compagnon Grammi, en mode solo ou avec des amis en multijoueur ! Programme ton Grammi pour automatiser diverses tâches et construire ta propre ville, et affronte de redoutables monstres.', 'https://cfinder.xyz/uploads/OmegaCrafter.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 864, 0),
(866, 'Heavy Cargo - The Truck Simulator', 'Transportez des cargaisons surdimensionnées au cours de nombreuses missions dans un monde ouvert de 175 km². Conduisez des camions très détaillés et hautement personnalisables sous des conditions météorologiques dynamiques, de jour comme de nuit.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1474930/header.jpg?t=1755065920', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:24', '2025-09-09 15:30:13', 1, 865, 0),
(867, 'The Bunny Graveyard', 'Ton but est de retrouver Skye, la lapine ! Mais il semble y avoir une étrange entité à l\'intérieur de l\'ordinateur qui ne veut pas que tu partes... Parviendras-tu à remplir ta mission et à survivre ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1892420/header.jpg?t=1745438140', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 866, 0),
(868, 'Overlooting', 'Adaptez votre stratégie à un arbre de compétences différent à chaque partie, associez des pièces d\'équipement afin de former de puissantes synergies et créez un build capable de vaincre les boss qui se dresseront face à vous ! Dans ce roguelike de gestion d\'inventaire, chaque partie est unique !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3410180/fe93f810b7747c58768081f7d848d417a186f3a9/header.jpg?t=1756748499', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 867, 0),
(869, 'CRUEL', 'A fast run and gun horror shooter with roguelike elements', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2689470/header.jpg?t=1738178596', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 868, 0),
(870, 'METAL EDEN', 'Un FPS de science-fiction palpitant. L’HYPER-UNITÉ ASKA est envoyée en mission suicide pour sauver les CORES des citoyens de MOEBIUS, une cité orbitale devenue un piège mortel. Plongez dans une guerre cybernétique, affrontez les INGÉNIEURS et découvrez les secrets de METAL EDEN.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/990380/header.jpg?t=1756825167', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 869, 0),
(871, 'Crab Champions', 'Claw your way across exotic islands combining fluid movement with fast paced combat to become a Crab Champion in this third person roguelike shooter.', 'https://cfinder.xyz/uploads/CrabChampions.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 870, 0),
(872, 'The Forever Winter', 'The Forever Winter est un jeu d’horreur coopératif de tir tactique où vous et votre équipe devez piller les morts pour survivre sous l\'ombre de machines de guerre terrifiantes et gigantesques dans un conflit sans fin.', 'https://cfinder.xyz/uploads/TheForeverWinter.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 871, 0),
(873, 'Bus Simulator 21 Next Stop', 'Bus Simulator 21 Next Stop propose la flotte de véhicules la plus exhaustive de la série avec 30 bus sous licence officielle. Pilotez vos bus sur deux cartes totalement différentes, seul ou avec un ami. Utilisez des éléments de gestion avancés ou passez simplement d\'agréables moments sur la route.', 'https://cfinder.xyz/uploads/BusSimulator21NextStop.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 872, 0),
(874, 'Bakery Cafe Simulator', 'Cuisinez, construisez et développez le café de vos rêves ! Créez de délicieuses pâtisseries, aménagez votre espace et servez les clients. Jouez en solo ou avec des amis en coopération en ligne pour développer votre entreprise et vivre l\'excitation de la gestion d\'un café animé !', 'https://cfinder.xyz/uploads/BakeryCafeSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 873, 0),
(875, 'Junk Survivor', 'Junk Survivor is a zombie post-apocalypse game where you loot, craft, build and farm in a struggle to survive. With a vast map to explore, a robust skillset to unlock this customizable sandbox awaits the adventurer. How long before you die!', 'https://cfinder.xyz/uploads/JunkSurvivor.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 874, 0),
(876, 'Digger: Galactic Treasures', 'Digger: Galactic Treasures est une aventure spatiale où vous forerez des astéroïdes pour découvrir des ressources rares et des trésors cachés. Explorez la galaxie, améliorez votre équipement et découvrez les secrets de l\'univers.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3604430/40a5200b03da84969cfd9c4f4cac2cfdc54e8039/header.jpg?t=1753112964', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 875, 0),
(877, 'I Am Your Beast', 'Poursuivez le complexe militaro-industriel dans ce jeu FPS palpitant de vengeance secrète, avec des parties en micro-sandbox illustrées dans le style BD. Ce thriller vous est présenté par les développeurs d\'El Paso et Elsewhere.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1876590/header.jpg?t=1752670777', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 876, 0),
(878, 'Bus Simulator 18', 'Incarnez un chauffeur de bus dans un monde urbain ouvert en solo ou en multi. Conduisez des modèles créés par des grands constructeurs comme Mercedes-Benz, Setra, MAN et IVECO BUS. Emmenez vos passagers à destination et soyez à l’heure !', 'https://cfinder.xyz/uploads/BusSimulator18.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 877, 0),
(879, 'INCISION', 'All old-school FPS action. No Bullshit. Lots of blood & gore. Slaughter your way through nightmarish industrial mazes, transformed cityscapes and surreal alien structures to cut down the Growth in this ultraviolent, fast-paced, and merciless retro-styled first person shooter.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1734680/header.jpg?t=1756409668', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 878, 0),
(880, 'Ultimate Monkey Race', 'Ultimate Monkey Race est un jeu de plateforme multijoueur dans lequel vous construisez le niveau au fur et à mesure que vous jouez. Placez des pièges mortels et parcourez votre chemin jusqu\'à la ligne d\'arrivée pour marquer des points.', 'https://cfinder.xyz/uploads/UltimateMonkeyRace.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 879, 0),
(881, 'Card Shark', 'Card Shark est un jeu d\'aventure où se mêlent intrigues, ruses et autres délicieuses tricheries. Découvrez un monde dans lequel vous devrez manipuler vos adversaires aussi bien que vos cartes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1371720/header.jpg?t=1728952706', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 880, 0),
(882, 'GONE Fishing', 'GONE Fishing est un jeu d’horreur de survie multijoueur coopératif où vous et vos amis devez pêcher ensemble pour rester en vie. Le seul moyen de survivre est de nourrir la faim insatiable du lac avant qu’il ne vous dévore. Pourrez-vous le rassasier… ou serez-vous la prochaine offrande ?', 'https://cfinder.xyz/uploads/GONEFishing.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 881, 0),
(883, 'Hell is Us', 'Si la guerre est ce qui se rapproche le plus de l’enfer sur terre c’est qu’elle abrite le pire des démons : l’Homme. Dans un pays isolé, ravagé par un conflit fratricide, découvrez les secrets de votre passé et affrontez une énigmatique calamité.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1620730/7d40fd2849a6b259ee4de2b77dd643e9306104aa/header.jpg?t=1756714719', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 882, 0),
(884, 'Bendy: Lone Wolf', 'Bendy: Lone Wolf™ will tests your ability to survive against ever increasing odds. Monsters and obstacles emerge from every direction as you journey into the rubberhose halls of the world\'s most evil animation studio. Every day is a challenge.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3232610/header.jpg?t=1755277206', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 883, 0),
(885, 'LEGO® MARVEL\'s Avengers', 'Avengers, rassemblez-vous ! La franchise de jeu LEGO® Marvel à succès revient avec une nouvelle aventure de super héros bourré d\'action.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/405310/header.jpg?t=1745541213', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 884, 0),
(886, 'Suicide Guy', 'Suicide Guy se situe dans l’incroyable et extraordinaire univers de ce drôle de personnage. Quoi faire pour sauver la chose que vous aimez le plus au monde ? Immergez-vous dans ce rêve bizarre et aidez Suicide Guy à se réveiller avant qu’il ne soit trop tard.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/303610/header.jpg?t=1745444170', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 885, 0),
(887, 'Pih', 'Pih is a really simple game that you can play on PC or VR. Complete each level by collecting all the food , without being killed by the enemy pigs. The game has 52 levels and 3 bosses. Ragdoll physics, platforms and good music. No story, no loading screens, no cutscenes, just gameplay.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2870710/3bb7b2be8baad4643468b3347a52ed2761139939/header.jpg?t=1755931076', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 886, 0),
(888, 'Waterpark Simulator', 'Build and run your own waterpark. Design slides, send guests flying with ragdoll physics, manage staff, and fully customize your park. Turn total madness into a five-star empire in this first-person management simulator!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3293260/310bed8696a5b1262963ecbee04398a491506360/header.jpg?t=1755959376', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 887, 0),
(889, 'Castle Crashers®', 'Sortez votre épée et frayez-vous un chemin vers la victoire dans ce jeu d\'arcade aventure en 2D primé et signé The Behemoth !', 'https://cfinder.xyz/uploads/CastleCrashers.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 888, 0),
(890, 'Lost Soul Aside™', 'Dans Lost Soul Aside™, embarquez pour une odyssée épique afin de sauver votre jeune sœur, et l\'humanité tout entière, de mystérieux envahisseurs dimensionnels venus de par-delà les étoiles.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3378960/header.jpg?t=1756456279', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 889, 0),
(891, 'Guardians of the Sanctree', 'You and allies, avian inhabitants of Sanctree City, build structures and production lines on the tree, crafting weapons to fend off subterranean insects. Defense is just the start—dig deeper, destroy nests, fortify new defenses against escalating threats for an impregnable stronghold.', 'https://cfinder.xyz/uploads/GuardiansoftheSanctree.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 890, 0),
(892, 'The Surge 2', 'Affrontez des ennemis redoutables et des boss colossaux dans des combats violents sans concessions. Tranchez les membres de vos ennemis pour leur voler l\'équipement qui vous rendra plus puissant.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/644830/header.jpg?t=1727794351', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 891, 0),
(893, 'Yu-Gi-Oh! EARLY DAYS COLLECTION', 'Yu-Gi-Oh! EARLY DAYS COLLECTION regroupe toute une série de classiques Yu-Gi-Oh! datant des débuts des Duels, riches en RPG rétro et jeux de cartes stratégiques mettant en scène des personnages d\'anime très populaires !', 'https://cfinder.xyz/uploads/Yu-Gi-OhEARLYDAYSCOLLECTION.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 892, 0),
(894, 'Talisman: Digital 5th Edition', 'Êtes-vous prêt à entrer dans une nouvelle ère de Talisman ? Découvrez un monde où chaque lancer de dés peut mener à une nouvelle aventure, dans cette adaptation numérique de la dernière édition du jeu de société d\'aventure fantastique emblématique et très apprécié.', 'https://cfinder.xyz/uploads/TalismanDigital5thEdition.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 893, 0),
(895, 'Whisper Mountain Outbreak', 'Un mélange d\'escape game et de jeu de tir en coop post-apocalyptique ! Nous sommes en 1998. Une ancienne malédiction vient d\'être libérée au Mont Bisik. En solo ou en équipe de 2 à 4, explorez divers environnements, découvrez des indices... et échappez aux abominations.', 'https://cfinder.xyz/uploads/WhisperMountainOutbreak.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 894, 0),
(896, 'Paddle Paddle Paddle', 'Pagayez malgré la douleur. En solo ou en coop. Chacun sa pagaie. De la lave partout. Vous allez tomber. Crier. Peut-être pleurer. Bon courage, et ragez pas trop.', 'https://cfinder.xyz/uploads/PaddlePaddlePaddle.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 895, 0),
(897, 'Pathologic 2', 'Pathologic 2 is a groundbreaking open-world horror RPG. Resist the plague. Make medicine. Heal people. Perform an autopsy. Trade to get what you need. Fight and kill if necessary. Survive. Struggle with an outbreak in a secluded rural town that is rapidly turning into hell.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/505230/header.jpg?t=1753720161', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 896, 0),
(898, 'Forgive Me Father 2', 'Plongez dans les plus noirs cauchemars pour échapper à la folie. Défoncez des hordes d\'ennemis possédés, débloquez un arsenal d\'armes mortelles et de capacités contre nature, et préparez-vous à affronter toujours plus de folie lovecraftienne dans ce FPS bourré d\'action.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2272250/header.jpg?t=1748531480', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 897, 0),
(899, 'Devil May Cry HD Collection', 'Les célèbres jeux d\'action stylisés Devil May Cry, Devil May Cry 2 et Devil May Cry 3 - édition spéciale font leur retour dans une seule et même collection !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/631510/header.jpg?t=1644282550', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 898, 0),
(900, 'Keep on Mining!', 'Keep on Mining! est un petit jeu incrémental de minage. Minez des roches, récoltez des matériaux, trouvez des artefacts, fabriquez des pioches et dépensez vos ressources dans des améliorations permanentes à débloquer dans un grand arbre de compétences !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3769130/320ecc31730377d03c319b411fbf9ee95908d3c2/header.jpg?t=1756203201', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 899, 0),
(901, 'Les Tortues Ninja - Le destin de Splinter', 'Libère la puissance des Tortues dans une quête roguelike visant à arracher Splinter au Clan des Foot ! Maîtrise des compétences ninja, collabore dans un gameplay génial en coop et prends le contrôle des quartiers emblématiques de New York.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2996040/c825bff0240379d44511f2c5800c110ede17a027/header.jpg?t=1755196887', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 900, 0),
(902, 'Streets of Rogue', 'Luttez, faufilez-vous et piratez pour progresser dans des villes générées aléatoirement. C\'est comme si Nuclear Throne rencontrait Deus Ex, avec un peu du côté anarchiste de GTA. Quand un rogue-lite se prend d\'affection pour un sim immersif, tout part de travers.', 'https://cfinder.xyz/uploads/StreetsofRogue.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 901, 0),
(903, 'Nuclear Option', 'Fly near-future aircraft with immersive physics on intense battlefields, facing land, air and sea threats. Wage war against AI or other players with an array of potent weapons. Wield tactical and strategic nuclear weapons, capable of annihilating anything in their path.', 'https://cfinder.xyz/uploads/NuclearOption.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 902, 0),
(904, 'Risk of Rain Returns', 'Design soigné, graphismes améliorés, nouvelles fonctionnalités... Risk of Rain  fait son grand retour ! (Re)découvrez ce roguelike mythique aux combinaisons de butin uniques, avec de nouveaux survivants, un multijoueur repensé, du contenu apprécié de Risk of Rain 2, et plus encore !', 'https://cfinder.xyz/uploads/RiskofRainReturns.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 903, 0),
(905, 'The Scouring', 'The Scouring est un STR au rythme rapide, avec une grande attention aux détails et une expérience de nouvelle génération. Menez les humains ou les orcs au combat ! Jouez seul ou avec des amis. Utilisez les outils de modélisation pour créer des modes de jeu personnalisés! Rejoignez la bataille!', 'https://cfinder.xyz/uploads/TheScouring.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 2, 904, 0),
(906, 'Orcs Must Die! Deathtrap', 'Orcs Must Die! Deathtrap allie combats effrénés à la troisième personne et pose de pièges stratégique. Profitez d\'une rejouabilité sans fin à mesure que votre War Mage devient plus fort grâce à la progression roguelite. Repoussez les hordes d\'orcs implacables en solo ou jusqu\'à 4 joueurs.', 'https://cfinder.xyz/uploads/OrcsMustDieDeathtrap.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 905, 0),
(907, 'Farthest Frontier', 'Protégez votre peuple pour bâtir une ville et dompter la nature. Récoltez des matériaux, chassez, pêchez et cultivez vos champs pour survivre. Produisez des objets d’artisanat que vos colons pourront échanger et utiliser pour se battre dans une terrible lutte contre les éléments et les dangers.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1044720/header.jpg?t=1753807170', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 906, 0),
(908, 'Project Silverfish', 'Explore a hostile, living world: Uncover forgotten horrors, both man-made and supernatural, as you hunt for powerful weapons and exotic artifacts.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2941710/80b1e0e691b4f9b372f27af8eef9173c9383289b/header.jpg?t=1750910382', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 907, 0),
(909, 'Tchia', 'Une aventure tropicale en monde ouvert. Grimpez, planez, nagez, et naviguez dans un magnifique archipel dans ce bac à sable basé sur la physique. Prenez le contrôle de tous les animaux et objets que vous trouvez, et grattez sur votre ukulélé entièrement jouable.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1496590/header.jpg?t=1727258805', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:25', '2025-09-09 15:30:13', 1, 908, 0),
(910, 'Pizza Bandit', 'Pizza Bandit est un shooter coopératif chaotique en 3ᵉ personne où primes délirantes et cuisine sous pression s’entrechoquent. Voyagez dans le temps, éliminez vos ennemis et cuisinez sous le feu pour financer votre pizzeria de rêve.', 'https://cfinder.xyz/uploads/PizzaBandit.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 909, 0),
(911, 'Bank Simulator', 'Simulateur de Banque est un jeu de gestion bancaire réaliste où vous construisez, gérez et développez votre empire financier. Embauchez du personnel, approuvez des prêts, investissez dans des obligations, gérez les comptes clients et lancez des campagnes marketing, tout en naviguant dans les défis financiers.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3355800/header.jpg?t=1751345689', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 910, 0),
(912, 'Gears of War: Reloaded', 'L’original emblématique, fidèlement remastérisé.', 'https://cfinder.xyz/uploads/GearsofWarReloaded.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', NULL, 911, 0),
(913, 'The Riftbreaker', 'The Riftbreaker est un jeu de survie et de construction de bases avec des éléments d\'action et de RPG jusqu’à 4 joueurs. Massacrez des hordes d’ennemis. Construisez votre base, fabriquez de nouvelles armes et recherchez de nouvelles inventions pour survivre.', 'https://cfinder.xyz/uploads/TheRiftbreaker.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 912, 0),
(914, 'METAL GEAR SOLID Δ: SNAKE EATER', 'Un remake du jeu sorti en 2004, METAL GEAR SOLID 3: SNAKE EATER, avec la même histoire dans le même monde captivant, désormais avec de tout nouveaux graphismes et audio 3D qui rendent l\'atmosphère de la jungle plus réaliste.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2417610/05c97cbcd0cfc27c8ed6c7fc6d81e0995aa2a7d4/header.jpg?t=1755846087', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', NULL, 913, 0),
(915, 'Finnish Cottage Simulator', 'Finnish Cottage Simulator is the ultimate cottage experience. Relax and enjoy the Finnish summer nature, go to the sauna, get drunk, grill food or play games with others!', 'https://cfinder.xyz/uploads/FinnishCottageSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 2, 914, 0),
(916, 'Star Trucker', 'Transportez des cargaisons, vendez ce que vous récupérez dans l\'espace et gardez toujours votre combinaison spatiale à portée de main alors que vous cherchez la gloire et la fortune dans cette variante interstellaire des jeux de simulation de camion.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2380050/header.jpg?t=1752838019', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 915, 0),
(917, 'Coral Island', 'Coral Island est un jeu de simulation agricole fun et relaxant, repensé en mode multijoueur ! Découvre la vie insulaire à ton rythme : jardine avec tes amis, élève des animaux, noue des relations, passe du temps avec des personnages hauts en couleur et plonge dans le royaume magique des Ondins.', 'https://cfinder.xyz/uploads/CoralIsland.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 916, 0),
(918, 'Ravenous Devils', 'Un jeu de cuisine horrifique avec un soupçon de crime. Améliorez vos boutiques, offrez-vous de nouveaux outils, élaborez votre carte et ravissez les papilles de vos clients.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1615290/header.jpg?t=1745478285', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 917, 0),
(919, 'Among the Sleep - Enhanced Edition', 'Among the Sleep: Enhanced Edition est une toute nouvelle version améliorée du jeu d\'aventure-horreur à la première personne primé. Vous incarnez un jeune enfant à la recherche de sa maman dans un cauchemar étrange.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/250620/header.jpg?t=1678873027', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 918, 0),
(920, 'Persona 4 Golden', 'Dans cette histoire de passage à l\'âge adulte, le héros et ses amis vivent une grande aventure déclenchée par une série de meurtres.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1113000/header.jpg?t=1704380046', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 919, 0),
(921, 'The RPG', 'Un jeu d\'aventure avec des aspects volontairement détournés des jeux de rôle traditionnels, un scénario amusant, des personnages excentriques et un monde où vos choix ont de l\'importance.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2429270/6cddcfe56655e34b0f8ea73d03ff10a09f6c73c4/header_alt_assets_0_french.jpg?t=1755090385', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 920, 0),
(922, 'Ravenfield', 'Fight upon the Ravenfield together with your Blue allies! Take down those pesky Reds using helicopters, tanks, guns, and active ragdoll physics!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/636480/header.jpg?t=1664197939', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 921, 0),
(923, 'The Dark Queen of Mortholme', 'Vous êtes le boss final, la Reine Sombre de Mortholme, au pouvoir inégalé. Un héros envahit votre domaine et est facilement écrasé. Pourtant, il revient encore et encore. Un jeu indépendant court sur un lien inattendu, les points de vue et la beauté du changement.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3587610/4bc4e379d808fa4b78f98b7b75c1a4874ca3d269/header.jpg?t=1755844642', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 922, 0),
(924, 'The Case of the Golden Idol', 'A new kind of detective game that allows you to think and investigate freely. Discover clues surrounding 12 strange and gruesome deaths and build your own theory. Pick your suspect, deduce the motive, unmask the awful truth.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1677770/header.jpg?t=1731435891', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 923, 0),
(925, 'Rise of Gun', 'Rise of Gun- vous plonge dans un monde d\'apocalypse zombie en tant que propriétaire d\'un magasin d\'armes. Achetez des pièces, fabriquez, vendez, améliorez votre magasin et embauchez des ouvriers. Aidez l\'humanité à survivre', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2319640/header.jpg?t=1750074032', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 924, 0),
(926, 'Poppy Playtime', 'Essayez de rester en vie dans ce jeu d\'aventure, d\'horreur et de puzzles. Tentez de survivre aux jouets vengeurs de l\'usine de jouets désaffectée. Utilisez votre GrabPack pour pirater les circuits électriques ou attraper des choses. Explorez la mystérieuse usine... sans vous faire prendre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1721470/header.jpg?t=1755873139', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 925, 0),
(927, 'FAR: Lone Sails', 'Traversez des fonds marins asséchés remplis de vestiges d\'une civilisation disparue. Manoeuvrez votre embarcation en évitant les nombreux obstacles qui vous attendront dans des conditions météorologiques parfois difficiles. Jusqu\'où pourrez-vous aller ? Que trouverez-vous là-bas ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/609320/header.jpg?t=1755781639', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 926, 0),
(928, 'MachiaVillain', 'Machiavillain is an evil mansion management and strategy game, inspired by Dungeon Keeper, Prison Architect and all the horror movie clichés! Build your own manor, raise your monsters, set up your traps, and exterminate your victims. But to gain reputation you\'ll have to slay by the horror movie rules!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/555510/header.jpg?t=1572630276', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 927, 0),
(929, 'Academia : School Simulator', 'Concevez, construisez et gérez votre propre établissement scolaire avec ses profs ahurissants et ses équipements incroyables, ou laissez juste vos élèves se soulager dans les buissons... Qui sait ? Academia : School Simulator est un jeu de gestion-tycoon où vous décidez de tout !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/672630/header.jpg?t=1726498028', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 928, 0),
(930, 'Garten of Banban', 'Enter Banban\'s Kindergarten, and you\'re sure to make some friends. Explore the mysterious establishment and don\'t lose your life and sanity. Uncover the horrifying truth behind the place, but be careful, as you are far from alone…', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2232840/2801bf370ff16d2995a1e015159837a9d3cfaa13/header.jpg?t=1750914495', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 929, 0),
(931, 'Crime Boss: Rockay City', 'Crime Boss: Rockay City est un FPS de braquage en coop (de 1 à 4 joueurs) mêlant infiltration immersive et combats frénétiques. Le jeu, doté d\'une campagne solo roguelite qui associe FPS et stratégie, est porté par un doublage à la fois kitsch et hilarant.', 'https://cfinder.xyz/uploads/CrimeBossRockayCity.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 930, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(932, 'World War Z', 'World War Z est un jeu de tir coopératif palpitant, où jusqu\'à 4 joueurs unissent leurs forces pour survivre à de gigantesques hordes de zombies dans des scènes d’action à couper le souffle.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/699130/b35277055fbb7e07c26c5e31e4398684c6461d53/header.jpg?t=1751996954', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 931, 0),
(933, 'GROUND BRANCH', 'L\'un des développeurs à l\'origine des jeux Rainbow Six® et Ghost Recon® originaux nous offre un jeu de tir à la première personne complexe proposant une personnalisation approfondie des personnages et des armes. Prenez votre temps. Réfléchissez. Finissez le travail.', 'https://cfinder.xyz/uploads/GROUNDBRANCH.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', NULL, 932, 0),
(934, 'Supraland', 'Commence par la demo! Un mélange entre Portal, Zelda et Metroid. Explorez, trouvez des améliorations secrètes, résolvez des puzzles, combattez des monstres et débloquez de nouvelles compétences vous permettant d’accéder à de nouveaux endroits. Playtime 12-25h.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/813630/header.jpg?t=1748353298', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 933, 0),
(935, 'Wordatro!', 'Wordatro! combine jeu de lettres et roguelite addictif ! Scorez un maximum en créant des mots, enchaînez les combos, et débloquez des bonus renversants. Avec plus de 50 améliorations et des défis journaliers, découvrez une infinité de challenges linguistiques !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3140120/header.jpg?t=1755278003', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 934, 0),
(936, 'Please, Don\'t Touch Anything 3D', 'Un jeu énigmatique, non linéaire, à s\'arracher les cheveux, dans lequel on appuie sur des boutons...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/529590/header.jpg?t=1688662166', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 935, 0),
(937, 'OVIS LOOP', 'A pixel-art action roguelike with dynamic combat, player-led combo crafting and a post-apocalyptic battle of wolf and lamb. Step into the shoes of the robot-sheep Omega to wield sci-fi weapons and gather evolving skills to protect your flock. Jump into the loop and create a unique combat style.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2226730/0eba149920684c03572704ae23059a4de935888b/header.jpg?t=1755244361', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 936, 0),
(938, 'Supraworld', 'Be tiny in a handcrafted toy world. Explore, solve puzzles, ignore the main quest, get out of bounds, find secret areas, convict murderers. Hunt for powerful new abilities to unravel this vast, interconnected world… And don\'t forget to save the princess.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1869290/header.jpg?t=1755269907', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 937, 0),
(939, 'KallaX', 'Kallax est un jeu coopératif chaotique de construction de meubles dans lequel un seul joueur à la fois peut lire le manuel d\'instructions. Faites l\'expérience de ce qui aurait dû être le travail d\'une seule personne et détruisez vos amitiés à jamais.', 'https://cfinder.xyz/uploads/KallaX.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 938, 0),
(940, 'Hot Brass', 'As an elite SWAT operator, think fast and put your tactics to the test to master a series of missions and save lives. Summon your team of up to four players in online and local co-op, or hone your skills solo. Don’t just be the best—be the best of the best.', 'https://cfinder.xyz/uploads/HotBrass.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 939, 0),
(941, 'Len\'s Island', 'Découvrez un jeu de survie et de fabrication en monde ouvert pour 1 à 8 joueurs offrant donjons, combats ARPG intenses, agriculture paisible et construction de bâtiments. Terminez des quêtes et explorez un vaste monde généré de manière procédurale, regorgeant de dangers et de surprises.', 'https://cfinder.xyz/uploads/LensIsland.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 940, 0),
(942, 'SWAT Commander', 'Dans SWAT Commander, vous prenez la tête d\'une unité de forces spéciales. Commandez votre équipe du SWAT, gérez ses membres et leur équipement, mais surtout: menez à bien votre mission. Accompagnez vos spécialistes au cours d\'opérations à haut risque qui mettront vos capacités tactiques à l\'épreuve.', 'https://cfinder.xyz/uploads/SWATCommander.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 941, 0),
(943, 'Frog Jump', '🐸👑 Saute, grimpe, pousse les autres avec ta langue, et atteins le sommet pour gagner le baiser de la princesse ! 🏰 (Jusqu’à 8 joueurs)', 'https://cfinder.xyz/uploads/FrogJump.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 942, 0),
(944, 'Cryptid Farm', 'Cultivate a thriving farm to survive in this peaceful horror farming game! Play online with up to 16 players in the same lobby. Work together with your fellow farmers to repair your tractor and escape the farm, try not to fall victim to the eerie and mysterious creatures that lurk nearby.', 'https://cfinder.xyz/uploads/CryptidFarm.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 943, 0),
(945, 'EMPTY SHELL', 'EMPTY SHELL vous plongera dans un environnement industriel sombre, une installation secrète sur une île japonaise. Chaque volontaire a signé un contrat pour une \"opération de récupération\" sans trop de détails. Une horreur de survie roguelite tendue avec une perspective top down.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2243110/header.jpg?t=1753358557', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 944, 0),
(946, 'World of Football', 'Un jeu de foot centré sur la physique et dont les parties ne sont pas gagnées par chance, mais grâce à vos compétences ! Facile à comprendre, difficile à maîtriser. Dans World of Football, rassemblez jusqu’à dix joueurs pour tester vos prouesses sur le terrain ! Devenez le GOAT !', 'https://cfinder.xyz/uploads/WorldofFootball.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 945, 0),
(947, 'Warhammer 40,000: Dawn of War - Definitive Edition', 'Warhammer 40,000: Dawn of War - Édition ultime constitue l\'expérience Dawn of War par excellence, avec le jeu Dawn of War d\'origine et toutes ses extensions ainsi que des visuels enrichis, une caméra améliorée et une compatibilité plateformes 64 bits.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3556750/f60b47fa49e3582f21c39f6b123fb59e2b441292/header.jpg?t=1755200083', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', NULL, 946, 0),
(948, 'Megaloot', 'Megaloot est un RPG roguelike de gestion d\'inventaire. Créez des stratégies puissantes et variées grâce à une gestion méticuleuse de votre butin, combinez vos objets pour élaborer d\'invincibles configurations dans votre quête de puissance ultime.', 'https://cfinder.xyz/uploads/Megaloot.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 947, 0),
(949, 'Disney•Pixar Cars 2: The Video Game', 'Inspired by the Disney•Pixar animated film, Cars 2: The Video Game lets players jump into the Cars 2 universe with some of their favorite Cars personalities in exotic locations around the globe.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/301760/header.jpg?t=1741732629', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 948, 0),
(950, 'Heroes of Valor', 'La guerre fait rage, soldat. Choisissez une classe, armez-vous et rejoignez le front. Sur terre comme dans les airs, les ordres sont clairs : luttez férocement, agissement stratégiquement et ne reculez jamais. Rejoignez les rangs ! Soyez un héros dès aujourd’hui !', 'https://cfinder.xyz/uploads/HeroesofValor.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 949, 0),
(951, 'Abyssus', 'Choisissez votre équipement, frayez-vous un chemin parmi les créatures mutantes d\'une civilisation engloutie et domptez des pouvoirs surnaturels dans Abyssus, un FPS en coop (1 à 4 joueurs) au rythme endiablé doublé d\'un roguelite brinepunk offrant une aventure palpitante.', 'https://cfinder.xyz/uploads/Abyssus.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 950, 0),
(952, 'Bogos Binted?', 'Welcome to a sinful night with the galaxy’s wackiest aliens. Play twisted tabletop games with up to 4 players, devise brilliant strategies, bluff your way to victory, and try not to lose your head - literally.', 'https://cfinder.xyz/uploads/BogosBinted.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 951, 0),
(953, 'Echoes of the End', 'Lancez-vous dans un voyage périlleux afin de sauver votre frère et d\'empêcher la guerre d\'éclater. Maîtrisez de puissantes capacités magiques, terrassez vos ennemis, arpentez des terrains traîtres et levez le voile sur l\'histoire secrète d\'Aema.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2821610/6d40e51d09e1a25ed342a918e0396cd9449cb544/header.jpg?t=1755010634', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 952, 0),
(954, 'Towers of Aghasba', 'Explorez un monde peuplé de créatures majestueuses et de personnages excentriques. Ravivez des terres flétries, construisez une civilisation en harmonie avec la nature et invitez des amis en mode coopératif pour créer, récolter et vous détendre ensemble.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2178070/3bf3bae70cfc34c8f964232f58a86ccc6a6fd902/header.jpg?t=1751648023', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 953, 0),
(955, 'LEGO® The Lord of the Rings™', 'Basé sur la trilogie des films du Seigneur des Anneaux, LEGO® Le Seigneur des Anneaux reconstitue fidèlement le scénario original des films Le Seigneur des Anneaux : La communauté de l’anneau, Le Seigneur des Anneaux : Les deux tours et Le Seigneur des Anneaux : Le retour du roi et fait ainsi revivre au joueur les événements épiques de ce', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/214510/header.jpg?t=1729803813', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:26', '2025-09-09 15:30:13', 1, 954, 0),
(956, 'The Medium', 'Découvrez un mystère que seule une médium peut résoudre. Dans un hôtel communiste abandonné, utilisez vos dons de voyance uniques pour mettre au jour ses secrets les plus noirs. Résolvez des énigmes en explorant deux réalités en même temps et survivez à des rencontres avec des esprits malfaisants.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1293160/header.jpg?t=1743602524', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 955, 0),
(957, 'Return of the Obra Dinn', 'Perdu en mer, 1803 LE FIER VAISSEAU « OBRA DINN »', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/653530/header.jpg?t=1686697594', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 2, 956, 0),
(958, 'LEGO® Batman™ 3: Beyond Gotham', 'Le Chevalier Noir s\'unit aux super-héros de l\'univers de DC Comics et décolle vers l\'espace pour empêcher le maléfique Brainiac de détruire la Terre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/313690/header.jpg?t=1745962284', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 957, 0),
(959, 'Forsaken Frontiers', 'Step into the frozen unknown in Forsaken Frontiers, a cooperative analog horror adventure set in the unforgiving embrace of an everlasting winter.', 'https://cfinder.xyz/uploads/ForsakenFrontiers.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 958, 0),
(960, 'A Few Quick Matches', 'A FEW QUICK MATCHES is a fast-paced, 1-4 player platform fighter that lets you bring old-school stick battles to life! play with your friends locally, or challenge players online in this flash-inspired spectacle!', 'https://cfinder.xyz/uploads/AFewQuickMatches.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 959, 0),
(961, 'Perfect Heist 2', 'Perfect Heist 2 is a round-based online game, where robbers try to hide in plain sight while robbing a bank without being noticed by the cop team!', 'https://cfinder.xyz/uploads/PerfectHeist2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 960, 0),
(962, 'ERA ONE', 'EraOne mêle stratégie en temps réel, construction, survie spatiale et combats tactiques. Créez et personnalisez votre base de A à Z, construisez des vaisseaux, gérez votre flotte et lancez-vous dans d\'intenses batailles spatiales.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2509200/45da35e5ff9fac78b3d2751a3af7688e23e26d15/header.jpg?t=1754656101', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 2, 961, 0),
(963, 'For The King II', 'Combattez la reine tyrannique de Fahrul en solo ou groupe de 4 joueurs dans la suite de For The King, le fameux RPG roguelite au tour par tour. Parviendrez-vous à découvrir le terrible secret de cette reine autrefois aimée de tous ?', 'https://cfinder.xyz/uploads/ForTheKingII.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 962, 0),
(964, 'Hunter x Hunter: Nen x Impact', 'Hunter X Hunter: Nen X Impact est un prochain jeu de combat Hunter x Hunter, \r\nPublié par Bushiroad Games. \r\n\r\nChoisissez vos personnages d\'utilisateurs NEN préférés pour la bataille de l\'équipe 3v3! \r\nLa compatibilité et l\'ordre des coéquipiers sont les clés de la victoire! \r\nConstruisez l\'équipe la plus forte et battez-vous pour la victoire!', 'https://cfinder.xyz/uploads/HunterxHunterNenxImpact.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', NULL, 963, 0),
(965, 'Men of War II', 'La guerre comme vous ne l\'avez jamais vue ! La série de RTS plébiscitée pour son cocktail d\'action trépidante et d\'authenticité historique revient avec des unités, théâtres, campagnes et modes de jeu inédits, sur les fronts Est et Ouest de la Seconde Guerre mondiale.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1128860/header.jpg?t=1735827939', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 964, 0),
(966, 'Demon Slayer: Kimetsu no Yaiba - The Hinokami Chronicles 2', 'Détruisez les démons avec le pouvoir des obligations forgées! La bataille de Tanjiro Kamado se déroulera à nouveau…', 'https://cfinder.xyz/uploads/DemonSlayerKimetsunoYaiba-TheHinokamiChronicles2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 2, 965, 0),
(967, 'Splatoon 2', 'Splatoon 2 est un tireur multijoueur à la troisième personne dans lequel les joueurs contrôlent les personnages connus sous le nom d\'Inklings et utilisent de l\'encre colorée pour attaquer les adversaires et les buts clairs. Les ennemis peuvent alterner entre la forme humanoïde, au cours de laquelle ils peuvent tirer de l\'encre avec leurs armes, et la forme de calmar, ce qui leur permet de nager à travers l\'encre de leur propre couleur afin de se déplacer rapidement et de reconstituer les fournitures d\'encre.', 'https://cfinder.xyz/uploads/Splatoon2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', NULL, 966, 0),
(968, 'Techtonica', 'Techtonica est un jeu d\'automatisation d\'usine à la première personne. Sortez des profondeurs de la planète Calyx et découvrez ses secrets pour résoudre un mystère captivant. Explorez des grottes bioluminescentes, façonnez le terrain destructible et construisez une gigantesque usine souterraine.', 'https://cfinder.xyz/uploads/Techtonica.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 2, 967, 0),
(969, 'Reigns', 'Asseyez-vous sur votre trône de monarque médiéval bienveillant (ou malveillant) et balayez vers la gauche ou la droite pour imposer votre volonté au royaume.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/474750/header.jpg?t=1728689014', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 968, 0),
(970, 'Animal Crossing: New Horizons', 'Échappez-vous à une île déserte et créez votre propre paradis pendant que vous explorez, créez et personnalisez dans Animal Crossing: New Horizons. Votre escapade insulaire a une multitude de ressources naturelles qui peuvent être utilisées pour tout élaborer, des outils au confort des créatures. Vous pouvez traquer les insectes à l\'aube, décorer votre paradis tout au long de la journée ou profiter du coucher du soleil sur la plage tout en pêchant dans l\'océan. La vraie vie de jour et de saison, donc chaque jour sur votre île est l\'occasion de s\'enregistrer et de trouver de nouvelles surprises toute l\'année.', 'https://cfinder.xyz/uploads/AnimalCrossingNewHorizons.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', NULL, 969, 0),
(971, 'Achilles: Survivor', 'Des milliers d’ennemis. Un seul survivant. Combattez comme un demi-dieu, construisez des défenses létales et devenez plus fort à chaque tentative dans ce bullet heaven effréné au cœur de la Grèce mythologique.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2922410/1ce861234db4b7c543533d2d9a77d82dcb7c6746/header.jpg?t=1754470377', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 970, 0),
(972, 'Reigns: Game of Thrones', 'Reigns: Game of Thrones est l\'héritier de la série multi-oscarisée Game of Thrones® de HBO® et de Reigns, le jeu culte développé par Nerial et Devolver Digital.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/897820/header.jpg?t=1728946888', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 971, 0),
(973, 'Suit for Hire', 'Suit for Hire is a challenging action shooter, tactically blend weapons and martial arts together to unleash beautifully crafted violence.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1612420/f6e38d56e0c086481d3692e028ec83b318ead4c1/header.jpg?t=1750440927', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 972, 0),
(974, 'ANIMAL WELL', 'Explore un labyrinthe dense et interconnecté, et découvre ses nombreux secrets. Ramasse des objets pour manipuler ton environnement de façon aussi surprenante que significative. Fais la rencontre de créatures aussi belles qu\'étranges, et tente de survivre à ce qui rôde dans les ombres.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/813230/header.jpg?t=1736282851', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 973, 0),
(975, 'Titan Quest II', 'Némésis, déesse du châtiment, est devenue incontrôlable. Elle corrompt les fils du destin et châtie ceux qui s’opposent à elle. Combattez aux côtés des dieux et changez le destin dans Titan Quest II, un RPG d’action inspiré de la mythologie Grecque.', 'https://cfinder.xyz/uploads/TitanQuestII.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 974, 0),
(976, 'Castle Craft', 'Votre château survivra-t-il aux assauts incessants ou s\'effondrera-t-il ? Dans un monde où tout peut être détruit, construisez, gérez vos ressources et soyez plus rusé que vos ennemis. Tirez parti du chaos ambiant en étant fin stratège et créatif !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2086680/c8fff25fba730b6b96e6e8a81a464582938edf61/header.jpg?t=1752757051', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 975, 0),
(977, 'Wrench', 'Wrench est un simulateur de mécanique où les joueurs préparent et entretiennent des voitures de course. Les pièces de Wrench sont les plus détaillées de tous les jeux du genre. Une attention particulière a été portée aux plus petits composants, notamment aux fixations, dont le pas de filetage et le couple de serrage sont précis.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/936720/header.jpg?t=1750871915', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 976, 0),
(978, 'Console Shop Simulator', 'Gérez votre propre boutique de jeux vidéo. Aménagez vos rayons avec des consoles et des jeux, fixez les prix, gérez la communication avec les entreprises, Le service client et développez votre marque. Ventes en ligne, concurrents, stratégies marketing et mises à jour technologiques sont à venir.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3425460/76b141c90b2c6e9453659d34e029eec62c926290/header.jpg?t=1753812651', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 2, 977, 0),
(979, 'Exanima', 'Explore, fight, survive and unravel mysteries in this unique and unforgiving 3D isometric RPG set in an original dark, low fantasy world. Exanima\'s exceptional attention to detail and realistic simulation of all things aim to provide a deeply immersive and dynamic gameplay experience.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/362490/header.jpg?t=1651083974', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 978, 0),
(980, 'Gothic® 3', 'Un héros sans nom devient une légende! Myrtana, un monde soudainement déchiré: rempli d\'orcs venus des terres sombres du nord, le roi Rhobar défend Vengard, l\'ancienne bastion humaine, avec la dernière troupe d\'adeptes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/39500/header.jpg?t=1752672619', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 2, 979, 0),
(981, 'Riders Republic', 'Découvrez l\'immense terrain de jeu multijoueur de Riders Republic !', 'https://cfinder.xyz/uploads/RidersRepublic.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 980, 0),
(982, 'Heartworm', 'Traversez le seuil et plongez dans un monde de souvenirs. Défendez-vous grâce à votre appareil photo et percez les secrets de la mort dans cet hommage aux jeux d\'horreur et de survie des années 90, intégrant à la fois une caméra fixe et à l\'épaule.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1257030/header.jpg?t=1753985506', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 981, 0),
(983, 'Nice Day for Fishing', 'Le monde a besoin de vous, aventurier ! Vivez une aventure RPG pixélisée dans la peau de Baelin, l\'humble pêcheur, contraint de devenir le héros de Honeywood. Utilisez votre adresse et des sorts pour affronter des poissons, améliorez vos capacités, vainquez le mal et reconstruisez Honeywood.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2393160/header.jpg?t=1751032878', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 982, 0),
(984, 'Silent Still 2', 'Silent Still 2 is a first-person psychological horror that traps you in the paralyzing nightmare of sleep paralysis. Helpless and unable to escape, you’ll face unspeakable entities that watch, whisper, and move when you can’t. Blurring the line between waking and something far worse', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3869680/8b4f20bd0307abc6e98c8a920ccdae0163491722/header.jpg?t=1753353819', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 983, 0),
(985, 'Fill Up The Hole', 'Transformez les déchets en argent dans un monde dystopique ! Fill Up The Hole est un petit jeu incrémental où vous construisez une ville, automatisez la production de déchets et les jetez dans un trou magique pour en tirer profit.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3343160/1eeee54eab7d517b375080b0fef2b5023d19101f/header.jpg?t=1752850926', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 984, 0),
(986, 'Check Inn', 'Construa hotéis, acomode hóspedes e expanda seu negócio de hotéis através do mundo!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2741390/06daf2c2523ffd4319f9f8c012f4554a92bfa9b9/header.jpg?t=1751390112', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 985, 0),
(987, 'The Garden Path', 'Un simulateur de quotidien sur les joies du jardinage, pensé pour qu\'on y joue à petites doses toutes douces. Que vous pêchiez, cultiviez, commerciez ou que vous vous liiez d\'amitié avec les légumes alentour, une merveilleuse et mélancolique aventure vous attend dans The Garden Path.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1638500/94466a5468b82166a5b7d9d424f946b90c9fad58/header_alt_assets_0.jpg?t=1753891232', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 986, 0),
(988, 'Animal Shelter 2', 'Bienvenue de nouveau dans le monde émouvant du jeu Animal Shelter 2! Assure un foyer bienveillant à chaque ami à quatre pattes qui en a besoin - joue avec eux, caresse-les et habille-les! Fais connaissance et trouve-leur une famille aimante. Joue avec tes amis et gérez ensemble le refuge mode co-op!', 'https://cfinder.xyz/uploads/AnimalShelter2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 987, 0),
(989, 'Chicken Strike®: Cluck Ops™', 'Chicken Strike®: Cluck Ops™, the action-packed adventure where feathers fly and the claws come out! Join the uprising to liberate FCK!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2889440/header.jpg?t=1727199126', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 988, 0),
(990, 'Saints Row®: The Third™ Remastered', 'The Full Package Remastered – Avec des graphismes et des éclairages améliorés, des environnements et des effets visuels retravaillés, Steelport et les Saints de 3rd Street n\'ont jamais été aussi beaux.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/978300/header.jpg?t=1725434774', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 989, 0),
(991, 'Killing Floor 2', 'In KILLING FLOOR 2, players descend into continental Europe after it has been overrun by horrific, murderous clones called Zeds that were created by rogue elements of the Horzine Corporation. 6-player Co-Op & 12-player VS Zed-slaughtering mayhem.', 'https://cfinder.xyz/uploads/KillingFloor2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 990, 0),
(992, 'Kerbal Space Program', 'Dans Kerbal Space Program, vous êtes en charge du programme spatial de la race extra-terrestre des Kerbals. Vous avez accès à toute une batterie de pièces pour assembler un vaisseau spatial fonctionnel qui vole (ou pas) sur une base d\'aérodynamique et de physique orbitale réelles.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/220200/header.jpg?t=1738037585', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 991, 0),
(993, 'Backroom Company', 'Backroom Company (aka Async Corporation) is a mysterious group exploring “Noclip.” No one knows who created it. Follow the missing explorers\' traces and find strange items deep in the Backrooms.', 'https://cfinder.xyz/uploads/BackroomCompany.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 992, 0),
(994, 'Figure Shop Simulator', 'Gérez votre propre boutique de figurines! Produisez des figurines avec des imprimantes 3D, stockez les étagères, fixez les prix et offrez la meilleure expérience aux clients.Gérez votre stock, agrandissez votre boutique, complétez des collections, suivez les tendances et développez votre entreprise!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3604560/808c1bf4140564386eac9a051a4c981d72072ba2/header.jpg?t=1754337346', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 993, 0),
(995, 'After Inc: Revival', 'Pouvez-vous reconstruire la civilisation après une apocalypse zombie ? Par le créateur de Plague Inc., un mélange unique de simu stratégique, city builder de survie et mini 4X. Bâtissez colonies, récoltez ressources et façonnez la société en guidant l’Humanité hors des ténèbres.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3337140/a1ca24de30bcfdefcfaf29b3f8d3b15a9a0f9f10/header.jpg?t=1750782777', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 994, 0),
(996, 'CashGrab: Refunded', 'Un jeu d\'horreur coopératif en ligne jusqu\'à 6 joueurs. Utilisez des objets entièrement basés sur la physique et des mouvements fluides pour récupérer de l\'argent et échapper au Grind. Utilisez votre argent pour acheter des objets et de l\'équipement, et financer des objectifs communautaires. Créez votre Grabba et devenez riche ou mourez en essayant.', 'https://cfinder.xyz/uploads/CashGrabRefunded.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 2, 995, 0),
(997, 'Bus Flipper: Renovator Simulator', 'Vous êtes-vous déjà demandé : ‘Et si j’achetais un vieux bus pour le transformer en camping-car ? Ou peut-être en café roulant ?’ Ce simulateur de conversion de bus vous offre cette possibilité ! Vous aurez une variété de bus et camionnettes à transformer.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2174560/da84d12d2c1c0ffd4f8461960c14fe78bdad9ebf/header.jpg?t=1754312738', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 996, 0),
(998, 'Teardown', 'Préparez le casse parfait dans un monde virtuel en voxel entièrement destructible. Détruisez les murs avec des véhicules ou des explosifs pour créer des passages. Utilisez l\'environnement à votre avantage en laissant libre cours à votre créativité.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1167630/header.jpg?t=1751447285', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 997, 0),
(999, 'Bum: Revenge', 'Sandbox criminel à la 1re pers. façon SDF. Vole, picole, hallucine et explose d’autres clochards en coop chaotique.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3702930/437f6b359f45d35e9bdf52949b909222b4bbd7c9/header.jpg?t=1754086473', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 998, 0),
(1000, 'Dead Signal', 'Monitor camera feeds, report valuable info, and hand-deliver shady packages. An hourly quota of reports will test your keen eye to spot the differences, while timed deliveries will force you outside unexpectedly. Until you clock out for the night almost nowhere is safe.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2599300/header.jpg?t=1726924697', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 999, 0),
(1001, 'Octodad: Dadliest Catch', 'Octodad: Dadliest Catch est un jeu sur la destruction, l\'illusion et la paternité. Le joueur incarne Octodad, un sympathique poulpe qui tente de mener une vie ordinaire en se faisant passer pour un humain.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/224480/header.jpg?t=1748894325', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 1000, 0),
(1002, 'Crashlands 2', 'Traversez à grands coups de baffes un monde plein de vie et développez des amitiés interstellaires cruciales à votre survie. Liez-vous d\'amitié avec des aliens excentriques, fabriquez des armes bizarres et rebellez-vous contre le système dans la suite de Crashlands, le RPG en monde ouvert primé.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1401730/header.jpg?t=1750972294', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 1001, 0),
(1003, 'Use Your Words', 'Use Your Words is the new party game for funny people and their unfunny friends! Laugh your way through four hilarious mini-games! Use your smartphone to fill in the blank, or try your luck using one of our answers to get laughs! No matter your strategy, Use Your Words brings comedy home!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/521350/header.jpg?t=1581680767', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 1002, 0),
(1004, 'SKY THE SCRAPER', 'SKY THE SCRAPER is an action-packed adventure about Sky, a young man who pursues his uncertain dreams while working as a building window cleaner. Through exciting wire action and daily life management, endure two months of hard living and pave the way for Sky\'s future.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2387430/header.jpg?t=1754300229', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 1003, 0),
(1005, 'Ostranauts', 'Ostranauts est un simulateur dans l\'espace noir et sans merci. Gérez la vie à bord de votre vaisseau. Explorez et fouillez le cimetière spatial. Concevez, construisez et personnalisez votre vaisseau. Recrutez un équipage pour vous aider.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1022980/header.jpg?t=1746647992', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:27', '2025-09-09 15:30:13', 1, 1004, 0),
(1006, 'Captain Bones: Le Voyage du Pirate', 'Captain Bones est un jeu d\'action-aventure se déroulant dans un monde de pirates ouvert. Vous devez avoir des compétences de survie pour faire des batailles navales et des chasses au trésor avec votre équipage.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/951820/52a13bcb39ce338d2899119ea06fa3f5892bab78/header.jpg?t=1753984595', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1005, 0),
(1007, 'The Unseen Fears: Ominous Talent Collector\'s Edition', 'The search for a missing art critic uncovers an otherworldly web of lies!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1228860/header.jpg?t=1579886200', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1006, 0),
(1008, 'Progressbar95', 'Progressbar95 est un jeu rétro, unique et hyper-cool.. Il te fera sourire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1304550/header.jpg?t=1720786503', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1007, 0),
(1009, 'Dominions 6 - Rise of the Pantokrator', 'In Dominions 6 you take control of a powerful being that rules a nation and aspires to godhood. The type of Pretender Gods can vary from magically powerful arch mages to old dragons or an enormous tree. Dominions is a deep 4x turn based strategy game with a very large variety of spells and units.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2511500/header.jpg?t=1742394476', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1008, 0),
(1010, 'The Biggleboss Incident', 'A pointy-clicky comedy corporate thriller. Solve puzzles, get to know your colleagues, and unravel a sinister global conspiracy. All in a day\'s work.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2967630/1960793da214e5bf97d4e185d543808b1155c5e4/header.jpg?t=1753955752', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1009, 0),
(1011, 'Primal Planet', 'Découvrez une histoire bouleversante de famille, dinosaures et OVNIs! Survivez parmi prédateurs, tribus et aliens. Devenez de simple cavernicole à dernier espoir de la planète, seul ou en co-op. Bienvenue dans Dinovania!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2350270/header.jpg?t=1753898279', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1010, 0),
(1012, 'He is Coming', 'Dans les recoins oubliés de ce monde, une sombre puissance s\'éveille. Le Roi démon s\'élève à nouveau. Aiguisez vos sens, cherchez de puissants artéfacts et dressez-vous contre l\'apocalypse dans ce jeu de rôle mêlant roguelite et auto battler.', 'https://cfinder.xyz/uploads/HeisComing.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1011, 0),
(1013, 'Tower Wizard', 'Help a wizard build and upgrade a wizard tower in this incremental game! Use the tower to study magic, summon spirits, create buildings, and influence the world.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3372980/header.jpg?t=1750465489', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1012, 0),
(1014, 'Gatekeeper', 'Gatekeeper est un rogue-like au rythme effréné. Lancez-vous en quête de chasser Kaos et récupérez le cœur du temps qu\'il a dérobé en vous frayant un chemin à travers des forces ennemies impitoyables. Jouez en solo ou en coop à 4 et devenez le prochain grand gardien !', 'https://cfinder.xyz/uploads/Gatekeeper.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1013, 0),
(1015, 'Gold Gold Adventure Gold', 'Pour les fins connaisseurs de Colony-Builders, Gold Gold Adventure Gold ne vous sera pas étranger. GGAG est ambitieux mélange, où Cult of the Lamb, Rimworld et Majesty avaient rencontré Black & White ! Le tout saupoudré d\'une touche de Against the Storm.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3133650/12b0a444d4d3f385c72a8ef0085270b28533aba7/header.jpg?t=1754247048', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1014, 0),
(1016, 'Thronefall', 'Un jeu minimaliste de construction et de défense de votre petit royaume.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2239150/header.jpg?t=1746797616', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1015, 0),
(1017, 'Bakery Simulator', 'Levez-vous avant l\'aube et voyez ce que c\'est que d\'être un boulanger ! Apprenez à cuire plusieurs dizaines de types de pain. Utilisez des machines de boulangerie réalistes. Livrez des commandes aux magasins, gagnez et investissez. Utilisez des recettes originales ou expérimentez avec des ingrédient', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1031120/header.jpg?t=1750948026', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1016, 0),
(1018, 'Captain of Industry', 'Débarquez votre équipage sur une île abandonnée ! Exploitez des matières premières, cultivez des aliments, construisez des usines, fabriquez des produits, recherchez des technologies et échangez avec d\'autres. Devenez un géant industriel ! Il ne sera pas facile de maintenir votre colonie en vie.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1594320/2ab6e9a5ec9aedca02b0347bb017c92caff0580b/header.jpg?t=1749679882', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1017, 0),
(1019, 'Until Then', 'Une rencontre fatidique déclenche une réaction en chaîne qui bouleverse la vie de Mark. Des gens disparaissent et des souvenirs se révèlent peu fiables. Découvrez la vérité avec Mark et ses amis dans cette aventure narrative, et percez le mystère avant qu’il soit trop tard.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1574820/header.jpg?t=1746722193', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1018, 0),
(1020, 'Jet Set Radio', 'Taguez et enchaînez en rythme grinds et autres figures dans Jet Set Radio, le jeu culte de SEGA !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/205950/header.jpg?t=1733765152', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1019, 0),
(1021, 'Welcome to the Game II', 'Dans Welcome to the Game II, tu joues un journaliste enquêtant sur une vidéo liée à un réseau criminel du dark web. Depuis ton ordinateur, tu dois explorer des sites cachés et trouver des codes pour localiser une victime.\r\nMais attention : pendant que tu cherches, des hackers et des tueurs peuvent t’attaquer dans le monde réel. Le jeu mélange exploration, énigmes et tension constante dans une ambiance sombre et paranoïaque.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/720250/header.jpg?t=1596752454', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1020, 0),
(1022, 'Welcome to the Game', 'Welcome to the Game est un jeu d’horreur en vue à la première personne qui te plonge dans l’univers sombre du deep web. Tu incarnes un utilisateur anonyme cherchant à découvrir la vérité derrière une vidéo mystérieuse liée à un réseau de traite humaine.\r\nLe jeu se déroule entièrement sur un ordinateur simulé, où tu dois explorer des sites inquiétants, trouver des codes cachés, et éviter d’être traqué par divers dangers (hackers, intrus, etc.). L’ambiance est pesante, la tension constante, et chaque clic peut te rapprocher de la vérité… ou de ta fin.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/485380/header.jpg?t=1478826657', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1021, 0),
(1023, 'Another Farm Roguelike: Rebirth', 'Cliquez pour cultiver ! Another Farm Roguelike Rebirth est un jeu de type roguelike stratégique où vous cultivez, construisez, collectez et gérez pour gagner de l\'argent afin de couvrir le loyer croissant. Pas de marche ennuyeuse ni de romance ; tout est fait à l\'aide d\'un curseur !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2760790/header.jpg?t=1754042305', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1022, 0),
(1024, 'Ikarus Parkour', 'Ikarus Parkour est un jeu de plateforme en 3D de précision qui se déroule dans le cadre d\'un jeu télévisé mortel. Escaladez l\'imposante tour verticale de 850 mètres, surmontez ses obstacles et réclamez la fortune promise.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3167280/header.jpg?t=1754071202', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1023, 0),
(1025, 'Driftwood', 'Un jeu sur la descente en longboard et un paresseux nommé Eddy. Roulez aussi vite que vous le pouvez et faites attention à ne pas sortir d\'un virage !', 'https://cfinder.xyz/uploads/Driftwood.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1024, 0),
(1026, 'Aviassembly', 'Build and fly your own airplane! Complete missions to earn money, upgrade your plane, and discover new locations in an open world.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2660460/header.jpg?t=1744379567', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1025, 0),
(1027, 'Assassin’s Creed® Liberation HD', 'Assassin’s Creed® Liberation HD, l\'impressionnant chapitre de la saga Assassin’s Creed initialement développé pour la PlayStation® Vita, débarque sur consoles HD et sur PC. Un gameplay amélioré, un scénario plus approfondi et des graphismes HD font de Liberation une expérience Assassin’s Creed unique et complète.Nous sommes en 1765.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/260210/header.jpg?t=1747655342', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1026, 0),
(1028, 'Tinkerlands', 'Explorez, créez, et luttez pour votre survie sur les îles inhospitalières de Tinkerlands, une aventure à vivre seul ou en coop et dans laquelle vous construisez votre camp, fabriquez vos outils, et manipulez la magie!', 'https://cfinder.xyz/uploads/Tinkerlands.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1027, 0),
(1029, 'NINJA GAIDEN: Ragebound', 'NINJA GAIDEN: Ragebound, le tout dernier opus en side-scrolling de la série NINJA GAIDEN conçu par l\'équipe de Blasphemous, réinvente l\'emblématique saga de jeu de plateformes dans une aventure de ninja spectaculaire, trépidante et implacable.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2542120/ceedbee72ac420cfff95dca68f73d6387bb2e433/header.jpg?t=1754037922', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1028, 0),
(1030, 'Marvel\'s Guardians of the Galaxy', 'Embarquez pour une virée déjantée à travers la galaxie dans cette version inédite de Marvel\'s Guardians of the Galaxy. Incarnez Star-Lord et menez les Gardiens dans des situations plus explosives les unes que les autres. Ça va le faire. Normalement.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1088850/header.jpg?t=1751567846', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1029, 0),
(1031, 'Mage Arena', 'A co-op PvP experience about using your voice to cast spells in the Mage Arena to settle an ages-old feud between sorcerers and warlocks.', 'https://cfinder.xyz/uploads/MageArena.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1030, 0),
(1032, 'ScootX', 'La première simulation de trottinette 100 % physique au monde. Des roues à la tête du rider, tout est propulsé par la physique. Tentez des tricks, des grinds et explorez des parks créés par la communauté grâce au support de Mod.io.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3800340/74cb0412738b42307dbe9a990b0e3cc1c3cbe263/header.jpg?t=1752877058', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1031, 0),
(1033, 'The Henry Stickmin Collection', 'A choose-your-own-path where failing is more fun than succeeding.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1089980/header.jpg?t=1619212064', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1032, 0),
(1034, 'Fields of Mistria', 'Start your new life! Build the farm of your dreams as you discover a world brimming with possibilities. Magic, romance, and adventure all await you in this nostalgic farming / life sim RPG!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2142790/72174a3f34600433ac65aa751b869ee4f7f0e8ca/header_alt_assets_2.jpg?t=1753302310', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1033, 0),
(1035, 'Resident Evil 0', 'La version remastérisée de Resident Evil 0 offre des graphismes HD, des commandes modernisées optionnelles et bien plus.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/339340/header.jpg?t=1742177237', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1034, 0),
(1036, 'Prison Escape Simulator: Dig Out', 'Trop de temps ici, il faut sortir. Tire le tapis et creuse avec une cuillère. Évite le gardien, vends-lui ce que tu trouves. Échange avec les prisonniers. Améliore tes objets et tes stats. Agrandis le tunnel, utilise des bâtons lumineux et de la dynamite. Réussiras-tu à t’échapper ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3672720/298ca32cc97f7f513e95461dd3cb1b11eb9c13d1/header.jpg?t=1753452716', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1035, 0),
(1037, 'Call of Duty®: Black Ops 6', 'Call of Duty®: Black Ops 6 signe le grand retour de Black Ops à travers une Campagne cinématique en solo, une expérience Multijoueur de premier ordre et le retour épique du mode Zombies par manche.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2933620/header.jpg?t=1753894673', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1036, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1038, 'Day of the Shell', 'Day of the Shell est un rogue-lite tactique : un clic, un tour. Voyagez d\'île en île à travers un monde dévasté et submergé, muni·e d\'un peu d\'espoir et d\'un revolver, pour affronter les dieux responsables du désastre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3008340/header.jpg?t=1753807951', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1037, 0),
(1039, 'Devil May Cry 4 Special Edition', 'Le célèbre jeu d\'action DMC4 fait un retour fracassant avec de nouveaux personnages et des modes de jeu inédits !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/329050/header.jpg?t=1644282580', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1038, 0),
(1040, 'DRAGON QUEST III HD-2D Remake', 'DRAGON QUEST III HD-2D Remake est une recréation du chef-d’œuvre culte et le point de départ de la trilogie d’Elric.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2701660/header.jpg?t=1747991212', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1039, 0),
(1041, 'Resident Evil', 'The game that defined the survival-horror genre is back! Check out the remastered HD version of Resident Evil.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/304240/header.jpg?t=1709710949', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 2, 1040, 0),
(1042, 'Neon Abyss 2', 'Plongez dans le chaos cybernétique de Neon Abyss 2. Dans ce nouveau rogue-like jouable jusqu\'à 4 joueurs en ligne et offrant de nombreux styles de combat différents et des synergies d\'objets illimitées, chaque run vous fera découvrir une expérience pleine d\'action que vous n\'êtes pas d\'oublier.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2235200/fb0ffb277856c5ab4a669c43dccc171a88fb9639/header.jpg?t=1753248564', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1041, 0),
(1043, 'Neon Abyss', 'Neon Abyss est un rogue-like de plateforme et d\'action au rythme effréné. Incarnez un membre de la « Grim Squad » d\'Hades traversant l\'Abyss ; synergies d\'objets à foison, système d\'évolution de donjon unique, défis inédits à chaque partie... Préparez-vous à déchaîner les flammes de l\'enfer !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/788100/7105869c3cf24c4fe65284ba978e23d2f691c372/header.jpg?t=1749365999', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1042, 0),
(1044, 'Grounded 2', 'Il y a à peine deux ans, vous avez découvert le monde à la taille d’une fourmi… aujourd’hui, c’est reparti, mais ce n’est pas tout à fait pareil', 'https://cfinder.xyz/uploads/Grounded2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1043, 0),
(1045, 'DEMONS', 'DEMONS is a card game for 1-4 players. When an evil cult unleashes an ancient demon, all that can stop the coming apocalypse is you, your friends and a deck of cards.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1805570/header.jpg?t=1753096525', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1044, 0),
(1046, 'ctrl.alt.DEAL', 'With your superior intelligence and sneakiness, you can find a way to escape from this heartless megacorp! (As long as no one realizes you’re actually a self-aware AI...) Spy on humans, offer them deals, and negotiate your way to freedom in a turn-based strategy game of corporate dysfunction.', 'https://shared.fastly.steamstatic.com/store_item_assets/steam/apps/2146390/header.jpg?t=1753383006', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1045, 0),
(1047, 'DORONKO WANKO', '『DORONKO WANKO』 is a DORONKO Action Game. In this game, You can become a cute, innocent Pomeranian, make your master\'s home messy and dirty. \"Will the master be angry with me?\" Don\'t worry. Because you are a sweet doggie.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2512840/header.jpg?t=1753327876', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1046, 0),
(1048, 'Game Shop Simulator', 'Un jeu de simulation de magasin où vous gérez votre propre boutique de jeux en achetant et en vendant des jeux de console. Gérez l\'inventaire, répondez aux besoins des clients et développez votre magasin. Jouable en solo ou en multijoueur.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3728550/7bf56065a9433885449439bbecfb9b97f8624605/header.jpg?t=1752606231', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1047, 0),
(1049, 'Missile Command Delta', 'Les missiles sont en approche. La situation est critique. Il n\'y a que vous qui puissiez empêcher la destruction. Gérez stratégiquement vos défenses pour survivre à des vagues de missiles dans ce jeu tactique tour par tour à haute pression. Pourrez-vous résoudre le mystère à temps ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2790160/4649496b410287001ad7a7c8f2e05b9a98a73e9b/header.jpg?t=1752010072', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1048, 0),
(1050, 'Hyperspaced', 'Sauvez le Multivers dans Hyperspaced , un jeu d\'action spatial chaotique en co-op pour 1 à 4 joueurs ! Frayez-vous un chemin dans une galaxie générée procéduralement. Détruisez vos ennemis, éteignez les feux, nettoyez, réparez, recyclez et explorez des lieux où personne n\'a encore échoué !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1125830/38536df55cb43fb8b687cc6f541da6b577b4af51/header.jpg?t=1753196740', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1049, 0),
(1051, 'Hell Clock', 'Créez des builds puissants avec un butin infini dans cette implacable fusion de Roguelike et d’ARPG. Traversez des donjons et libérez des pouvoirs inhumains dans une version dark fantasy de la guerre de Canudos au Brésil.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1782460/header.jpg?t=1753480869', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1050, 0),
(1052, 'The King is Watching', 'Découvrez The King is Watching, un jeu de construction de royaume dans lequel vous régnez par la seule force de votre regard ! Produisez des ressources, formez des troupes, ou cherchez le juste équilibre entre puissance économique et militaire tout en vous adaptant à de multiples événements !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2753900/a6757865adf488b7a98e11d1197e0165cd412302/header_alt_assets_0.jpg?t=1753433786', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1051, 0),
(1053, 'Alaloth: Champions of The Four Kingdoms', 'Baldur\'s Gate et Dark Souls ont eu un bébé ! Un RPG palpitant qui mêle action en temps réel et vue isométrique, dans un monde de magie et de monstres. Les joueurs devront traverser des donjons dangereux, combattre des boss redoutables et découvrir des secrets anciens pour sauver Plamen!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/919360/8882af84cba09ed0deecbd5a617d2140daba88cb/header.jpg?t=1750143690', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', 1, 1052, 0),
(1054, 'WolfQuest: Anniversary Edition', 'Live the life of a wild wolf in a realistic ecological simulation set in Yellowstone National Park.', 'https://cfinder.xyz/uploads/WolfQuestAnniversaryEdition.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:28', '2025-09-09 15:30:13', NULL, 1053, 0),
(1055, 'Luto', 'Luto est une expérience d’horreur psychologique dans laquelle vous incarnez une personne incapable de quitter sa maison. Chaque tentative d’évasion vous entraînera plus profondément dans l’inconnu, où rien n’est ce qu’il paraît et où tout mettra vos sens à l’épreuve.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1729740/def13c797b5c98624d24fb0b75d2e57ea0fdbf70/header.jpg?t=1753555605', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1054, 0),
(1056, 'PGA TOUR 2K23', 'Parcourez les terrains avec plus de style dans PGA TOUR 2K23. Profitez de pros jouables y compris Tiger Woods, de nouveaux parcours, des nouvelles commandes, un MyCAREER PGA TOUR, un concepteur de parcours, des compétences et archétypes inédits MyPLAYER ! PGA TOUR 2K23. Plus de golf. Plus de jeu.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1588010/header.jpg?t=1753286287', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1055, 0),
(1057, 'Bazaar Simulator', 'Set up stalls with fresh vegetables, fruits, and fish. Deliver customer orders, set prices, and expand your bazaar. Catch your own fish to sell and enjoy fishing\'s thrill. Collaborate with friends in multiplayer mode to manage the bazaar together. Much more is coming soon!', 'https://cfinder.xyz/uploads/BazaarSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1056, 0),
(1058, 'RoboCop: Rogue City - Unfinished Business', 'Unfinished Business est une nouvelle aventure indépendante de RoboCop: Rogue City. L’OmniTower est leur forteresse, la violence leur langage. Affrontez des mercenaires d’élites jusqu’au sommet de la tour et faites régner la loi au milieu du chaos !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3527760/header.jpg?t=1753173967', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1057, 0),
(1059, 'The Crust', 'Bienvenue à The Crust, un jeu qui fait de vous le PDG d\'une gigantesque entreprise de colonisation de la Lune. C\'est un simulateur économique à grande échelle qui apporte aussi des éléments de survie en plus d\'un riche contexte et d\'un scénario remarquable.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1465470/5e756149e113eb8fa4d20133a817888a41b41e52/header_alt_assets_13.jpg?t=1752221075', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1058, 0),
(1060, 'Age of Darkness: Final Stand', 'Age of Darkness: Final Stand est un jeu de stratégie et de survie dark fantasy dans lequel vous devez bâtir, éclairer et défendre le dernier bastion de l\'humanité contre des hordes de Cauchemars.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1426450/header.jpg?t=1750207098', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1059, 0),
(1061, 'Oxide Room 208', 'Huit personnes enfermées dans un vieux laboratoire tentent de survivre dans ce jeu d’horreur et d’action qui vous plongent dans un univers gore et insensé. Oxide Room 208 vous met au défi d’affronter vos peurs dans un environnement sombre et étrange.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2217720/header.jpg?t=1753531980', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1060, 0),
(1062, 'Sector Unknown', 'Sector Unknown est un RPG isométrique et riche en histoire situé dans l\'immensité obscure de l\'espace. Commencez sur une planète déserte, établissez une forteresse, explorez l\'espace, alliez-vous ou dominez des factions locales, et combattez une organisation despotique.\"', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2734270/4842cfb0ee3a3aac92a1e484451e87c3635c8ef1/header.jpg?t=1752681940', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1061, 0),
(1063, 'Azure Striker Gunvolt Trilogy Enhanced', 'Azure Striker Gunvolt Trilogy Enhanced est une collection de trois jeux d\'action traditionnels en 2D, Azure Striker Gunvolt (2014), Azure Striker Gunvolt 2 (2016) et Azure Striker Gunvolt 3 (2022) réunis en une seule version, avec tous les DLC inclus.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3813350/9f7aee4e3ee92cc7ccdd452aa276fdfd3b711d6f/header.jpg?t=1753340191', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1062, 0),
(1064, 'Sandwich Simulator', 'Ready to create your own world of flavor? Play solo or co-op with up to 6 players, prepare sandwiches with your friends, deliver online orders to the courier and run your sandwich restaurant. Clean, expand, and keep your customers happy!', 'https://cfinder.xyz/uploads/SandwichSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1063, 0),
(1065, 'BMX Streets', 'Prêt à conquérir les rues ? BMX Streets vous met le BMX entre les mains. Découvrez la nouvelle génération de jeux BMX avec une physique réaliste, d’innombrables options de personnalisation et des cartes superbes. Entraînez-vous, expérimentez et explorez pour trouver votre style unique et maîtriser les rues.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/871540/header.jpg?t=1752875855', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1064, 0),
(1066, 'Who\'s at the door?', 'Vous êtes piégé(e) dans une petite maison, atteint(e) de psychose et ayant perdu la mémoire. Observez attentivement votre environnement, distinguez la réalité des hallucinations et prenez à temps la pilule fournie par les visiteurs pour surmonter votre maladie.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3690010/0f806f79ec822e9b3b6832b29afcc36cd7f64c3a/header.jpg?t=1753145209', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1065, 0),
(1067, 'Killing Floor 3', 'Killing Floor 3 est le nouvel opus de la série d\'action/horreur mythique. Dans ce FPS intense, vous incarnez un spécialiste de Crépuscule et faites équipe avec 5 coéquipiers maximum pour repousser des hordes de Zeds, gagner du fric, déverrouiller des compétences et créer l\'arsenal ultime.\r\nJouable sur les serveurs officiels', 'https://cfinder.xyz/uploads/KillingFloor3.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 2, 1066, 0),
(1068, 'WUCHANG: Fallen Feathers', 'RPG d\'action soulslike, WUCHANG: Fallen Feathers vous fera découvrir la sombre et chaotique période de la fin de la dynastie Ming dans la région de Shu, gangrénée par les guerres et une mystérieuse épidémie faisant naître des créatures monstrueuses.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2277560/7dbbe47ac51463eb1627581f5c048b94ef856d5c/header.jpg?t=1753323153', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', NULL, 1067, 0),
(1069, 'Mycopunk', 'Rejoignez la New Atlas Hazard Crew, une escouade de robots cinglés dotés de gadgets uniques, et débarrassez la galaxie d\'un péril fongique mortel au fil des missions de ce jeu de tir coopératif ultra personnalisable.', 'https://cfinder.xyz/uploads/Mycopunk.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1068, 0),
(1070, 'The Karters 2: Turbo Charged', 'Préparez-vous pour l\'expérience ultime de course de kart sur Steam et Steam Deck ! Inspiré de Crash Team Racing, avec sa propre identité, des systèmes de jeu avancés, de nombreuses nouvelles fonctionnalités et une prise en charge massive du modding pour une rejouabilité infinie !', 'https://cfinder.xyz/uploads/TheKarters2TurboCharged.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1069, 0),
(1071, 'Tony Hawk’s™ Pro Skater™ 3 + 4', 'Prépare-toi au retour d\'une franchise légendaire avec Tony Hawk\'s™ Pro Skater™ 3 + 4. Tout ce que tu as aimé revient dans une version améliorée proposant des skateurs supplémentaires, de nouveaux parks, des tricks encore plus dingues, de la musique de malade, et bien plus encore !', 'https://cfinder.xyz/uploads/TonyHawksProSkater34.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', NULL, 1070, 0),
(1072, 'Super Loco World - Cozy Train Automation', 'Effortlessly build and automate intricate railroads and deliver goods to meet the demands of a dynamic world! Make clever use of signals and signposts to avoid traffic jams, and watch your villages blossom into bustling towns in this cozy take on the train tycoon genre. ', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3109280/dc50ab99364142ff6e7e8c770cb507d30de832c1/header.jpg?t=1752839440', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1071, 0),
(1073, 'Fretless - The Wrath of Riffson', 'Dans ce jeu de rôle au tour par tour, maniez de puissants instruments légendaires, rassemblez de redoutables attaques de riffs et sauvez le monde de Rick Riffson, ses sbires diaboliques et ses monstres hybrides musicaux !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2429050/header.jpg?t=1752744402', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1072, 0),
(1074, 'Deadline: Rogue Rally', 'Les compétitions de rallye féroces dominent le paysage désertique. Les cartes ouvertes vous défient d\'essayer plusieurs approches différentes pour trouver le chemin le plus court. La seule limite est la ligne d\'arrivée, et votre seul ennemi est le temps. Eh bien, aussi la physique. Et parfois les autres. Mais surtout vous.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3203230/fc643b795816bd761124f479f4de2dc9e1e4ceed/header.jpg?t=1752160889', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1073, 0),
(1075, 'PATAPON 1+2 REPLAY', 'PATAPON est une aventure d\'action où les joueurs utilisent le rythme de 4 tambours mystiques pour guider les Patapons, de mignonnes petites créatures mystérieuses en forme de gros œil. En tant que dieu des Patapons, vous les menez dans une grande aventure à Earthend !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2383200/header.jpg?t=1752575178', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1074, 0),
(1076, 'Stronghold Crusader: Definitive Edition', 'Affûtez vos lames ! Assiégez 20 seigneurs et affrontez vos amis dans la réédition du jeu de simulation de châteaux. Revivez l’histoire avec vos troupes, des ennemis IA, des éléments visuels et audio, des campagnes, des escarmouches et un mode coop, sur des cartes agrandies.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3024040/18079832ff76118fc8c5e30b2990882f25975b22/header_alt_assets_0_french.jpg?t=1752590641', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1075, 0),
(1077, 'Crypto Mining Simulator', 'Realistic Mining simulator with custom builds mechanics! A lot of GPUs, CPUs, Motherboards, RAMs, SSDs, PSUs and more! Build your dream farm with 1000+ GPUs!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1596310/header.jpg?t=1673560621', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1076, 0),
(1078, 'CHRONO TRIGGER®', 'Ce RPG culte et indémodable revient rempli de nouveautés ! D\'un passé oublié à un avenir inconnu et jusqu\'à la « Fin des temps », vivez une aventure sans pareille à travers les âges aux côtés de nombreux compagnons pour sauver la planète !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/613830/header.jpg?t=1719545360', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1077, 0),
(1079, 'Tower Wizard', 'Help a wizard build and upgrade a wizard tower in this incremental game! Use the tower to study magic, summon spirits, create buildings, and influence the world.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3372980/header.jpg?t=1750465489', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1078, 0),
(1080, 'Beff Jezos Simulator', 'Construisez Votre Empire en Ligne ! Créez et gérez votre boutique dans Beff Jezos Simulator. Personnalisez votre boutique, sourcez des produits, fixez les prix, embauchez des employés et développez votre entreprise. Faites face à des défis réalistes avec un gameplay addictif.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3128740/header.jpg?t=1752241711', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1079, 0),
(1081, 'Back to the Dawn', 'Back to the Dawn is a story-rich RPG set in a high-security prison ruled by factions and buried secrets. Investigate two conspiracies from the inside, gather evidence, and outsmart a system designed to silence you. Make friends (or foes) with fellow inmates and with their help, break out of prison.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1735700/72b25f7829cfc1a82a16f61e185cb11eb1527b61/header.jpg?t=1753103389', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1080, 0),
(1082, 'DREADZONE', 'Dreadzone est un jeu de survie situé dans une zone de quarantaine mortelle. Fouillez pour trouver des ressources, fabriquez des outils, construisez un abri et survivez face à des animaux dangereux, des zombies, des mutants et d\'autres survivants. Explorez la zone où le désespoir pousse chacun à tout faire pour survivre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3484300/header.jpg?t=1752768024', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1081, 0),
(1083, 'SIGNALIS', 'Une expérience d\'horreur et survie dans un futur dystopique déshumanisé. Percez un mystère cosmique, échappez à de terrifiantes créatures et survivez sur une planète inconnue en tant qu\'Elster, une technicienne Replika à la recherche de ses rêves oubliés.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1262350/header.jpg?t=1704064951', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1082, 0),
(1084, 'The Stalked 2', 'The Stalked 2 est la suite autonome de The Stalked dans laquelle vous incarnez Rachel, une randonneuse invétérée. Ce qui commence comme une balade tranquille vers une cabane se transforme rapidement en cauchemar d’étrangetés et d’événements troublants. Y survivrez-vous ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2976490/header.jpg?t=1743675439', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 2, 1083, 0),
(1085, 'The Stalked', 'Échappée à l\'obsession de Liam, Kate trouve refuge dans le manoir de son grand-père. D\'étranges événements soulèvent des questions sur la présence de Liam ou d\'une autre personne. Dévoilant des lettres mystérieuses, Kate se lance dans un voyage en quête de paix.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2587770/header.jpg?t=1740792487', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1084, 0),
(1086, 'Derail Valley', 'Drive massive trains and build your career in a vast open railway network. For both PC and VR.', 'https://cfinder.xyz/uploads/DerailValley.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1085, 0),
(1087, 'Rail Route', 'Dans Rail Route, vous allez créer, bâtir, améliorer et automatiser un réseau ferré sur une des cartes basées sur les villes du monde entier. Gérez les trains pour que le trafic soit fluide et que le réseau grandisse !', 'https://cfinder.xyz/uploads/RailRoute.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1086, 0),
(1088, 'Lost in Random: The Eternal Die', 'Terrassez un fléau immémorial dans Lost in Random: The Eternal Die, un jeu d\'action roguelite frénétique se déroulant dans le monde d\'Aléa. Incarnez la reine Aleksandra et son dé Fortune pour affronter ses horreurs et manipuler reliques et compétences pour échapper au cauchemar.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2564520/af9d8114bbb142043fe17162e341ef04b9faf73a/header.jpg?t=1751465131', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1087, 0),
(1089, 'I Am Bread', 'Les créateurs de Surgeon Simulator vous proposent une aventure avec un héros très original ! \"I am Bread\" raconte l\'histoire épique d\'une tranche de pain voulant devenir un toast. Incarnez cet aventurier intrépide, et à croquer, et voyagez depuis la cuisine jusqu\'au monde extérieur, en parcourant la maison de son propriétaire,...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/327890/header.jpg?t=1739399026', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1088, 0),
(1090, 'Yaoling: Mythical Journey', 'Yaoling: Mythical Journey is a creature collecting Eastern fantasy RPG featuring an world filled with rich stories and unique Yaolings. Tasked to uncover a mysterious evil, you embark on a journey with your Yaolings, forming new friendships, engage in intense battles, and face countless challenges!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2816950/header.jpg?t=1750974058', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1089, 0),
(1091, 'Max Payne 3', 'Après avoir quitté le NYPD, Max Payne tente de fuir son passé en partant à São Paulo, où il doit protéger la famille d\'un magnat de l\'immobilier. Cette édition intégrale de Max Payne 3 inclut le jeu original complet et tous les contenus téléchargeables précédemment sortis.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/204100/header.jpg?t=1718391374', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1090, 0),
(1092, 'The NOexistenceN of you AND me', 'Use \"game\" as a medium to showcase the world of \"you/girl\". Explore the truth of \"you/girl/world\" through the form of a \"visual novel\".', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2873080/header.jpg?t=1749088341', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1091, 0),
(1093, 'Bad Parenting 1: Mr. Red Face', 'Mr. Red Face, a fictional character created by adults to teach their children, suddenly becomes real..', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3205080/header.jpg?t=1739082924', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1092, 0),
(1094, 'Iron Lung', 'A short horror game where you pilot a tiny submarine through an ocean of blood on an alien moon.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1846170/header.jpg?t=1750084184', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1093, 0),
(1095, 'Jump King', 'Relevez le défi et visez de gros enjeux avec le jeu de plateforme Jump King ! Démenez-vous pour monter toujours plus haut à la recherche de la légendaire nana canon, mais avancez prudemment, car un seul saut raté est synonyme de longue chute...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1061090/header.jpg?t=1708097084', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1094, 0),
(1096, 'Better Mart', 'ACCÈS ANTICIPÉ - Better Mart – Construis et Gère Ton Supermarché de Rêve !Bienvenue dans Better Mart, un jeu de gestion dynamique où tu crées, personnalises et développes le supermarché ultime !', 'https://cfinder.xyz/uploads/BetterMart.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1095, 0),
(1097, 'Borderlands Game of the Year Enhanced', 'Découvrez le shooter-looter original, rempli de nouvelles améliorations ! Incarnez l\'un des 4 mercenaires disponibles et équipez des trilliards d\'armes pour survivre à Pandore, une planète désolée.', 'https://cfinder.xyz/uploads/BorderlandsGameoftheYearEnhanced.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1096, 0),
(1098, 'The Echo Paradox', 'The Echo Paradox is a first-person psychological horror game. Humanity stands on the brink of an unsettling revelation – alternate dimensions are real, but eerily without signs of life.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2743410/header.jpg?t=1751373334', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1097, 0),
(1099, 'ROMANCE OF THE THREE KINGDOMS 8 REMAKE', 'Théâtre de guerre, drames infinis. \"ROMANCE OF THE THREE KINGDOMS 8\", un chef-d\'œuvre d\'historical simulation, est de retour après 20 ans. Profitez des plus grands drames militaires de la série the Three Kingdoms, accompagnés du plus grand nombre d\'officers et de scenarios proposés jusqu\'ici !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2288150/header.jpg?t=1747030684', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1098, 0),
(1100, 'Broken Arrow', 'Broken Arrow est un jeu de combat tactique moderne en temps réel et à grande échelle. Il combine la complexité du contrôle de forces interarmées d\'un wargame à l\'action rapide et immédiate des jeux de stratégie en temps réel.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1604270/50ce0a7c53286a7e96f634bdf80f70fbd8fc6c0c/header_alt_assets_2.jpg?t=1750446898', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1099, 0),
(1101, 'Pocket Bravery', 'S\'inspirant des classiques du jeu de combat des années 90 tels que Street Fighter, Fatal Fury et The King of Fighters, « Pocket Bravery » reprend l\'esthétique « Neo Geo Pocket » dans un jeu de combat moderne avec une touche rétro !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1555150/header.jpg?t=1743584813', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1100, 0),
(1102, 'Corsairs Legacy - Pirate Action RPG & Sea Battles', 'Soyez prêt pour \'Corsairs Legacy\'. Une aventure dans les Caraïbes, en simulant l\'histoire de la vie de pirate. Voguez, combattez les ennemis et explorez des îles. Serez-vous un pirate légendaire ou finirez-vous aux mains de vos ennemis ? À vous de choisir dans \'Corsairs Legacy\'', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1594880/a907a3386faa8b69b4331a6b8604e26fb7759ef6/header_alt_assets_0.jpg?t=1750959828', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1101, 0),
(1103, 'Alaskan Road Truckers', 'Mettez-vous dans la peau des camionneurs de l\'Alaska. Installez-vous aux commandes de machines colossales et bravez l\'un des environnements les plus rudes et les plus dangereux. Relevez le défi et tentez de survivre assez longtemps pour profiter pleinement de la beauté sauvage de l\'Alaska.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/849100/header.jpg?t=1738333451', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:29', '2025-09-09 15:30:13', 1, 1102, 0),
(1104, 'Immortals Fenyx Rising', 'Immortals Fenyx Rising donne vie à l\'aventure mythologique. Incarnez Fenyx, dont la tâche est de sauver les dieux grecs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2221920/header.jpg?t=1747655839', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 2, 1103, 0),
(1105, 'Dying Light Definitive 10th Anniversary Edition', 'Un jeu d\'action-survie à la première personne dans un monde ouvert post-apocalyptique grouillant de zombies dévoreurs de chair. Explorez une ville dévastée par un mystérieux virus. Cherchez des ravitaillements, fabriquez des armes et affrontez les hordes d\'infectés.', 'https://cfinder.xyz/uploads/DyingLightDefinitive10thAnniversaryEdition.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1104, 0),
(1106, 'Call to Arms - Gates of Hell: Ostfront', 'Call to Arms - Gates of Hell est un RTS/RTT offrant une rejouabilité sans fin. Commandez des troupes de tous types dans des missions historiques, des campagnes générées dynamiquement, et des batailles en PvP et PvE. Êtes vous prêt à vous immerger totalement dans la Seconde Guerre mondiale ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/400750/dbbd1ee41869ac2bae52511ab9d171e1aba441e4/header.jpg?t=1750352139', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1105, 0),
(1107, 'DR4X', 'A fast, casual haunted 4X game with asymmetric factions and roguelike elements. Enjoy brief, 30-turn skirmishes in a unique setting filled with strategic choices, or delve into a story-rich campaign with 5 different endings—all without the slow and tedious \'long wars\' typical of the genre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1704830/header.jpg?t=1750866133', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1106, 0),
(1108, 'Zom Nom', 'Zom Nom is a humorous, 2.5D, side scrolling platformer with puzzle elements. Play as Barry, a brain munching, gob spitting, slap happy Zombie. Spit and slap your way through the streets and sewers to take on the President of the World. Claim your place as Ruler of all Human and Zombie-kind.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1193070/header.jpg?t=1577969480', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1107, 0),
(1109, 'SULFUR', 'SULFUR est un jeu d’action-aventure old-school moderne. Surpassez des ennemis, trouvez des trésors, améliorez vos armes, canalisez des pouvoirs, plongez au cœur de niveaux, trouvez des réponses, mettez fin à tout cela.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2124120/4d942d8a5d996c29cbb7f06348b5348a67ce4391/header_alt_assets_5_french.jpg?t=1751281248', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1108, 0),
(1110, 'New Arc Line', 'Rejoignez le conflit éternel entre magie occulte et révolution steampunk ! À la tête de votre groupe, faites pencher la balance entre sorcellerie, elfes, nains et monstres mystérieux d\'un côté, et de l\'autre gadgets steampunk, zeppelins et pistolets Tesla, dans ce RPG solo au scénario captivant.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2458310/59ded0a3a25bad6d27acd96bfa204c0bb5abe768/header_alt_assets_1.jpg?t=1750952194', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1109, 0),
(1111, 'Summer Pockets REFLECTION BLUE', 'No matter how much times passes... I remember that blue, blue summer. Summer Pockets, the midsummer story brought to you by Key, has been powered-up with even more to play, including new heroines and routes, in Summer Pockets REFLECTION BLUE, now available on Steam!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3418570/3ecfde9ce2b88e00514a2986a5e8b8fc91b37420/header.jpg?t=1751007908', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1110, 0),
(1112, 'Shatterline', 'Get ready for the apocalypse! Shatterline is a high-octane single-player FPS adventure where Earth’s survival hangs in the balance. Pick a unique operator and combat the alien plague!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2087030/header.jpg?t=1751576878', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1111, 0),
(1113, 'Ship Graveyard Simulator 2', 'Dépoussiérez votre torche et votre marteau - il est temps de vous remettre au travail, vous avez une nouvelle mission à accomplir. Visitez la nouvelle côte de la plage avec le plus grand cimetière de navires du monde, démontez d\'énormes parties de navires et collectez des tonnes d\'acier précieux.', 'https://cfinder.xyz/uploads/ShipGraveyardSimulator2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 2, 1112, 0),
(1114, 'SOMA', 'Imaginé par les créateurs d’Amnesia: The Dark Descent, SOMA, mêle science-fiction et horreur sous les vagues de l’océan Atlantique. Lutter pour assurer votre survie dans un monde hostile vous conduira à vous interroger sur votre propre existence.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/282140/header.jpg?t=1727954562', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1113, 0),
(1115, 'Jazzpunk: Director\'s Cut', 'Jazzpunk is a comedy adventure set in an alternate reality Cold War World, plagued with corporate espionage, CyberCrime, and sentient martinis. Gameplay is inspired by spoof comedy films and cartoons of yesteryear, with a focus on weird gadgets, exotic locales, and open-world style exploration.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/250260/header.jpg?t=1710253452', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1114, 0),
(1116, 'Parcel Simulator', 'Inspectez et traitez des colis dans ce simulateur de gestion de colis ! Recevez et triez des livraisons, examinez les étiquettes pour détecter les erreurs et automatisez le contrôle pour augmenter votre rentabilité. Améliorez et agrandissez votre entrepôt pour construire votre empire !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2424010/15a3212115715456805b6d8f0480944e7911004b/header_alt_assets_0.jpg?t=1750438837', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1115, 0),
(1117, 'Tobacco Shop Simulator', 'Gérez votre boutique de tabac. Entre amis ou en solo, signez des contrats avec de grandes marques, commandez des produits, engagez des vendeurs, développez votre magasin, et ne laissez jamais vos clients repartir les mains vides.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3211680/12adde930feca1c99f70df12900c9040befc7102/header.jpg?t=1750655944', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1116, 0),
(1118, 'STAR WARS™ Knights of the Old Republic™', 'Choisis ton chemin. Nous sommes quatre mille ans avant l\'Empire Galactique et des centaines de Chevaliers Jedi sont tombés au combat contre les impitoyables Sith. Vous êtes le dernier espoir de l\'Ordre Jedi. Pouvez-vous maîtriser l\'incroyable puissance de la Force pour votre quête et sauver la République ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/32370/header.jpg?t=1681144833', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1117, 0),
(1119, 'Astrumis - Survive Together', 'Astrumis - Survive Together est un jeu d\'horreur exclusivement coopératif conçu pour deux joueurs. Un joueur contrôle un survivant sur un vaisseau spatial abandonné et l\'autre le vaisseau lui-même.', 'https://cfinder.xyz/uploads/Astrumis-SurviveTogether.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1118, 0),
(1120, 'Adobe Premiere Pro 2025', 'Adobe Premiere Pro 2025 est une application de montage vidéo qui propose un ensemble d’outils puissants pour éditer et améliorer les vidéos avec différents effets et utiliser la chronologie pour une sélection précise des vidéos.\r\n La version 25.3 de Premiere Pro propose un filtrage avancé dans le panneau Rechercher, des couleurs de libellés dans les onglets de séquence, etc', 'https://imgs.search.brave.com/zasnks-Sk7Q7RIjBNlIYRxN_TEEWrmHk0Y7TBPqY7Ug/rs:fit:500:0:1:0/g:ce/aHR0cHM6Ly93d3cu/ZWxlcGhvcm0uY29t/L3NpdGVzL2RlZmF1/bHQvZmlsZXMvc3R5/bGVzL3ZpZ25ldHRl/X2Zvcm1hdGlvbi9w/dWJsaWMvY292ZXJz/LWZvcm1hdGlvbnMt/dmlkZW8vYXBwcmVu/ZHJlLWxlLW1vbnRh/Z2UtYXZlYy1wcmVt/aWVyZS1wcm8lMjAy/MDI1KDE5MjAlMjB4/JTIwMTA4MCkuanBn/P2l0b2s9d28ycFZD/RzU', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1119, 0),
(1121, 'The Alters', 'Explorez un jeu de sci-fi plein d\'émotions, avec un mélange de survie, d\'aventure et de construction de bases. Aidez Jan Dolski, seul survivant, à créer d\'autres versions de lui pour fuir une planète hostile et affronter des problèmes personnels avec cet équipage hors norme.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1601570/header.jpg?t=1750429998', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1120, 0),
(1122, 'Card Shop Simulator Multiplayer', 'You and your friends are going to compete to see whose card shop can earn more money! Starting from a humble little shop, decorate your store, hire staff, formulate marketing strategies. Finally, use the coolest cards to engage in card battles, and win away your friends\' precious cards!', 'https://cfinder.xyz/uploads/CardShopSimulatorMultiplayer.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1121, 0),
(1123, 'FBC: Firebreak', 'FBC : Firebreak est un jeu de tir coopératif à la première personne vous plongeant au cœur d\'une mystérieuse agence gouvernementale attaquée par des forces surnaturelles.', 'https://cfinder.xyz/uploads/FBCFirebreak.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 2, 1122, 0),
(1124, 'SCUM', 'Explorez des environnements hostiles, pillez, fabriquez des objets et échappez aux menaces perpétuelles qui vous guettent. La personnalisation et la progression de votre personnage sont vos meilleures alliées pour survivre.', 'https://cfinder.xyz/uploads/SCUM.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1123, 0),
(1125, 'Car Dealer Simulator', 'Uncover a goldmine in the used car market! Sniff out deals, buy low, modify, and sell high. Your journey from amateur grease monkey to car dealer magnate awaits. How fast will you rise in this lucrative venture?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2404880/77ad6970ce80e055eaa65153f5b78ec863805c49/header.jpg?t=1749646208', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1124, 0),
(1126, 'DmC: Devil May Cry', 'Dans ce récit des débuts de Dante, sur une toile de fond contemporaine, DmC Devil May Cry™ conserve l’action pleine de style.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/220440/header.jpg?t=1742347813', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1125, 0),
(1127, 'Prehistoric Kingdom', 'Bouleversez les lois de la nature dans Prehistoric Kingdom et créez, gérez et faites prospérer le zoo pour animaux disparus ultime !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/666150/d43eb387e2f3a41014ee39d8d70918710a6db2e4/header.jpg?t=1745580648', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1126, 0),
(1128, 'Street Fighter X Tekken: Gems Assist 3 ', 'This 3 Gem pack is great for battle veterans. These Assist Gems can be used by all characters. These Gems will raise the strength percentage of Boost Gems! Note: If you would like to see the effects of the Gems individually before purchase, you can view them in-game from the Gem List within the Store, or from Gem Unit in the Customize...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/210095/header.jpg?t=1447356728', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1127, 0),
(1129, 'Middle-earth™: Shadow of War™', 'Découvrez un monde ouvert épique animé par le système Nemesis récompensé. Forgez un nouvel Anneau de Pouvoir, prenez le contrôle des forteresses et dominez le Mordor avec votre armée orque personnelle dans La Terre du Milieu™ : L\'Ombre de la Guerre™.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/356190/header_french.jpg?t=1747346596', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1128, 0),
(1130, 'Call of Duty®: WWII', 'Call of Duty retourne à ses origines avec Call of Duty: WWII, une expérience à couper le souffle qui servira de référence à la nouvelle génération de joueurs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/476600/header.jpg?t=1748041216', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1129, 0),
(1131, 'Crime Simulator', 'Vous êtes sorti de prison, mais la dette reste. Infiltrez-vous, volez et cambriolez des maisons en solo ou en coop jusqu’à 4 joueurs. Utilisez crochets, gaz soporifique et force brute pour finir les missions, déjouer la sécurité et amasser assez d’argent avant qu’il ne soit trop tard.', 'https://cfinder.xyz/uploads/CrimeSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1130, 0),
(1132, 'PEAK', 'PEAK is a co-op climbing game where the slightest mistake can spell your doom. Either solo or as a group of lost nature scouts, your only hope of rescue from a mysterious island is to scale the mountain at its center. Do you have what it takes to reach the PEAK?', 'https://cfinder.xyz/uploads/PEAK.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1131, 0),
(1133, 'REMATCH', 'Rematch est un jeu de football multijoueur en ligne. Contrôlez un joueur de votre équipe et disputez d\'intenses matchs 5 contre 5 avec une vue immersive à la troisième personne. Faites équipe avec vos amis et vivez l\'action ensemble.', 'https://cfinder.xyz/uploads/REMATCH.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1132, 0),
(1134, 'Out of Ore', 'A casual heavy equipment experience. Mine ore, Move dirt, Build and repair.', 'https://cfinder.xyz/uploads/OutofOre.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1133, 0),
(1135, 'TEKKEN 7', 'Découvrez la conclusion épique de la guerre de longue haleine entre les membres de la famille Mishima. Animée par le moteur Unreal Engine 4, la légendaire franchise de jeux de baston revient avec d\'époustouflants combats cinématiques scénarisés et d\'intenses duels à jouer avec vos amis ou rivaux.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/389730/header.jpg?t=1737674502', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1134, 0),
(1136, 'Undercover Fools', 'Infiltrez les bâtiments gardés, contournez intelligemment les gardes et les pièges, accomplissez des tâches à l\'aide de gadgets d\'espionnage sympas. Jouez seul ou en équipe, améliorez vos compétences d\'espion et planifiez des missions parfaites, et surtout... Ne vous trompez pas !', 'https://cfinder.xyz/uploads/UndercoverFools.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1135, 0),
(1137, 'School 666', 'L\'école 666 est un jeu de survie en coopération pour 1 à 4 joueurs. Identifiez le chemin correct et survivez aux anomalies dans cette école sans fin. Certaines puissantes anomalies vous entraîneront dans leurs dimensions. Explorez la raison pour laquelle vous êtes ici... et ne mourez pas.', 'https://cfinder.xyz/uploads/School666.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1136, 0),
(1138, 'Five Nights at Freddy\'s: Secret of the Mimic', 'Pénétrez dans l’atelier abandonné du Murray’s Costume Manor et percez le mystère perdu de l’inventeur fou. Dans Five Nights at Freddy’s: Secret of the Mimic, vous entrerez dans un monde où chaque recoin sombre garde un secret, et où chaque soupçon de lumière laisse entrevoir une menace permanente.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2215390/527bbebaa5764de58528487b3f2142c44a58b267/header.jpg?t=1749834013', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1137, 0),
(1139, 'MX vs ATV Legends', 'Foncez vers la victoire en pilotant motos, quads et UTV dans MX vs ATV Legends ! Profitez de nouveaux environnements ouverts très vastes, ainsi que d\'un mode Carrière dans lequel vous devrez relever les mêmes défis qu\'un véritable pilote professionnel. Imposez-vous comme la légende du tout-terrain !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1205970/header.jpg?t=1747302997', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1138, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1140, 'Tempest Rising', 'Prenez le contrôle de factions bien différentes qui se disputent désespérément les ressources d\'une Terre post-apocalyptique dans Tempest Rising, un STR héritier des classiques du genre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1486920/header.jpg?t=1747203759', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1139, 0),
(1141, 'Rune Factory: Guardians of Azuma', 'Bienvenue à Azuma, la nation de l\'est ! Exploitez vos pouvoirs de danseur tellurique pour restaurer les terres, ses habitants et même ses dieux. Affrontez des monstres corrompus, reconstruisez fermes et villages et tissez des liens avec un peuple haut en couleur lors de votre périple.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2864560/header.jpg?t=1749766933', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1140, 0),
(1142, 'ATOM RPG Trudograd', 'ATOM RPG : Trudograd est un jeu de rôle post-apocalyptique au tour par tour qui poursuit l’histoire d’ATOM RPG en tant que suite et extension indépendante, tout en s’inspirant des classiques du cRPG comme les premiers Fallout et Wasteland.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1139940/header.jpg?t=1748873456', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1141, 0),
(1143, 'Liftoff®: FPV Drone Racing', 'Liftoff® is a drone simulator that translates the rush of first-person view drone flight to the digital world. Join the biggest community for virtual FPV racing and freestyle!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/410340/header.jpg?t=1745306589', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1142, 0),
(1144, 'POPUCOM', 'Aventurez-vous avec vos amis sur une planète inconnue. Utilisez le changement de couleur, des techniques de match-3 et les pouvoirs des artéfacts pour faire face aux défis. Une aventure merveilleuse, débordante d\'espoir et pleine de surprises vous attend !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2543180/df67c9096023cbff9bd766d9b146fb08f85fba38/header.jpg?t=1749645741', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1143, 0),
(1145, 'CYGNI: All Guns Blazing', 'Un déferlement incessant de visuels saisissants, d\'ambiances sonores assourdissantes et d\'action à vous retourner le cerveau fait de CYGNI l\'avant-garde de la prochaine génération des jeux de tirs. Sous-armé, dépassé, et tout seul, plongez dans un ciel infernal pour l\'ultime bataille de la survie.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1248080/header.jpg?t=1734548060', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1144, 0),
(1146, 'Jotunnslayer: Hordes of Hel', 'Dans ce jeu de survie roguelike, explorez les royaumes obscurs de la mythologie nordique et combattez des vagues d\'ennemis pour remporter les bénédictions des divinités vikings. Affrontez de redoutables boss et entrez dans la légende dans cette ultime confrontation.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2820820/f3b5464c88d5fdfc87fd9a1599355ac5827417ef/header_alt_assets_1_french.jpg?t=1747818191', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1145, 0),
(1147, 'Cyber Knights: Flashpoint', 'Cyberpunk mercenaries RPG! Turn-based squad tactics with unique heist-planning strategy. Build your crew wisely; their stories will become interwoven with your own. Pull off heists with powerful cyberware, faction connections, multiclassing, weapon modding, stealth, hacking, and more!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1021210/cf04c53334afad7141119d635e8ff3454423895c/header_alt_assets_11.jpg?t=1749167490', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1146, 0),
(1148, 'Victory at Sea Atlantic - World War II Naval Warfare', 'Victory At Sea Atlantic vous transporte dans les eaux froides et impitoyables du théâtre de l\'Atlantique pendant la Seconde Guerre mondiale. Avec un vaste choix de navires, d\'avions et de sous-marins, engagez-vous dans d\'épiques batailles maritimes et assurez votre place dans l\'histoire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1674830/header.jpg?t=1745596817', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1147, 0),
(1149, 'MindsEye', 'MindsEye est un thriller d\'action-aventure en solo qui vous plongera dans un futur proche et vous emmènera à Redrock, une ville fictive située en plein désert. Le producteur Leslie Benzies vous embarque dans des cinématiques incomparables, des courses-poursuites survoltées et des combats explosifs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3265250/b2180b5a89ebee18c7b879b646f8b69dc0182a03/header.jpg?t=1749576184', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 2, 1148, 0),
(1150, 'Backrooms: Extractions', 'Backrooms: Extractions est un jeu d\'horreur coopératif (1-6 joueurs) se déroulant en 2062. En tant qu’agent du MEG, explorez les Backrooms pour secourir des opérateurs disparus tout en évitant des entités terrifiantes. Résolvez des énigmes, utilisez des outils avancés et survivez!', 'https://cfinder.xyz/uploads/BackroomsExtractions.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1149, 0),
(1151, 'SpyFall', 'Spyfall is a multiplayer game for up to 8 players. Spies must complete missions without getting caught. One player is the Detective who must find the spies. Each map has different characters and tasks.', 'https://cfinder.xyz/uploads/SpyFall.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1150, 0),
(1152, 'Better Mart', 'ACCÈS ANTICIPÉ - Better Mart – Construis et Gère Ton Supermarché de Rêve !Bienvenue dans Better Mart, un jeu de gestion dynamique où tu crées, personnalises et développes le supermarché ultime !', 'https://cfinder.xyz/uploads/BetterMart.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1151, 0),
(1153, 'DELTARUNE', 'Dive into the parallel story to UNDERTALE! Fight or spare your way through action-packed battles as you explore a mysterious world alongside an endearing cast of new and familiar characters. Chapters 1-4 will be available on launch, with more planned as free updates!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1671210/7ccda5b1631d2e60cc756a3271e845dbb9168821/header.jpg?t=1749073604', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1152, 0),
(1154, 'SurrounDead', 'SurrounDead is an open world survival game. Taking place in a world ravaged by an apocalyptic catastrophe. The dead reign free and will stop at nothing to kill you.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1645820/header.jpg?t=1744191457', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1153, 0),
(1155, 'Lightyear Frontier', 'Lightyear Frontier vous permet de créer et entretenir votre ferme sur une magnifique planète extraterrestre à l\'aide votre fidèle mécha. Cultivez et livrez vos produits à des colonies isolées, bâtissez, fabriquez, explorez, développez, rencontrez vos voisins et faites votre petit chez-vous.', 'https://cfinder.xyz/uploads/LightyearFrontier.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1154, 0),
(1156, 'Barotrauma', 'Barotrauma est une simulation de sous-marin 2D en coop intégrant des éléments de survival horror et de RPG. Dirigez un submersible, remplissez des missions, affrontez des monstres, réparez des fuites et fabriquez des objets. Mais méfiance, le danger frappe sans prévenir !', 'https://cfinder.xyz/uploads/Barotrauma.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1155, 0),
(1157, 'FANTASY LIFE i : La voleuse de temps', 'Découvrez ce nouveau jeu de rôle social « tranquille » dans lequel vous pouvez jouer et intervertir librement entre 14 professions uniques, aussi appelées « carrières, » pour profiter d\'une vie insouciante dans un monde utopique.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2993780/header_french.jpg?t=1748422477', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', NULL, 1156, 0),
(1158, 'Wrap House Simulator🌯', 'Bienvenue dans Wrap House Simulator! Gérez votre restaurant, coupez, grillez et servez dans cette aventure culinaire. Personnalisez votre shop, maîtrisez le grill et jouez en solo ou en coop jusqu\'à 4. Suivez les commandes, satisfaites les clients et bâtissez le resto de vos rêves!', 'https://cfinder.xyz/uploads/WrapHouseSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:30', '2025-09-09 15:30:13', 1, 1157, 0),
(1159, 'Guilty as Sock!', 'Enter a chaotic courtroom where socks play lawyers, prosecutors, and judges! Use absurd evidence, craft wild arguments, and deliver verdicts in this hilarious online party game. Improvise, strategize, and shout \"Objection!\"—because in Guilty as Sock!, chaos always wins!', 'https://cfinder.xyz/uploads/GuiltyasSock.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1158, 0),
(1160, 'Gaming Cafe Simulator', 'Relancez un café gaming fermé et transformez-le en hub ultime ! Gérez les locations, vendez des produits, ajoutez des PC, consoles, et un café pour vendre des plats frais. Attirez les clients avec des espaces de jeu uniques. Votre café peut-il devenir un succès ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2978540/2caf430868df646ce6b1308ec6ab4b80edeec687/header.jpg?t=1748451647', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1159, 0),
(1161, 'Tainted Grail: The Fall of Avalon', 'Plongez dans une réinterprétation sombre des légendes arthuriennes dans ce RPG en monde ouvert à la première personne. Explorez un monde figé dans un automne éternel, assistez à la chute des légendes et prenez des décisions significatives intégrées dans une histoire complexe et ramifiée.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1466060/0c0e01b67ccd041c4d69542fea84972836d7055a/header.jpg?t=1748179597', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', NULL, 1160, 0),
(1162, 'ELDEN RING NIGHTREIGN', 'ELDEN RING NIGHTREIGN est une aventure indépendante se déroulant dans l\'univers d\'ELDEN RING, conçue pour offrir aux joueurs une nouvelle expérience en réimaginant la structure même du jeu.', 'https://cfinder.xyz/uploads/ELDENRINGNIGHTREIGN.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', NULL, 1161, 0),
(1163, 'Call of Duty®: Modern Warfare®', 'Vivez une Campagne viscérale ou rassemblez votre équipe sur le terrain de jeu en ligne ultime avec de multiples défis d\'Opérations Spéciales et un mélange de cartes et de modes Multijoueur.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2000950/header.jpg?t=1678294805', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1162, 0),
(1164, 'Call of Duty®: Vanguard', 'Call of Duty®: Vanguard inclut une campagne solo captivante, une offre Multijoueur énorme le jour du lancement incluant plus de 20 cartes dont 16 conçues pour le Multijoueur standard, et une incroyable nouvelle expérience Zombies développée par Treyarch.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1985820/header.jpg?t=1731607702', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1163, 0),
(1165, '9 Kings', 'Bâtissez votre royaume dans ce roguelike effréné. Étendez votre empire et livrez des batailles homériques contre de puissants rivaux royaux. Cassez le jeu avec des milliers de decks démentiels pour régner sans partage.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2784470/696583b4634bfd2777a516cfc59b752f06150c62/header.jpg?t=1748026388', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', NULL, 1164, 0),
(1166, 'COMBOLITE', 'Un deckbuilder roguelike simple, court et satisfaisant où le but est d\'infliger le plus de dégâts possible. Collectez des buffs et appliquez des gemmes à vos armes pour atteindre les MILLIONS et au-delà !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3499540/header.jpg?t=1746195554', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1165, 0),
(1167, 'Worshippers of Cthulhu', 'Prenez les rênes du Culte de Cthulhu. Décidez du sort de vos adeptes, accomplissez des rituels surnaturels et maîtrisez l\'art de la construction de villes dans un monde où la frontière entre raison et folie s\'estompe. Pourrez-vous supporter les horreurs que vous déchaînerez ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2807150/4b6d6babb3cea575f820cf008d0fcc3d38384102/header_alt_assets_5.jpg?t=1748003417', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1166, 0),
(1168, 'Doloc Town', 'Doloc Town is a cozy pixel-art farming simulation set in a post-apocalyptic world. Build your dream farm from scratch and explore this mysterious wasteland. Harvest, plant, build, and uncover the untold stories of this forgotten land!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2285550/4f696f4c17ac4903f9a77d951b82e58e9101e59a/header.jpg?t=1747909458', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1167, 0),
(1169, 'Monster Train 2', 'Monster Train revient avec de nouveaux clans, factions ennemies, défis, modes inédits et plus ! Défendez votre Brasier dans le gameplay vertical à 3 niveaux qui a fait la renommée du deckbuilder roguelike d\'origine.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2742830/header.jpg?t=1747843433', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1168, 0),
(1170, 'iDigging', 'Dans iDigging, vous équilibrerez la chasse au trésor, l’amélioration de votre maison et la stratégie pour échapper aux voisins curieux et aux autorités. Améliorez, creusez, et créez votre meilleure vie malgré tous les défis!', 'https://cfinder.xyz/uploads/iDigging.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', NULL, 1169, 0),
(1171, 'Cute Bite', 'A vampire raising sim! Train the Little Mistress in skills so she can bite her way through obstacles. She might hunt criminals for their blood, become a celebrity and feed on her fans, raise a dark army to threaten the world, or many other possible outcomes!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1586960/header.jpg?t=1636565498', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1170, 0),
(1172, 'Arietta of Spirits', 'Arietta of Spirits est un jeu d’action-aventure à l’histoire pleine d’émotion et de surprises. Suivez Arietta dans sa découverte du Royaume des esprits.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1140170/header.jpg?t=1744835641', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1171, 0),
(1173, 'Call of Duty®: Modern Warfare® II', 'Call of Duty®: Modern Warfare® II plonge les joueurs dans un conflit mondial sans précédent, avec le retour des Opérateurs emblématiques de la Task Force 141.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1962660/header.jpg?t=1710969334', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', NULL, 1172, 0),
(1174, 'Industry Giant 4.0', 'Bâtissez un empire industriel dans Industry Giant 4.0. Produisez des biens, développez vos industries, construisez des réseaux de transport, planifiez la production, gérez vos finances et négociez les événements. Devenez le magnat des affaires et écrivez l\'histoire !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1129570/b006727c4bb7e2a1a43f64953a90a0c4fcc177f8/header.jpg?t=1747848660', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', NULL, 1173, 0),
(1175, 'Life is Strange: Double Exposure', 'Lorsque Max Caulfield trouve le corps sans vie de son amie Safi dans la neige, elle ouvre une brèche vers un monde parallèle. Le seul moyen de sauver Safi est de découvrir l\'identité de son assassin. Parviendrez-vous à réussir l\'impossible ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1874000/header.jpg?t=1747227819', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1174, 0),
(1176, 'JDM: Japanese Drift Master', 'Découvrez la culture automobile japonaise dans JDM : Japanese Drift Master ! Battez les pistes grâce à une physique de conduite digne d\'un simulateur, plongez dans le scénario du manga et explorez un monde ouvert inspiré de lieux réels. Chaque virage vous rapproche d\'un maître du drift !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1153410/7a2223dff24456e54907fa6083790bb52e7b354a/header.jpg?t=1747933510', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', NULL, 1175, 0),
(1177, 'Out of Sight', 'Out of Sight est un jeu d\'horreur à l\'atmosphère profonde qui mélange les perspectives à la première et à la deuxième personne avec un doublage captivant pour vous plonger dans un voyage effrayant et émouvant.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2526310/5ac77fa5a0ae808cda04e176a1de28d7fbc48a12/header.jpg?t=1747918820', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1176, 0),
(1178, 'S.T.A.L.K.E.R.: Clear Sky - Enhanced Edition', 'S.T.A.L.K.E.R.: Clear Sky est le préquel de la trilogie Legends of the Zone. Capable d’influencer l’équilibre des pouvoirs à travers les guerres entre factions, Scar est le personnage que vous incarnerez.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2427420/cc29f2e9bdc14922b5e43f5b34058e0f902bb4a9/header.jpg?t=1747757980', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 2, 1177, 0),
(1179, 'The Slormancer', 'Combattez des hordes d\'ennemis dirigées par Le Slormancer, un sorcier maléfique du temps passé, dans un Action-RPG décalé mais Épique ! Avec son lot de butin étincelant, des tonnes d\'objets à collecter, d\'innombrables heures de contenu, un gameplay frénétique et un pixel art soigneusement réalisé.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1104280/d425c51526b26037fa7e4ebfd8bb5424164e95f7/header.jpg?t=1747155678', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1178, 0),
(1180, 'Cash Cleaner Simulator', 'Vérifier, nettoyer, trier, expédier. Bienvenue dans la vie d\'un nettoyeur de cash. Acceptez des contrats de la pègre et blanchissez de l\'argent. Mais, n\'envisagez surtout pas de partir...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2488370/header.jpg?t=1747473052', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1179, 0),
(1181, 'Tennis Manager 25', 'Plongez dans l’expérience de gestion de tennis la plus aboutie à ce jour. Gérez votre académie, développez votre staff et vos infrastructures, recrutez les meilleurs joueurs sur les circuits masculin et féminin, junior et pro. Forgez les champions de demain et façonnez l’avenir du tennis !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3549220/aa804ea5bd301fa1d2c34eb2fff5ecc5110c8528/header.jpg?t=1747324660', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1180, 0),
(1182, 'Trainz™ Simulator 12', 'Released 2011. See also Trainz A New Era and TRS19.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/24670/header.jpg?t=1571295015', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1181, 0),
(1183, 'The Precinct', 'Averno, 1983. Les gangs font la loi et gangrènent toute la ville. Débarrassez la cité de ces malfrats, lancez-vous dans des courses-poursuites haletantes et découvrez la vérité derrière la mort de votre père, dans ce jeu d\'action policier néon-noir en bac à sable.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/490110/header.jpg?t=1747313291', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1182, 0),
(1184, 'EBOLA VILLAGE', 'EBOLA VILLAGE - this is a classic survival horror game from the 90s with a focus on atmosphere and player immersion. Solve puzzles, follow the story carefully and use various weapons in a brutal fight for survival. Danger lurks at every turn.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2306030/b3355c7d5b004be424a47279489db89beac60d8d/header.jpg?t=1747157702', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1183, 0),
(1185, 'Age of Reforging:The Freelands', 'Bienvenue dans le CRPG d\'aventure sandbox médiéval à haute liberté ! Vous incarnerez un \"reforgeur\" dans les Terres Libres, choisi par la Déesse pour entreprendre une aventure médiévale à votre propre rythme, rassembler des compagnons, chercher à survivre et forger votre légende unique !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1161830/469a3b6eb8f1511d6a93d4314e0a21f689d56bc6/header.jpg?t=1746701726', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1184, 0),
(1186, 'The Infected', 'The Infected is a survival crafting game set in an open world sandbox. Build your base defend and protect yourself from wildlife and infected Vambies. (Hybrid Vampire-Zombie)', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1360000/header.jpg?t=1747228323', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1185, 0),
(1187, 'Talon\'s Blade', 'Talon\'s Blade is a third person adventure RPG with an advanced direction based melee combat system. Experience the journey of Marcus Veridius as he is set on the path of vengeance. Explore a world plagued with war and corruption as the very foundations of an empire crumble around you.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2131460/header.jpg?t=1746537322', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1186, 0),
(1188, 'Overthrown', 'Soulevez et jetez à tout va en construisant et gérant votre royaume dans ce city-builder pour 1 à 6 joueurs. Défendez vos citoyens face aux bandits et mutants grâce au pouvoir de votre couronne, cultivez la terre et récoltez des ressources. Contentez vos citoyens ou ils rejoindront les hors-la-loi !', 'https://cfinder.xyz/uploads/Overthrown.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1187, 0),
(1189, 'Planetaries', 'Découvrez un vaste jeu TD de survie en monde ouvert de science-fiction se déroulant sur une planète lointaine au plus profond de l\'univers. Fabriquez, construisez, exploitez, échangez, explorez et survivez dans ce monde extraterrestre. Collectez des données et défendez-vous contre des vagues d\'ennemis cherchant à vous bannir.', 'https://cfinder.xyz/uploads/Planetaries.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1188, 0),
(1190, 'Squirreled Away', 'Devenez un écureuil. Explorez, rassemblez, créez, et construisez d’incroyables cabanes sur des aires boisées. Cavalez à travers les espaces verts, faufilez-vous entre les arbres et balancez-vous de branche à branche en solo, ou jusqu’à quatre en coop. D’infinies journées estivales vous attendent !', 'https://cfinder.xyz/uploads/SquirreledAway.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1189, 0),
(1191, 'Altarium', 'Altarium est un jeu d\'horreur PVP Co-Op asymétrique à la première personne qui peut être joué par 1 à 5 joueurs ensemble. Les joueurs peuvent choisir de jouer soit en tant que victime, soit en tant que personnage maléfique. Préparez-vous, choisissez votre rôle, façonnez votre destin et survivez !', 'https://cfinder.xyz/uploads/Altarium.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1190, 0),
(1192, 'Battle Realms: Zen Edition', 'Le retour du classique, maintenant remasterisé ! Battle Realms est un STR fantastique inspiré par les histoires racontées dans les films d\'arts martiaux et la mythologie orientale. Transformez vos paysans en un clan de guerriers hautement entraînés et mortellement efficaces, prêts à mourir avec votre nom sur leurs lèvres.', 'https://cfinder.xyz/uploads/BattleRealmsZenEdition.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1191, 0),
(1193, 'CyberCorp', 'CyberCorp: jeu de tir coopératif dans un monde cyberpunk. Gangs, surpopulation, violence. En tant que combattant de la société militaire CyberCorp, éliminez les gangs avec force et armes avancées dans les rues d\'Omni-City.', 'https://cfinder.xyz/uploads/CyberCorp.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1192, 0),
(1194, 'DeathWatchers', 'Utilisez l\'équipement spécialisé à votre disposition pour localiser et enregistrer autant d\'événements paranormaux que possible. Élaborez votre rituel et tentez d\'exorciser les démons qui s\'y trouvent. Si vous utilisez des ingrédients incorrects, vous risquez de ne jamais repartir ! 1-4 joueurs', 'https://cfinder.xyz/uploads/DeathWatchers.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1193, 0),
(1195, 'PROJECT ZERO : LA PRÊTRESSE DES EAUX NOIRES', '« FATAL FRAME / PROJECT ZERO : LA PRÊTRESSE DES EAUX NOIRES » arrive sur Steam pour célébrer le 20e anniversaire de la série d\'aventure horrifique, FATAL FRAME / PROJECT ZERO. Le jeu se déroule sur le mont Hikami, un lieu sacré où plusieurs événements mystérieux se produisent.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1732190/header_french.jpg?t=1729053546', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1194, 0),
(1196, 'Kingdom Rush 5: Alliance TD', 'Alors qu\'un mal redoutable émerge, une alliance inattendue se forme ! Il faudra les plus fins guerriers de Linirea et l\'implacable Armée des Ténèbres pour l\'arrêter. Attention ! Bien qu\'ils puissent cheminer côte à côte, les vents changeants du destin pourraient rapidement changer leur trajectoire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2849080/header.jpg?t=1743080303', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1195, 0),
(1197, 'Monaco 2', 'Assemblez une nouvelle fois votre équipe pour organiser le casse du siècle! Retournez à Monaco, planifiez votre coup, puis déguerpissez quand la situation tournera au vinaigre (comme elle ne manquera pas de le faire)dans ce jeu de cambriolage coopératif. Les trésors de la ville n\'attendent que vous!', 'https://cfinder.xyz/uploads/Monaco2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1196, 0),
(1198, 'MotoGP™24', 'Rev up your engines, MotoGP™24 is back! Dive into the heart-pounding action of the 2024 season and immerse yourself in the thrills of unexplored landscapes, all thanks to the revolutionary Riders market!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2581700/header.jpg?t=1746000421', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1197, 0),
(1199, 'Skin Deep', 'Skin Deep est un jeu de tir immersif à la première personne dans un vaisseau non linéaire, avec éternuements et objets qui traînent. Faufilez-vous, subvertissez et sabotez pour survivre dans ce bac à sable stellaire, en infériorité numérique, moins bien armée et pieds nus. Bienvenue dans Skin Deep !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/301280/header.jpg?t=1746226385', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1198, 0),
(1200, 'MotoGP™25', 'Faites hurler les moteurs pour la saison 2025 ! Vivez toute l\'authenticité de MotoGP™ avec une bande-son retravaillée et des défis haletants. Entraînez-vous à de nouvelles disciplines avec le mode Race Off et optez pour une expérience Arcade ou Pro.', 'https://cfinder.xyz/uploads/MotoGP25.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', NULL, 1199, 0),
(1201, 'Megaton Rainfall', 'Devenez un surhomme interdimensionnel indestructible dans ce jeu de super héros à la première personne et sauvez la terre d’une invasion extraterrestre. Faites attention quand même : vous êtes si puissant que vous pouvez détruire des gratte-ciel entiers (sans le faire exprès) lorsque vous ratez votre cible de l’autre monde...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/430210/header.jpg?t=1572861367', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1200, 0),
(1202, 'News Tower', 'Développez votre journal et devenez le plus grand magnat des médias de New York ! Construisez votre empire et gérez votre journal de A à Z. Créez votre propre ligne éditoriale, envoyez vos journalistes enquêter sur des évènements historiques des années 30 et dénichez les derniers scoops !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1649950/header.jpg?t=1744301267', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1201, 0),
(1203, 'Savara', 'Dans cet action rogue-lite haut en couleur, prenez part aux festivités organisées pour le bon plaisir du dieu guerrier. Équipez vos meilleures armes, prouvez votre valeur face à de puissants monstres et gravez votre nom à jamais dans l\'Histoire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3021630/header.jpg?t=1746617777', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1202, 0),
(1204, 'There Is No Game: Wrong Dimension', 'Il n\'y a pas de jeu. Donc n\'allez pas tout faire planter en cliquant partout. Vous ne voudriez tout de même pas être expulsé de votre univers vidéoludique, n\'est-ce pas ? Bien sûr que non.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1240210/header.jpg?t=1728289933', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1203, 0),
(1205, 'Tower Dominion', 'Construis la carte tout en défendant ta forteresse contre une invasion extraterrestre dans ce jeu palpitant de Tower Defense roguelike. Choisis parmi 30 héros, survis aux vagues d\'ennemis et améliore une variété de tours destructrices pour tenir la ligne de front !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3226530/db1bd39b1fe29a4e90865345fce8c5fd9d88652c/header.jpg?t=1746823766', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1204, 0),
(1206, 'To Pixelia', 'Rencontrez les Pixeliens et découvrez le simulateur de vie ultime dans To Pixelia. En gravissant les échelons de votre carrière, entrez dans le monde de la politique, de l\'art, du sport, de la musique et même du crime. Vivez la vie de vos rêves en pixels!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1954160/777c070fbbf186cb70d3374c5d6e0a8081c1e349/header.jpg?t=1746111627', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1205, 0),
(1207, 'Ratopia', 'Un nouveau jeu combinant les genres de survie stratégique, Sandbox, et simulation de construction de ville. Profitez de la simulation dans un vaste monde d\'aventure avec un grand nombre de contenus. Construisez votre propre système économique pour soutenir votre ville idéale de Ratopia.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2244130/06e20c1c0c1a21d43133bb2934096c01e61f212a/header_alt_assets_0.jpg?t=1746066146', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1206, 0),
(1208, 'Nobody Sleeps Tonight', 'a co-op survival horror about finding your friend who disappears at night in a strange forest hiding a sinister secret.', 'https://cfinder.xyz/uploads/NobodySleepsTonight.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1207, 0),
(1209, 'Survival Machine', 'Construisez votre base sur une Machine en perpétuel mouvement, explorez des biomes aux ressources variées et préparez-vous à la nuit, les zombies sont bien plus dangereux qu’à la lumière du jour. Tu veux y aller seul(e) ou explorer ce nouveau monde avec tes meilleurs amis?', 'https://cfinder.xyz/uploads/SurvivalMachine.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1208, 0),
(1210, 'Worlds of Aria', 'Menez votre propre groupe d\'aventuriers dans une quête épique qui s\'inspire des jeux de rôle papier. Invitez vos amis à vous rejoindre grâce au Friends Pass ou partez seul de votre côté. Collaborations, trahisons, chance aux dés... Quelles aventures vous attendent, vos compagnons et vous ?', 'https://cfinder.xyz/uploads/WorldsofAria.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:31', '2025-09-09 15:30:13', 1, 1209, 0),
(1211, 'Lost Skies', 'Parcourez un monde sublime, mais divisé. Découvrez ses vestiges et sa technologie avancée, et créez votre aéronef pour braver la nature impitoyable de Lost Skies. Partez à l\'aventure en équipe ou en solo dans ce jeu de survie coopératif captivant.', 'https://cfinder.xyz/uploads/LostSkies.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1210, 0),
(1212, 'Équipe de nettoyage Backrooms (Backrooms Cleanup Crew)', 'Vous et votre équipe êtes chargés de nettoyer après le voyage désastreux de la dernière équipe d’exploration dans les Backrooms. Esquivez les incursions mortelles, nettoyez chaque surface et ne laissez aucune trace.', 'https://cfinder.xyz/uploads/quipedenettoyageBackroomsBackroomsCleanupCrew.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1211, 0),
(1213, 'FATAL FURY: City of the Wolves', 'FATAL FURY: City of the Wolves, est sur le point de faire son arrivée 26 ans après le dernier épisode ! Offre un style artistique unique qui exhale les sens et un système REV innovant pour des moments de jeu intenses. Ici, enfin, une nouvelle légende est sur le point de voir le jour...', 'https://cfinder.xyz/uploads/FATALFURYCityoftheWolves.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', NULL, 1212, 0),
(1214, 'Deadzone: Rogue', 'Deadzone: Rogue est un FPS roguelite au rythme effréné qui se déroule dans l\'espace lointain. Éliminez des hordes d\'ennemis avec des armes dévastatrices. Définissez votre style de combat avec de puissantes améliorations et améliorations. Devenez plus fort à chaque mort, en solo ou en coopération.', 'https://cfinder.xyz/uploads/DeadzoneRogue.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', NULL, 1213, 0),
(1215, 'The Jump Guys', 'Un jeu de plateforme basé sur la physique. 40 niveaux à passer. 12 arènes de combat. Jouez avec des amis en multijoueur local ou en ligne pour jusqu’à 4 joueurs', 'https://cfinder.xyz/uploads/TheJumpGuys.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1214, 0),
(1216, 'LIZARDS MUST DIE 2', 'RUSSI VS LIZARDS 2 est un jeu d\'action coopératif de slasher, une continuation de haute qualité de la première partie SENSATIONNELLE. Des lézards insidieux, attaquèrent à nouveau les terres des Rus. HYPERBORÉE est en feu et seuls les HÉROS peuvent lécher les envahisseurs de leur patrie.', 'https://cfinder.xyz/uploads/LIZARDSMUSTDIE2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1215, 0),
(1217, 'DreadHaunt', 'DreadHaunt is a survival horror and deception game that can be played solo or in multiplayer. While designed with multiplayer in mind, a single-player story mode reveals the chilling origins of the supernatural events from a decade ago.', 'https://cfinder.xyz/uploads/DreadHaunt.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1216, 0),
(1218, 'Revenge of the Savage Planet', 'Revenge of the Savage Planet est un jeu d\'aventure de science-fiction satirique remplis d\'actions. Sautez, tirez et collectionnez pour vous frayer un chemin à travers des mondes extraterrestres vibrants. Découvrez de nouveaux équipements et améliorations, ainsi que de nombreux secrets cachés.', 'https://cfinder.xyz/uploads/RevengeoftheSavagePlanet.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1217, 0),
(1219, 'Twas The Night', 'Build and manage Santa\'s North Pole mega-workshop in this festive city builder where workshops produce toys for the world\'s children. Spend Christmas Spirit to create new holiday traditions and upgrade your workshops, but lose your spirit and you\'ll cease to exist.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3196020/header.jpg?t=1735588221', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1218, 0),
(1220, 'Drive Beyond Horizons', 'Aventurez-vous dans l\'inconnu avec Drive Beyond Horizons ! Partez à la conquête de paysages dynamiques, personnalisez votre véhicule et découvrez des trésors cachés. Préparez-vous à relever des défis palpitants et à vivre des émotions sans fin. Votre aventure commence maintenant !', 'https://cfinder.xyz/uploads/DriveBeyondHorizons.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', NULL, 1219, 0),
(1221, 'Logic World', 'Build. Program. Simulate. Logic World teaches you how circuits do math.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1054340/header.jpg?t=1739033192', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1220, 0),
(1222, 'Parkitect', 'Parkitect est un jeu de simulation de gestion, dans lequel vous devez construire et administrer des parcs d’attractions ! Il propose tout ce que les grands classiques du genre ont de meilleur en apportant ses propres nouvelles fonctionnalités.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/453090/header.jpg?t=1739000510', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1221, 0),
(1223, 'A Space for the Unbound', 'A magical adventure about two high school sweethearts set at the end of their school days - and the end of the world. Explore a crumbling town and help friends face their inner demons, which could be the key to stopping reality itself disintegrating. And don’t forget to pet the cats.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1201270/header.jpg?t=1737345095', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1222, 0),
(1224, 'Mosa Lina', 'a hostile interpretation of the immersive sim, where nothing is planned, and everything works', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2477090/header.jpg?t=1730301481', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1223, 0),
(1225, 'Tiny Pasture', 'Rencontrez vos nouveaux petits copains de bureau ! Ils dormiront, gratteront, gambaderont pendant que vous travaillez ou étudiez (ne vous inquiétez pas, ils ont été formés pour ne pas envahir votre espace de travail) et occuperont le bas de votre écran avec différents types et couleurs !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3167550/header.jpg?t=1746088338', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1224, 0),
(1226, 'Bao Bao\'s Cozy Laundromat', 'Détendez-vous dans la Lavanderie Douillette de Bao Bao, un jeu idle où vous aidez Bao Bao, un adorable panda, à créer la laverie la plus cosy. Achetez des machines colorées, ajoutez des décorations et embauchez des pandas assistants. Votre laverie s\'animera même quand vous n\'êtes pas là !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3194550/header.jpg?t=1742046811', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1225, 0),
(1227, 'WHAT THE BAT?', 'Vos mains sont des battes, et quoi maintenant ? ON Y VA ! Jouez à une série de mini-jeux de plus en plus ridicules dans une comédie de réalité virtuelle déjantée qui est bien plus qu’un simple jeu de baseball.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2012100/header.jpg?t=1738146442', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1226, 0),
(1228, 'Summer Memories', 'It\'s summer break, and it\'s been years since you\'ve last seen your aunt and cousins in the countryside! You don\'t know what to expect, but what could go wrong? Find out in Summer Memories!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1227890/header.jpg?t=1735619997', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1227, 0),
(1229, '100% Orange Juice', '100% Orange Juice is a digital multiplayer board game populated by developer Orange Juice\'s all-star cast. Characters from Flying Red Barrel, QP Shooting, Suguri and Sora come together with all-new characters to duke it out... with dice.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/282800/74b8f808c2ea623f9aee9ed20c6d76c7e536e137/header.jpg?t=1745601243', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1228, 0),
(1230, 'THE LONGING', 'Une fusion unique entre jeu d\'aventure et jeu incrémental. Seul dans les profondeurs insondables d\'une caverne souterraine, votre tâche consiste à attendre le réveil de votre roi… pendant 400 jours.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/893850/header.jpg?t=1743084326', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1229, 0),
(1231, 'Zet Zillions', 'Zet Zillions est un deckbuilder solo de type rogue-like dans lequel vous utilisez vos cartes pour faire des combinaisons déjantées et exploser des planètes entières !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2229560/b5440b76684503e56a27947e41ae266d0f658c22/header_alt_assets_1.jpg?t=1740754793', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1230, 0),
(1232, 'SunnySide', 'Venez trouver l\'harmonie et la paix intérieure dans la campagne japonaise tout en aidant Sparky à retrouver des souvenirs enfouis dans ce simulateur de vie à la ferme mis au goût du jour. Construisez un domaine prospère, cultivez de nouvelles relations et partez à la conquête de votre propre bonheur', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1746930/header.jpg?t=1737745049', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1231, 0),
(1233, 'MACHI KORO avec tout le monde', '« MACHI KORO avec tout le monde » est la version numérique du jeu MACHI KORO, un jeu de société populaire dans le monde entier, et nommé pour le Spiel des Jahres 2015. Ce jeu simple garantit des moments de joie et de bonne humeur entre amis, hors ligne ou sur Internet.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1969860/header.jpg?t=1745985337', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1232, 0),
(1234, 'Caribbean Legend', 'Embarquez dans un RPG en monde ouvert à l\'âge d\'or de la piraterie caribéenne. Vivez une aventure de 200 heures : pillez villes et navires, explorez l\'inconnu, découvrez des trésors, forgez des alliances, gagnez des primes et charmez les femmes en quête de liberté ultime !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2230980/header.jpg?t=1744994191', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1233, 0),
(1235, 'Look Outside', 'Look Outside is a survival horror RPG set in a single apartment building. A mysterious event turns anyone who looks out the window into grotesque monsters, leaving the world in absolute chaos. Scavenge the building to seek food, supplies, and weapons while encountering strange characters.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3373660/7af754cc405af7db9396a0c1bedff8e7fd213198/header.jpg?t=1743515206', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1234, 0),
(1236, 'Space Haven', 'Embarquez pour l\'espace avec un équipage de colons en quête d\'un nouveau foyer. Créez vos vaisseaux tuile par tuile, optimisez le flux et la qualité de l\'air, gérez les besoins et l\'humeur de votre équipage et explorez le cosmos dans ce simulateur de colonie spatiale.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/979110/header.jpg?t=1694086997', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1235, 0),
(1237, 'Spire Blast', 'Spire Blast est un jeu de puzzle unique basé sur la physique où vous associez des couleurs, tirez et faites exploser des tours. Entrez dans le monde coloré de Spire Blast. Faites équipe avec votre dragon toujours affamé pour faire s\'effondrer de nombreuses tours mystérieuses.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3352260/header.jpg?t=1745569929', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1236, 0),
(1238, 'MEMORIAPOLIS', 'Memoriapolis vous invite à construire une ville de l\'Antiquité à la Révolution Industrielle. Choisissez votre culture, gérez vos ressources, affrontez les événements historiques, construisez des \"merveilles\" pour réaliser \"The Collection\" et laissez votre empreinte dans l\'histoire !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2228280/header_french.jpg?t=1746031674', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1237, 0),
(1239, 'ROBOBEAT', 'Ne lâchez pas la gâchette ! Dans le jeu de tir rythmé ROBOBEAT, vous jouez Ace, un chasseur de prime aux trousses du robot fou Frazzer dans son manoir évolutif. Courez sur les murs, glissez et tirez au rythme qui vous plaît grâce à l\'éditeur de musiques personnalisées !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1456760/60368d84372b1f8809de35d66811f2748dd01d53/header.jpg?t=1742553743', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1238, 0),
(1240, 'Wizordum', 'Wizordum is a retro FPS that puts you in the role of a Mage on a quest to track down the source of Chaos. With a wide arsenal of spells and magic items, battle your way through the world of Terrabruma in this unique blend of classic 90s shooters and modern gaming elements.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1715590/header.jpg?t=1745939867', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1239, 0),
(1241, 'Crypterion', 'Crypterion is an open-world visual novel in a distant future where anyone can rise to power—including you. As a new arrival in the Rimshot system, you are free to forge your own destiny, conquering space by mastery of trade, politics, celebrity status through galactic TV or... Other means.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1048860/261d8baccb601c5fcc95532c445f5374e98fe514/header_alt_assets_1.jpg?t=1745942588', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 2, 1240, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1242, 'StarVaders', 'Prenez commande d’un mécha pour repousser une invasion extraterrestre dans StarVaders, un mélange explosif de deckbuilding et de tactique. Créez des combos dévastateurs, remontez le temps et protégez l’avenir de l’humanité dans ce roguelike au potentiel de rejouabilité infini.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2097570/742fe73872aefccb189ec30c3f27c6ddb757bf36/header_alt_assets_2.jpg?t=1746116870', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1241, 0),
(1243, 'Starless Abyss', 'La Terre est tombée. La science et l\'occulte ont uni leurs forces pour faire face à l\'arrivée des Horreurs. Les efforts déployés contre ces étranges extraterrestres suffiront-ils ? Incarnez un Proxima et défendez l\'humanité dans ce deck-builder intergalactique au tour par tour de type roguelike.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3167970/header.jpg?t=1746027636', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1242, 0),
(1244, 'KIBORG', 'KIBORG est un beat’em up rogue-lite brutal où vous améliorez votre corps avec des implants cybernétiques à chaque partie. Envoyé dans la pire prison de la galaxie pour des crimes non commis, la mort ne vous sauvera pas. Votre seule chance : gagner un show télévisé violent et fou.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2405060/16f43836785f5ae5fba0c0859a9b21e54b6d50f9/header.jpg?t=1746107232', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1243, 0),
(1245, 'ZEPHON', 'Par les créateurs de Warhammer 40,000: Gladius, ZEPHON est un jeu de stratégie 4X post-apocalyptique avec le système de combat propre à Proxy. Aidez les survivants à endurer des catastrophes, des horreurs lovecraftiennes et des monstruosités cyberpunk. Jusqu\'où irez-vous pour survivre ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1481170/header.jpg?t=1745831002', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1244, 0),
(1246, 'Coridden', 'Devenez les bêtes que vous terrassez dans ce RPG débordant d\'action ! Équipez et améliorez vos formes humaine et bestiale et transformez-vous n’importe quand. Partez en solo ou en co-op à la découverte des secrets d’une cité légendaire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1656930/7968c8c187253e43cb66100ec8ec4328edd806f2/header_alt_assets_2.jpg?t=1745831973', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1245, 0),
(1247, 'Firmament', 'Firmament est un nouveau jeu d’énigmes et d’aventure créé par le légendaire studio derrière les meilleurs vendeurs Myst et Riven. Avec sa narration et son univers détaillés, découvrez l’histoire de ce monde semble-t-il abandonné en explorant et en élucidant les mystères de trois royaumes uniques.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/754890/header.jpg?t=1730853629', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1246, 0),
(1248, 'Darkwater', 'Darkwater est un jeu d\'extraction d\'horreur coopératif pour 1 à 4 joueurs. Commandez un sous-marin piégé sous la glace d\'une lune inconnue. Combattez des vaisseaux ennemis et des abominations des profondeurs sous-marines tout en cherchant des ressources. Faites tout ce qu\'il faut pour survivre.', 'https://cfinder.xyz/uploads/Darkwater.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1247, 0),
(1249, 'Call of Duty®: Ghosts', 'Dépassés et débordés, mais pas encore vaincus.Call of Duty®: Ghosts représente une avancée extraordinaire pour l\'une des franchises de divertissement les plus importantes de tous les temps. Ce nouveau chapitre de Call of Duty® offre une dynamique inédite où les joueurs se rallient à un pays en ruine qui se bat, non pas pour la liberté,...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/209160/header.jpg?t=1654830036', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1248, 0),
(1250, 'The Rise of the Golden Idol', 'La saga d\'enquête plébiscitée par la critique est de retour. Plongez dans les années 1970 pour percer le secret de 20 affaires étranges mêlant crime, mort et dépravation. Le monde a changé du tout au tout... mais les péchés de l\'humanité sont restés les mêmes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2716400/header.jpg?t=1738770402', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1249, 0),
(1251, 'The Wardrobe - Even Better Edition', 'Inspiré des grands classiques des années 90 comme «Monkey Island», «Day of the Tentacle», «Sam & Max: Hit the Road» et «Tony Tough», «The Wardrobe» est un jeu plein d\'humour, qui n\'hésite pas à traiter de thèmes sérieux et non politiquement corrects.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/497730/header.jpg?t=1599213481', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1250, 0),
(1252, 'Artisan TD', 'Artisan TD est un Tower Défense orienté casse-tête où vous devrez survivre en construisant des labyrinthes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2224640/header.jpg?t=1739892923', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1251, 0),
(1253, 'RATSHAKER™', 'RATSHAKER™ est une solution amusante et insolite pour régler tous vos problèmes de nuisibles ! Tenez bien votre RAT, secouez-le vigoureusement et regardez vos soucis s\'envoler ! Jusqu\'où irez-vous ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3290710/header.jpg?t=1745490585', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1252, 0),
(1254, 'PRIM', 'PRIM est un jeu d\'aventure mignon et plein d\'humour noir. À la mort de sa mère, Prim découvre qu\'elle est la fille de Mort et qu\'elle doit vivre avec son père. Mais celui-ci a des règles strictes et lorsque Prim les enfreint, les choses prennent une tournure fatale. Saurez-vous lui venir en aide ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1510470/header.jpg?t=1743084490', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1253, 0),
(1255, 'Sunset Motel', 'Prêt pour la transformation des chambres négligées ? Veillez à la satisfaction des clients, rénovez les intérieurs, concevez des espaces de divertissement ! Gérez votre motel dans votre propre style et offrez aux voyageurs des expériences inoubliables !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2616140/header.jpg?t=1744992761', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1254, 0),
(1256, 'Clair Obscur: Expedition 33', 'À la tête de l\'Expédition 33, partez éliminer la Peintresse pour que plus jamais elle ne peigne la mort. Explorez un monde rappelant la France de la Belle Époque et affrontez des ennemis uniques dans ce RPG au tour par tour avec mécaniques de temps réel.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1903340/be3305b02d4db0dffa3458537118423bf2792d7e/header.jpg?t=1745488664', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', NULL, 1255, 0),
(1257, 'Class of \'09', 'This is the anti-visual novel. Instead of playing as some guy magically able to score with beautiful anime girls, YOU play the anime girl and create mass chaos in the lives of your potential \"suitors\". Earnest comedy, social accuracy, and late 2000\'s aesthetic await you in Class of \'09!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1443200/header.jpg?t=1707532149', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1256, 0),
(1258, 'Yarimono', 'The protagonist\'s life takes a turn after their partner Yarimon learns the ultra-invincible move, the \"Cheat Tackle\". While challenging various trainers to participate in the Yarimon tournament, the protagonist unexpectedly discovers the secrets of this world.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2696050/header.jpg?t=1742889432', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1257, 0),
(1259, 'BAKERU', 'Bakeru\'s adventure begins in this Japan-esque Wild Action Game!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2969380/header.jpg?t=1738230147', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1258, 0),
(1260, 'SNK VS. CAPCOM SVC CHAOS', 'Les combattants légendaires de séries de jeux de combat SNK et CAPCOM sont prêts à en découdre ! SVC CHAOS, hit des arcades sorti en 2003, revient dans une version améliorée !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2442380/header.jpg?t=1721504892', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1259, 0),
(1261, 'Urban Myth Dissolution Center', 'Faites équipe avec le directeur du Centre de dissolution des légendes urbaines et élucidez diverses affaires impliquant objets maudits, lieux hantés, dimensions parallèles et bien plus encore dans ce jeu d’aventure aux enquêtes paranormales !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2089600/header.jpg?t=1743570123', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1260, 0),
(1262, 'Afterlove EP', 'From the creator of Coffee Talk and What Comes After, comes a slice-of-life adventure set in modern Jakarta about love, loss and finding your own way forward. Step into the shoes of Rama, a young musician struggling to move on with life after the death of his girlfriend, Cinta.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1599780/header.jpg?t=1739615553', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:32', '2025-09-09 15:30:13', 1, 1261, 0),
(1263, 'Nunholy', 'Dans un monde envahi par les vampires, un groupe de religieuses avec leurs propres histoires est arrivé à la Guilde des Chasseurs. Elles sont prêtes à utiliser n\'importe quel pouvoir, même celui des démons, pour vaincre leurs ennemis. Quel sort les attend lors de ce dangereux périple?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2854740/header.jpg?t=1742485802', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1262, 0),
(1264, 'KitHack Model Club', 'Développé par le créateur de Kerbal Space Program et une petite équipe de trois personnes,, KitHack Model Club propose des outils et une liberté illimitée pour vous permettre de créer, construire, explorer et affronter vos adversaires avec des véhicules télécommandés.', 'https://cfinder.xyz/uploads/KitHackModelClub.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1263, 0),
(1265, 'Space for Sale', 'Space for Sale est un jeu d\'immobilier spatial interplanétaire en vue du dessus, qui met l\'accent sur la résolution de problèmes et l\'exploration. En solo ou à deux, c\'est à vous de transformer des terres sauvages et inhabitées en lieux de vie bouillonnants !', 'https://cfinder.xyz/uploads/SpaceforSale.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1264, 0),
(1266, 'The Elder Scrolls IV: Oblivion Remastered', 'Explorez Cyrodiil comme jamais auparavant, grâce à de nouveaux visuels étonnants et un gameplay peaufiné, dans The Elder Scrolls IV: Oblivion™ Remastered.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2623190/a7cee9165bb1bfc092c390c5cff215ce0e381dfc/header.jpg?t=1745345472', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1265, 0),
(1267, 'Entropy Survivors', 'Entropy Survivors est un jeu de type roguelike où vous dirigez simultanément un redoutable robot et une grenouille reine de la gâchette. Évitez les balles et maîtrisez des capacités innovantes et des armes puissantes. Sauvez l\'univers seul ou jusqu\'à 4 joueurs !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2602030/b8fbc9ce672513ce1a0df3b3fc6bbb1a6ef05025/header_alt_assets_3.jpg?t=1744725315', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 2, 1266, 0),
(1268, '9 Days', 'You have 9 days before the final fight. At your current state, you do not stand a chance! Explore this Open World to gain new skills and abilities for the battle. Choose where you go, what you do carefully. You cannot waste time! You have 9 days.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2075720/header.jpg?t=1745152263', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1267, 0),
(1269, 'Shoulders of Giants: Ultimate', 'Contrôlez en même temps un robot muni d\'une épée et une grenouille à la gâchette facile dans Shoulders of Giants, un roguelike de science-fiction aux couleurs explosives. Jouez solo, avec un ami ou en équipe de quatre personnes, et survivez aux vagues d\'ennemis dans une quête pour sauver la galaxie!', 'https://cfinder.xyz/uploads/ShouldersofGiantsUltimate.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1268, 0),
(1270, 'SENTRY', 'SENTRY est un FPS d\'action-défense où vous protégez votre vaisseau contre des envahisseurs extraterrestres. Planifiez votre itinéraire de fuite à travers un espace hostile et affrontez l\'ennemi dans tout votre vaisseau en tirant profit de pièges et de tourelles, ainsi que de l\'environnement.', 'https://cfinder.xyz/uploads/SENTRY.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1269, 0),
(1271, 'Farm Manager World', 'Plonge-toi dans le monde agricole avec Farm Manager World ! Gère ta propre ferme dans des régions animées du monde, cultive des plantes exotiques et construis ton empire agroalimentaire. L’agriculture durable dans toute sa splendeur.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2206350/c94c360daa28414b8ea491383f5e221fc2883daf/header_alt_assets_1.jpg?t=1745259942', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1270, 0),
(1272, 'Mandragora: Whispers of the Witch Tree', 'Tailladez, brûlez et déchaînez votre rage dans Mandragora, un jeu d\'action et de rôle en 2.5D avec des éléments de type Metroidvania et Souls-like. Allumez votre lanterne maudite, entrez dans le sombre royaume de l\'Entropie et déchirez la réalité.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1721060/header.jpg?t=1745251753', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1271, 0),
(1273, 'Fireworks Simulator', 'Les feux d\'artifice fascinent. Tous les regards sont tournés vers le ciel, la musique démarre, les premiers effets spectaculaires explosent dans le ciel, tous les spectateurs sont émerveillés et on entend les « oh » et les « ah » de la foule.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/323780/header.jpg?t=1654106539', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1272, 0),
(1274, 'Clustertruck', 'Clustertruck is a chaotic physics based truckformer. Jump your way through insane levels in a game of \"the floor is lava\" on top of speeding trucks driven by terrible drivers.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/397950/header.jpg?t=1739397318', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1273, 0),
(1275, 'Railroad Corporation 2', 'Les voies ferrées électriques incarnent le progrès. Accédez rapidement au succès dans Railroad Corporation 2. Bâtissez votre société ferroviaire, développez un réseau de rails et de locomotives pour le transport des marchandises et des passagers, et éliminez la concurrence!', 'https://cfinder.xyz/uploads/RailroadCorporation2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1274, 0),
(1276, 'Pushing it! Together - Sisyphus Co-op', 'Un jeu coopératif dans lequel vous devez faire rouler un rocher jusqu\'en haut d\'une montagne avec vos amis, inspiré de l\'ancien mythe de Sisyphe.', 'https://cfinder.xyz/uploads/PushingitTogether-SisyphusCo-op.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1275, 0),
(1277, 'Thrive: Heavy Lies The Crown', 'Prospérité : Lourde est la couronne est un city-builder complexe, où le destin de votre royaume dépend de chacune de vos décisions. Explorez cette contrée médiévale en solo ou avec des amis, faites face à des choix cornéliens et terrassez vos ennemis lors de combat RTS.', 'https://cfinder.xyz/uploads/ThriveHeavyLiesTheCrown.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1276, 0),
(1278, 'Batman: Arkham Asylum Game of the Year Edition', 'Soyez Batman et affrontez les super-vilains de Gotham City. Parcourez l\'asile d\'Arkham et son île terrifiante.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/35140/header.jpg?t=1739318487', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 2, 1277, 0),
(1279, 'Kart Racing Pro', 'Kart Racing Pro is a realistic karting simulator. The aim is to create a software useful as a training tool for real drivers, based on a scratch built physics engine that accurately simulates kart dynamics and setup options.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/415600/header.jpg?t=1594311317', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1278, 0),
(1280, 'The Sims™ 3', 'Nouveau contenu pour The Sims 3 maintenant disponible !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/47890/header.jpg?t=1738703889', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1279, 0),
(1281, 'Dreamcore', 'Plongez dans Dreamcore, un jeu d\'horreur psychologique en caméra corporelle qui vous transporte dans la beauté étrange des \"espaces liminaux\". Explorez des mondes non linéaires et dévoilez leurs secrets. Pouvez-vous découvrir ce qui se cache au-delà des limites de la réalité ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2453060/header.jpg?t=1741978327', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1280, 0),
(1282, 'Frostpunk 2', 'Développez et élargissez votre ville dans un jeu de survie qui se déroule 30 ans après qu\'un blizzard apocalyptique a ravagé la Terre. Dans Frostpunk 2, vous devez affronter les périls d\'un hiver sans fin, mais aussi lutter contre les factions qui vous surveillent dans la Salle du conseil.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1601580/header.jpg?t=1743428688', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1281, 0),
(1283, 'Blue Prince', 'Bienvenue au Mont Holly, où chaque nouveau jour apporte son lot de mystères. Explorez des pièces qui changent constamment de place dans un dédale de couloirs au cours de ce jeu mêlant stratégie et réflexion. Votre improbable chemin vous mènera-t-il jusqu\'à la mystérieuse chambre 46 ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1569580/header.jpg?t=1744394425', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', NULL, 1282, 0),
(1284, 'The Sinking City', 'Les années 20, sur la côte est des États-Unis. À demi submergée, la ville d’Oakmont est sous l’emprise de puissances surnaturelles. Vous êtes un investigateur et vous cherchez à faire la vérité sur ce qui a pris possession des lieux et corrompt l\'esprit des habitants... ainsi que le vôtre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/750130/header.jpg?t=1730838204', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1283, 0),
(1285, 'HARVESTELLA', 'HARVESTELLA, un RPG de simulation de vie inédit signé SQUARE ENIX ! Vivez en autarcie dans votre maison colorée servant de base d\'opérations, et coopérez avec vos alliés pour surmonter divers obstacles.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1816300/header.jpg?t=1684729971', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1284, 0),
(1286, 'BRAVELY DEFAULT II', 'Un nouveau volet de la série Bravely ! Quatre nouveaux héros de la lumière, un nouveau monde et une nouvelle histoire !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1446650/header.jpg?t=1725001894', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1285, 0),
(1287, 'Riven', 'Découvrez une histoire mêlant intrigue et trahison dans une civilisation au bord de l’effondrement ; vous devrez résoudre des énigmes épineuses pour lever le voile sur les secrets de Riven. Entièrement conçu pour enrichir le jeu primé d’origine, sorti en 1997.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1712350/header.jpg?t=1734757473', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1286, 0),
(1288, 'DRAGON QUEST MONSTERS : Le Prince des ombres', 'DRAGON QUEST MONSTERS : Le Prince des ombres arrive sur Steam® ! Recrutez des monstres de la série DQ, synthétisez de nouvelles créatures et constituez votre équipe idéale.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2175540/header_french.jpg?t=1730958188', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1287, 0),
(1289, 'Forever Skies', 'Un jeu post-apocalyptique de survie en vue subjective, sur une Terre ravagée par un drame écologique. En solo ou avec jusqu\'à 3 amis, construisez et améliorez un dirigeable futuriste. Traquez des ressources, fabriquez des outils et bravez la surface pour trouver le remède qui sauvera l\'humanité.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1641960/1dfc0c309e79b702577963629269d92228bff86a/header_alt_assets_3_french.jpg?t=1744728559', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1288, 0),
(1290, 'Supercar Collection Simulator', 'Crée ta propre boutique de diecasts ! Déballes des packs de voitures surprises, développe ta collection, participe à des courses excitantes avec des clients sur les circuits et joue à des jeux d\'échange en ligne. Un monde rempli de vitesse et d\'excitation t\'attend dans ta boutique !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3453600/header.jpg?t=1744650224', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1289, 0),
(1291, 'Killer Frequency', 'Killer Frequency est un puzzle game d’horreur à la première personne se déroulant en 1987. Incarnez Forrest Nash, un animateur de radio nocturne dans une petite ville américaine, dont les interlocuteurs téléphoniques sont pourchassés par un tueur mystérieux.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1903620/header.jpg?t=1741368212', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1290, 0),
(1292, 'Photoshop 2025', 'Adobe Photoshop est un puissant logiciel de retouche photo qui vous permet de créer, retoucher et remixer vos photos.', 'https://filecr.com/_next/image/?url=https%3A%2F%2Fmedia.imgcdn.org%2Frepo%2F2023%2F03%2Fadobe-photoshop%2F6719e44b28598-adobe-photoshop-screenshot1.webp&w=1080&q=75', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', NULL, 1291, 0),
(1293, 'Computer Tycoon', 'Computer Tycoon is a fairly complex Business Grand Strategy game about Computer Evolution. Start in the 70s, invent until 2034, create the best computer systems, upgrade your infrastructure, lead a team, and alter computer history! It is time to \"Think Different\"', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/686680/header.jpg?t=1738055235', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1292, 0),
(1294, 'Neighbors: Suburban Warfare', 'Affrontez vos voisins dans une bataille coopérative en ligne pleine d\'action et de chaos. Formez une équipe de résidents, attaquez la maison de vos rivaux avec des objets loufoques, et déployez des pièges sournois pour défendre la vôtre. Quelle maison survivra pour régner sur le quartier?', 'https://cfinder.xyz/uploads/NeighborsSuburbanWarfare.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 2, 1293, 0),
(1295, 'Mechabellum', 'Découvrez Mechabellum, un jeu de guerre tactique satisfaisant, où vous triompherez en faisant preuve de stratégie et d\'adaptation. Affrontez d\'autres joueurs ou l\'IA avec votre armée de méchas, personnalisez-la et déployez-la stratégiquement pour ne faire qu\'une bouchée de vos adversaires.', 'https://cfinder.xyz/uploads/Mechabellum.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1294, 0),
(1296, 'Emissary Zero', 'Horreur en coopération (1 à 4 joueurs). Vous êtes envoyé explorer un bâtiment mystérieux la nuit. Trouvez la Lune et essayez de revenir en vie.', 'https://cfinder.xyz/uploads/EmissaryZero.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', NULL, 1295, 0),
(1297, 'RuneScape: Dragonwilds', 'Sur Ashenfall, le continent oublié de RuneScape, les dragons se sont réveillés. Récoltez, bâtissez et fabriquez pour progresser dans ce jeu de survie coopératif (1-4). Maîtrisez l\'art de la survie et percez des secrets immémoriaux pour terrasser la Reine des dragons, en solo ou avec vos alliés.', 'https://cfinder.xyz/uploads/RuneScapeDragonwilds.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', NULL, 1296, 0),
(1298, 'Lost Lullabies: The Orphanage Chronicles', '\"Lost Lullabies\" est un jeu d\'horreur en coopération (co-op) se déroulant en 1980, inspiré par les histoires réelles d\'un orphelinat ruiné par un incendie dans le Lowell de 1960. Jouable de 1 à 4 joueurs, le but est d\'identifier et d\'expulser des esprits malveillants, seul ou en équipe.', 'https://cfinder.xyz/uploads/LostLullabiesTheOrphanageChronicles.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', NULL, 1297, 0),
(1299, 'Dead Age 2: The Zombie Survival RPG', 'Le JDR de survie indépendant \"Dead Age\" à succès est de retour avec une vengeance ! Aucun autre jeu n\'offre ce mélange tout-en-un de jeu de rôle, de combat au tour par tour rapide et de survie. Notre jeu est inspiré de Darkest Dungeon, Fallout, This War of Mine et Walking Dead.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/951430/header.jpg?t=1741247968', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', NULL, 1298, 0),
(1300, 'Titanfall­™', 'Plongez au coeur de combats fluides et frénétiques, où vous pouvez librement incarner des pilotes d\'assaut d\'élite ou de gigantesques Titans aussi agiles que robustes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1454890/header.jpg?t=1638381599', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1299, 0),
(1301, 'Tales of Graces f Remastered', 'Tales of Graces™f est de retour dans une version plus somptueuse et facile à jouer que jamais ! Elle inclut Lignée & Héritage, un épilogue au scénario principal ! La lame étincelante ouvre de nouveau un chemin vers le futur...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2530980/header.jpg?t=1739758056', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1300, 0),
(1302, 'Enotria: The Last Song', 'Enotria: The Last Song est un jeu d\'action-RPG Souls-like ayant pour cadre un splendide univers baigné de soleil inspiré par le folklore italien. Changez de rôle, affrontez des ennemis formidables et modifiez la réalité grâce au pouvoir d\'Ardore afin de révéler les secrets d\'Enotria !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2102450/header.jpg?t=1730220222', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1301, 0),
(1303, 'AI LIMIT', 'In the distant future when civilization is on the verge of extinction, people follow the legend of the Elysium in the last city, Havenswell. In this post-apocalyptic wasteland sci-fi ARPG, you will play as Arrisa, a Blader with immortality, and explore the city ruin to find the hope of a new life.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2407270/header.jpg?t=1743290781', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1302, 0),
(1304, 'Into the Dead: Our Darkest Days', 'Texas, 1980. Walton City est tombée face à une épidémie zombie. Récupérez, fabriquez et combattez sans cesse pour survivre et mener un groupe de survivants désespérés de refuge en refuge. Planifiez soigneusement, restez soudés et, surtout, ne vous arrêtez jamais si vous voulez en sortir vivants.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2239710/header.jpg?t=1744264546', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1303, 0),
(1305, 'Commandos: Origins', 'ALERTE ! Vous participez à une mission où se joue l\'avenir du monde entier. Assistez aux tout débuts des forces d\'élite légendaires de la Seconde Guerre mondiale dans Commandos: Origins. La très attendue suite de la série Commandos vous ramène aux origines des jeux de stratégie en temps réel.', 'https://cfinder.xyz/uploads/CommandosOrigins.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1304, 0),
(1306, 'Gedonia 2', 'Gedonia 2 is an online coop RPG, which allows up to 4 players to freely explore living open world and build absolutely unique characters. An expanded and improved sequel for RPG Gedonia.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2566340/header.jpg?t=1744203559', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1305, 0),
(1307, 'Monster Energy Supercross 25 - The Official Video Game', 'Préparez-vous à un nouveau départ avec la saison 2025, ses pistes et pilotes officiels, un gameplay renouvelé grâce à Unreal Engine 5 et bien plus !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2581370/header.jpg?t=1744363613', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1306, 0),
(1308, 'Endzone 2', 'Endzone 2 est un jeu de gestion de colonie post-apocalyptique, dans lequel vous devrez assurer la survie de l\'humanité après une catastrophe qui a tout détruit. Explorez les dernières terres habitables. La survie de votre peuple dépendra de votre prévoyance et de votre persévérance.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2144640/header.jpg?t=1743607189', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1307, 0),
(1309, 'The Talos Principle: Reawakened', 'Découvrez ou redécouvrez The Talos Principle: Reawakened, ce chef-d\'œuvre à la première personne rempli d\'énigmes ardues, d\'intrigues philosophiques et de visuels époustouflants, destiné tant aux nouveaux joueurs qu\'aux fans de longue date.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2806640/header.jpg?t=1744301611', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1308, 0),
(1310, 'Sixtar Gate: STARTRAIL', 'Sixtar Gate: STARTRAIL is a rhythm game for keyboard set against a space exploration backdrop. Captain your science vessel alongside your navigator Shii as you explore the vast Sixtar system!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1802720/header.jpg?t=1741223764', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1309, 0),
(1311, 'Burden of Command™', 'Can you lead? Burden of Command is an emotionally authentic tactical leadership RPG. You’re a company Captain in the historical Cottonbalers. Fighting psychology as much as bullets, you must build respect, trust, and battlefield experience to bring your brothers safely home.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/887490/header.jpg?t=1744131633', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1310, 0),
(1312, 'X-Plane 12', 'Ultra-Realistic Flight Simulation', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2014780/header.jpg?t=1736770770', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', 1, 1311, 0),
(1313, 'Monster Care Simulator', 'Gérez un centre de soins pour adorables monstres dans Monster Care Simulator ! Soignez les créatures des clients, faites éclore des œufs, élevez vos propres compagnons et amusez-les. Engagez du personnel, agrandissez votre centre et personnalisez votre espace !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3288270/header.jpg?t=1744218781', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', NULL, 1312, 0),
(1314, 'STORROR Parkour Pro', 'Escape Reality. The ultimate multiplayer parkour experience. Escape, race, and explore the streets and rooftops of London’s Isle of Dogs. Join team STORROR to save your estate, or challenge your friends to test their skills. STORROR Parkour Pro is complete control and freedom of movement.', 'https://cfinder.xyz/uploads/STORRORParkourPro.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', NULL, 1313, 0),
(1315, 'SketchUp Pro', 'SketchUp Pro – L’outil de modélisation 3D par excellence\r\n\r\nSketchUp Pro est un logiciel de modélisation 3D professionnel reconnu pour sa simplicité d’utilisation, sa puissance et sa flexibilité. Que vous soyez architecte, designer d’intérieur, urbaniste, constructeur ou maquettiste, SketchUp Pro vous permet de donner vie à vos idées avec précision et rapidité.\r\n\r\nGrâce à son interface intuitive, vous pouvez créer des modèles 3D complexes, documenter vos projets avec LayOut, importer/exporter dans de nombreux formats (DWG, DXF, OBJ, STL, etc.) et intégrer facilement vos rendus avec des moteurs comme V-Ray ou Enscape.', 'https://imgs.search.brave.com/sZ1Z8P_RG1MFPQiCQRX5qopdct5kq0Sh03OFiWA1AUo/rs:fit:860:0:0:0/g:ce/aHR0cHM6Ly93d3cu/bWFuYW5kbWFjaGlu/ZS5mci93cC1jb250/ZW50L3VwbG9hZHMv/MjAyMS8wNS9iYWRn/ZS1za2V0Y2h1cC1w/cm8uanBn', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:33', '2025-09-09 15:30:13', NULL, 1314, 0),
(1316, 'Road 96: Mile 0', 'La préquelle de Road 96 ! Jouez Zoé et Kaito là où tout a commencé. Préparez-vous à remettre vos convictions en question !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2095340/header.jpg?t=1725363275', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1315, 0),
(1317, 'Delta Force 1', 'En tant que membre de la Delta Force — l\'unité d\'élite secrète des forces spéciales — le mot \'impossible\' ne fait pas partie de votre vocabulaire. Dans Delta Force, vous allez conduire des missions en silence sur tous les terrains du globe dans toutes les conditions possibles.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/32620/header.jpg?t=1733246315', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1316, 0),
(1318, 'Haste', 'Courez à toute vitesse, élancez-vous dans les airs et maîtrisez vos atterrissages pour avoir une longueur d\'avance sur la fin des temps !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1796470/header.jpg?t=1743674787', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1317, 0),
(1319, 'Diesel Legacy: The Brazen Age', 'Diesel Legacy est un jeu de combat 2 vs 2 dans lequel quatre joueurs s\'affrontent dans le même niveau en même temps. Cette version unique de la formule traditionnelle des jeux de combat apporte un tout nouveau degré de stratégie où la coopération devient la clé du succès.', 'https://cfinder.xyz/uploads/DieselLegacyTheBrazenAge.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1318, 0),
(1320, 'Cafemart Simulator', 'Créez et décorez un café cosy pour servir de délicieux plats et boissons. Ajoutez un supermarché avec des produits frais pour que vos invités profitent d’un repas et fassent leurs courses. Jouez en solo ou en coop avec des amis!', 'https://cfinder.xyz/uploads/CafemartSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1319, 0),
(1321, 'Starground', 'Construisez une usine et partez explorer les donjons seul ou avec des amis. Automatisez la collecte et la fabrication de ressources ou bien aventurez-vous dans des donjons remplis de dangers et de récompenses. Trouvez votre équilibre de jeu idéal car peu importe le chemin l\'histoire vous suivra !', 'https://cfinder.xyz/uploads/Starground.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1320, 0),
(1322, 'The Stone of Madness', 'The Stone of Madness est un jeu d\'infiltration tactique en temps réel dans un monastère espagnol du XVIIIe siècle. Cinq prisonniers allient leurs compétences et ressources pour affronter leurs phobies, repousser la folie, découvrir les mystères du lieu et s\'échapper.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1309710/header.jpg?t=1743087957', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1321, 0),
(1323, 'Automobilista 2', 'Automobilista 2 vous place une fois de plus aux commandes d\'un simulateur de course avancé et diversifié - désormais avec une qualité graphique incroyable, des voitures et des pistes de haut niveau, un système de condition de piste dynamique avancé et un support de réalité virtuelle (VR).', 'https://cfinder.xyz/uploads/Automobilista2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1322, 0),
(1324, 'Vagrus - The Riven Realms', 'Embark on a perilous journey across a realm forsaken by the gods and devastated by an arcane cataclysm. Accompanied by a hardy crew, you must trade, fight, and explore your way to success as the leader of a traveling company in Vagrus, an award-winning turn-based post-apocalyptic fantasy RPG.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/909660/header.jpg?t=1741968336', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1323, 0),
(1325, 'REYNATIS', 'Fantasy meets reality in Shibuya, Tokyo, where magic is something to be feared. In this action RPG, a young wizard seeks freedom through strength, and an officer seeks to control magic and restore order. When their paths cross, a darkness that will transform the world descends.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2738750/header.jpg?t=1743527528', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1324, 0),
(1326, 'Farmer\'s Life', '🌾Libérez le fermier intérieur. 🚜 Plongez dans le charme rustique de la vie rurale dans « Farmer\'s Life », où vous découvrirez la joie et les défis de la vie dans une ferme dynamique. Plantez, cultivez et embrassez un pays vivant dans un vaste monde ouvert.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1137750/header.jpg?t=1742498185', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1325, 0),
(1327, 'Warhammer 40,000: Battlesector', 'Vivez pleinement les explosions assourdissantes et les charges anéantissantes des combats dans Warhammer 40,000: Battlesector, le jeu de guerre et de stratégie au tour par tour qui vous plonge au cœur des champs de bataille du 41e millénaire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1295500/header.jpg?t=1743002579', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1326, 0),
(1328, 'Orcs Must Die! Deathtrap', 'Orcs Must Die! Deathtrap allie combats effrénés à la troisième personne et pose de pièges stratégique. Profitez d\'une rejouabilité sans fin à mesure que votre War Mage devient plus fort grâce à la progression roguelite. Repoussez les hordes d\'orcs implacables en solo ou jusqu\'à 4 joueurs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2273980/b222caaa7b81d347bcd2962c3f593d8428904bbe/header.jpg?t=1742922082', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1327, 0),
(1329, 'KAMITSUBAKI CITY ENSEMBLE', '\"KAMITSUBAKI CITY ENSEMBLE\" is a rhythm game in which AI girls who were awoken after the apocalypse use special song magic to create melodies with you, in an effort to restart the world. How did the destruction happen? Why do these girls exist? All answers will be revealed...when the music stops.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2581050/header.jpg?t=1738177423', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1328, 0),
(1330, 'American Truck Simulator', 'Découvrez les légendaires camions américains et livrez diverses cargaisons à travers la Californie ensoleillée, le Nevada sablonneux et l\'Arizona, l\'État du Grand Canyon. American Truck Simulator vous emmène dans un voyage à travers des paysages à couper le souffle et des monuments emblématiques des États-Unis.', 'https://cfinder.xyz/uploads/AmericanTruckSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1329, 0),
(1331, 'Platypus Adventures', 'An action packed, third person adventure about a Platypus uncovering a cosmic mystery! Explore an epic story based on Australian animals and landscapes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1719550/header.jpg?t=1742713044', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1330, 0),
(1332, 'South of Midnight', 'South of Midnight est le nouveau jeu d\'action-aventure de Compulsion Games. Laissez-vous emporter dans les mythes du Sud profond et affrontez d\'étranges créatures dans ce conte moderne. Maîtrisez un pouvoir de tissage ancestral et surmontez des obstacles pour dévoiler les secrets de votre famille.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1934570/header.jpg?t=1743699640', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1331, 0),
(1333, 'The Last of Us™ Part II Remastered', 'Pour la première fois sur PC, découvrez le titre élu plus de 300 fois Jeu de l\'année. Retrouvez l\'histoire d\'Ellie et d\'Abby avec des améliorations graphiques, des modes de jeu comme l\'expérience de survie roguelike Sans retour, et plus encore.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2531310/header.jpg?t=1743700473', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1332, 0),
(1334, 'Device Doctor Simulator 2024', 'Device Doctor Sim 2024 offre une expérience de simulation interactive et détaillée pour devenir un expert en réparation technologique. Dans cette simulation unique, plongez dans le monde complexe de divers appareils numériques, y compris les smartphones, les tablettes et les montres intelligentes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2850380/header.jpg?t=1742841671', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1333, 0),
(1335, 'Zompiercer', 'Prenez le contrôle du train qui deviendra votre refuge sur les rails. Collectez des ressources, fabriquez du matériel, construisez une maison confortable sur des wagons et voyagez à travers des lieux soigneusement fabriqués à la main pour explorer l\'histoire d\'un monde apocalypse zombie.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1262460/header.jpg?t=1733590945', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1334, 0),
(1336, 'Ambulance Life: A Paramedic Simulator', 'Vouez votre existence à sauver des vies. Dès l’appel d’urgence reçu, foncez avec votre ambulance, sirène hurlante, jusqu’au lieu de l’accident. Appliquez les premiers soins et transportez les blessés graves à l’hôpital. Chaque seconde compte !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1926520/header.jpg?t=1738919341', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1335, 0),
(1337, 'KARMA: The Dark World', 'Le Monde Mystérieux : KARMA Un jeu d\'horreur psychologique à la première personne, qui se déroule à partir d\'une histoire. Le joueur entre dans ce monde étrange et sombre avec l\'agent enquêteur de Roam. Retrouvez les souvenirs perdus et remplissez sa mission.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1376200/header.jpg?t=1743264456', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1336, 0),
(1338, 'Space Engineers 2 Pioneer Edition', 'The Space Engineers 2 Pioneer Edition DLC is an extension package to the Space Engineers 2 game.  It is a special package for early explorers, featuring a breathtaking soundtrack, exclusive content, and the chance to directly support the game’s development.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3365540/header.jpg?t=1738002523', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1337, 0),
(1339, 'Old World', 'Old World est un jeu de stratégie révolutionnaire où vous dirigez une dynastie sur plusieurs générations face à ses rivaux. Déclenchez des guerres, gérez votre cour, fondez votre dynastie... ou regardez votre empire s\'effondrer. Quel héritage laisserez-vous derrière vous ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/597180/header.jpg?t=1743006911', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1338, 0),
(1340, 'Pillars of Eternity', 'Laissez-vous ensorceler par un monde où vos choix et vos actions façonneront votre destinée. Obsidian Entertainment, les développeurs de Fallout: New Vegas™ et de South Park: Le Bâton de la vérité™, en association avec Paradox Interactive, sont très fiers de vous présenter Pillars of Eternity.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/291650/header.jpg?t=1683221851', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1339, 0),
(1341, 'NINJA GAIDEN 2 Black', 'À l\'aide de l\'Unreal Engine 5 qui permet de grandement améliorer l\'expression graphique, nous vous présentons l\'édition définitive de \"NINJA GAIDEN 2\", dotée de personnages jouables supplémentaires et de fonctions de combat améliorées.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3287520/header.jpg?t=1738832031', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1340, 0),
(1342, 'Men of Valor', 'Vietnam, 1965. You are Dean Shepard, a \"cherry\" to the \'Nam with zero war experience other than standard boot camp training at Parris Island, SC. Along with your platoon, you will fight the NVA and the Vietcong in true historic locales and battles.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/411330/header.jpg?t=1562768516', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1341, 0),
(1343, 'TRYP FPV: Drone Racer Simulator', 'Volez librement et perfectionnez vos compétences de pilote FPV sans risque de casse avec des visuels et des sensations de vol hyperréalistes. Que vous soyez débutant ou expert, TRYP FPV est le simulateur nouvelle génération qui vous plonge dans l\'adrénaline pure du drone FPV.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1881200/header.jpg?t=1734558549', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1342, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1344, 'Tainted Grail: The Fall of Avalon', 'Plongez dans une réinterprétation sombre des légendes arthuriennes dans ce RPG en monde ouvert à la première personne. Explorez un monde figé dans un automne éternel, assistez à la chute des légendes et prenez des décisions significatives intégrées dans une histoire complexe et ramifiée.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1466060/3fce43505b3c534649eb25866b414bac9df7f791/header.jpg?t=1743014151', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1343, 0),
(1345, 'inZOI', '« Chaque vie devient une histoire ». Créez votre histoire en guidant/observant les vies de vos Zois. Utilisez les puissants outils d\'inZOI pour créer une vie de rêve, donner vie à des personnages uniques, bâtir de superbes maisons et plonger dans une simulation qui capte les émotions de la vie.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2456740/header.jpg?t=1743141318', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1344, 0),
(1346, 'Red Faction Guerrilla Re-Mars-tered', 'Red Faction: Guerrilla repousse les limites du gameplay basé sur la destruction avec un monde ouvert gigantesque, des combats de guérilla rapides et nerveux, et de l\'authentique démolition basée sur la physique.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/667720/header.jpg?t=1591103504', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1345, 0),
(1347, 'Easy Red 2', 'Infanterie, véhicules blindés, chars d’assaut, canons et avions. Gérez de manière réaliste vos armes et équipements, organisez-vous avec votre escouade, et déplacez-vous avec stratégie sur d’immenses cartes en monde ouvert, entièrement destructibles. Joueur solo, JcJ et en mode coopératif.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1324780/header.jpg?t=1737800535', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1346, 0),
(1348, 'Myst', 'Welcome to Myst: a starkly beautiful island, eerily tinged with mystery and shrouded in intrigue. Built from the ground up to play in 2D & VR, explore Myst in a whole new dimension! Journey to the Ages, unravel puzzles, and be a part of the surrealistic adventure that will become your own.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1255560/header.jpg?t=1734757608', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1347, 0),
(1349, 'Achilles: Legends Untold', 'Préparez-vous pour un RPG d\'action légendaire avec des combats intenses à la Souls. Explorez un monde ouvert, relevez d\'innombrables défis. Améliorez vos compétences, jouez seul ou en mode coopératif en arène. Êtes-vous prêt pour cette aventure inoubliable?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1314000/header.jpg?t=1742822399', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1348, 0),
(1350, 'Arctic Motel Simulator', 'Êtes-vous déjà allé dans l\'Arctique? Vous souhaitez ouvrir un motel dans l’Arctique ? Avec la compagnie des aurores boréales, des blizzards, des jours et des nuits polaires, des forêts vierges et des animaux sauvages, pouvez-vous transformer un motel délabré en un point de repère dans l\'Arctique ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3098470/header.jpg?t=1739278826', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1349, 0),
(1351, 'MechWarrior 5: Clans', 'Dans MECHWARRIOR 5: CLANS, incarnez les pilotes du Smoke Jaguar lors de l\'Invasion des Clans de l\'Inner Sphere. Commandez une escouade « Star » de 5 mechs dans une campagne immersive et complexe. Personnalisez vos BattleMechs avec des technologies avancées et explorez diverses stratégies', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2000890/header.jpg?t=1741891214', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1350, 0),
(1352, 'DRAGON BALL Z: KAKAROT', 'Revivez l\'histoire de Son Goku et des Guerriers Z dans DRAGON BALL Z: KAKAROT ! Au-delà des affrontements épiques, vivez le monde de DRAGON BALL Z, combattez, mangez, pêchez et entraînez-vous avec Son Goku, Son Gohan, Vegeta et les autres.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/851850/header.jpg?t=1740611011', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1351, 0),
(1353, 'Monster Hunter: World', 'Bienvenue dans le Nouveau Monde ! \"Monster Hunter: World\" offre une dimension de jeu et une liberté sans commune mesure avec les précédents épisodes. Les chasseurs pourront utiliser un arsenal varié pour chasser un bestiaire unique dans un monde fabuleux !', 'https://cfinder.xyz/uploads/MonsterHunterWorld.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 2, 1352, 0),
(1354, 'Cookie Clicker', 'Un jeu incrémental à base de confection de cookies ! Publié à l\'origine en 2013 sur le Web, et toujours développé activement depuis. Voici sa version officielle sur Steam.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1454400/header.jpg?t=1739389079', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1353, 0),
(1355, 'Astrometica', 'Astrometica est un jeu amusant sur la survie dans l\'espace. Vous devez utiliser vos compétences et vos outils pour rester en vie. Il y a de nombreux défis à relever, et vous devez vous battre pour survivre. Vous devez également construire une nouvelle base dans l\'espace.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2353250/header.jpg?t=1736854171', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1354, 0),
(1356, 'Squad', 'Squad est un FPS tactique qui offre des expériences de combat authentiques grâce au travail d\'équipe, à la communication et à des combats réalistes. Il comble le fossé entre le shooter arcade et le réalisme militaire avec des batailles à 100 joueurs.', 'https://cfinder.xyz/uploads/Squad.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1355, 0),
(1357, 'Schedule I', 'From small-time dope pusher to kingpin - manufacture and distribute a range of drugs throughout the grungy city of Hyland Point. Expand your empire with properties, businesses, employees and more.', 'https://cfinder.xyz/uploads/ScheduleI.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1356, 0),
(1358, 'Terrorbytes', 'A Lethal Company and Pac-Man inspired game where players are forced to gather pellets for a horrifically mangled retro-arcade hero', 'https://cfinder.xyz/uploads/Terrorbytes.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 2, 1357, 0),
(1359, 'Wreckfest 2', 'Prêt à tout démolir ? Wreckfest revient et vous offre le meilleur de la course où se mêlent carambolages et destruction ! Broyez les véhicules de vos adversaires grâce à un moteur physique grandement amélioré, développé par les créateurs de Wreckfest et FlatOut !', 'https://cfinder.xyz/uploads/Wreckfest2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1358, 0),
(1360, 'Home Sweet Home', 'Home Sweet Home is a first-person horror adventure game based on Thai myths and beliefs. The core gameplay focuses on storytelling and stealth to avoid perilous spirits hunting you. Moreover, few puzzles are added into the game, making gameplay more various.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/617160/header.jpg?t=1544779603', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1359, 0),
(1361, 'Kenshi', 'Un RPG en escouade dans un monde ouvert, avec un gameplay de type sandbox plutôt qu’une histoire linéaire. Vous pourrez y être un marchand, un voleur, un rebelle, un chef de guerre, un aventurier, un fermier, un esclave… ou juste de la nourriture pour cannibales.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/233860/header.jpg?t=1721059338', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 1, 1360, 0),
(1362, 'BlazBlue Entropy Effect', 'Enjoy action-packed flashy combat with incredibly satisfying combos and responsive controls! Numerous characters, each with completely unique playstyles and loads of unlockable moves & upgrades! This action roguelike sets the bar for fluid fast-paced action.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2273430/header.jpg?t=1737400773', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1361, 0),
(1363, 'Project Unknown', 'PROJECT UNKNOWN est un jeu d\'horreur coopératif en ligne de 1 à 4 joueurs avec des personnages jouables uniques et des capacités spéciales. Exorcisez différents fantômes, utilisez une variété d\'outils et plongez-vous dans une expérience pleine de visuels horrifiants et de mécanismes complexes', 'https://cfinder.xyz/uploads/ProjectUnknown.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 2, 1362, 0),
(1364, 'Serious Sam 4', 'Serious Sam 4 signe le retour fracassant de la série de FPS classique dans ce préquel de choc associant arsenal explosif, carnage intergalactique et répliques bien placées.', 'https://cfinder.xyz/uploads/SeriousSam4.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 2, 1363, 0),
(1365, 'Sins of a Solar Empire II', 'Luttez pour la dominance galactique dans ce jeu de stratégie 4X en temps réel à l\'échelle inégalée ! Vous allez explorer, étendre, exploiter et exterminer par la force militaire, la diplomatie, le commerce, la culture, l\'influence et d\'autres tactiques sournoises.', 'https://cfinder.xyz/uploads/SinsofaSolarEmpireII.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', NULL, 1364, 0),
(1366, 'Eden Crafters', 'Embarquez dans une aventure de survie, de craft et d\'automatisation dans Eden Crafters, jeu coopératif en monde ouvert qui vous met au défi de transformer une planète hostile en un refuge pour l\'humanité. Tempérez le climat, créez une atmosphère respirable et des océans : façonnez un nouveau monde !', 'https://cfinder.xyz/uploads/EdenCrafters.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:34', '2025-09-09 15:30:13', 2, 1365, 0),
(1367, 'UNDERWARD', 'UNDERWARD est un jeu coopératif d\'exploration et d\'horreur pour 1 à 4 joueurs. Les enquêteurs doivent transporter des monstres «TEST-SUBJECT» d\'un quartier d\'hôpital abandonné et mortel sous terre.', 'https://cfinder.xyz/uploads/UNDERWARD.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 2, 1366, 0),
(1368, 'The Long Dark', 'The Long Dark est une expérience contemplative de survie et d\'exploration qui met au défi les joueurs solo de penser par eux-mêmes à mesure qu\'ils s\'aventurent sur de vastes étendues sauvages et glacées à la suite d\'un désastre géomagnétique. Ici, pas de zombies : juste vous, le froid et tout ce que Mère Nature peut vous faire subir.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/305620/header.jpg?t=1740091378', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1367, 0),
(1369, 'Way of the Hunter', 'Devenez le nouveau propriétaire d\'un gîte de chasse niché en plein cœur d\'un habitat magnifique où abondent les espèces animales. Explorez de vastes environnements et chassez avec une sélection exceptionnelle d\'armes à feu. Chassez en solo ou avec des amis.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1288320/header.jpg?t=1734530347', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1368, 0),
(1370, 'Steel Division 2', 'Steel Division 2 est un jeu de stratégie en temps réel se déroulant sur le Front de l\'Est durant la Seconde Guerre Mondiale. Il vous permet de commander une armée à l\'échelle 1:1 au tour par tour et sur des batailles en temps réel hautement tactiques avec des milliers d\'hommes sous vos ordres.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/919640/header.jpg?t=1741853146', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1369, 0),
(1371, 'Diplomacy is Not an Option', 'Les hasards de la naissance ont fait de vous un seigneur féodal. Tres bien, n’est-ce pas ? Cependant, dans Diplomacy is Not an Option, votre destin n\'est pas un long fleuve tranquille, car votre château est toujours assiégé. Défendez contre des hordes d\'ennemis et à gagner des batailles homériques.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1272320/header.jpg?t=1741946727', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1370, 0),
(1372, 'KAISERPUNK', 'Construisez votre cité-État dans Kaiserpunk, un city-builder qui entremêle des mécaniques de production fouillées et de grande stratégie mondiale. Gérez votre ville et son industrie, levez une armée et affrontez vos rivaux pour devenir la figure de proue d\'un 20e siècle uchronique.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2012190/bdacd43a303f0dc535e55a3d573637c0aee68334/header_alt_assets_0.jpg?t=1742649342', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1371, 0),
(1373, 'Atelier Yumia : L’Alchimiste des Souvenirs et la Terre Rêvée', 'Atelier Yumia raconte l\'histoire de Yumia et ses compagnons alors qu\'ils font face à leurs souvenirs et tracent la voie en laquelle ils croient. Explorez un monde vaste, construisez-y vos bases et récoltez des ingrédients pour synthétiser des objets.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3123410/header_french.jpg?t=1742518824', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1372, 0),
(1374, 'Songs of Silence', 'Commandez vos armées, rebatissez des royaumes déchus et accédez à la grandeur dans Songs of Silence ! Embarquez pour un voyage épique dans ce monde fantastique infusé d\'Art nouveau, où des batailles féroces ponctuent une histoire captivante.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2195410/header.jpg?t=1742476903', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1373, 0),
(1375, 'F.E.A.R.', 'L\'expérience du jeu original F.E.A.R. avec F.E.A.R. Point d\'Extraction et F.E.A.R. Perseus Mandate.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/21090/header.jpg?t=1681232225', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1374, 0),
(1376, 'UnderRail', 'Underrail is an old school turn-based isometric indie role playing game that focuses on exploration and combat. The game is set in a distant future, when the life on the Earth’s surface has long since been made impossible and the remnants of humanity now dwell in the Underrail, a vast system of metro station-states that, it seems, are...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/250520/header.jpg?t=1728564887', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1375, 0),
(1377, 'Distant Worlds 2', 'Distant Worlds 2 is a vast, pausable real-time 4X space strategy game.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1531540/header.jpg?t=1742484294', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1376, 0),
(1378, 'Total Conflict: Resistance', 'Total Conflict: Resistance est une symbiose unique entre stratégie globale, tactique et action à la première personne. Des batailles de masse réalistes, de nombreux types de véhicules blindés, des armes, des uniformes, des mécanismes uniques, un gameplay gratuit immersif.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1860510/header.jpg?t=1729421467', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1377, 0),
(1379, 'Dark Envoy', 'Menez une équipe de chasseurs de reliques dans une aventure épique se déroulant dans un monde de conflit entre armes à feu et sorcellerie. Expérimentez et pensez hors des sentiers battus pour surmonter les obstacles qui se dressent devant vous.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/945770/108eb549382750b09a6e0cb4d62ae3b05f258e1e/header.jpg?t=1742557993', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', NULL, 1378, 0),
(1380, 'Arms Trade Tycoon: Tanks', 'Arms Trade Tycoon: Tanks is a unique combination of tank design and tycoon game. It puts you in charge of an arms trading company specialized in tanks from WWI to the modern era. Research, design, sell and follow your tanks in battle to make your own history!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1662210/75040f92b295af6cf1ffd8a604e64fd3fd65e70b/header.jpg?t=1742589706', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1379, 0),
(1381, 'Rogue Waters', 'Rogue Waters est un rogue-lite tactique au tour par tour. Incarnez le Capitaine Cutter, commandez votre navire et votre équipage dans des rencontres générées aléatoirement. Recrutez, formez, améliorez l’équipage, utilisez des créatures marines et engagez des combats navals et au corps à corps.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1691190/header.jpg?t=1730902158', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 2, 1380, 0),
(1382, 'Bears In Space', 'Libérez l\'ourse qui sommeille en vous dans ce FPS où les balles fusent ! Dans cette aventure rétrofuturiste déjantée, affrontez des robots avec un arsenal monstrueux. Changez-vous en ours, utilisez vos pouvoirs et savourez l\'action rythmée de Bears in Space !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1309620/header.jpg?t=1726660017', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 2, 1381, 0),
(1383, 'Still Joking', 'What do mirror reflections do once they have no one to repeat after anymore? Play as Iris, quite a sarcastic reflection torn between the urge to unravel the mystery of death of her “prototype” and the need to find her place in a mirrored world.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2147330/header.jpg?t=1720465060', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1382, 0),
(1384, 'SpaceBourne 2', 'Embark on a journey to greatness. Get ready for adrenaline-fueled battles and a chance to claim your place in the galaxy. Grab the controls of your ship, gear up for the fight, and unleash your ambition to conquer and build a new empire in the vastness of space.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1646850/header.jpg?t=1725002721', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1383, 0),
(1385, 'Dungeons 4', 'Le Mal absolu et sa fidèle *tousse* servante, Thalya l\'elfe sombre, reviennent dans Dungeons 4 après les événements de son fabuleux prédécesseur, pour triompher une fois de plus des forces du bien.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1643310/header.jpg?t=1733908259', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1384, 0),
(1386, 'WWE 2K18', 'REMARQUE : Les serveurs multijoueur de WWE 2K18 seront fermés à partir du 30/06/2022. Après cette date, toutes les fonctions du jeu nécessitant des serveurs en ligne ne seront plus disponibles.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/664430/header.jpg?t=1657748285', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1385, 0),
(1387, 'SPY×ANYA: Operation Memories', 'Anya Forger doit créer un journal photo ! Faites-vous des tas de souvenirs à l\'école et dans plein d\'autres lieux géniaux. Découvrez plus de 15 minijeux inspirés du célèbre manga ! Pourrez-vous aider Anya à remplir son journal ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2170370/header.jpg?t=1724267894', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1386, 0),
(1388, 'DIRT 5', 'Repoussez les limites dans DIRT 5 - la plus ambitieuse expérience de course automobile hors piste à ce jour, avec un mode Carrière rempli de stars, un mode écran partagé à quatre joueurs, des modes de jeux en ligne uniques, un éditeur de livrée et bien plus !', 'https://cfinder.xyz/uploads/DIRT5.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', NULL, 1387, 0),
(1389, 'Fabled Lands - The Serpent King\'s Domain', 'Navigate through the dense, trap-filled jungles, ascend the unexplored Plateau of Dragons, unravel the haunts of Tarshesh, and challenge the immortal Serpent King. Beyond the treacherous seas, discover mysterious islands and seek fortune among the perilous ports of Ankon-Konu.', 'https://cfinder.xyz/uploads/FabledLands-TheSerpentKingsDomain.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', NULL, 1388, 0),
(1390, 'Aloft', 'Envolez-vous dans Aloft, le jeu de survie en coop dans un monde bac à sable d\'îles flottantes. Transformez une île en navire céleste, votre nid douillet dans les nuages. Retrouvez un savoir perdu, remédiez à la corruption fongique, et bravez l\'ouragan pour restaurer l\'écosystème.', 'https://cfinder.xyz/uploads/Aloft.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 2, 1389, 0),
(1391, 'UNDER NIGHT IN-BIRTH II Sys:Celes', 'La suite officielle du jeu de combat 2D de style animé contemporain Under Night In-Birth ! Des graphismes et un système de combat améliorés ! Découvrez l\'apogée finale de la Hollow Night. Une expérience unique mêlant combats stratégiques, coups spéciaux stylés et lutte chronometrée pour le pouvoir!', 'https://cfinder.xyz/uploads/UNDERNIGHTIN-BIRTHIISysCeles.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', NULL, 1390, 0),
(1392, 'A Quiet Place: The Road Ahead', 'A quiet place : the road ahead est un jeu d’horreur et d’aventure en solo inspiré par la franchise à succès du film éponyme. Survivez en silence.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2233120/header.jpg?t=1736876506', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1391, 0),
(1393, 'BLEACH Rebirth of Souls', 'Éveillez le guerrier en vous et changez votre destin dans BLEACH Rebirth of Souls ! Participez à des combats palpitants avec les personnages et pouvoirs emblématiques du manga légendaire.', 'https://cfinder.xyz/uploads/BLEACHRebirthofSouls.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 2, 1392, 0),
(1394, 'Grand Theft Auto V Enhanced', 'Découvrez Grand Theft Auto V et Grand Theft Auto Online, les blockbusters incontournables, améliorés pour une nouvelle génération avec des graphismes exceptionnels, un temps de chargement accéléré, un audio 3D et plus, ainsi que du contenu exclusif pour les joueurs de GTA Online.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3240220/header_french.jpg?t=1741381848', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', NULL, 1393, 0),
(1395, 'ORDER 13', 'Vous vous réveillez dans un entrepôt sombre, chargé d\'emballer des commandes tandis que quelque chose se cache dans l\'ombre. Travaillez vite, soyez prudent et protégez votre chat. Il est tout ce que vous avez.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2259310/4b116c0e73e060141d3fe899f01b383c561718ef/header.jpg?t=1741784383', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1394, 0),
(1396, 'Dragon\'s Dogma 2', 'Dragon\'s Dogma 2 est un RPG action en solo à l\'histoire riche, qui invite les joueurs à définir leur expérience, de l\'apparence de leur Insurgé, à leur classe, leur groupe, la façon dont ils approchent les différentes situations, et plus encore, cela dans un monde de fantasy captivant.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2054970/header.jpg?t=1732148252', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1395, 0),
(1397, 'Streamlands: Defense', 'A low-poly Tower Defense game inspired by World War I and II, in an original universe.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3465180/header.jpg?t=1742226930', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1396, 0),
(1398, 'Tile Tales: Pirate', 'Solve tile-based puzzles while following the journey of a mischievous pirate as he plunders his way across a mysterious island in search of the ultimate treasure!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2983520/header.jpg?t=1742317812', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 2, 1397, 0),
(1399, 'Corner Kitchen Fast Food Simulator', 'Gérez votre propre restaurant de fast-food ! Achetez des équipements de cuisine, préparez de délicieux plats et servez des clients affamés. Améliorez vos installations, lisez les avis des clients et développez votre entreprise pour devenir le meilleur fast-food de la ville.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3357250/header.jpg?t=1741788833', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1398, 0),
(1400, 'Spiritfarer®: édition Farewell', 'Spiritfarer® est un jeu de gestion cosy sur le thème de la mort, dans lequel vous incarnez une passeuse d’âmes. Construisez un bateau pour explorer le monde, prenez soin de vos esprits et guidez-les au jusqu’à l’au-delà. Inclut le jeu de base émouvant et trois mises à jour de contenu majeures.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/972660/header_french.jpg?t=1729618510', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1399, 0),
(1401, 'House of Golf 2', 'Découvrez l\'ultime duel de golf dans House of Golf 2 ! Conquérez plus de 100 trous uniques avec jusqu\'à 4 joueurs lors de sessions animées sur le canapé. Montrez vos talents, participez à des tournois en direct palpitants et remportez des récompenses exclusives. Préparez-vous à dominer le green !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2914390/header.jpg?t=1736251587', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1400, 0),
(1402, 'Remnant II® - The Dark Horizon', 'En retournant sur N\'Erud, vous découvrez une section du vaisseau mystérieusement préservée, où des cultures extraterrestres sont entretenues par une armée de robots afin de nourrir des habitants depuis longtemps disparus.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2384075/header.jpg?t=1727193577', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1401, 0),
(1403, 'World War Z: Sin City Apocalypse Episode', 'Un nouvel épisode de l\'histoire se déroulant à Las Vegas et mettant en scène de nouveaux survivants qui combattent les zékés dans le casino et ailleurs !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3245120/header.jpg?t=1733741601', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:35', '2025-09-09 15:30:13', 1, 1402, 0),
(1404, 'Sid Meier’s Civilization® VI', 'Repoussez les frontières de votre empire, développez votre patrimoine culturel et affrontez les plus grands seigneurs de l\'histoire. Votre civilisation tiendra-t-elle face aux ravages du temps ?', 'https://cfinder.xyz/uploads/SidMeiersCivilizationVI.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1403, 0),
(1405, 'Kingdom Rush Vengeance - Tower Defense', 'L\'heure de la vengeance a sonné ! Faites trembler le Royaume avec votre puissante armée ! Affrontez des ennemis féroces et des boss. Bâtissez des tours redoutables, choisissez votre arsenal et trouvez les combinaisons destructrices. Entraînez des héros légendaires et menez-les vers la victoire !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1367550/header.jpg?t=1739448279', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1404, 0),
(1406, 'Ale & Tale Tavern', 'Un mélange épatant de genres : un simulateur co-op de gestion de taverne dans un monde ouvert de fantasy où vous pouvez combattre, pêcher, chasser, explorer, vous amuser et faire diverses quêtes. Et bien entendu, vous pouvez CUISINER ! Jouez en solo ou avec des amis, et nourrissez le monde entier !', 'https://cfinder.xyz/uploads/AleTaleTavern.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1405, 0),
(1407, 'LEGO® Star Wars™ III - The Clone Wars™', 'LEGO Star Wars III: The Clone Wars va permettre aux fans d\'explorer la galaxie Star Wars en toute liberté, tout en s\'amusant dans le jeu LEGO le plus drôle, le plus accessible et le plus riche en action à ce jour !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/32510/header.jpg?t=1699053866', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1406, 0),
(1408, 'Towers of Aghasba', 'Explorez un monde peuplé de créatures majestueuses et de personnages excentriques. Ravivez des terres flétries, construisez une civilisation en harmonie avec la nature et invitez des amis en mode coopératif pour créer, récolter et vous détendre ensemble.', 'https://cfinder.xyz/uploads/TowersofAghasba.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1407, 0),
(1409, 'FEZ', 'Gomez est une créature 2D vivant dans un monde 2D. Enfin, c\'est ce qu\'il croit... Quand il découvre l\'existence d\'une mystérieuse troisième dimension, Gomez se lance dans une aventure qui le mènera aux confins du temps et de l\'espace. Utilise ta capacité à te déplacer dans des structures 3D à partir de 4 perspectives 2D classiques.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/224760/header.jpg?t=1572375251', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1408, 0),
(1410, 'Cheaters Cheetah', 'Tout le monde a de VRAIS cheats dans ce shooter multijoueur. Utilise les wallhacks et les aimbots à ton avantage pour dominer les autres tricheurs. Le vainqueur pourra BANNIR tous les perdants', 'https://cfinder.xyz/uploads/CheatersCheetah.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1409, 0),
(1411, 'Rise of the Ronin', 'Embarquez dans un voyage épique pendant la période Bakumatsu dans ce RPG à monde ouvert de Team NINJA, le studio à l\'origine de Nioh et NINJA GAIDEN.', 'https://cfinder.xyz/uploads/RiseoftheRonin.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1410, 0),
(1412, 'Machinika: Atlas', 'Machinika : Atlas est un jeu de puzzle indépendant et la suite directe de Machinika : Museum. Vous incarnez un chercheur de musée qui vient d\'atterrir sur Atlas. Saurez-vous percer les mystères du vaisseau extraterrestre ? Résolvez des énigmes pour découvrir ce qu\'il s\'est passé !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2817620/header.jpg?t=1726735734', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1411, 0),
(1413, 'Zoochosis', 'Zoochosis est un jeu de simulation d\'horreur avec caméra piéton. Vous êtes gardien de zoo de nuit. Identifiez les animaux mutants infectés, fabriquez un vaccin et guérissez-les. Allez-vous tous les sauver et survivre?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2458560/header.jpg?t=1737726879', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1412, 0),
(1414, 'Zardy\'s Cave', 'Beneath the farm something terrible awaits. You fell down a giant hole into a dark world full of terrifying scarecrows and monsters. Now you must make your way through the tunnels deep underground while watching your back. Solve puzzles, find tools, and most importantly… Stay alive!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2079980/header.jpg?t=1732125606', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1413, 0),
(1415, 'Slime Heroes', 'Enfin un jeu où les slimes sont les héros ! Jouez avec vos amis en incarnant d\'adorables slimes, seules créatures capables de sauver le monde d\'une mystérieuse corruption. Utilisez différentes armes et créez vos propres capacités magiques de manière à donner vous-même forme à votre aventure !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1511880/header.jpg?t=1741278138', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1414, 0),
(1416, 'Devilated', 'Devilated est un RPG de tir ultraviolent à l\'ancienne, dans lequel vous serez amené à brutaliser et à cannibaliser vos ennemis démoniaques. Mangez-les avant qu\'ils ne vous mangent.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/570950/header.jpg?t=1737532415', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1415, 0),
(1417, 'Svarog\'s Dream', 'Awaken as a soul from the Underworld. Discover who you are and explore an ever-changing open world full of mystery. Battle beasts and gods, or forge alliances with them. Die and be reborn in this adventure.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2004640/header.jpg?t=1736417374', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1416, 0),
(1418, 'WWE 2K25', 'Feiere The Bloodline im Showcase. Tritt online in Mein GM an. Erweitertes Gameplay mit Intergender-Wrestling, Kettenwrestling, Sprüngen von den Absperrungen, die Rückkehr von Promos & mehr!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2878960/header.jpg?t=1741371282', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1417, 0),
(1419, 'Split Fiction', 'Vivez des moments inoubliables en explorant les différents mondes de Split Fiction, un jeu d\'aventure en coopération qui repousse les limites du genre.', 'https://cfinder.xyz/uploads/SplitFiction.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1418, 0),
(1420, 'Shadowveil: Legend of The Five Rings', 'La stratégie mêlée à la progression roguelite de type RPG offre une aventure épique, dans l’univers de la Légende des Cinq Anneaux. Débloquez des cartes puissantes, formez une faction de samouraïs et menez-les dans l’Outremonde, où leur destin repose sur vos choix.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2536960/header.jpg?t=1741107558', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1419, 0),
(1421, 'R.E.P.O.', 'An online co-op horror game with up to 6 players. Locate valuable, fully physics-based objects and handle them with care as you retrieve and extract to satisfy your creator\'s desires.', 'https://cfinder.xyz/uploads/REPO.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1420, 0),
(1422, 'X4: Foundations', 'X4: FOUNDATIONS, la suite longuement attendue de la série X apporte la SIMULATION d\'un univers la plus sophistiquée à ce jour. Gérez un empire ou EXPLOREZ l\'espace en personne. Pilotez tous les vaisseaux, COMMERCEZ et COMBATTEZ pour CONSTRUIRE votre empire avec des stations modulaires et RÉFLECHISSEZ soigneusement avant d\'embarquer pour...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/392160/header_alt_assets_2.jpg?t=1740085754', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1421, 0),
(1423, 'Visions of Mana', 'Vivez une grande aventure dans un monde rempli d\'esprits avec le dernier action-RPG de la série des Mana !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2490990/header.jpg?t=1740474763', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1422, 0),
(1424, 'FRONT MISSION 1st: Remake', 'FRONT MISSION 1st: Remake est un RPG immersif aux combats tactiques au tour par tour, qui vous met aux commandes d\'impressionnantes machines militaires nommées wanzers.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2399730/header.jpg?t=1728550756', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1423, 0),
(1425, 'Darkest Dungeon® II', 'Darkest Dungeon II est un voyage maudit. Assemblez un groupe, équipez votre diligence et traversez un monde en ruines dans une course désespérée pour empêcher l’apocalypse. Mais méfiez-vous, car vos plus grands obstacles pourraient bien venir de l’intérieur…', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1940340/header.jpg?t=1738151249', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1424, 0),
(1426, 'Command: Modern Operations', 'Command: Modern Operations is the next generation in cross-domain modern wargaming. It enables you to simulate every military engagement from post World War II to the present day and beyond. The scale is primarily tactical/operational, although strategic scale operations are also possible.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1076160/header.jpg?t=1741014923', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1425, 0),
(1427, 'Railway Empire 2', 'Incarnez un entrepreneur astucieux, prenez le contrôle d\'une petite entreprise ferroviaire au début des années 1800 et faites de vos locomotives les moteurs de l\'économie.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1644320/header_alt_assets_5.jpg?t=1740491807', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1426, 0),
(1428, 'UBOAT', 'UBOAT est un simulateur de sous-marin à l\'époque de la Seconde Guerre mondiale. C\'est un jeu bac à sable de survie proposant la gestion d\'un équipage et son thème principal repose sur la vie des marins allemands. Le sous-marin est leur maison, mais peut à tout moment devenir leur tombeau.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/494840/header.jpg?t=1740579564', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1427, 0),
(1429, 'Sea Power : Naval Combat in the Missile Age', 'Marchant dans les pas de Cold Waters, Sea Power vous permet de contrôler les forces de l\'OTAN et du Pacte de Varsovie dans les années 1980. Affrontez les Boghammars, chassez les Backfires, ou traquez les sous-marins: à vous de faire la différence dans les airs, sur mer et dans les profondeurs!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1286220/header.jpg?t=1739542180', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1428, 0),
(1430, 'RoadCraft', 'A la tête d’une compagnie de reconstruction, utilisez vos engins de chantier pour restaurer des sites industriels dévastés par des catastrophes naturelles. Déblayez les débris et les équipements défectueux, rénovez les routes et les ponts endommagés par les intempéries, et bien plus encore !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2104890/header.jpg?t=1740482464', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1429, 0),
(1431, 'IfSunSets', 'IfSunSets est un jeu RPG de survie sur une île mystérieuse. Le jour, explorez l\'île pour trouver des ressources. La nuit, affrontez des monstres terrifiants qui vous traquent. Utilisez les ressources pour construire une base et renforcer votre refuge.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2271930/header.jpg?t=1740104918', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1430, 0),
(1432, 'Enemy Front', 'ENEMY FRONT est le premier FPS dédié à la Seconde Guerre mondiale véritablement moderne, avec ses graphismes époustouflants, ses niveaux ouverts et son expérience de combat hautement interactive qui se démarque du modèle de FPS scripté standard, offrant au joueur une liberté totale pour leur propre style de jeu.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/256190/header.jpg?t=1692601016', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1431, 0),
(1433, 'Expeditions: A MudRunner Game', 'Embarquez pour des expéditions scientifiques dans ce nouveau jeu d\'aventure tout-terrain. Menez des missions de recherche tout-terrain aux commandes de divers véhicules, exploitez un équipement high-tech, et gérez votre camp et votre équipe pour réussir en pleine nature.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2477340/9502ddb552171be9bd9018121371972edbfc8dcb/header_alt_assets_3_french.jpg?t=1740655281', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1432, 0),
(1434, 'DYNASTY WARRIORS: ORIGINS', 'Livrez des batailles exaltantes en tant que héros sans nom des Trois Royaumes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2384580/header.jpg?t=1739496566', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1433, 0),
(1435, 'Eiyuden Chronicle: Hundred Heroes', 'Eiyuden Chronicle: Hundred Heroes apporte une touche de modernité au genre du JRPG. Préparez-vous à diriger plus de 100 personnages jouables dans un monde ravagé par la guerre que vous seul pourrez sauver.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1658280/header.jpg?t=1740681506', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1434, 0),
(1436, 'FINAL FANTASY XVI', 'L\'hégémonie des cristaux contrôle la destinée du monde depuis trop longtemps... Le jeune Clive Rosfield a perdu sa patrie et son frère dans l\'ouragan de la guerre. Ne vivant plus que pour la vengeance, il tente de lutter contre un destin cruel.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2515020/header.jpg?t=1741059170', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1435, 0),
(1437, 'Gone Rogue', 'Gone Rogue est un jeu tactique et furtif avec des éléments de RPG. Entrez dans le rôle d\'un voleur des bidonvilles de la ville. Tapi dans l\'ombre, passez inaperçu devant vos ennemis, passez derrière n\'importe quelle porte verrouillée et emportez un riche butin.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1803600/header.jpg?t=1735780149', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1436, 0),
(1438, 'Renaissance Kingdom Wars', 'An 1510. En Europe, en Afrique et à travers le Moyen-Orient, la guerre fait rage. L’âge de la poudre et des mercenaires est à son apogée. Forgez votre légende en ces temps périlleux jusqu\'à devenir empereur suprême dans ce jeu unique combinant STR et grande stratégie.', 'https://cfinder.xyz/uploads/RenaissanceKingdomWars.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1437, 0),
(1439, 'Sonic & All-Stars Racing Transformed Collection', 'Affrontez-vous sur terre, sur mer et dans les airs grâce aux incroyables véhicules transformables en voitures, bateaux ou avions en pleine course.', 'https://cfinder.xyz/uploads/SonicAll-StarsRacingTransformedCollection.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1438, 0),
(1440, 'Topaz Video AI Pro', 'Jusqu’à présent, il n’existait aucun moyen de recréer parfaitement une vidéo haute résolution à partir d’images basse résolution. Video Enhance AI transformera vos vidéos en séquences nettes et améliorées jusqu\'à une résolution de 8K, des vieux films amateurs à la qualité SD à DVD de faible qualité.', 'https://www.aiarty.com/images/ai-image-enhancer/topaz-video-ai.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1439, 0),
(1441, 'Class of \'09: The Re-Up', 'The REJECTION SIM returns! Explore a slice of chaotic life in late 2000\'s American high school as you assume the role of Nicole once again. A 100% fully voiced VN presenting as the most culturally accurate period piece in the history of gaming.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2318310/header.jpg?t=1704255196', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1440, 0),
(1442, 'Plants vs. Zombies GOTY Edition', 'Tout nouveau jeu d\'action et de stratégie de PopCap, les réalisateurs de Bejeweled et Peggle. Les zombies envahissent votre maison et vos seules armes sont les plantes. Muni de vos plantes anti-zombies vous allez devoir repousser l\'invasion. Attention au brouillard et au couché du soleil...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3590/header.jpg?t=1738970324', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1441, 0),
(1443, 'Chained in the Backrooms', 'Chained in the Backrooms est un jeu d\'horreur coopératif pour 1 à 4 joueurs. Des ours en peluche, piégés dans un subconscient flou et enchaînés, doivent survivre et s\'échapper. Chaque niveau offre des énigmes et défis uniques. Des entités malveillantes tenteront de les arrêter.', 'https://cfinder.xyz/uploads/ChainedintheBackrooms.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 2, 1442, 0),
(1444, 'Chaos Express: Delivery Simulator', 'Gérez, livrez et faites-le avec soin dans ce simulateur au rythme effréné. Devenez propriétaire d\'un point de livraison dans un petit district et faites en sorte que tous les colis arrivent à destination. Faites-le vous-même ou avec des amis', 'https://i.ibb.co/MygkYLyD/Chaos-Express-Delivery.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1443, 0),
(1445, 'Lost Records: Bloom & Rage', 'Plongez dans la nouvelle aventure narrative des créateurs de Life is Strange. Filmez votre été 1995 et partagez des moments inoubliables avec vos amies. 27 ans plus tard, affrontez les sombres secrets qui vous ont poussées à faire le serment de ne plus jamais vous revoir.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1902960/header.jpg?t=1739883360', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1444, 0),
(1446, 'Shredders', 'Imposez-vous dans la compétition de snowboard de l\'année pour tenter de décrocher votre invitation à un événement exclusif. Prouvez que vous êtes à la hauteur du défi en maîtrisant park riding, butters, rails et kickers et méritez votre place dans le monde du snowboard.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1874170/header.jpg?t=1733415105', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1445, 0),
(1447, 'Foundation', 'Foundation est un city-builder relaxant basé sur un système sans grille qui se focalise sur le développement authentique, la construction de monuments et la gestion des ressources.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/690830/header_alt_assets_3_french.jpg?t=1739057314', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1446, 0),
(1448, 'Avowed', 'Avowed est un jeu de rôle fantastique à la première personne d\'Obsidian Entertainment.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2457220/header.jpg?t=1740086726', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1447, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1449, 'Hired 2 Die', 'Des êtres malfaisants en quête de proies se tapissent dans les lieux de travail. Seul ou accompagné, rejoignez une étrange société anonyme pour lutter contre ces forces des ténèbres. Utilisez les systèmes de sécurité et caméras de surveillance pour survivre.', 'https://cfinder.xyz/uploads/Hired2Die.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1448, 0),
(1450, 'Backrooms Rec.', 'Plongez dans les mystères des Backrooms avec un jeu de survie développé en solo. Explorez des couloirs inquiétants, découvrez des secrets en solo ou en multijoueur (jusqu\'à 6 joueurs), et relevez des défis uniques.', 'https://cfinder.xyz/uploads/BackroomsRec.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', NULL, 1449, 0),
(1451, 'Amenti', 'A photographer enters the Great Pyramids to photograph Pharaoh Rudamon’s remains, but is soon overwhelmed by a sinister curse, as the ancient tomb awakens dark forces that claw at his sanity.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3292260/header.jpg?t=1738095096', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1450, 0),
(1452, 'Fallout 3', 'Les ingénieurs Vault-Tec ont travaillé 24 heures sur 24 pour vous apporter cette simulation post-apocalyptique. Monde complet, simulation de combat et effets visuels impressionnants : vous pourrez choisir parmi des tonnes d\'options.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/22300/header.jpg?t=1732208474', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1451, 0),
(1453, 'A Game About Digging A Hole', 'Un jeu minimaliste sur le creusement d’un trou dans le jardin d’une maison fraîchement achetée. Collectez des ressources, vendez-les, améliorez votre équipement et découvrez un mystère fascinant. Le tout pour le prix d’un café !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3244220/header.jpg?t=1739437793', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1452, 0),
(1454, 'Five Nights at Freddy\'s: Help Wanted 2', 'Five Nights at Freddy\'s : Help Wanted 2 est la suite de la terrifiante expérience VR qui a redonné vie à la célèbre franchise horrifique. En tant que tout nouvel employé, vous devrez prouver que vous avez les tripes pour exceller dans tous les aspects de la gestion et l’entretien d’une pizzeria.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2287520/header.jpg?t=1718900946', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:36', '2025-09-09 15:30:13', 1, 1453, 0),
(1455, 'Furnish Master', 'Furnish Master est un jeu relaxant qui consiste à décorer des appartements, maisons, zones commerciales et même des lieux extérieurs ! Créer les designs de vos rêves !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2004080/header.jpg?t=1729286761', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1454, 0),
(1456, 'TrickShot Simulator', 'La simulation ultime de trickshot qui reproduit fidèlement les mouvements réalistes ! Dans ce jeu, vous pouvez découvrir différentes étapes de trickshot avec une simple manipulation de la souris. Certaines étapes sont difficiles et peuvent mettre à l\'épreuve votre précision et votre patience.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3384190/header.jpg?t=1738788195', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1455, 0),
(1457, 'Zoonomaly', 'You must survive a monster infested zoo while searching for key shards that unlock the truth to its origin. Collect all the key shards by solving puzzles throughout the grounds and put a stop to the monster mayhem.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2101890/header.jpg?t=1709757837', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1456, 0),
(1458, 'Oblivity - Find your perfect Sensitivity', 'Oblivity est un Aim Trainer avancé qui offre tout ce dont tu as besoin pour améliorer ton Aim ! Trouve ta sensibilité de souris parfaite et intuitive dans le Sensitivity Finder d\'Oblivity. Ou trouve tes mauvaises habitudes d\'Aiming dans la vaste zone d\'analyse et de replay.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1389990/header.jpg?t=1694430670', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1457, 0),
(1459, 'WWE 2K20', 'REMARQUE : Les serveurs multijoueur de WWE 2K20 seront fermés à partir du 30/06/2022. Après cette date, toutes les fonctions du jeu nécessitant des serveurs en ligne ne seront plus disponibles.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1015500/header.jpg?t=1657748382', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1458, 0),
(1460, 'Age of Mythology: Retold', 'Par les créateurs à l\'origine de la franchise acclamée Age of Empires, Age of Mythology: Retold explore un âge mythique où les dieux, les monstres et les humains se livrent une lutte sans merci.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1934680/header.jpg?t=1739579492', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1459, 0),
(1461, 'Rugby 22', 'Flexion, liez, jeu ! Découvrez une expérience de rugby authentique. Jouez avec les meilleurs clubs et les plus grandes nations, profitez d\'un gameplay dynamique fidèle au sport et vivez l\'intensité des grands matchs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1475850/header.jpg?t=1725350314', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1460, 0),
(1462, 'Uncle Chop\'s Rocket Shop', 'Essayez-vous à la simulation de réparation de vaisseaux spatiaux ! Réveillez-vous, pointez, réparez des vaisseaux, faites-vous des amis et des ennemis, payez votre loyer, améliorez votre L.O.Y.E.R., réfléchissez à la futilité de l\'existence, allez vous coucher... et recommencez.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1849790/header_french.jpg?t=1733739394', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1461, 0),
(1463, 'KLETKA', 'KLETKA est un jeu d\'horreur coopératif qui consiste à descendre dans un ascenseur qui essaie de vous manger. Alimentez l\'ascenseur, évitez les pièges et les monstres et descendez plus profondément.', 'https://cfinder.xyz/uploads/KLETKA.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', NULL, 1462, 0),
(1464, 'ATLYSS', 'Enter the world of ATLYSS, a Singleplayer/Online RPG where you can fight with or against friends in a surreal world filled with creatures beyond comprehension. Customize and progress your character(s), complete quests, and discover strange locations.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2768430/header.jpg?t=1732316418', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1463, 0),
(1465, 'Nuclear Nightmare', 'Venture forth as part of a specialized team of fellow players tasked with retrieving classified materials, evading the black goo virus, and the nightmarish entities it has spawned. With time running out before the US government initiates a devastating nuclear strike to contain the spreading menace.', 'https://cfinder.xyz/uploads/NuclearNightmare.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', NULL, 1464, 0),
(1466, 'Ballionaire', 'BALLIONAIRE est un roguelike intense s\'inspirant du pachinko dans lequel la stratégie et les lois de la physique se rencontrent pour générer des richesses scandaleuses ! Découvrez et exploitez des synergies abusives en imaginant de nouvelles configurations de victoire !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2667120/header.jpg?t=1738079724', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1465, 0),
(1467, 'Deep Rock Galactic', 'Deep Rock Galactic est un FPS de SF en co-op mettant en scène des nains de l\'espace durs à cuire, des environnements 100 % destructibles, des grottes générées de façon procédurale et des hordes infinies de monstres extraterrestres.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/548430/header.jpg?t=1738238209', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1466, 0),
(1468, 'Metaphor: ReFantazio', 'L\'assassinat du roi a laissé le trône vacant. Faute d\'héritier, le testament du défunt est clair : le choix du prochain monarque revient au peuple. C\'est ainsi que commence votre course au trône.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2679460/header.jpg?t=1736331314', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 2, 1467, 0),
(1469, 'Vampire Survivors', 'Réduisez des milliers de créatures de la nuit en bouillie pour survivre jusqu\'à l\'aurore ! Vampire Survivors est un jeu d\'horreur gothique teinté d\'éléments de roguelite, dans lequel vos choix vous permettent de lutter contre des hordes de monstres qui vous assaillent de toute part.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1794680/header.jpg?t=1730983128', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1468, 0),
(1470, 'Elin', 'Successor to the roguelike RPG \"Elona\". Adventure, survival, crafting, home-building, myths passed down, and stories of humans and Elea spun. What scars will you leave on the land of Ylva?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2135150/header.jpg?t=1734443460', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1469, 0),
(1471, 'Conan Exiles', 'Jeu de survie multijoueur en ligne, désormais agrémenté de montures, de combat monté et de sorcellerie, dans le monde de Conan le barbare. Survivez dans un monde immense de type bac à sable, construisez votre propre maison, fondez un royaume et dominez vos ennemis, en mode solo ou multijoueur.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/440900/header.jpg?t=1734616906', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1470, 0),
(1472, 'Baldi\'s Basics Plus', 'Baldi\'s Basics® Plus est un roguelike furtif actif qui parodie à bon marché des années 90 avec une touche d\'horreur subtile! Jouez à Hide & cherchez avec Baldi alors qu\'il vous poursuit à travers des niveaux générés par procédure tout en utilisant votre environnement, vos articles et vos connaissances pour le chaos pour déplacer le chaos en votre faveur.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1275890/header.jpg?t=1739202728', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1471, 0),
(1473, 'Resident Evil 5', 'Ce jeu est une adaptation de la version Games for Windows - Live, sortie en 2009. Acheter le pack \"Untold Stories Bundle\" sur Steam correspondra a mettre à jour vers \"Resident Evil 5 Gold Edition\".', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/21690/header.jpg?t=1712193350', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1472, 0),
(1474, 'Hairdresser Simulator', 'Prenez les ciseaux en main et commencez votre voyage dans le monde enchevêtré des cheveux! Gagnez de l\'argent pour développer votre salon et embaucher des employés. Améliorez vos compétences et devenez un maître du métier de coiffeur!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1330560/header.jpg?t=1737843879', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1473, 0),
(1475, 'The Cabin Factory', 'Votre travail à la Cabin Factory est tout simple : inspecter les cabines et décider si elles sont hantées ou non. Et si vous constatez la moindre anomalie, sortez... immédiatement.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3311740/header.jpg?t=1736175335', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1474, 0),
(1476, 'LEGO® Bricktales', 'Dans ce jeu d\'aventure et de construction, utilisez un mécanisme intuitif de construction brique par brique pour donner vie à vos créations ! Vivez une belle histoire en explorant les magnifiques dioramas LEGO® et en aidant leurs habitants.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1898290/header.jpg?t=1728655900', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1475, 0),
(1477, 'Void Crew', 'Void Crew est un roguelite coop chaotique pour 1 à 4 joueurs : équipez votre vaisseau et vos membres d\'équipage, lancez-vous dans des quêtes palpitantes, affrontez de féroces ennemis, et surtout... ne cédez pas à la panique !', 'https://cfinder.xyz/uploads/VoidCrew.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 2, 1476, 0),
(1478, 'Settlements Rising', 'Settlements Rising est un jeu de gestion de villes médiévales et de colonies. Il propose des villageois simulés, des professions variées, des ressources, des catastrophes, des raids, et un contrôle total via le commerce et les chaînes de production.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2378910/header.jpg?t=1738750878', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1477, 0),
(1479, 'Manhunt', 'You awake to the sound of your own panicked breath. In Manhunt, you must run, hide and fight to survive. If you can stay alive long enough, you may find out who did this to you. This is a brutal blood sport.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/12130/header.jpg?t=1618852702', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1478, 0),
(1480, 'Total War: NAPOLEON – Definitive Edition', 'Complétez votre collection Total War avec cette Definitive Edition de Total War: Napoleon, incluant tous les DLC et fonctionnalités mises à jour depuis la sortie du jeu', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/34030/header.jpg?t=1668768417', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1479, 0),
(1481, 'Carry The Glass', 'Team up as two quirky construction workers in this fun 2-player co-op platformer! Carry a fragile glass window through colorful levels filled with challenges. Communicate and coordinate to dodge obstacles and solve puzzles. Can you finish the job without breaking the glass?', 'https://cfinder.xyz/uploads/CarryTheGlass.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', NULL, 1480, 0),
(1482, 'Streamer Life Simulator 2', 'Dans le deuxième jeu de la série, la concurrence a augmenté et désormais tout le monde veut devenir streamer. Êtes-vous prêt à streamer jusqu’à ce que votre processeur brûle ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2890830/header.jpg?t=1738849332', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', NULL, 1481, 0),
(1483, 'Kingdom Come: Deliverance', 'Kingdom Come: Deliverance est un RPG en monde ouvert au scénario riche qui vous transportera au beau milieu du Saint Empire Romain pour y vivre une aventure épique. Vengez la mort de vos parents en luttant contre l’envahisseur, remplissez des quêtes révolutionnaires et effectuez des choix qui auront un impact sur le déroulement de...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/379430/header.jpg?t=1726645188', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1482, 0),
(1484, 'The Headliners', 'Un jeu d\'horreur coopératif où vous incarnez une équipe de 1 à 4 journalistes, prêts à explorer New York envahie par des créatures mortelles pour capturer des images spectaculaires. Votre seul objectif : faire la une... et rester en vie pour la lire.', 'https://cfinder.xyz/uploads/TheHeadliners.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 2, 1483, 0),
(1485, 'Driving Is Hard', 'Prouvez vos compétences en conduisant la baignoire sur roues ! Résolvez des énigmes, collectez du savon et plongez dans le drame familial de Jeff. Conduisez, tombez, apprenez, répétez.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3175860/header.jpg?t=1738350468', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1484, 0),
(1486, 'Kingdom Come: Deliverance II', 'Un jeu de rôle et d\'action à l\'histoire captivante, dans un monde ouvert très riche, se déroulant dans l\'Europe du XVe siècle. Vivez l\'aventure médiévale ultime en incarnant le jeune Henry, et lancez-vous dans un périple aux proportions épiques.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1771300/header.jpg?t=1738691626', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 2, 1485, 0),
(1487, 'Wartales', 'Wartales est un RPG en monde ouvert dans lequel vous menez un groupe de mercenaires en quête de richesses à travers un vaste univers médiéval. Explorez, recrutez des compagnons, collectez des primes et levez le voile sur les mystères des tombes ancestrales !', 'https://cfinder.xyz/uploads/Wartales.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', NULL, 1486, 0),
(1488, 'Le Mans Ultimate', 'Le Mans est une histoire en constante évolution... portée par l\'émotion, le rythme et la gloire. Le Mans Ultimate – le jeu officiel du Championnat du Monde d\'Endurance FIA ​​et des 24 Heures du Mans.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2399420/header.jpg?t=1737563029', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 2, 1487, 0),
(1489, 'Suicide Squad: Kill the Justice League', 'Développé par les créateurs de Batman : Arkham, Suicide Squad: Kill the Justice League est un shooter d\'action-aventure à la troisième personne dans lequel la plus célèbre bande de marginaux doit réaliser l’impossible : tuer la Justicer League.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/315210/header_alt_assets_5.jpg?t=1733850022', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1488, 0),
(1490, 'Marvel\'s Spider-Man 2', 'Dépassez vos limites. Ensemble. L\'incroyable puissance du symbiote force Peter Parker et Miles Morales à se dépasser et à trouver le bon équilibre entre leurs vies, leurs amitiés et leurs responsabilités dans un nouveau chapitre palpitant de la franchise Spider-Man.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2651280/header.jpg?t=1738262058', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', NULL, 1489, 0),
(1491, 'Heroes of Hammerwatch II', 'A rogue-lite action-rpg that offers extensive persistent progression. Build your town, upgrade and equip your heroes, before taking on the the ever-changing Dark Citadel - either solo or with a team of friends.', 'https://cfinder.xyz/uploads/HeroesofHammerwatchII.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', NULL, 1490, 0),
(1492, 'PICO PARK 2', 'PICO PARK est de retour avec de nouveaux niveaux ! Jouez de 2 à 8 joueurs localement ou en ligne dans ce jeu coopératif de puzzle et d\'action !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2644470/header.jpg?t=1726674876', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1491, 0),
(1493, 'Coin Pusher Casino', 'Coin Pusher Casino brings the excitement of classic coin pusher machines to your computer! With its engaging gameplay and realistic physics, Coin Pusher Casino is a must-play for fans of arcade and coin pusher games!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2178590/header.jpg?t=1735927995', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:37', '2025-09-09 15:30:13', 1, 1492, 0),
(1494, 'Beat Saber', 'Beat Saber est un jeu de rythme en VR où vous devez trancher les notes d\'une musique entraînante qui arrivent vers vous, au sein d\'un univers futuriste.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/620980/header.jpg?t=1734095750', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', NULL, 1493, 0),
(1495, 'Workers & Resources: Soviet Republic', 'Créez une république soviétique et transformez un pays pauvre en superpuissance dans ce city builder aux chaînes de production complexes. Gérez les vies de vos citoyens, de l’école au travail en passant par la loyauté au parti et les activités criminelles.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/784150/header.jpg?t=1737659075', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1494, 0),
(1496, 'Eternal Strands', 'Affrontez d\'immenses créatures épiques en combinant de puissantes capacités magiques et un arsenal d\'armes enchantées pour empêcher le monde de s\'effondrer dans ce jeu d\'action-aventure fantastique à la troisième personne.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1491410/header.jpg?t=1738097753', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1495, 0),
(1497, 'Slay the Spire', 'En fusionnant les jeux de cartes avec les roguelikes, nous sommes arrivés à créer le jeu de cartes solo le plus intéressant possible. Construisez votre deck, rencontrez toutes sortes d\'ennemis bizarres, découvrez des reliques aux pouvoirs immenses, et éradiquez la tour!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/646570/header.jpg?t=1732020340', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1496, 0),
(1498, 'WEBFISHING', 'WEBFISHING, un jeu de pêche multijoueur axé sur les salons de discussion ! Détendez-vous et pêchez', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3146520/header.jpg?t=1728673229', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1497, 0),
(1499, 'GreedFall II: The Dying World', 'Retrouvez le monde de GreedFall dans une nouvelle aventure palpitante. Arraché à votre île natale, parcourez le Vieux Continent, forgez des alliances et combattez pour recouvrer votre liberté !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1997660/header.jpg?t=1736436494', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1498, 0),
(1500, 'Empires of the Undergrowth', 'Dirigez des légions d’inédites proportions dans cet épique mélange STR/construction. Menez-les contre les redoutables menaces du monde naturel. Construisez des nids élaborés, développez des stratégies et faites évoluer votre colonie pour qu\'elle affronte de grandissants dangers.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/463530/header.jpg?t=1737359526', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1499, 0),
(1501, 'Car For Sale Simulator 2023', 'Car For Sale Simulator 2023 Développez votre propre entreprise de vente de voitures en achetant et en vendant différents modèles de voitures pour les passionnés d\'automobile. Conduisez les voitures achetées comme vous le souhaitez, réparez, modifiez et vendez-les à des prix abordables à vos clients', 'https://cfinder.xyz/uploads/CarForSaleSimulator2023.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', NULL, 1500, 0),
(1502, 'The Witcher 3: Wild Hunt', 'Vous incarnez Geralt de Riv, un tueur de monstres. Devant vous s\'étend un continent en guerre, infesté de monstres, à explorer à votre guise. Votre contrat actuel ? Retrouver Ciri, l\'enfant de la prophétie, une arme vivante capable de changer le monde.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/292030/header.jpg?t=1736424367', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', NULL, 1501, 0),
(1503, 'Age of Wonders 4', 'Régnez sur un royaume de votre création ! Explorez de nouveaux territoires dans l\'incomparable 4x stratégique au tour par tour d\'Age of Wonders. Prenez le contrôle d\'une faction, regardez-la grandir et se transformer à mesure que s\'étend votre empire !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1669000/header.jpg?t=1735836601', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 2, 1502, 0),
(1504, 'HITMAN World of Assassination', 'Entrez dans le monde de l\'assassin ultime. HITMAN le monde de l\'assassinat regroupe le meilleur de HITMAN, HITMAN 2 et HITMAN 3, y compris la campagne principale, les modes Contrat, Escalade, Cible fugitive et Freelance, le mode de jeu inspiré du genre roguelike.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1659040/header_alt_assets_5.jpg?t=1737630798', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1503, 0),
(1505, 'Don\'t Starve Together', 'Don\'t Starve Together est l’extension multijoueur autonome du jeu de survie intransigeant Don\'t Starve.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/322330/header_alt_assets_47.jpg?t=1737656057', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1504, 0),
(1506, 'The Thing: Remastered', 'The Thing : Remastered est une restauration fidèle du jeu de tir culte de 2002 à la troisième personne, inspiré du film d\'Universal Pictures de 1982, The Thing, qui définit le genre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2958970/header.jpg?t=1737741765', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1505, 0),
(1507, 'Ship Graveyard Simulator', 'Visitez le plus grand cimetière de navires au monde! Choisissez le navire le plus précieux pour vous et commencez votre aventure. Incarnez un des ouvriers pendant le travail le plus dangereux au monde. Démantelez tout le navire, vendez les pièces obtenues et améliorez votre équipement.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1286880/header.jpg?t=1736360041', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1506, 0),
(1508, 'Automation - The Car Company Tycoon Game', 'Faites des voitures de vos rêves une réalité grâce aux outils de conception de voitures et de moteurs sans précédent d’Automation. Bénéficiez d’un avantage concurrentiel grâce à des décisions d’ingénierie et commerciales intelligentes qui vous aideront à bâtir un empire automobile. Deviendrez-vous un leader de l’industrie, ou simplement une note de bas de page dans l’histoire de l’automobile ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/293760/header.jpg?t=1721698657', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1507, 0),
(1509, 'FINAL FANTASY VII REBIRTH', 'Le voyage vers l\'inconnu continue... Après s’être échappés de Midgar, Cloud et ses amis se lancent dans un voyage à travers toute la planète. De nouvelles aventures les attendent dans le vaste monde plein de vie de ce titre indépendant de la trilogie de remakes de FFVII !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2909400/header.jpg?t=1737644170', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 2, 1508, 0),
(1510, 'Assetto Corsa EVO', 'Assetto Corsa EVO redéfinit le réalisme et les fonctionnalités de l’une des simulations de course multiplateformes les plus populaires développées. Le jeu inclut des circuits et des véhicules de toutes classes de l’histoire de l’automobile.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3058630/header.jpg?t=1737128642', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', NULL, 1509, 0),
(1511, 'Trailmakers', 'Créez et lancez-vous dans le monde ouvert de Trailmakers. Libérez votre propre capacité à créer et innover dans Trailmakers. Un jeu d\'ingénierie sandbox inédit, stimulé par la communauté de joueurs la plus créative au monde.', 'https://cfinder.xyz/uploads/Trailmakers.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', NULL, 1510, 0),
(1512, 'Get To Work', 'Vous êtes pauvre et chauve. Mettez-vous au travail.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2706170/header.jpg?t=1735594455', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1511, 0),
(1513, 'Caves of Qud', 'Caves of Qud est une épopée roguelike de science-fiction imprégnée de rétrofuturisme, de simulation profonde et de bandes de plantes sensibles. Venez habiter un monde exotique et ciseler des couches de civilisations millénaires.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/333640/header.jpg?t=1736442324', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1512, 0),
(1514, 'Grim Dawn', 'Entrez dans un monde fantastique apocalyptique où l\'humanité est au bord de l\'extinction, le fer est plus valorisé que l\'or et la confiance est durement gagnée. Cet ARPG propose un développement de personnages complexe, des centaines d\'objets uniques, de l\'artisanat et des quêtes avec choix et conséquences.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/219990/header.jpg?t=1726250949', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', NULL, 1513, 0),
(1515, 'Need for Speed™ Heat', 'Pilotez le jour et risquez tout la nuit dans Need for Speed™ Heat Édition Deluxe, un jeu palpitant de courses urbaines où les limites de la légalité s’estompent dès que le soleil se couche.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1222680/header.jpg?t=1716831270', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1514, 0),
(1516, 'BeamNG.drive', 'Un simulateur de véhicules basé sur la dynamique des corps mous et capable de faire à peu près n\'importe quoi.', 'https://cfinder.xyz/uploads/BeamNGdrive.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', NULL, 1515, 0),
(1517, 'Sengoku Dynasty', 'Cap sur le Japon féodal avec Sengoku Dynasty : bâtissez des villages, développez votre communauté et forgez un monde ouvert via le combat ou l\'économie. Régnez en souverain ou détendez-vous. Le choix n\'appartient qu\'à vous... ou jusqu\'à 4 joueurs en coop multijoueur !', 'https://cfinder.xyz/uploads/SengokuDynasty.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', NULL, 1516, 0),
(1518, 'SchoolBoy Runaway', '«Petit vaurien ! Apprends tes leçons tout de suite ! » dirent les parents en colère en te mettant en résidence surveillée. Essaie de déjouer tes parents et trouve un moyen de t’amuser avec tes amis.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3359320/header.jpg?t=1733726446', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1517, 0),
(1519, 'Beyond Citadel', 'Beyond Citadel is an anime style retro throwback shooter inspired by the classics of the 90\'s, with realistic gunplay mechanics, anime violence and fast paced combat. Fight your way through the heavily armed mechanical fortress and discover the secret that lies beneath.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3371240/header.jpg?t=1735841818', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 2, 1518, 0),
(1520, 'SimRail - The Railway Simulator', 'SimRail est un nouveau simulateur ferroviaire avancé. Maîtriser l\'UEM grande vitesse longue distance, les transports de marchandises lourdes et les trains de banlieue. Devenez répartiteur de train et contrôlez le trafic selon l\'horaire ou coopérez avec d\'autres joueurs en mode multijoueur.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1422130/header.jpg?t=1734118551', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1519, 0),
(1521, 'FAITH: The Unholy Trinity', 'What you are about to do has not been approved by the Vatican. As a young priest, struggle against demons, insane cultists, and your own weakening faith in this pixel horror game inspired by the era of classic 8-bit gaming and the \"Satanic Scare\" of the 1980s.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1179080/header.jpg?t=1726657651', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1520, 0),
(1522, 'Tobacco Shop Simulator', 'Gérez votre boutique de tabac. Entre amis ou en solo, signez des contrats avec de grandes marques, commandez des produits, engagez des vendeurs, développez votre magasin, et ne laissez jamais vos clients repartir les mains vides.', 'https://cfinder.xyz/uploads/TobaccoShopSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', NULL, 1521, 0),
(1523, 'The Wandering Village', 'The Wandering Village est un jeu de construction de ville sur le dos d\'une gigantesque créature errante. Construisez une colonie et formez une relation symbiotique avec ce colosse. Survivrez-vous dans ce monde post-apocalyptique hostile, mais magnifique, contaminé par des plantes toxiques ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1121640/header.jpg?t=1734360294', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 1, 1522, 0),
(1524, 'F1 2020', 'F1® 2020 vous permet pour la 1re fois de créer votre écurie de F1® et d’affronter les écuries et pilotes officiels. Défiez aussi vos amis en écran partagé lors de courses personnalisables, juste pour le plaisir. Affrontez 22 circuits, avec du contenu classique et actualisé.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1080110/header.jpg?t=1678892552', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:38', '2025-09-09 15:30:13', 2, 1523, 0),
(1525, 'Sackboy™: A Big Adventure', 'PARFAITEMENT ADAPTÉ POUR PC L\'emblématique Sackboy de PlayStation® débarque en furie sur PC avec un jeu de plateformes 3D palpitant en multijoueur. Un voyage épique rempli de défis acrobatiques. Des commandes immersives. Du multijoueur collaboratif, chaotique et délirant.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1599660/header.jpg?t=1717622011', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 2, 1524, 0),
(1526, 'Steep™', 'Explorez le vaste monde ouvert des Alpes, à la poudreuse toujours fraîche et où la compétition ne cesse jamais. Domptez la montagne seul ou avec des amis, à skis, en wingsuit, en snowboard et parapente. Enregistrez et partagez vos cascades.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/460920/header.jpg?t=1679998365', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 2, 1525, 0),
(1527, 'UNO', 'UNO revient avec de nouvelles fonctionnalités. Assemblez les cartes par couleur ou valeur et jouez des cartes spéciales. Débarrassez-vous de vos cartes le premier dans une partie classique, ou personnalisez votre expérience grâce aux variantes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/470220/header.jpg?t=1728664374', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1526, 0),
(1528, 'FAIRY TAIL 2', 'La bataille finale de FAIRY TAIL est sur le point de commencer', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3002850/header_french.jpg?t=1736298045', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1527, 0),
(1529, 'The Crush House', 'Filmez et produisez la téléréalité la plus tendance de 99 : The Crush House ! Choisissez votre casting, contentez un public exigeant et restez à l’antenne pour dévoiler les sombres secrets de ce jeu décalé à la première personne.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2337820/header.jpg?t=1731336304', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1528, 0),
(1530, 'Mon Bazou', 'Transformez votre vieux véhicule délabré en voiture de course en installant vous-même des pièces de performance. Gagnez de l\'argent en coupant du bois, en faisant des courses ou en livrant des pizzas. Peut-être aimeriez-vous gérer une cabane à sucre ou encore, vous construire un énorme garage ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1520370/header.jpg?t=1730218880', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1529, 0),
(1531, 'Castlevania Lords of Shadow Ultimate Edition', '', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/238510/header.jpg?t=1690416579', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1530, 0),
(1532, 'Granny: Escape Together', 'Il s\'agit d\'un jeu d\'horreur coopératif effrayant. Dans lequel vous vous retrouvez enfermé dans la maison d\'une grand-mère folle. Mais grand-mère n\'est pas le seul danger qui vous attend dans la maison, quelqu\'un d\'autre effrayant vit au sous-sol. Vous avez cinq jours pour sortir de la maison !', 'https://cfinder.xyz/uploads/GrannyEscapeTogether.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', NULL, 1531, 0),
(1533, 'Dark Hours', 'Dark Hours est un survival-horror en coop pour 1 à 4 joueurs. Votre cambriolage est interrompu par un événement surnaturel et votre équipe de voleurs se retrouve piégée avec un monstre. Oubliez votre plan, votre mission: survivre ! Explorez et coopérez pour sortir ou cachez-vous jusqu\'à l\'aube.', 'https://cfinder.xyz/uploads/DarkHours.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', NULL, 1532, 0),
(1534, 'Warhammer 40,000: Rogue Trader', 'Partez à l\'aventure dans le premier JDR informatique se déroulant dans les ténèbres du 41e millénaire. Incarnez un libre-marchand héritier d\'une antique dynastie d\'intrépides corsaires. Établissez votre empire commercial et explorez les confins de l\'Imperium.', 'https://cfinder.xyz/uploads/Warhammer40000RogueTrader.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 2, 1533, 0),
(1535, 'Tricky Towers', 'En avant, magicien, il est temps ! Le monde de Tricky Towers vous attend ! Bienvenue dans un univers magique, où vous construirez une tour avec des briques. Gérez la gravité, affrontez vos amis, dans ce jeu aux fous rires garantis !', 'https://cfinder.xyz/uploads/TrickyTowers.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 2, 1534, 0),
(1536, 'Horizon Zero Dawn™ Remastered', 'Découvrez Horizon Zero Dawn™, acclamé par la critique, avec de nouveaux graphismes et des fonctionnalités améliorées. Dans un futur lointain où des machines gigantesques parcourent la Terre, des colonies humaines isolées survivent sous forme de tribus dans les vestiges d\'une civilisation oubliée.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2561580/header.jpg?t=1730386633', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', NULL, 1535, 0),
(1537, 'Dead Space™ 3', 'Combattez l\'horreur ensemble', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1238060/header.jpg?t=1614938992', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1536, 0),
(1538, 'Le Vaillant Petit Page', 'Les personnages d\'un conte découvrent un monde en trois dimensions à l\'extérieur du livre dans lequel ils vivent. Ils devront passer d\'un univers 2D à 3D et inversement pour sauver leurs amis dans cette aventure charmante pleine d\'action.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1627570/header_alt_assets_0_french.jpg?t=1734384387', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1537, 0),
(1539, 'Dishonored 2', 'Endossez à nouveau le rôle d\'assassin surnaturel dans Dishonored 2. Qualifié d\'\"incroyable\" et de \"remarquable suite\" par IGN, présenté comme \"chef-d\'œuvre\" par Eurogamer et acclamé comme un \"un récit de vengeance incontournable\" par Game Informer, Dishonored 2 succède au légendaire FPS d\'Arkane...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/403640/header.jpg?t=1726161101', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1538, 0),
(1540, 'Call of Duty: World at War', 'Call of Duty est de retour et, une fois de plus, redéfinit le genre du jeu de guerre. Basé sur le moteur de Call of Duty 4®: Modern Warfare, Call of Duty: World at War plonge les joueurs dans les combats les plus intenses de la seconde guerre mondiale.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/10090/header.jpg?t=1654830025', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1539, 0),
(1541, 'NEEDY GIRL OVERDOSE', 'NEEDY STREAMER OVERLOAD est un ADV à plusieurs fins sur la vie d\'une fille (AngeliKawaii) qui a un fort besoin d\'approbation et qui veut devenir la plus forte Le CyberAnge (distributeur).', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1451940/header.jpg?t=1730165409', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1540, 0),
(1542, 'Middle-earth™: Shadow of Mordor™', 'Menez un combat à travers le Mordor et découvrez la vérité sur l’esprit qui vous possède, découvrez l’origine des Anneaux de pouvoir, créez votre légende et confrontez le mal de Sauron dans cette nouvelle chronique des Terres du Milieu.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/241930/header_french.jpg?t=1729788851', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1541, 0),
(1543, 'Farming Simulator 19', 'La franchise plusieurs fois millionnaire fait un bond de géant, avec une révision totale de son moteur graphique. La simulation agricole ultime se pare ainsi de visuels et d\'effets saisissants de réalisme, tout en offrant l\'expérience de jeu \"farming\" la plus riche et complète jamais réalisée.', 'https://cfinder.xyz/uploads/FarmingSimulator19.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', NULL, 1542, 0),
(1544, 'Brotato', 'Brotato est un roguelite où vous incarnez une pomme de terre maniant jusqu\'à 6 armes à la fois pour combattre des hordes d\'extraterrestres. Choisissez parmi une variété de traits et d\'objets pour créer des parties uniques et survivre jusqu\'à l\'arrivée des secours.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1942280/header.jpg?t=1733741345', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1543, 0),
(1545, 'Windblown', 'Bravez le vortex et foncez vers la gloire dans ce roguelite d\'action fulgurant jouable de 1 à 3 joueurs et concocté par les créateurs de Dead Cells. Absorbez les pouvoirs de guerriers déchus, recréez leurs armes, et EXPLOSEZ les Sentinelles en quête de la run parfaite !', 'https://cfinder.xyz/uploads/Windblown.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', NULL, 1544, 0),
(1546, 'I Am Future: Cozy Apocalypse Survival', 'I Am Future est un jeu de survie en solo relaxant, où vous construisez un camp sur le toit d\'un bâtiment d\'une ville inondée. Cultivez, pêchez, bricolez, confectionnez de nouveaux outils, gérez une équipe de robots pour automatiser et agrandir votre base, explorez le monde et détendez-vous!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1658040/header_alt_assets_8.jpg?t=1733128539', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1545, 0),
(1547, 'Disco Simulator', 'Disco Simulator est un jeu tycoon consistant à gérer une boîte de nuit. Ta tâche est d\'aménager la boîte à partir de zéro, construire les murs, placer les meubles, embaucher le personnel, planifier les fêtes, inviter les artistes, organiser les concerts. Crée ta propre boîte!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1226970/header.jpg?t=1734704638', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1546, 0),
(1548, 'The Mageseeker: A League of Legends Story™', 'Développé par Digital Sun, les créateurs de Moonlighter, The Mageseeker est un RPG d\'action qui se déroule dans l\'univers de League of Legends. Incarnez Sylas, un mage fraîchement libéré après des années de captivité. Libérez le royaume de Demacia de la tyrannie des traqueurs de mages.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1457080/header.jpg?t=1720737340', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1547, 0),
(1549, 'Prototype 2', 'Devenez l\'arme évolutive ultime !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/115320/header.jpg?t=1655761001', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 2, 1548, 0),
(1550, 'MiSide', 'Imaginons que vous disposiez d\'un jeu dans lequel vous vous êtes attaché à un personnage. Pourriez-vous cependant imaginer entrer vous-même un jour dans ce jeu ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2527500/header.jpg?t=1734142208', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', NULL, 1549, 0),
(1551, 'Zort', 'Zort est un jeu d\'action, d\'aventure et d\'horreur pouvant se jouer jusqu\'à 4 personnes. Explorez des cartes avec vos amis et amusez-vous en échappant à diverses créatures. Vivez une expérience d\'horreur réaliste avec le chat vocal en jeu avec vos amis !', 'https://cfinder.xyz/uploads/Zort.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', NULL, 1550, 0),
(1552, 'Maximum Action', 'MAXIMUM Action is a brutal and satisfying physics-based first person shooter influenced by Hong Kong cinema, heroic slow motion bloodshed, and old-school FPS ACTION.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/853770/header.jpg?t=1705033547', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1551, 0),
(1553, 'Cinq Cœurs Sous un Toit d’Amour', 'La maison autrefois solitaire de Yuman, est maintenant envahie par cinq magnifiques jeunes femmes ! Chacune a son propre charme unique “l’amie d’enfance de 20 ans,” “le premier amour et ancienne idole,” “la patronne exigeante,” “la jeune fille audacieuse” et “la recluse timide.” Qui choisirez-vous?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3021100/header.jpg?t=1734671426', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 2, 1552, 0),
(1554, 'Mass Effect™ Édition Légendaire', 'Mass Effect™ Édition Légendaire, entièrement remasterisé et optimisé en 4K Ultra HD, inclut le contenu solo de base et plus de 40 DLC pour les jeux très renommés Mass Effect, Mass Effect 2 et Mass Effect 3, ainsi que les armes, les armures et les packs promotionnels !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1328670/header.jpg?t=1725576882', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 2, 1553, 0),
(1555, 'Danganronpa: Trigger Happy Havoc', 'Enquêtez sur des meurtres, cherchez des indices et parlez à vos camarades pour préparer le procès, où chaque mot compte face aux suspects. Disséquez leurs déclarations, mettez-les face à leurs propres paroles et révélez leurs mensonges ! Le seul moyen de survivre est d\'appuyer sur la détente.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/413410/header.jpg?t=1731312195', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1554, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1556, 'Danganronpa S: Ultimate Summer Camp', 'With an all-star dream lineup of characters from each Danganronpa game, gather Hope Fragments at a tropical resort. Explore Jabberwock Island and develop your Dangan characters. Gather money through battle and upgrade your equipment, then defeat bosses and move on to the next island!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1691970/header.jpg?t=1715701297', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1555, 0),
(1557, 'Danganronpa Another Episode: Ultra Despair Girls', 'Depuis plus d\'un an, Komaru Naegi est séquestrée dans un mystérieux appartement. Son sauvetage dérape lorsque des centaines de Monokumas attaquent soudain. Elle s\'allie à Toko Fukawa pour survivre aux Monokumas déchaînés, échapper aux rusés Gamins Monokuma et découvrir les secrets de la ville.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/555950/header.jpg?t=1715701294', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1556, 0),
(1558, 'Tales of Arise', '300 ans de tyrannie. Un masque mystérieux. De la douleur et des souvenirs perdus. Brandissez l\'Épée ardente et combattez vos tyrans aux côtés d\'une mystérieuse jeune fille et de personnages encore plus expressifs grâce aux nouveaux graphismes !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/740130/header.jpg?t=1717810303', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', 1, 1557, 0),
(1559, 'Power Rangers: Battle for the Grid - Dai Shi', 'Cela déverrouille Dai Shi - le méchant Jungle Fury, un personnage à part entière, qui sera joué dans Power Rangers: Battle for the Grid', 'https://cfinder.xyz/uploads/PowerRangersBattlefortheGrid-DaiShi.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:39', '2025-09-09 15:30:13', NULL, 1558, 0),
(1560, 'Quest Hunter', 'Quest Hunter est un action-RPG isométrique où le déroulement de l’histoire dépend de votre choix. Trouvez des trésors, résolvez des casse-têtes, équipez votre personnage, améliorez vos habiletés et combattez des ennemis. Jouez seul, avec des amis ou faites une partie à quatre en ligne!', 'https://cfinder.xyz/uploads/QuestHunter.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', NULL, 1559, 0),
(1561, 'Finding Frankie', 'Finding Frankie VOUS invite à vivre une expérience réellement terrifiante sur un parkour aussi horrible que tordu. Faufilez-vous à l\'insu d\'horribles personnages et frayez-vous un chemin jusqu\'à la sortie. Vous n\'allez quand même pas passer à côté de ce jeu !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2597970/header.jpg?t=1731527788', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1560, 0),
(1562, 'Storage Hunter Simulator', 'Participez à la vente aux enchères d\'entrepôts et de conteneurs abandonnés. Votre tâche consiste à estimer correctement la valeur des objets présents dans la pièce. Le vainqueur est celui qui gagne le plus d\'argent. Les sites et les enchérisseurs peuvent réserver plus d\'une surprise aux joueurs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1442430/header.jpg?t=1734439749', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1561, 0),
(1563, 'Hatred', 'Hatred is a violent twin-stick shooter, in which you take the role of The Antagonist fighting against all of humanity.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/341940/header.jpg?t=1727965684', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1562, 0),
(1564, 'Cooking Simulator', 'Devenez le chef ultime ! Prenez le contrôle d\'une cuisine réaliste remplie d\'ustensiles et d\'équipements. Débloquez et préparez plus de 80 recettes et utilisez des dizaines d\'ingrédients pour cuisiner tout ce que vous voulez. Le tout saupoudré d\'une touche de physique ultra-réaliste.', 'https://cfinder.xyz/uploads/CookingSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', NULL, 1563, 0),
(1565, 'ULTIMATE MARVEL VS. CAPCOM 3', 'Marvel et Capcom se sont associés pour vous proposer les combats en équipe à 3 contre 3 les plus intenses qui soient avec Ultimate Marvel vs. Capcom 3. Ce nouveau titre regorge de fonctionnalités et propose notamment tous les contenus téléchargeables précédents ainsi que Marvel vs. Capcom: Official Complete Works.', 'https://cfinder.xyz/uploads/ULTIMATEMARVELVSCAPCOM3.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', NULL, 1564, 0),
(1566, 'Train Sim World® 5', 'À vous les rails avec Train Sim World 5 ! Relevez de nouveaux défis et endossez de nouveaux rôles en apprenant à maîtriser les rails et les trains de villes iconiques sur 3 nouveaux itinéraires. Immergez-vous dans un divertissement ferroviaire ultime et embarquez pour votre prochain voyage.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2967990/header_alt_assets_0.jpg?t=1734631020', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1565, 0),
(1567, 'WHAT THE PAK?!', 'WHAT THE PAK?! est un jeu de fête à mini-jeux en mode rush, au rythme rapide, pour jusqu\'à 8 joueurs. Nos divers mini-jeux sont conçus pour que vous puissiez faire toutes sortes de pitreries avec vos amis. Frappez-les, léchez-les... Volez leurs poules avant de les jeter par-dessus bord.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2752710/header.jpg?t=1733774333', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 2, 1566, 0),
(1568, 'Age of History 3', 'Embarquez pour un voyage épique avec Age of History 3, qui vous emmène à travers la vaste chronologie de l\'histoire humaine. De l\'ère des civilisations aux royaumes d\'un futur lointain, incarnez diverses civilisations allant des empires dominants aux petites tribus.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2772750/header.jpg?t=1733603632', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1567, 0),
(1569, 'Simulateur de Carte Fantasy', 'Simulateur de Carte Fantasy: Créez et observez l\'évolution de mondes imaginaires. Concevez des cartes, simulez des nations. Voyez des empires s\'élever sur votre fond d\'écran. Une simulation unique pour les passionnés d\'histoire et les esprits créatifs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3035500/header.jpg?t=1731470519', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1568, 0),
(1570, 'DRAGON QUEST BUILDERS™ 2', 'DRAGON QUEST BUILDERS™ 2 est un jeu de rôle et de construction dans un monde fantastique menacé par une secte maléfique. Explorez, combattez, créez et récoltez dans la campagne solo ou bâtissez des projets dans le bac à sable en ligne pour 4 joueurs.', 'https://cfinder.xyz/uploads/DRAGONQUESTBUILDERS2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', NULL, 1569, 0),
(1571, 'Escape the Ayuwoki', 'Escape The Ayuwoki is a first person horror-adventure videogame, in which you need to escape from a haunted mansion as quiet as possible, to evade the hideous creature called \"The Ayuwoki\". Stealth Mode will be your ally!', 'https://cfinder.xyz/uploads/EscapetheAyuwoki.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', NULL, 1570, 0),
(1572, 'Les Fourmis', 'Partez à la conquête de nids ennemis et guidez votre colonie à travers les périls de la forêt dans ce STR novateur. Les Fourmis est un jeu de stratégie en temps réel photoréaliste à la troisième personne dans lequel vous commandez des légions d\'insectes au cours d\'affrontements épiques.', 'https://cfinder.xyz/uploads/LesFourmis.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', NULL, 1571, 0),
(1573, 'LOLLIPOP CHAINSAW RePOP', 'Juliet, la légendaire chasseuse de zombies, est de retour en 4K !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2658450/header_french.jpg?t=1732876695', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1572, 0),
(1574, 'Call of Duty® 4: Modern Warfare® (2007)', 'Le nouvel opus de l\'équipe Infinity Ward, les créateurs de la série Call of Duty®, nous délivrent leur meilleure création jusqu\'alors. Call of Duty 4: Modern Warfare vous enrôle et vous fournit les armes les plus puissantes avant de vous envoyer aux 4 coins du globe combattre un ennemi menaçant l\'équilibre du monde.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/7940/header.jpg?t=1731698665', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1573, 0),
(1575, 'LEGO® Horizon Adventures™', 'Rejoignez la chasseuse de machines Aloy et sa bande de héros truculents dans une quête pour sauver le monde et découvrir les secrets de son passé. Plongez dans une aventure captivante, personnalisez à l\'infini et combattez en solo ou avec vos amis.', 'https://cfinder.xyz/uploads/LEGOHorizonAdventures.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', NULL, 1574, 0),
(1576, 'Dragon Age™: The Veilguard', 'Unissez la Garde du Voile et défiez les dieux dans Dragon Age™: The Veilguard, un RPG solo immersif dans lequel vous serez le ciment de l’équipe.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1845910/header.jpg?t=1733835290', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1575, 0),
(1577, 'CARRION', 'CARRION est un jeu d\'horreur inversé : vous incarnez une créature informe d\'origine inconnue, captive d\'un complexe de recherche.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/953490/header.jpg?t=1719983753', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1576, 0),
(1578, 'Colony Survival', 'Colony Survival is a unique first-person strategy game developed by a two-man team. Build your own colony in a voxel world. Command guards, farmers, miners and other colonists. Defend your colony against the horde of monsters that attacks every night!', 'https://cfinder.xyz/uploads/ColonySurvival.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', NULL, 1577, 0),
(1579, 'Rivals of Aether', 'RIVALS OF AETHER is an indie fighting game where warring civilizations summon the power of Fire, Water, Air, and Earth. Play with up to four players either locally or online.', 'https://cfinder.xyz/uploads/RivalsofAether.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', NULL, 1578, 0),
(1580, 'Danganronpa V3: Killing Harmony', '16 nouveaux personnages sont enlevés et emprisonnés dans une école. Certains vont tuer, d’autres mourir, et des punitions seront infligées. Revoyez votre conception de ce qu\'est une enquête effrénée aux enjeux de taille en enquêtant sur des meurtres retors et en condamnant à mort vos nouveaux amis.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/567640/header.jpg?t=1715701301', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:40', '2025-09-09 15:30:13', 1, 1579, 0),
(1581, 'House', 'Try to survive through the night in a house that\'s trying its best to kill you and your family.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1444350/header.jpg?t=1711608083', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1580, 0),
(1582, 'CarX Street', 'Dominez les routes de montagne, les larges autoroutes et les rues animées de CarX Street. Construisez et tunez la voiture de vos rêves avec le puissant système physique de CarX Technology©. En ligne ou hors ligne, participez à des courses pleines de réalisme avec des commandes dynamiques.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1114150/header.jpg?t=1731076952', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1581, 0),
(1583, 'Backrooms: Escape Together', 'A visually lifelike 1-6 player co-op survival horror made in Unreal Engine 5. Explore 7 procedurally generated levels that host liminal environments, puzzles, and entities with new levels and content added regularly. You are at the mercy of what\'s lurking and must do whatever it takes to escape.', 'https://cfinder.xyz/uploads/BackroomsEscapeTogether.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1582, 0),
(1584, 'Panic In The Woods', 'Un jeu d\'horreur et de survie en solo ou en coop jusqu\'à 4 joueurs. Perdus dans une forêt effrayante, vous êtes traqués par un monstre terrifiant. Restez silencieux en récupérant des clés dans des mondes cauchemardesques avec des pièges, sonars et fusées éclairantes pour survivre !', 'https://cfinder.xyz/uploads/PanicInTheWoods.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1583, 0),
(1585, 'Fast Food Simulator', 'Bienvenue dans l\'endroit le plus chaotique du monde ! Jouez en solo ou en coopération jusqu\'à 6 joueurs. Dirigez un fast-food et travaillez avec vos amis pour développer votre entreprise. Prenez les commandes, préparez les hamburgers et augmentez vos revenus en traitant avec les clients.', 'https://cfinder.xyz/uploads/FastFoodSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1584, 0),
(1586, 'Just Cause 2', 'Plongez dans cette aventure bourrée d\'adrenaline, de centaines d\'armes et de véhicules.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/8190/header.jpg?t=1728396849', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1585, 0),
(1587, 'Marvel vs. Capcom: Infinite', 'La confrontation épique entre deux univers incroyablement fouillés connaît un nouveau rebondissement avec Marvel vs. Capcom: Infinite. Avec les Gemmes de l\'Infini pour unique espoir, d\'intrépides héros s\'unissent pour contrer Ultron Sigma, qui entend éradiquer toute forme de vie biologique.', 'https://cfinder.xyz/uploads/MarvelvsCapcomInfinite.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1586, 0),
(1588, 'Ara: History Untold', 'Bâtissez une nation et guidez votre peuple à travers les méandres de l\'histoire jusqu\'à l\'apogée de l\'accomplissement humain. Explorez de nouveaux territoires en développant les arts et la culture, en menant des actions diplomatiques et en rivalisant avec vos adversaires pour prouver que vous êtes le plus grand dirigeant jamais connu.', 'https://cfinder.xyz/uploads/AraHistoryUntold.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1587, 0),
(1589, 'Maneater', 'Découvrez la puissance ultime en incarnant le plus grand prédateur des mers, le requin géant ! Terrorisez les zones côtières. Démembrez des nageurs et faites-vous craindre des humains !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/629820/header.jpg?t=1697725794', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1588, 0),
(1590, 'BERSERK and the Band of the Hawk', 'Découvrez la rencontre entre \"Warriors\" et \"Berserk\" ! Dans ce jeu, la possibilité de terrasser des centaines d\'ennemis, essentielle dans la série des Warriors, est combinée à l\'ambiance sombre et violente du monde de \"Berserk\", ce qui rend possibles certaines actions jusque-là impossibles, comme se servir...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/502280/header.jpg?t=1729051111', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1589, 0),
(1591, 'Transport INC', 'Deviens le manager de la plus grande entreprise de transport qui ait jamais existé! Crée de nouvelles connections d\'avions, d\'autobus et de camions. Réagis aux demandes toujours flexibles et aux événements inattendus. Triomphe de la concurrence. Relie les villes de la vraie carte du monde!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/936500/header.jpg?t=1726272163', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1590, 0),
(1592, 'Squirrel with a Gun', 'Un écureuil... avec un flingue. Incarnez le rongeur détesté du quartier et développez une affinité pour le crime et le chaos en cherchant des glands dorés dans ce jeu de type sandbox mêlant tir et casse-têtes. Usez de vos dents, griffes et armes pour fuir un complexe souterrain secret et ses Agents.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2067050/header.jpg?t=1727904923', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1591, 0),
(1593, 'Journey To The Savage Planet', '\"BIENVENUE DANS LE PROGRAMME PIONNIER ! Vous êtes la nouvelle recrue de Kindred Aerospace - la 4e entreprise d\'exploration spatiale - et votre mission consiste à déterminer si la planète ARY-26 est habitable pour les humains.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/973810/header.jpg?t=1723047768', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1592, 0),
(1594, 'Prisoners', 'Partie en ligne dans laquelle des joueurs (2-10) condamnés à mort tentent de gagner leur liberté et le grand prix en éliminant d\'autres joueurs', 'https://cfinder.xyz/uploads/Prisoners.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1593, 0),
(1595, 'Injustice™ 2', 'Améliorez et personnalisez vos personnages DC préférés afin d\'en faire des combattants ultimes dans INJUSTICE 2. C\'est votre légende. Votre histoire. Votre injustice.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/627270/header.jpg?t=1708021375', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1594, 0),
(1596, 'Forza Motorsport 7', 'Forza Motorsport 7 plonge les joueurs dans le frisson exaltant de la course compétitive. De la maîtrise de la nouvelle campagne inspirée du sport automobile à la collection d\'une large gamme de voitures en passant par l\'expérience de la conduite à la limite, voici Forza réinventé.', 'https://cfinder.xyz/uploads/ForzaMotorsport7.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1595, 0),
(1597, 'Indiana Jones et le Cercle Ancien', 'Découvrez l\'un des plus grands mystères de l\'Histoire dans une aventure solo à la première personne. Nous sommes en 1937. Des forces sinistres parcourent le globe pour trouver le secret d\'un pouvoir ancestral lié au Cercle Ancien. Une seule personne peut les arrêter : Indiana Jones™.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2677660/header_french.jpg?t=1733702560', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 2, 1596, 0),
(1598, 'TheoTown', 'Build and manage your dream city in this captivating simulation game. Create unique urban landscapes and enjoy compatibility with the mobile versions. Unleash your creativity and shape the metropolis of your dreams.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1084020/header.jpg?t=1729507396', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1597, 0),
(1599, 'Tank Mechanic Simulator', 'Rénovez et construisez des chars de la seconde guerre mondiale. Démontez entièrement des chars en utilisant différents outils. Transformez des épaves rouillées en chars qui fonctionnent parfaitement. Testez-les sur le terrain d\'entraînement, vendez-les ou mettez-les dans votre propre musée.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/407130/header.jpg?t=1725003326', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1598, 0),
(1600, 'Lawn Mowing Simulator', 'Vivez l’expérience unique de tondre les parcs et jardins des plus belles campagnes anglaises dans Lawn Mowing Simulator, le seul simulateur qui vous permet de conduire d’authentiques tondeuses à gazon de fabricants prestigieux tels Toro, SCAG et STIGA, et de développer votre entreprise de tonte.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1480560/header.jpg?t=1728998504', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1599, 0),
(1601, 'Fears to Fathom - Woodbury Getaway', 'Sydney Harper, une femme de 23 ans travaillant dans un cabinet de conseil, organise un weekend d\'escapade dans une location à Woodbury avec ses amis de l\'université. Jamais ils n\'auraient pu imaginer ce qui allait se dérouler durant leur séjour.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2961530/header.jpg?t=1726757992', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1600, 0),
(1602, 'Warhammer 40,000: Space Marine 2', 'Devenez un Space Marine, véritable incarnation de puissance surhumaine. Massacrez les nuées tyranides grâce à vos talents mortels et à votre armement. Défendez l’Imperium seul ou à plusieurs au cœur de combats spectaculaires à la troisième personne.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2183900/header.jpg?t=1732028471', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1601, 0),
(1603, 'Bopl Battle', 'Un jeu en ligne où tu affrontes tes amis, avec des capacités uniques et déjantées. Il y a tellement de combo comme un rayon rétrécissant, un créant des trous noirs, un arrêtant le temps, un t’attachant à une fusée pour décoller dans les airs. Choisis la combinaison pour remporter le match', 'https://cfinder.xyz/uploads/BoplBattle.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1602, 0),
(1604, 'Ashen', 'Ashen est un jeu de rôle et d’action dans lequel un vagabond cherche un lieu où s’établir.', 'https://cfinder.xyz/uploads/Ashen.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1603, 0),
(1605, 'LEGO® Jurassic World', 'Retraçant les scénarios épiques de Jurassic Park, Le Monde perdu : Jurassic Park et Jurassic Park III, ainsi que du très attendu Jurassic World, LEGO® Jurassic World™ est le premier jeu vidéo permettant aux joueurs de redécouvrir et vivre les quatre films Jurassic Park.', 'https://cfinder.xyz/uploads/LEGOJurassicWorld.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', NULL, 1604, 0),
(1606, 'POSTAL 4: No Regerts', 'POSTAL 4 : No “Regrets” est un sandbox FPS satirique et scandaleusement comique, c’est très attendue suite officiel du jeu qui a été élu “Pire Jeu de Tous Les Temps ™” POSTAL 2 !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/707030/header.jpg?t=1726332007', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1605, 0),
(1607, 'The Callisto Protocol™', 'Survivez pour échapper aux horreurs de Callisto et découvrez les terribles secrets de la lune morte de Jupiter.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1544020/header.jpg?t=1726806420', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:41', '2025-09-09 15:30:13', 1, 1606, 0),
(1608, 'FLATHEAD', 'Over or Under? A simple game of gambling with your life.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2840480/header.jpg?t=1730135132', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1607, 0),
(1609, 'EVERSPACE™ 2', 'EVERSPACE 2 est un jeu de tir solo au rythme effréné, ou vous explorez l’espace et récupérez du butin, composé d’éléments RPG, d’extraction minière et de fabrication. Vivez une histoire de science-fiction passionnante dans un monde vivant, conçu par nos soins, regorgeant de secrets et de dangers.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1128920/header.jpg?t=1731056121', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1608, 0),
(1610, 'Vampyr', 'Londres, 1918. Vous êtes le Dr. Jonathan Reid. Vous êtes un vampire. En tant que docteur, vous cherchez un remède au fléau qui décime la population - mais le vampire en vous réclame le sacrifice de ceux que vous aviez juré de protéger.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/427290/header.jpg?t=1727792911', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1609, 0),
(1611, 'Salt and Sanctuary', 'Explore a haunting, punishing island in this stylized 2D action RPG. Salt and Sanctuary combines fast and brutal 2D combat with richly developed RPG mechanics in a cursed realm of forgotten cities, blood-soaked dungeons, and desecrated monuments.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/283640/header.jpg?t=1729712419', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1610, 0),
(1612, 'Fate/stay night REMASTERED', 'Seek the root of the Fate franchise. Return to where it all began.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2396980/header.jpg?t=1726036301', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 2, 1611, 0),
(1613, 'Counter-Strike 1.6', 'Découvrez le jeu d\'action en ligne le plus populaire au monde. Joignez-vous à une lutte antiterroriste au réalisme époustouflant dans ce jeu d\'équipe extrêmement populaire. Avec vos coéquipiers, accomplissez des missions stratégiques, partez à l\'assaut des sites ennemis et sauvez des otages.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/10/header.jpg?t=1729702322', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', NULL, 1612, 0),
(1614, 'Bellwright', 'Fondez et agrandissez vos propres villages, libérez la terre et aidez ses habitants, recrutez d\'autres personnes à votre cause tout en en apprenant plus sur la vie que vous avez dû abandonner. Commandez vos forces, prouvez votre bravoure au combat et affirmez-vous en tant que héros de votre peuple.', 'https://cfinder.xyz/uploads/Bellwright.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', NULL, 1613, 0),
(1615, 'Shotgun Farmers', 'Shotgun Farmers est un jeu de tir multijoueur dans lequel les tirs ratés font pousser de nouvelles armes !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/604240/header.jpg?t=1732218882', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1614, 0),
(1616, 'The Casting of Frank Stone™', 'L\'ombre de Frank Stone plane sur Cedar Hills, une ville à jamais altérée par son passé violent. Comme un groupe d’amis va bientôt le découvrir, l\'héritage sanglant de Stone est profondément ancré, laissant des cicatrices à travers les familles, les générations et le tissu même de la réalité.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2223840/header.jpg?t=1725654929', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', NULL, 1615, 0),
(1617, 'Boogeyman', 'Live your childhood nightmare and try to survive against the Boogeyman. Equipped with only your flashlight, survive each night until the morning light.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/412770/header.jpg?t=1717081475', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1616, 0),
(1618, 'Warhammer 40,000: Darktide', 'Reprenez la ville de Tertium aux hordes d\'ennemis assoiffés de sang dans ce jeu de tir intense et brutal. Warhammer 40,000: Darktide est la nouvelle expérience de coopération par l\'équipe primée à l\'origine de la série Vermintide. Avec la chute de Tertium, les parias s\'élèveront.', 'https://cfinder.xyz/uploads/Warhammer40000Darktide.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', NULL, 1617, 0),
(1619, 'Fly Corp', 'Créez votre propre réseau de transport à travers divers pays et villes : Créez de nouvelles routes, achetez de nouveaux avions et améliorez-les et augmentez la capacité des aéroports !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1372530/header.jpg?t=1733247831', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1618, 0),
(1620, 'UBOAT', 'UBOAT est un simulateur de sous-marin à l\'époque de la Seconde Guerre mondiale. C\'est un jeu bac à sable de survie proposant la gestion d\'un équipage et son thème principal repose sur la vie des marins allemands. Le sous-marin est leur maison, mais peut à tout moment devenir leur tombeau.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/494840/header.jpg?t=1728659421', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1619, 0),
(1621, 'Sunset Overdrive', 'Sunset Overdrive transforms an open-world apocalypse into your tactical playground. Zip, grind and wall-run across Sunset City with an unconventional arsenal. Hyper-agility, unique weapons, and customizable abilities deliver an explosive and irreverent adventure in the end times.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/847370/header.jpg?t=1667851405', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', NULL, 1620, 0),
(1622, 'Fate/Samurai Remnant', '« Ton vœu mourra... » Une Holy Grail War débute à l\'époque d\'Edo du Japon. Un tout nouveau jeu de rôle et d\'action Fate présenté par TYPE-MOON and KOEI TECMO GAMES.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1902690/header.jpg?t=1729050888', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1621, 0),
(1623, 'Last Stop', 'Last Stop est une aventure pour un joueur à la troisième personne, qui se déroule dans le Londres d’aujourd’hui. On y incarne trois personnages différents, dont les univers se croisent au milieu d’une crise au caractère surnaturel.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1122690/header.jpg?t=1729099916', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1622, 0),
(1624, 'Adobe Illustrator 2025', 'Dans Illustrator 2024, l\'une des fonctionnalités les plus remarquables est “Text to Vector Image,” qui ouvre de nouvelles possibilités pour la création d\'illustrations vectorielles. Cette fonction permet aux utilisateurs de générer des illustrations à partir de simples prompts textuels.', 'https://i.postimg.cc/5tGJqTK6/anh-bia-adobe-illustrator-2025-rhtlgnf.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', NULL, 1623, 0),
(1625, 'The Quintessential Quintuplets - Five Memories Spent With You', 'I want to confess my feelings for you...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2507620/header.jpg?t=1716890806', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1624, 0),
(1626, 'Mouthwashing', 'Les cinq membres d\'équipage du Tulpar se retrouvent coincés aux confins de l\'espace, plongés dans un crépuscule perpétuel. Dieu les a abandonnés.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2475490/header.jpg?t=1732038344', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1625, 0),
(1627, 'Escape Academy', 'Venez apprendre l\'art de l\'évasion dans Escape Academy. Résolvez des casse-têtes, piratez des serveurs, rencontrez les professeurs et préparez la tasse de thé parfaite, le tout entièrement jouable en solo ou en coop avec un ami, en local ou en ligne !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1812090/header.jpg?t=1731528274', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1626, 0),
(1628, 'Wandersong', 'A musical platforming adventure with an emotional story. Play as a silly bard and use music to interact with everything on a journey around the world. Along the way you\'ll explore, solve puzzles, and meet a huge cast of characters!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/530320/header.jpg?t=1728309447', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1627, 0),
(1629, 'Le Vaillant Petit Page', 'Les personnages d\'un conte découvrent un monde en trois dimensions à l\'extérieur du livre dans lequel ils vivent. Ils devront passer d\'un univers 2D à 3D et inversement pour sauver leurs amis dans cette aventure charmante pleine d\'action.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1627570/header_french.jpg?t=1730740429', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1628, 0),
(1630, 'S.T.A.L.K.E.R. 2: Heart of Chornobyl', 'Partez explorer la vaste Zone d\'exclusion de Tchornobyl et ses ennemis redoutables, ses anomalies mortelles et ses puissants artefacts. Découvrez votre propre histoire épique en vous frayant un chemin jusqu\'au cœur de Tchornobyl.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1643320/header.jpg?t=1732124346', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1629, 0),
(1631, 'Night in the Woods', 'NIGHT IN THE WOODS is an adventure game focused on exploration, story, and character, featuring dozens of characters to meet and lots to do across a lush, vibrant world.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/481510/header.jpg?t=1706292417', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', 1, 1630, 0),
