(1635, 'Call of the Wild The Angler', 'Les créateurs de theHunter: Call of the Wild vous proposent une expérience de pêche en monde ouvert ! Détendez-vous dans votre endroit favori ou baladez-vous en pleine nature avec vos amis, et devenez un maître de la pêche.', 'https://cfinder.xyz/uploads/CalloftheWildTheAngler.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:42', '2025-09-09 15:30:13', NULL, 1634, 0),
(1636, 'Descenders', 'Descenders est un jeu de descente VTT extrême avec génération procédurale du terrain, et où les erreurs ont de réelles conséquences. Allez-vous mener votre équipe à la victoire et devenir le prochain Descender de légende ?', 'https://cfinder.xyz/uploads/Descenders.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1635, 0),
(1637, 'Castle Crashers®', 'Sortez votre épée et frayez-vous un chemin vers la victoire dans ce jeu d\'arcade aventure en 2D primé et signé The Behemoth !', 'https://cfinder.xyz/uploads/CastleCrashers.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1636, 0),
(1638, 'Trepang2', 'Devenez le plus badass des badass dans Trepang2 : un FPS gore bourré d\'action dans un futur lointain. Faites pleuvoir la mort sur vos ennemis, esquivez les balles et laissez derrière vous un sillon de destruction dans ce jeu de tir hardcore et effréné.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1164940/header.jpg?t=1726498689', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1637, 0),
(1639, 'Sunset Overdrive', 'Sunset Overdrive transforms an open-world apocalypse into your tactical playground. Zip, grind and wall-run across Sunset City with an unconventional arsenal. Hyper-agility, unique weapons, and customizable abilities deliver an explosive and irreverent adventure in the end times.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/847370/header.jpg?t=1667851405', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1638, 0),
(1640, 'Tabletop Simulator', 'Tabletop Simulator is the only simulator where you can let your aggression out by flipping the table! There are no rules to follow: just you, a physics sandbox, and your friends. Make your own online board games or play the thousands of community created mods. Unlimited gaming possibilities!', 'https://cfinder.xyz/uploads/TabletopSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1639, 0),
(1641, 'UBOAT', 'UBOAT est un simulateur de sous-marin à l\'époque de la Seconde Guerre mondiale. C\'est un jeu bac à sable de survie proposant la gestion d\'un équipage et son thème principal repose sur la vie des marins allemands. Le sous-marin est leur maison, mais peut à tout moment devenir leur tombeau.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/494840/header.jpg?t=1728659421', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1640, 0),
(1642, 'Planetary Annihilation: TITANS', 'Faites la guerre à travers des systèmes solaires entiers avec de gigantesques armées à vos ordres. Annihilez les forces ennemies avec des unités de classe TITAN révolutionnaires et détruisez des planètes avec des super-armes massives !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/386070/header.jpg?t=1723020373', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1641, 0),
(1643, 'Aseprite', 'Aseprite is a pixel-art tool to create 2D animations, sprites, and any kind of graphics for games.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/431730/header.jpg?t=1712679350', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1642, 0),
(1644, 'Blockbuster Inc.', 'Créez les films que vous voulez voir! Êtes-vous un amateur de cinéma? Ou peut-être avez-vous vraiment envie de réaliser cette parodie qui vous trotte dans la tête depuis longtemps? Gérez votre propre studio, développez-le, décorez-le et gagnez des prix!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1793090/header.jpg?t=1730895712', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1643, 0),
(1645, 'Children of the Sun', 'En route pour un voyage mortel dans les ténèbres, vous contrôlez la trajectoire d\'une seule balle et libérez une folie vengeresse contre la sinistre secte qui a détruit votre vie dans ce puzzle-shooter tactique.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1309950/header.jpg?t=1721667684', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1644, 0),
(1646, 'Company of Heroes 3', 'Plus impressionnant que jamais, Company of Heroes 3 associe un combat haletant à des choix stratégiques encore plus complexes dans un sublime théâtre d\'opérations méditerranéen. Dans Company of Heroes 3, chaque bataille a une histoire... Alors, quelle sera la vôtre ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1677280/header.jpg?t=1722417077', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1645, 0),
(1647, 'Escape Simulator', 'Jeu d\'énigmes à la première personne, peut être joué seul ou en ligne en mode co-op (Idéal pour 2-3 joueurs, mais ouvert à plus de joueurs). L\'éditeur de niveau prend en charge les scènes créent par la communauté.', 'https://cfinder.xyz/uploads/EscapeSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1646, 0),
(1648, 'Farming Simulator 25', 'Farming Simulator 25 vous invite à rejoindre la vie gratifiante de la ferme, en solo ou en coopération en multijoueur. Cette ferme est la vôtre !', 'https://cfinder.xyz/uploads/FarmingSimulator25.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1647, 0),
(1649, 'CODE VEIN', 'Unis face à une mort certaine. Aventurez-vous aux confins de l\'enfer pour retrouver votre passé et échapper à ce cauchemar éveillé dans CODE VEIN.', 'https://cfinder.xyz/uploads/CODEVEIN.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1648, 0),
(1650, 'Assassin\'s Creed Mirage', 'Découvrez l\'histoire de Basim, voleur à la tire habile mais atteint de visions cauchemardesques, qui cherche désespérément des réponses, mais aussi la justice, dans les rues animées du Bagdad du IXe siècle. Par l\'intermédiaire d\'une société aussi ancienne que mystérieuse appelée Ceux qu\'on ne voit pas, il va devenir un tueur redoutable et son sort va prendre une tournure qu\'il n\'aurait jamais imaginée.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3035570/header.jpg?t=1729184423', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 2, 1649, 0),
(1651, 'Super Mario Party Jamboree', 'Super Mario Party Jamboree est un jeu de société virtuel développé par Nintendo, sorti le 17 octobre 2024 sur Nintendo Switch. Il propose aux joueurs de participer à des parties endiablées sur sept plateaux variés, dont cinq inédits, en incarnant l\'un des 22 personnages jouables.', 'https://www.nintendo.com/eu/media/images/10_share_images/games_15/nintendo_switch_4/2x1_NSwitch_SuperMarioPartyJamboree_image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1650, 0),
(1652, 'Funko Fusion', 'Découvrez un festival de pop culture unique dans Funko Fusion ! Incarnez divers personnages dans des mondes emblématiques inspirés par certaines de vos franchises préférées dans un jeu d’action-aventure à l’humour original, unique et irrévérencieux, imaginé par les esprits créatifs de 10:10 Games.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1843310/header.jpg?t=1730737898', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1651, 0),
(1653, 'Amnesia: The Bunker', 'Amnesia: The Bunker est un jeu d\'horreur à la première personne qui se déroule dans un bunker de la Première Guerre mondiale. Faites face aux dangers tapis dans l\'ombre. Trouvez les outils et les armes à votre disposition, et gardez les lampes allumées pour espérer survivre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1944430/header.jpg?t=1729682218', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1652, 0),
(1654, 'Liar\'s Bar', 'Plongez dans cette expérience multijoueur en ligne se déroulant dans un bar sommaire où les jeux sont aussi dangereux que les clients. Rejoignez une table de 4 et testez vos compétences dans Liar\'s Dice et Liar\'s Deck, où le mensonge et le bluff sont la clé de la victoire. Prêt pour une soirée au Liar\'s Bar ?', 'https://i.ibb.co/FL1XK342/header-8.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 2, 1653, 0),
(1655, 'DEATH NOTE Killer Within', 'DEATH NOTE Killer Within est un jeu de déduction sociale en ligne pour 10 joueurs maximum. Les joueurs sont répartis en deux équipes aux objectifs opposés. Pour gagner, ils devront découvrir l\'identité des autres et soit éliminer L, qui menace le pouvoir de Kira, soit s\'emparer du Death Note.', 'https://i.ibb.co/dcc15vM/2213190-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 2, 1654, 0),
(1656, 'Subterranauts', 'Subterranauts est un jeu d\'horreur multijoueur pour 2 à 6 joueurs avec chat vocal de proximité et créatures terrifiantes. Votre travail consiste à accomplir des missions en collectant de la ferraille pour l\'Association of Scrap Allocation. Travaillez avec votre équipe pour accomplir des missions, gagner des Bucks d\'entreprise et survivre !', 'https://i.ibb.co/PgK5Gq7/3075800-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1655, 0),
(1657, 'Red Dead Redemption', 'Vivez l\'histoire de John Marston, un ancien hors-la-loi qui traque les derniers membres de la célèbre bande de Van der Linde avec l\'arrivée sur PC de l\'illustre prédécesseur de Red Dead Redemption 2.\r\n', '/storage/game_banners/red-dead-redemption-310e074b15.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1656, 0),
(1658, 'Trombone Champ', 'Klaxonnez, soufflez et amp; Parcourez plus de 60 chansons, collectionnez les 50 cartes Tromboner uniques et découvrez les mystères du Trombiverse. Avez-vous ce qu\'il faut pour devenir le véritable champion du trombone ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1059990/header.jpg?t=1725572078', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', NULL, 1657, 0),
(1659, 'Endorphin Vice', 'Endorphin Vice est un jeu bac à sable basé sur la physique permettant d\'explorer des réactions gore et blessées réalistes. Personnalisez votre environnement avec des objets et des équipements conçus de manière tactique. Incarnez un justicier en utilisant des tactiques et des outils militaires pour créer et tester divers scénarios et effets.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1861610/header.jpg?t=1728005214', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1658, 0),
(1660, 'Junkyard Truck', 'Junkyard Truck is an open-world off road driving and mechanic simulator. Build, upgrade, and maintain your old off road truck. Make money using your skills in driving, scavenging, gambling, or moonshine brewing. Try to build a truck capable of taking on the difficult challenges around the map.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1697880/header.jpg?t=1707594358', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:43', '2025-09-09 15:30:13', 1, 1659, 0),
(1661, 'The Break-In', 'Voler tout. Même les gens. Le Break-In vous permet d\'emporter tout ce que vous voulez, des téléviseurs aux réfrigérateurs en passant par les toilettes. Et le tout en coopération pour 1 à 4 joueurs, VR et non VR. Sélectionnez votre véhicule de fuite, qu\'il s\'agisse d\'un vélo ou d\'un fourgon de police volé, et chargez-le avec du matériel comme des marteaux et des propulseurs de fusée, et volez.\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1397390/header.jpg?t=1689627306', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', NULL, 1660, 0),
(1662, 'Bud Spencer and Terence Hill Slaps and Beans 2', 'Suite à leur naufrage en terres Africaines, Bud et Terence sauvent un village d\'une bande de criminels et parviennent à rentrer chez eux sur un rafiot plein de bananes. Sauf que ce ne serait pas une aventure de nos deux héros si tout se passait comme prévu.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2142330/header.jpg?t=1712483875', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1661, 0),
(1663, 'Fort Solis', 'Fort Solis est un thriller captivant se déroulant sur la planète rouge.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1931730/header.jpg?t=1730111521', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1662, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1664, 'AirportSim', 'AirportSim est un simulateur de services aéroportuaires avec des graphismes et des activités réalistes, des avions et véhicules sous licence, de vrais aéroports et des conditions météo en direct. Accomplissez de nombreuses tâches seul ou avec vos amis pour une expérience inoubliable.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1715280/header.jpg?t=1729256349', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1663, 0),
(1665, 'I Am Fish', 'I Am Fish est un charmant jeu d\'aventure basé sur la physique avec quatre poissons intrépides arrachés à leur foyer et enfermés dans un aquarium. Nagez, volez, roulez et mordez pour retrouver votre liberté et vos amis dans l\'océan.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1472560/header.jpg?t=1728988473', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1664, 0),
(1666, 'Adobe InDesign 2024', 'Adobe InDesign 2024 est un logiciel de création vectorielle utilisé pour la conception graphique, le dessin et l\'illustration. Il permet aux utilisateurs de créer des images de haute qualité pour des projets d\'impression et de web design.', 'https://i.ytimg.com/vi/iC_c6wQZHxo/maxresdefault.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', NULL, 1665, 0),
(1667, 'Lossless Scaling', 'All-in-one gaming utility for scaling and frame generation', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/993090/header.jpg?t=1723403204', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', NULL, 1666, 0),
(1668, 'Monster Hunter Rise: Sunbreak', 'Extension Monster Hunter Rise: Sunbreak L\'univers de Monster Hunter Rise s\'agrandit avec une extension monstrueuse comportant de nouveaux monstres, des régions inédites et bien plus encore !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1880360/header.jpg?t=1727684396', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 2, 1667, 0),
(1669, ' OMSI 2', 'Off to the next round! Experience a new omnibus simulator with OMSI 2 and start discovering Spandau while driving the omnibus. OMSI 2 is the successor of the well-known and awarded omnibus simulator \"OMSI - The Bus Simulator\".', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/252530/header.jpg?t=1725972328', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1668, 0),
(1670, 'Call Of Duty: Modern Warfare III', 'La série action/FPS la plus vendue de tous les temps revient avec la suite épique de Call of Duty®: Modern Warfare® 2', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/115300/header.jpg?t=1692032509', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1669, 0),
(1671, ' This Bed We Made', 'This Bed We Made est jeu de mystère à la troisième personne. Plongez dans la peau d\'une femme de chambre d\'hôtel des années 50 et fouinez dans les possessions d\'inconnus afin de découvrir leurs terribles secrets. Découvrez ce qui lie les clients entre eux dans cette histoire d\'amour et de meurtre!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1243850/header.jpg?t=1715700544', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 2, 1670, 0),
(1672, ' Nine Sols', 'Nine Sols est un jeu d\'action/plateforme 2D dessiné à la main avec une riche histoire et des combats de déviation inspirés de Sekiro. Voyagez dans une fantasy asiatique, explorez une terre autrefois habitée par une race extraterrestre et suivez un héros en quête de vengeance contre les 9 Sols.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1809540/header.jpg?t=1725277458', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1671, 0),
(1673, 'Laika Aged Through Blood', 'Laika: Aged Through Blood est un motorvania inspiré des westerns se déroulant dans un désert post-apocalyptique. C\'est l\'histoire d\'une tribu opprimée par les forces d\'occupation, et celle d\'une mère coyote guerrière qui se lance sur la voie de la vengeance pour récupérer ce que son peuple a perdu.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1796220/header.jpg?t=1728655845', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1672, 0),
(1674, 'Quantum Break', 'Remedy Entertainment, maître des jeux d\'action cinématiques, vous présente Quantum Break, une aventure temporelle pleine d’action et de suspense. Quantum Break mêle jeu et série télévisée, et les décisions prises dans l\'un affecteront l\'autre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/474960/header.jpg?t=1682524073', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1673, 0),
(1675, ' Dead Rising 4', 'Dead Rising 4 marque le retour du journaliste Frank West dans un tout nouveau chapitre de l\'une des meilleures sagas de zombies de tous les temps. Avec une personnalisation poussée des armes et des personnages, d’ambitieuses nouvelles fonctionnalités dont de nouvelles classes de zombies et des exosquelettes, Dead Rising 4 est une...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/543460/header.jpg?t=1644282464', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', NULL, 1674, 0),
(1676, 'Going Medieval', 'Affirmez votre suprématie dans cette simulation de survie médiévale. Bâtissez une forteresse au cœur d’une contrée où la nature a repris ses droits, défendez-vous contre des raids, puis veillez au bien-être de vos villageois dont la personnalité est façonnée par le monde !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1029780/header_french.jpg?t=1729165831', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1675, 0),
(1677, 'NARUTO SHIPPUDEN: Ultimate Ninja STORM 3', 'Vivez la quatrième grande guerre des ninjas et ses batailles dantesques ou défiez vos amis dans des combats de ninjas en ligne ou hors ligne !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/234670/header.jpg?t=1703662542', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1676, 0),
(1678, ' Sprocket', 'Carefully balance mobility, firepower and armour in a dedicated tank designer. Then uncarefully put them to the test in a series of combat scenarios progressing through the ages of the tank. Here, your limit is what you can fit inside your hull and turret while still being able to move forwards.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1674170/header.jpg?t=1632163787', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 2, 1677, 0),
(1679, 'Crime Scene Cleaner', 'Une fois mêlé à la mafia, vous en ferez toujours partie. Au moins, ça paye bien et tout ce que vous avez à faire, c\'est de nettoyer leurs sales coups, mais vous savez ce que vous faites. Nettoyez les scènes de crime, soyez plus malin que la police et préparez-vous pour la prochaine mission.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1040200/header.jpg?t=1729281414', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', NULL, 1678, 0),
(1680, 'Tavern Manager Simulator', 'Restaurez la taverne dans toute sa splendeur. Effectuez des réparations, améliorez et agrandissez l\'établissement. Préparez de délicieux plats et surveillez l\'humeur des visiteurs. Créez une atmosphère unique pour des aventures inoubliables !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2756770/header.jpg?t=1729016728', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1679, 0),
(1681, 'The Bathhouse', 'The Bathhouse | 地獄銭湯 Remake is a Japanese horror game that revolves around working at a bathhouse. A complete revamp of the original bathhouse.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2989950/header.jpg?t=1725097542', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1680, 0),
(1682, 'Need for Speed Rivals', 'Offrez-vous l\'intégralité de Need for Speed™ Rivals.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1262600/header.jpg?t=1625518950', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1681, 0),
(1683, 'Adobe Acrobat', 'Adobe Acrobat est une famille de logiciels mis au point par Adobe Systems, pour manipuler des documents électroniques au format PDF. Le programme Adobe Acrobat Reader DC est disponible gratuitement sur le site Web d\'Adobe et permet l\'affichage et l\'impression des fichiers PDF.', 'https://media.discordapp.net/attachments/1132785258769690725/1391423234204897350/1200x630wa.png?ex=686bd75e&is=686a85de&hm=6fa16d3306aa228c1e0ac0032b162aa08b27f5b6cf03eb84e66b7d65f9453397&=&format=webp&quality=lossless', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1682, 0),
(1684, 'Spyro Reignited Trilogy', 'Toujours aussi brûlant et attachant, Spyro revient dans une HD flamboyante avec Spyro™ Reignited Trilogy ! Rallumez la flamme avec les trois jeux originaux, Spyro™ the Dragon, Spyro™ 2: Ripto\'s Rage! et Spyro™: Year of the Dragon.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/996580/header.jpg?t=1715804778', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1683, 0),
(1685, 'Fifa19', 'FIFA 19 est un jeu de simulation de football d\'EA Sports, sorti en 2018. Il inclut des améliorations de gameplay comme le Timed Finishing, et propose des modes populaires tels que Ultimate Team et The Journey. Le jeu intègre pour la première fois la Ligue des champions de l’UEFA.', '/storage/game_banners/fifa19-b75f43a8c2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1684, 0),
(1686, 'Unrailed!', 'Unrailed! est un jeu multijoueur en co-op où vous devez construire une voie de chemin de fer avec vos amis, à travers des mondes infinis générés de manière procédurale. Rencontrez les autochtones, améliorez votre train et empêchez-le de dérailler !\r\n', 'https://i.postimg.cc/y8ZC7jRM/1016920-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', NULL, 1685, 0),
(1687, 'We Were Here Too', 'À l’approche de votre dernière heure, une immense bâtisse se profile au loin – surplombant une tempête déchaînée. Découvrez la vérité sur ce lugubre château dans une aventure coopérative fondée sur la communication.\r\n\r\n', 'https://i.postimg.cc/rF2nGzT6/677160-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', NULL, 1686, 0),
(1688, 'Max Payne 3', 'Après avoir quitté le NYPD, Max Payne tente de fuir son passé en partant à São Paulo, où il doit protéger la famille d\'un magnat de l\'immobilier. Cette édition intégrale de Max Payne 3 inclut le jeu original complet et tous les contenus téléchargeables précédemment sortis.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/204100/header.jpg?t=1718391374', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1687, 0),
(1689, 'Sniper Ghost Warrior Contracts 2', 'SGW Contracts 2 est un jeu de tir de guerre moderne qui se déroule au Moyen-Orient. Incarnez Raven, tireur d\'élite assassin sous contrat, et éliminez des cibles dans une campagne solo spectaculaire. Préparez-vous à une entrée en matière des plus palpitante, avec des tirs à très longue distance.\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1338770/header.jpg?t=1721368334', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1688, 0),
(1690, 'This War of Mine', 'Vous faites partie d\'un groupe de civils qui tentent de survivre dans une ville assiégée ; vous devez faire face aux pénuries de nourriture, de médicaments et au danger permanent que représentent les tireurs d\'élite et les collecteurs hostiles.\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/282070/header.jpg?t=1726058417', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', 1, 1689, 0),
(1691, 'EMERGENCY 20', 'Coordinate your team of first responders in the anniversary edition of EMERGENCY! Featuring 10 remastered classic EMERGENCY missions and three full campaigns, EMERGENCY 20 is the complete package for both experienced and new rescue commanders!\r\n', 'https://i.postimg.cc/zGBszbS2/735280-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:44', '2025-09-09 15:30:13', NULL, 1690, 0),
(1692, 'Ben and Ed', 'Ben and Ed is a 3D platformer, in which the player controls Ed the Zombie, who is forced to participate in a grotesque game show called \"Rundead\". Will he beat all obstacles Hans Showmaster confronts him with, to save his best friend Ben?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/395200/header.jpg?t=1691427922', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1691, 0),
(1693, 'Amanda the Adventurer', 'Suis les aventures d’Amanda et de son copain Pelote, et découvre les petites merveilles que recèle notre monde ! Dans ces NOUVEAUX épisodes, tu vas pouvoir chanter, rigoler et apprendre plein de choses chouettes ! Par contre, fais bien tout ce que te dira Amanda. Sinon, elle risque de se fâcher.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2166060/header.jpg?t=1727799956', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1692, 0),
(1694, 'Don\'t Starve', 'Don\'t Starve Together est l’extension multijoueur autonome du jeu de survie intransigeant Don\'t Starve.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/322330/header_alt_assets_46.jpg?t=1728334191', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1693, 0),
(1695, 'Hitman : Absolution', 'L\'assassin originel est de retour. Trahi par l\'agence et traqué par la police, l\'agent 47 se doit de trouver le chemin de la rédemption dans un monde brisé et corrompu.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/203140/header.jpg?t=1712238033', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1694, 0),
(1696, ' saints row the third', 'Soyez prêt à vivre l\'une des histoires les plus dingues jamais vues opposant les Saints au Syndicat !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/55230/header.jpg?t=1725434603', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1695, 0),
(1697, 'Far Cry : New Dawn ', 'Plongez au cœur d\'un Hope County post-apocalyptique, 17 ans après une catastrophe nucléaire mondiale. Combattez les Ravageurs, qui cherchent à prendre le contrôle des dernières ressources.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/939960/header.jpg?t=1725613807', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1696, 0),
(1698, 'Two Point Hospital', 'Concevez de splendides hôpitaux, soignez d\'étranges maladies et gérez des employés difficiles tandis que vous étendez votre organisation naissante dans tout le Two Point County.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/535930/header.jpg?t=1726486228', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1697, 0),
(1699, ' Drug Lord Tycoon', 'Start from nothing and rise to the top as you expand your criminal empire in Drug Lord Tycoon.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2450700/header.jpg?t=1722431262', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1698, 0),
(1700, 'E-TECH SIMULATOR', 'Bienvenue dans E-TECH Simulator, le jeu de simulation ultime où vos compétences entrepreneuriales seront mises à l\'épreuve !\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2990240/header.jpg?t=1722506622', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1699, 0),
(1701, 'DRAGON BALL Sparking ZERO', 'DRAGON BALL: Sparking! ZERO reprend le gameplay effréné de la série Budokai Tenkaichi et l\'emmène vers des sommets inégalés. Incarnez la force de destruction des plus puissants guerriers jamais apparus dans l\'univers DRAGON BALL !', 'https://i.ibb.co/yBpxPsP/dragon-ball-sparking-zero-pc-jeu-steam-europe-cover-copie.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1700, 0),
(1702, 'Granny Remake', 'Granny Remake is a gripping horror game where you must escape from a sinister house chased by a cunning and relentless Granny. Choose from multiple escape routes: drive away in a car, call the police, or unlock the main door\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2110820/header.jpg?t=1726355317', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1701, 0),
(1703, 'DOOM + DOOM II', 'Développés par id Software et sortis à l\'origine en 1993 et 1994, DOOM + DOOM II sont maintenant disponibles sous forme de pack dans des versions définitives et fraîchement améliorées.\r\n\r\n', 'https://i.postimg.cc/yNKDxnJt/2280-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1702, 0),
(1704, 'Tom Clancy’s Splinter Cell Blacklist', 'Les Etats-Unis possèdent une présence militaire dans deux pays sur trois à travers le monde. Certains d’entre eux en ont assez. Un groupe de terroristes se faisant appeler Les Ingénieurs ont décidé d\'en finir en instaurant un ultimatum - la Blacklist : un terrible compte à rebours annonçant une série d\'attaques terroristes contre les...\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/235600/header.jpg?t=1680011149', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1703, 0),
(1705, 'Styx Shards of Darkness', 'Lancez-vous dans une mission des plus périlleuses, seul ou en coop avec un ami ! Explorez d’immenses environnements, et faites usage de vos redoutables compétences et de votre arsenal d’assassin pour vous infiltrer ou éliminer silencieusement vos ennemis.\r\n\r\n', 'https://i.postimg.cc/bN91rxGZ/355790-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1704, 0),
(1706, ' Warno', 'Réaliste, immersif, WARNO est l\'ultime simulateur de combats de la 3ème Guerre mondiale, conçu par les maîtres de la stratégie, Eugen Systems. Une guerre froide qui prend une tournure brûlante alors que vous commandez des centaines d\'unités sur de magnifiques champs de bataille.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1611600/header.jpg?t=1725003192', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1705, 0),
(1707, 'Terra Nil', 'Terra Nil est un jeu de stratégie subtil sur le thème de l\'environnement, qui consiste à transformer une terre stérile en un écosystème prospère et harmonieux. Ramenez un monde désolé à la vie, puis partez sans laisser de traces.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1593030/header.jpg?t=1726601263', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1706, 0),
(1708, 'LEGO DC Super-Villains', 'Que c\'est bon d\'être méchant... Embarquez dans la nouvelle aventure DC/LEGO® en devenant le meilleur vilain de l\'univers. Dans le jeu, les joueurs créeront et incarneront un tout nouveau super-vilain, déclenchant d\'espiègles facéties et provoquant la destruction dans une histoire bourrée d\'action.\r\n\r\n', 'https://i.postimg.cc/TYrrkzWb/829110-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1707, 0),
(1709, 'Silent Hill 2', '\"Mon nom est... Maria,\" dit la femme en souriant. Son visage, sa voix... Elle lui ressemble tellement.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2124490/header.jpg?t=1728199422', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1708, 0),
(1710, 'Tiny Glade', 'Tiny Glade est un jeu relaxant dans lequel on érige des châteaux. Découvrez un système de construction sans grille et regardez le jeu assembler briques, planches et pierres. Pas de gestion, pas de combat, pas de mauvaises approches : détendez-vous en transformant des prairies en jolis dioramas.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2198150/header.jpg?t=1727471389', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1709, 0),
(1711, 'Little Kitty Big City', 'Allez-vous chercher le chemin du retour ou commencerez-vous par explorer un peu cette grande ville ? Rentrer à la maison, c\'est important, non ? C\'est forcément la priorité des priorités. Enfin, ça fait partie des priorités. Sans doute... À l\'occasion. Mais d\'abord ! Place à l\'exploration !\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1177980/header.jpg?t=1727460136', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1710, 0),
(1712, 'Autopsy Simulator', 'Autopsy Simulator est un jeu de simulation avec des éléments d\'horreur, dans lequel le joueur peut examiner un cadavre, et sur la base des résultats, ldéterminer la cause de son décès.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1283230/header.jpg?t=1726655961', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 2, 1711, 0),
(1713, 'Dead Rising 2', 'Suite de Dead Rising, vendu à plus d\'un million d\'exemplaires, Dead Rising 2 transpose le survival horror zombie à Fortune City, le dernier et le plus grand terrain de jeu américain.', 'https://i.postimg.cc/j5JgBzTm/45740-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1712, 0),
(1714, 'Slackers - Carts of Glory', 'Entrez dans le monde merveilleux des Slackers ! Imaginez : vous et vos amis n\'avez plus de boissons et le magasin ferme ! Montez dans un caddie, l\'ultime merveille écologique, maîtrisez l\'art de chevaucher une bête imprévisible, découvrez des raccourcis et tracez votre chemin vers la gloire !', 'https://i.postimg.cc/KcMjBWFn/2354000-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1713, 0),
(1715, 'Fae Farm', 'Evadez-vous dans le conte de fées de vos rêves dans Fae Farm, un RPG de simulation de ferme jouable de 1 à 4 joueurs. Construisez, cultivez et décorez votre ferme. Apprenez à jeter des sorts, tissez desliens avec les résidents et partez explorer l\'île enchantée d\'Azoria !\r\n\r\n', 'https://i.postimg.cc/VvSXDNn6/2230110-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1714, 0),
(1716, 'Worms W.M.D', 'Les vers sont de retour dans le jeu le plus destructeur jamais sorti. Avec son look 2D dessiné à la main, de nouvelles armes, de l\'artisanat, des véhicules et des bâtiments ainsi que le retour des armes et de la jouabilité si appréciées, Worms W.M.D. est le meilleur jeu de la série.\r\n\r\n', 'https://i.postimg.cc/7661c90m/327030-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1715, 0),
(1717, 'DiRT Rally 2', 'DiRT Rally 2.0 vous invite à arpenter les circuits de rallye les plus emblématiques du globe, dans les véhicules tout-terrain les plus puissants jamais conçus. Mais n\'oubliez pas que la moindre erreur peut mettre fin à votre étape.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/690790/header.jpg?t=1694601907', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1716, 0),
(1718, 'Until Dawn™', 'Refondu et amélioré pour PC, Until Dawn vous invite à revivre le cauchemar et à vous immerger dans un slasher angoissant où chaque décision peut faire toute la différence entre la vie et la mort.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2172010/header.jpg?t=1728053885', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1717, 0),
(1719, 'Rounds', 'Rounds est un rogue-lite en 1 contre 1 où chaque manche est plus intense que la précédente. Le perdant de chaque manche débloque des pouvoirs sensationnels pour améliorer son build et parvenir à vaincre son adversaire.', 'https://i.ibb.co/vJh62w7/1557740-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1718, 0),
(1720, 'Mullet Madjack ', 'MULLET MADJACK est un FPS solo frénétique qui vous propulse directement dans un ANIME AUTHENTIQUE. Renforcez votre personnage et atteignez le dernier étage ; Battez votre meilleur temps ou réessayez.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2111190/header.jpg?t=1727459359', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1719, 0),
(1721, 'Deadpool ', 'l y a quelques trucs importants qu\'il faut que je vous dise avant que vous ne craquiez pour mon jeu vidéo incroyablement cool.(rha. C\'est reparti) Je suis un mercenaire avec un facteur de guérison accéléré. On m\'a décrit comme instable, ce qui est comlètement dingo. (Oula, est-ce que les gens normaux disent dingo ?) Je vais me battre pour la sécurité des humains et des mutants. (Et même des hutants). Préparez-vous car tout peut arriver.', 'https://gaming-cdn.com/images/products/239/616x353/deadpool-pc-jeu-steam-cover.jpg?v=1646390591', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', 1, 1720, 0),
(1722, 'TCG Card Shop Simulator', 'Open your own local game store. Stock shelves with the latest booster packs, or crack them and collect the cards for yourself. Set your own prices, hire staff, host events, and expand your card shop.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/3070070/header.jpg?t=1727334511', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1721, 0),
(1723, 'DRAGON QUEST XI S : Les Combattants de la destinée', 'L\'Édition ultime inclut le jeu salué par la critique DRAGON QUEST XI, des scénarios supplémentaires, une bande-son orchestrale, un mode 2D et plus encore ! Que vous soyez un fan de toujours ou un nouvel aventurier, c\'est là l\'expérience DQXI ultime.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1295510/header_french.jpg?t=1727228467', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1722, 0),
(1724, 'Disney Epic Mickey: Rebrushed', 'Préparez-vous à vivre un voyage magique dans Disney Epic Mickey: Rebrushed ! Donnez vie à votre aventure d’un coup de pinceau ; glissez-vous dans le rôle de Mickey Mouse et transformez le monde de la désolation dans ce jeu de plateforme 3D superbement recréé.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1522160/header.jpg?t=1727183190', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1723, 0),
(1725, 'Tribes of Midgard', 'Fabriquez des objets légendaires, construisez une base de plus en plus imposante, embarquez pour un voyage épique à travers des mondes générés de manière procédurale, et affrontez d\'immenses adversaires bien déterminés à déclencher le Ragnarök.\r\n\r\n', 'https://i.postimg.cc/FzNsRTzk/858820-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1724, 0),
(1726, ' Golf With your friends', 'À quoi servent les amis, sinon à jouer au golf... entre amis ? Tous les coups sont permis sur ces parcours de minigolf endiablés et stimulants, jouables jusqu\'à 12 joueurs en simultané !', 'https://i.ibb.co/vJczWyJ/431240-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:45', '2025-09-09 15:30:13', NULL, 1725, 0),
(1727, ' Ride 5', 'Faites monter les tours et préparez-vous à avaler l\'asphalte avec RIDE 5. Une expérience bourrée d\'adrénaline si authentique que vous aurez réellement l\'impression de rouler à des vitesses folles.', 'https://cfinder.xyz/uploads/Ride5.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', NULL, 1726, 0),
(1728, 'Pilgrim', 'Pilgrim is a medieval-based, co-op horror, adventure. Can you and your friends make it to the end of The Road?', 'https://i.ibb.co/SKjVj55/2965660-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', NULL, 1727, 0),
(1729, ' Ships At Sea', 'Ressentez l\'excitation de naviguer sur différents navires. Accomplissez des tâches telles que l\'opérateur de services, le transport de marchandises et la pêche commerciale en modes solo ou multijoueur tout en explorant le magnifique monde ouvert des îles norvégiennes. La mer est à portée de main !', 'https://i.ibb.co/DtBcMtM/1266540-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', NULL, 1728, 0),
(1730, 'Dale & Dawson Stationery Supplies', 'Dans \"Fournitures de Papeterie Dale & Dawson\", jouez en tant que Manager, Spécialiste ou Fainéant dans un cadre de bureau. Les Fainéants se fondent dans la masse, imitant les Spécialistes pour éviter les soupçons du Manager. Décelez ou provoquez la tromperie pour gagner.', 'https://i.ibb.co/NxGpGsq/2920570-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', NULL, 1729, 0),
(1731, 'Truck & Logistics Simulator', 'Chargez, conduisez et livrez dans un monde ouvert pouvant accueillir 24 joueurs en multijoueur cross-play. Rejoignez vos amis dans des convois de transport lourds. Prenez le volant de plus de 30 véhicules uniques, exécutez des tâches de chargement complexes et livrez des marchandises variées.', 'https://i.ibb.co/nPkkZ8j/873840-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', NULL, 1730, 0),
(1732, 'God of War Ragnarök', 'Kratos et Atreus partent en quête de réponses avant l\'arrivée du Ragnarök, désormais sur PC.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2322010/header.jpg?t=1726764322', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', NULL, 1731, 0),
(1733, 'Star Wars Jedi Survivor', 'L\'histoire de Cal Kestis continue dans STAR WARS Jedi: Survivor™, un jeu d\'action-aventure galactique à la troisième personne.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1774580/header.jpg?t=1701206599', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', NULL, 1732, 0),
(1734, 'Exo One', 'Un signal étrange... un vaisseau d\'un autre monde... un voyage interplanétaire défiant la gravité, à travers le temps et l\'espace.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/773370/header.jpg?t=1706782417', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', 1, 1733, 0),
(1735, 'Evil Nun: The Broken Mask', 'Plongez dans le cauchemar de Evil Nun. Piégé dans une école maudite, échappez à Sœur Madeline. Astucieuse, elle explore chaque coin, vous attire et communique selon vos actions. Résolvez des énigmes, créez des objets et découvrez le mystère dans ce jeu d\'horreur aux échappatoires variées.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1460220/header.jpg?t=1701972302', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', 1, 1734, 0),
(1736, 'Everdream Valley', 'Une aventure agricole magique est là ! Transformez votre ferme en paradis estival en solo ou en coop jusqu\'à 4. Explorez, cultivez, prenez soin des animaux et rénovez votre foyer, voilà vos missions du jour. La nuit, rejoignez les créatures dans le rêve et apportez une touche de magie à la vallée.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1403650/header.jpg?t=1723533612', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', 1, 1735, 0),
(1737, 'ENDER LILIES: Quietus of the Knights', 'Découvrez l\'histoire de Lily et des chevaliers immortels au royaume de Lointerre, touché par une pluie de mort. Dans cet action-RPG à défilement horizontal où les ennemis ne vous laisseront pas le moindre répit, percez les mystères d\'un monde beau et tragique aux côtés de vos camarades.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1369630/header.jpg?t=1713433509', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', 1, 1736, 0),
(1738, ' Eco', 'Créez une civilisation capable de repousser un météore sans pour autant détruire son écosystème.', 'https://cfinder.xyz/uploads/Eco.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', NULL, 1737, 0),
(1739, 'Dwarf Fortress', 'The deepest, most intricate simulation of a world that\'s ever been created. The legendary Dwarf Fortress is now on Steam. Build a fortress and try to help your dwarves survive against a deeply generated world.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/975370/header.jpg?t=1721153775', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', 1, 1738, 0),
(1740, 'Dishwashing Simulator', 'A short, unique survival-farming-base-building-tycoon-horror game where you must survive through washing dishes. Explore mysterious depths, manage resources, and unravel a cryptic narrative. In DWS, a chore becomes a journey to freedom.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2747780/header.jpg?t=1720177159', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', 1, 1739, 0),
(1741, 'DAVE THE DIVER', 'DAVE THE DIVER est un jeu d\'aventure RPG décontracté en solo qui propose de l\'exploration et de la pêche en haute mer le jour, ainsi que la gestion d\'un restaurant de sushis le soir. Rejoignez Dave et ses amis excentriques alors qu\'ils cherchent à découvrir les secrets du mystérieux Trou Bleu.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1868140/header.jpg?t=1722244594', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', 1, 1740, 0),
(1742, 'Construction Simulator', 'Construction Simulator est de retour, plus grand et plus impressionnant que jamais ! Réalisez votre ambition de devenir un entrepreneur de la construction renommé en donnant vie à votre entreprise avec l\'aide de Hape, votre mentor.', 'https://i.postimg.cc/9fqFMZF2/1273400-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', NULL, 1741, 0),
(1743, 'Cloudpunk: Ultimate Edition', 'Un récit noir et néon. Une métropole cyberpunk noyée sous la pluie. C’est votre première nuit en tant que livreuse pour Cloudpunk, et il n’y a que deux règles : ne ratez pas une livraison, et ne demandez pas ce qu’il y a dans le colis.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/746850/header.jpg?t=1654681860', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', 1, 1742, 0),
(1744, 'City Bus Manager', 'Dans City Bus Manager, vous pouvez construire votre dépôt de bus de toutes pièces et créer vos propres itinéraires de bus. Jouez avec les données de cartes réelles de votre ville natale ou de n\'importe quelle ville du monde, illustre ou inconnue.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1364210/header.jpg?t=1719316911', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:46', '2025-09-09 15:30:13', 2, 1743, 0),
(1745, 'Big Ambitions', 'Big Ambitions est un jeu de rôle révolutionnaire de simulation d\'entreprise. Passez du statut de rien du tout à celui de plus grand entrepreneur de New York en ouvrant de petites entreprises ou en construisant lentement d\'énormes sociétés comme vous le souhaitez.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1331550/header.jpg?t=1699965768', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', NULL, 1744, 0),
(1746, 'Autonauts', 'Votre mission ? Coloniser des planètes inhabitées. Partez de zéro et exploitez des ressources naturelles pour bâtir un empire de robots à qui vous pouvez tout apprendre. L\'automation est le thème du jeu : traversez des ères technologiques, automatisez la vie elle-même et atteignez une autonomie totale !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/979120/header.jpg?t=1691067729', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1745, 0),
(1747, 'WorldBox - God Simulator', 'WorldBox est le jeu sandbox ULTIME de simulateur de Dieu. Créez votre propre monde ou détruisez-le en utilisant différents pouvoirs. Regardez les civilisations se développer et conquérir le monde. Guerre, paix, désastres… C\'est à vous de choisir entre aider les peuples ou les regarder se battre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1206560/header.jpg?t=1692701293', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1746, 0),
(1748, 'Attack on Titan 2', 'N\'ayez plus peur. A.O.T. 2 est la suite fantastique du jeu d\'action inspiré par \"Attack on Titan\", la série animée au succès mondial.', 'https://i.ibb.co/S6PLT43/601050-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', NULL, 1747, 0),
(1749, 'Alice: Madness Returns', 'Alice pourra-t-elle sauver le Pays des merveilles (ainsi qu\'elle-même) de la folie qui les ronge tout deux ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/19680/header.jpg?t=1655743771', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1748, 0),
(1750, 'Ad Infinitum', 'Quand la réalité est un cauchemar, les cauchemars prennent vie. Dans ce jeu d’horreur psychologique, vous luttez contre les terribles créatures qui envahissent votre esprit. Serez-vous capable de recouvrer votre santé mentale ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1234430/header.jpg?t=1705418819', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 2, 1749, 0),
(1751, 'A Little to the Left', 'A Little to the Left est un jeu de réflexion cosy où vous triez, empilez et organisez des objets du quotidien de manière agréable, tout en gardant un œil sur un chat espiègle ayant un penchant pour le chaos. Découvrez ce jeu de réflexion ludique avec plus de 100 désordres satisfaisants à ranger.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1629520/header.jpg?t=1720187557', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1750, 0),
(1752, 'Shinkansen 0', 'Shinkansen 0 | 新幹線 0号 est un jeu se déroulant au Japon dans lequel les joueurs sont chargés de trouver des anomalies dans le Shinkansen. (Train à grande vitesse japonais)', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2793370/header.jpg?t=1712378962', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1751, 0),
(1753, 'Dark Deception', 'La mort vous attend dans Dark Deception, un jeu de labyrinthe d\'horreur à la première personne. Il n\'y a nulle part où se cacher & ; nulle part où reprendre son souffle. Courir ou mourir, c\'est votre choix. Piégé dans un royaume de labyrinthes cauchemardesques avec une femme mystérieuse, votre seul espoir de survie est de trouver un moyen de vous échapper.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/332950/header.jpg?t=1693784243', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1752, 0),
(1754, 'Steven Universe: Save the Light', 'Rejoins les Gemmes de Cristal dans une aventure ultime ! Une nouvelle Gemme mysétrieuse a volé une arme dévastatrice. Seuls Steven et ses amis sont capables de l\'arrêter. La menace lumineuse est un JDR hybride de type unique qui combine combats en temps réel et au tour par tour.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/821890/header.jpg?t=1704498797', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 2, 1753, 0),
(1755, 'Five Nights at Freddy\'s: Into the Pit', 'Survivez à cinq nuits de terreur dans ce jeu d\'aventure effrayant. Voyagez dans le temps, recueillez des indices et échappez à la menace qui vous poursuit sans relâche. Déplacez-vous rapidement et mettez-vous à l\'abri, et vous pourriez bien survivre. Vous n\'êtes pas le seul à être en danger. Le père d\'Oswald et d\'autres enfants de son passé peuvent également perdre la vie si vous ne les sauvez pas.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2638370/header.jpg?t=1723065423', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1754, 0),
(1756, 'Synthesia', 'Le programme d\'installation hors ligne autonome de la version complète de Synthesia 10 pour PC Windows offrira un moyen amusant d\'apprendre à jouer du piano. Que vous ayez toujours voulu apprendre ou que vous ayez déjà une certaine expérience, vous venez de trouver une nouvelle façon amusante de vous entraîner. Rejoignez les millions de personnes utilisant Synthesia.', '/storage/game_banners/synthesia-6d3dffad5f.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', NULL, 1755, 0),
(1757, 'LOCKDOWN Protocol', 'Un jeu de déduction sociale à la première personne, combinant action et communication en temps réel, pour 3 à 8 joueurs. Alors que la plupart des joueurs feront de leur mieux pour remplir les objectifs et assurer la victoire, une petite partie des dissidents tentera de les arrêter à tout prix, sans se faire prendre.', 'https://cfinder.xyz/uploads/LOCKDOWNProtocol.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', NULL, 1756, 0),
(1758, 'SpeedRunners', 'Un jeu de course multijoueur à couper le souffle qui oppose 4 joueurs les uns contre les autres, en local et/ou en ligne. Courez, sautez et balancez-vous, utilisez des armes sournoises et des gadgets pour éjecter vos adversaires hors de l\'écran !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/207140/header.jpg?t=1699018142', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1757, 0),
(1759, 'Bramble: The Mountain King', 'Bramble: The Mountain King est une aventure sombre et horrifique inspirée du folklore scandinave. Explorez un territoire somptueux, mais retors, dans l\'espoir de sauver votre sœur. Traversez des paysages grandioses tout en survivant aux innombrables monstres répugnants et mortels qui guettent.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1623940/header.jpg?t=1704463694', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1758, 0),
(1760, 'letasoft sound booster', 'Letasoft Sound Booster pour Windows PC. Il s\'agit d\'une solution logicielle innovante conçue pour amplifier le volume de votre système Windows. Que vous regardiez votre série préférée, écoutiez de la musique, jouiez à des jeux ou participiez à des conférences en ligne, cet outil pratique vous permet de ne manquer aucun son. Avec Letasoft Sound Booster, vous pouvez augmenter le volume de vos haut-parleurs ou de votre casque au-delà de leur niveau maximum par défaut sans compromettre la qualité audio.', 'https://allrepack.ru/wp-content/uploads/2022/06/Letasoft-Sound-Booster.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1759, 0),
(1761, 'SOULCALIBUR VI', 'Vos poings ne vous suffiront pas pour gagner! Proposant de nouveaux personnages et systèmes de combats, SOULCALIBUR VI marque le début d\'un nouveau chapitre de la franchise historique. Remontez sur la scène de l’histoire!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/544750/header.jpg?t=1718967845', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1760, 0),
(1762, 'Timberborn', 'Les humains ont disparu. Votre société de castors arrivera-t-elle à survivre dans un monde frappé par la sécheresse et pollué ? Un jeu de construction avec des animaux rusés, une architecture verticale, un contrôle des physiques de l’eau et une terraformation. Contient une quantité élevée de bois.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1062090/header.jpg?t=1721034347', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1761, 0),
(1763, 'FIFA 17 Super Deluxe Edition', 'FIFA 17 est un jeu vidéo de football développé par EA Canada et édité par Electronic Arts, sorti le 29 septembre 2016 sur PC, PlayStation 3, PlayStation 4, Xbox 360 et Xbox One. C\'est le 23ᵉ jeu de la franchise FIFA Football et le successeur de FIFA 16.', 'https://www.trueachievements.com/contentimages/514106.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1762, 0),
(1764, 'Far Cry 3', 'Découvrez les secrets les plus sombres d\'une ile sans foi ni loi où règne la violence. Il vous faudra bien plus que de la chance pour sortir vivant de cette ile.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/220240/header.jpg?t=1682960396', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1763, 0),
(1765, 'Only Climb: Better Together', 'Ne restez pas au sol ? Lancez-vous dans un voyage vers le ciel avec des amis dans Only Climb: Better Together ! Touchez les nuages de vos propres mains et découvrez ce qui se cache derrière, mais rappelez-vous qu\'il n\'y a pas de chemins faciles…', 'https://i.postimg.cc/CM2YmVns/2500750-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', NULL, 1764, 0),
(1766, 'Disney Dreamlight Valley', 'Explorez un monde où abonde la magie de Disney, découvrez des histoires complexes et construisez le voisinage parfait où se côtoient les héros et les méchants de Disney et Pixar dans ce nouveau jeu d\'aventure et de simulation de vie. Bienvenue dans Disney Dreamlight Valley.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1401590/header.jpg?t=1721140394', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', NULL, 1765, 0),
(1767, 'The Mortuary Assistant', 'Avec pour seule compagnie les morts... Embaumez des corps, bannissez des démons, sauvez votre âme.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1295920/header.jpg?t=1722618701', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1766, 0),
(1768, 'Call of Duty®: WWII', 'Call of Duty retourne à ses origines avec Call of Duty: WWII, une expérience à couper le souffle qui servira de référence à la nouvelle génération de joueurs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/476600/header.jpg?t=1646764749', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 2, 1767, 0),
(1769, 'The Operator', 'Bienvenue au FDI. En tant qu\'opérateur, vous devrez mettre à profit vos aptitudes d\'enquêteur pour aider nos agents de terrain à élucider des crimes mystérieux. Utilisez les logiciels de pointe du FDI pour trouver des indices, résoudre des énigmes et découvrir la vérité.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1771980/header.jpg?t=1722459302', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1768, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1770, 'Anno 1800', 'Anno 1800™ – Prenez la tête de la Révolution industrielle ! Bienvenue à l\'aube de l\'Ère industrielle. La voie que vous tracerez changera la face de votre monde. Serez-vous un innovateur ou un profiteur ? Un conquérant ou un libérateur ? De vous seul dépend la trace que vous laisserez dans l\'histoire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/916440/header.jpg?t=1722974288', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1769, 0),
(1771, 'Fez', 'Gomez est une créature 2D vivant dans un monde 2D. Enfin, c\'est ce qu\'il croit... Quand il découvre l\'existence d\'une mystérieuse troisième dimension, Gomez se lance dans une aventure qui le mènera aux confins du temps et de l\'espace. Utilise ta capacité à te déplacer dans des structures 3D à partir de 4 perspectives 2D classiques.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/224760/header.jpg?t=1572375251', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1770, 0),
(1772, 'CONSCRIPT', 'Pendant la Première Guerre mondiale, un soldat français doit traverser l’enfer des tranchées, dénicher de rares provisions et résoudre des énigmes en luttant pour sa survie au beau milieu du conflit le plus terrible de l’Histoire. CONSCRIPT offre une nouvelle approche du survival horror classique.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1286990/header.jpg?t=1721870892', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 2, 1771, 0),
(1773, 'Grocery Store Simulator', 'Gérez votre propre supermarché. Scannez des articles, approvisionnez les rayons, fixez les prix, commandez des produits et gérez votre entrepôt. Jouez seul ou avec un ou deux amis en mode coopératif pour 1 à 4 joueurs pour développer votre entreprise dans ce jeu en première personne.', 'https://cfinder.xyz/uploads/GroceryStoreSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 2, 1772, 0),
(1774, 'Alien Isolation', 'Découvrez le vrai sens de la peur dans Alien: Isolation, un survival horror se déroulant dans une atmosphère d\'épouvante et de danger constants.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/214490/header.jpg?t=1717083621', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1773, 0),
(1775, 'MAGIX VEGAS Pro', 'VEGAS Pro, anciennement Sony Vegas Pro, est une suite de logiciels de montage vidéo qui était éditée ', 'https://i.postimg.cc/W3YZtGy7/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1774, 0),
(1776, 'Power & Revolution 2021', 'Nouvelle évolution du simulateur hyperréaliste du monde actuel où vous incarnez un chef d’État ou de l’opposition ! Principales nouveautés 2021 : gestion de l’UE, vaccination Covid, Biden’s challenge, coalitions politiques, négociations diplomatiques, taxe mondiale, accords de libre-échange.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1683320/header.jpg?t=1697805014', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1775, 0),
(1777, 'SPORE', 'Be the architect of your own universe with Spore, an exciting single-player adventure. From Single Cell to Galactic God, evolve your creature in a universe of your own creations.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/17390/header.jpg?t=1642702281', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1776, 0),
(1778, 'Flintlock: The Siege of Dawn', 'A44, le studio de jeux déjà auteur d\'Ashen, vous propose un Souls-lite explosif dans lequel le combat de l\'humanité contre les dieux se règle à coups d\'armes à feu.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1832040/header.jpg?t=1722249199', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', NULL, 1777, 0),
(1779, 'Islands of Insight', 'Islands of Insight est un jeu de réflexion sublime en monde partagé. Vous incarnez un Quêteur lancé dans une aventure paisible d\'exploration et de découvertes. Profitez d\'innombrables heures de jeu et résolvez plus de 10 000 puzzles à votre rythme à travers un monde grandiose d\'îles flottantes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2071500/header.jpg?t=1716489364', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1778, 0),
(1780, 'Rooftops & Alleys: The Parkour Game', 'Avez-vous déjà eu l\'impression que ce jeu de Parkour/Freerunning manquait au monde ? Ce jeu qui gratte cette démangeaison que les autres jeux ne font tout simplement pas ? Toits et amp; Alleys, alias TheParkourGame, est là pour vous offrir ! Dans ce jeu, il n\'y a pas de mentalité de « maintenir le bouton enfoncé pour faire du parkour ». Ici, c\'est vous, le joueur, qui avez le contrôle !', 'https://cfinder.xyz/uploads/RooftopsAlleysTheParkourGame.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', NULL, 1779, 0),
(1781, 'LEGO Star Wars - The Complete Saga', 'Ramassez des briques du I au VI! Jouez aux 6 films Star Wars en un seul jeu vidéo! Ajout de nouveaux personnages, de nouveaux niveaux, de nouvelles fonctionnalités et pour la première fois, la chance de construire votre chemin et combattre à travers un univers Star Wars amusant sur votre PC!', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/32440/header.jpg?t=1604517910', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1780, 0),
(1782, 'Persona 5 Strikers', 'Rejoignez les Voleurs Fantômes et ripostez face à la corruption qui s\'étend sur les villes japonaises. Des vacances d\'été entre amis tournent court lorsqu\'émerge une réalité déformée : dévoilez la vérité et faites briller le cœur de ceux qui ont été pris au piège au centre de la singularité !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1382330/header.jpg?t=1722432160', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1781, 0),
(1783, 'Adobe Fresco', 'Adobe Fresco est un éditeur de graphiques vectoriels et raster développé par Adobe principalement pour la peinture numérique.', 'https://fixthephoto.com/images/content/logo-adobe-fresco.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1782, 0),
(1784, 'NoLimits 2 Roller Coaster Simulation', 'NoLimits 2 is the ultimate roller coaster simulation that lets you experience authentic roller coaster thrills. Climb into the world\'s most famous roller coasters and experience the excitement in real time. Or design a new roller coaster that is engineered to your specifications.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/301320/header.jpg?t=1717492960', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1783, 0),
(1785, 'Twin Mirror', 'La ville de Basswood ne sera plus jamais la même après le passage de Sam Higgs, ex-journaliste d\'investigation, dans cette expérience narrative captivante du studio à succès DON\'T NOD. Parviendrez-vous à découvrir la vérité, quel qu\'en soit le prix ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1552810/header.jpg?t=1721038190', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', 1, 1784, 0),
(1786, 'Stormworks: Build and Rescue', 'Join a world where you design, create and pilot your own air sea rescue service. Release your inner hero as you battle fierce storms out at sea to rescue those in need.', 'https://i.ibb.co/4dV8NVL/573090-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:47', '2025-09-09 15:30:13', NULL, 1785, 0),
(1787, 'Platform 8', 'You are trapped on a train that runs forever. Keep an eye out for anomalies and find a way out.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2903560/header.jpg?t=1722848137', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1786, 0),
(1788, 'Fossilfuel', 'Prépare-toi à monter de niveau et à affronter les dinosaures les plus effrayants ayant jamais vécu !\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1597040/header.jpg?t=1708706585', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1787, 0),
(1789, 'CYBER INTERNET CLUB SIMULATOR', 'Prenez les rênes en tant que cerveau derrière le club cyber le plus tendance de la ville. Transformez vos modestes débuts en un sanctuaire cyber de premier plan grâce à la gestion des ressources, aux investissements stratégiques et au maintien d\'un flux de trésorerie constant.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2845070/header.jpg?t=1721916059', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1788, 0),
(1790, 'Session: Skate Sim', 'Conçu par des skaters pour des skaters, le dual stick controls reproduit vos pieds sur un skateboard, pour une expérience ultra réaliste. Skatez des spots iconiques, personnalisez votre skater et votre planche avec des objets de marques références.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/861650/header.jpg?t=1721380666', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1789, 0),
(1791, 'The Tenants', 'Devenez propriétaire et construisez votre empire immobilier ! Comment réagirez-vous face aux voisins en colère et aux interventions de la police ? Louerez-vous votre appartement à un jeune couple ou à une vieille fille et ses chats ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1009560/header.jpg?t=1718358489', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1790, 0),
(1792, 'INAZUMA ELEVEN: Victory Road', 'Nouvel opus de la série de RPG footballistique de collecte et d\'entraînement de joueurs \"Inazuma Eleven\". Vous pourrez y découvrir une nouvelle histoire avec un nouveau protagoniste, collecter et entraîner plus de 4500 joueurs et disputer des tournois en ligne.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2799860/header.jpg?t=1721617333', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1791, 0),
(1793, 'Parasocial', 'Parasocial | パラソーシャル is a Japanese horror game about a live streamer.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2314720/header.jpg?t=1696963440', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1792, 0),
(1794, 'Hello Engineer: Scrap Machines Constructor', 'Laissez libre cours à votre créativité dans un jeu de construction multijoueur au cœur de l’univers Hello Neighbor ! Récupérez, fabriquez et surmontez les obstacles dans un parc d’attractions bizarre et mystérieux. Concevez des machines et défiez votre inquiétant voisin et ses robots maléfiques.', 'https://i.ibb.co/8gMFKrK/1856190-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', NULL, 1793, 0),
(1795, 'Rival Stars Horse Racing', 'Avec ses chevaux stupéfiants de réalisme, un système d\'élevage profond et un assortiment de modes de jeu passionnants, Rival Stars Horse Racing propose aux fans de chevaux l\'expérience ultime en matière de course et de chevauchée. Prenez les rênes et devenez une légende équestre !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1166860/header.jpg?t=1722292915', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', NULL, 1794, 0),
(1796, 'MADNESS: Project Nexus', 'MADNESS : Project Nexus est un Run n\' Gun / Beat\'Em Up à la troisième personne rempli d\'action de style arcade et de brutalité à écraser les boutons. Frayez-vous un chemin à travers des hordes de méchants dans la campagne Histoire ou construisez votre machine à tuer parfaite dans l\'assaut sans fin du mode Arène.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/488860/header.jpg?t=1680568111', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1795, 0),
(1797, 'Lawgivers II', 'Lawgivers II est un jeu de simulation politique qui propose plusieurs systèmes électoraux, permet de voter pour ou contre des projets de loi et de gouverner un pays. Débutez votre carrière depuis les bas fonds et peut-être, un jour, menez votre nation à devenir la plus influente du monde.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1407180/header.jpg?t=1703113295', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', NULL, 1796, 0),
(1798, 'Witchfire', 'L\'action se déroule dans un univers de dark fantasy où vous incarnez un Witch, et une guerre fait rage entre les derniers membres de l\'église et les witches. Vous allez donc combattre le clan des witches pour le compte de l\'église', 'https://i.postimg.cc/ZRRxC7dK/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', NULL, 1797, 0),
(1799, 'LEGO The Hobbit', 'Reprenez possession du Royaume perdu d\'Erebor, brique par brique. Rejoignez Bilbon Sacquet, Gandalf, Thorïn et sa compagnie de nains dans une aventure épique à travers la Terre du Milieu', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/285160/header.jpg?t=1634923955', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1798, 0),
(1800, 'No Rest for the Wicked', 'Moon Studios, les développeurs récompensés pour Ori and the Blind Forest et Ori and the Will of the Wisps, vous présentent No Rest for the Wicked, un jeu d\'Action-RPG sanglant et exigeant pensé pour réinventer le genre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1371980/header.jpg?t=1722519309', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 2, 1799, 0),
(1801, 'Skater XL', 'Faites l\'expérience d\'un contrôle et d\'une réactivité inégalés de votre planche tout en skatant sur des endroits emblématiques du monde réel. C\'est l\'évolution de la jouabilité du skateboard. Grâce à la commande au pied indépendante et à la jouabilité unique basée sur la physique, les joueurs de skate disposent enfin des commandes...', 'https://i.postimg.cc/vT9kjNTZ/962730-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', NULL, 1800, 0),
(1802, 'Rain World', 'Vous êtes un chat-limace nomade, à la fois proie et prédateur, qui évolue dans un écosystème corrompu. Muni de votre lance, affrontez les friches industrielles et chassez pour survivre. Prenez garde.... D\'autres créatures, bien plus imposantes, font de même, et raffolent des chats-limaces.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/312520/header.jpg?t=1712787126', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', NULL, 1801, 0),
(1803, 'Core Keeper', 'Explorez une caverne infinie pleine de créatures, d\'objets et de ressources dans une aventure bac à sable pour 1 à 8 joueurs. Creusez, construisez, combattez, fabriquez et cultivez pour découvrir le mystère du Cœur.', 'https://cfinder.xyz/uploads/CoreKeeper.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', NULL, 1802, 0),
(1804, 'Warlord: Britannia', 'Menez un corps expéditionnaire romain au cœur de la Grande-Bretagne antique ! Recrutez, promouvez et améliorez vos légionnaires tout en construisant une série de camps de marche fortifiés. Utilisez les tactiques et stratégies romaines pour conquérir toute l’île et devenir un seigneur de guerre !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1970980/header.jpg?t=1698600999', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1803, 0),
(1805, 'Spec Ops: The Line', 'Un jeu de tir à la 3ème personne moderne conçu pour tester les principes moraux des joueurs en les plaçant au cœur de situations inconcevables.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/50300/header.jpg?t=1706567828', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1804, 0),
(1806, 'Amnesia: The Dark Descent', 'Amnesia : The Dark Descent, un jeu d\'horreur de survie à la première personne. Un jeu sur l\'immersion, la découverte et la vie d\'un cauchemar. Une expérience qui vous refroidira profondément.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/57300/header.jpg?t=1685699016', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1805, 0),
(1807, 'Nightingale', 'Partez pour un voyage de survie et d\'aventure, où mystères et dangers vous attendent dans les royaumes Fae de Nightingale ! Devenez un Realmwalker intrépide et aventurez-vous seul ou avec des amis: explorez, créez, construisez et combattez dans un monde visuellement époustouflant de Gaslamp Fantasy.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1928980/header.jpg?t=1721319634', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1806, 0),
(1808, 'Prince of Persia: The Forgotten Sands', 'Prince of Persia: Les Sables Oubliés est le prochain chapitre de la franchise prisée par les fans Les Sables du Temps. Tandis qu\'il visite le royaume de son frère après ses aventures à Azad, le Prince découvre le palais royal assiégé par une armée destructrice.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/33320/header.jpg?t=1720535241', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 1, 1807, 0),
(1809, 'Shadow of the Tomb Raider', 'Alors que Lara Croft met tout en œuvre pour sauver le monde d\'une apocalypse maya, elle doit suivre son destin et devenir pilleuse de tombeaux.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/750920/header.jpg?t=1709834464', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', NULL, 1808, 0),
(1810, 'Rise of the Tomb Raider™', 'Rise of the Tomb Raider: 20 Year Celebration inclut le jeu de base ainsi que le Season Pass et ses contenus inédits. Explorez le manoir Croft dans la nouvelle séquence « Blood Ties » et défendez-le contre une invasion de zombies dans le niveau « Lara’s Nightmare ».', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/391220/header.jpg?t=1709834259', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', NULL, 1809, 0),
(1811, 'Tomb Raider', 'Tomb Raider part à la découverte des origines de Lara Croft : comment cette jeune femme peu sûre d\'elle a-t-elle bien pu devenir la combattante que l\'on sait ? Avec pour seules armes son instinct et sa capacité à repousser les limites de son endurance, Lara va devoir se battre pour déjouer les sombres mystères d\'une île oubliée et échapper à son emprise. Téléchargez la bande-annonce \"Le tournant\" pour avoir un premier aperçu de cette aventure épique !.', 'https://i.postimg.cc/sD7fCNDk/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:48', '2025-09-09 15:30:13', 2, 1810, 0),
(1812, 'Still Wakes the Deep', '1975. Une catastrophe frappe la plateforme pétrolière de Beira D au large de l’Écosse. Naviguez sur la plateforme qui s\'effondre pour sauver votre équipage d\'une horreur d\'un autre monde, à la limite de la logique et de la réalité.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1622910/header.jpg?t=1720087704', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1811, 0),
(1813, 'Happy room', 'Bienvenue dans le laboratoire! Ici on teste sur des clones de haute résistance humains avec les derniers développements d\'armes. Votre tâche est se mettre à la tête de ces tests.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/550010/header.jpg?t=1647542460', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 2, 1812, 0),
(1814, 'The Beginner\'s Guide', 'The Beginner\'s Guide est un jeu vidéo narratif de Davey Wreden, le créateur de The Stanley Parable. Il dure environ une heure et demie et n\'a pas de mécanique traditionnelle, pas de buts ou d\'objectifs. Au lieu de cela, il raconte l’histoire d’une personne qui lutte pour faire face à quelque chose qu’elle ne comprend pas.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/303210/header.jpg?t=1668035509', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1813, 0),
(1815, 'Dungeons of Hinterberg', 'Épée et guide touristique à la main, explorez le magnifique village alpin d\'Hinterberg et découvrez quelle magie se dissimule dans ses donjons ! Une nouvelle forme de magie à maîtriser, des énigmes à résoudre, des monstres à tuer ; Hinterberg, c\'est tout ça et bien plus encore !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1983260/header.jpg?t=1722001389', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1814, 0),
(1816, 'Burnout™ Paradise Remastered', 'Ravis de t’accueillir à nouveau à Paradise City ! Fais-toi connaître pour tes exploits en t’imposant dans les rues de Burnout™ Paradise Remastered !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1238080/header.jpg?t=1625518920', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1815, 0),
(1817, 'SCHIM', 'Dans SCHiM, tu sautes d\'une ombre à une autre au sein d\'un environnement vivant et reposant. Ce jeu de plateforme en 3D s\'inspire des concepts de la lumière, des ombres et de l\'animation, et les injecte directement dans son gameplay afin d\'offrir une expérience vidéoludique unique en son genre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1519710/header.jpg?t=1722101992', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 2, 1816, 0),
(1818, 'shapez 2', 'Découvrez un jeu entièrement dédié à la construction d\'usines géantes ! Érigez des bâtiments tentaculaires sur plusieurs étages et donnez-vous-en à cœur joie pour optimiser vos plans. Shapez 2 ravira les amoureux de la beauté des chaînes de production et de la perfection des systèmes automatisés.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2162800/header.jpg?t=1721931212', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', NULL, 1817, 0),
(1819, 'Clip Studio Paint', 'officieusement connu au Japon sous le nom de Kurisuta, est une famille d\'applications logicielles développées par la société japonaise de logiciels graphiques Celsys. Il est utilisé pour la création numérique de bandes dessinées, l\'illustration générale et l\'animation 2D', 'https://i.postimg.cc/9Q5dSjXh/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1818, 0),
(1820, 'Bō: Path of the Teal Lotus', 'Évoluez avec grâce dans un jeu de plateformes en 2,5D dessiné à la main qui s\'inspire du folklore japonais. Battez-vous dans les airs, débloquez de puissantes capacités mystiques et explorez un monde mythique pour tenter de percer le mystère de vos origines.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1614440/header.jpg?t=1721323410', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1819, 0),
(1821, 'Nobody wants to Die', 'New York 2329. Dans cette vertigineuse dystopie, l\'immortalité est possible, mais il faut en payer le prix. Utilisez des technologies avancées pour mener l\'enquête dans la peau du détective James Karra, sur la piste d\'un dangereux tueur en série qui s\'en prend à l\'élite de la ville.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1939970/header.jpg?t=1721227287', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1820, 0),
(1822, 'Guitar pro 8', 'PROGRESSEZ PLUS VITE\r\nEntraînez-vous à votre rythme avec le jeu en boucle, le métronome et accédez aux dictionnaires d\'accords et de gammes.\r\n\r\n\r\nAJOUTEZ UNE PISTE AUDIO À VOS PARTITIONS\r\nSynchronisez votre partition avec la piste audio pour transcrire plus rapidement vos morceaux et pour jouer accompagné par une backing track.', 'https://www.guitar-pro.com/themes/gp_child_classic/assets/img/mediakit/guitar-pro-8-logo.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1821, 0),
(1823, 'Another Crab\'s Treasure', 'Dans un royaume sous-marin grouillant de vie, mais en péril, un bernard-l\'ermite se lance dans une chasse au trésor épique pour récupérer son coquillage. Le deuxième jeu d\'AGGRO CRAB.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1887840/header.jpg?t=1718137120', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1822, 0),
(1824, 'Uncrashed : FPV Drone Simulator', 'Pilote FPV amateur ou expérimenté, apprenez ou améliorez vos compétences sur Uncrashed, le nouveau simulateur FPV ultra réaliste. Simulez votre propre drone FPV avec des paramètres basés sur des valeurs réelles et vous aurez les mêmes sensations qu\'un vrai vol sans risque de casse !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1682970/header.jpg?t=1718149031', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1823, 0),
(1825, 'PC Manager	', 'PC Manager est un ensemble d\'outils afin d\'optimiser Windows 10 et 11. Il s\'appuie sur certaines fonctionnalités intégrées au système d\'exploitation tout en proposant d\'autres qui lui sont propre.', 'https://akril.net/wp-content/uploads/2024/02/image-20.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', NULL, 1824, 0),
(1826, 'Dragon\'s Dogma: Dark Arisen', 'Situé dans un énorme monde ouvert, Dragon’s Dogma: Dark Arisen offre une expérience de combat/action exceptionnelle.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/367500/header.jpg?t=1701395331', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', NULL, 1825, 0),
(1827, 'Doki doki literature club plus', 'Bienvenue au club ! Écrivez des poèmes à l\'élue de votre cœur et découvrez toute la terreur qui se cache derrière une amourette de lycée, dans cette histoire d\'horreur psychologique encensée par la critique.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1388880/header.jpg?t=1634143775', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', NULL, 1826, 0),
(1828, 'Norland', 'Dans ce jeu de sim médiévale, vous dirigez une famille noble et affrontez conflits de classe, luttes religieuses et trahisons politiques. Veillez sur votre peuple, découvrez les savoirs perdus d’un empire déchu et complotez contre vos ennemis.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1857090/header.jpg?t=1721906482', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1827, 0),
(1829, 'aomei partission assistant', 'AOMEI PA Standard vous permet de réaliser la mise à niveau/le remplacement de disque, la conversion de style de partition, la migration de l\'OS et d\'autres ...', 'https://i.ibb.co/ThFfgRs/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1828, 0),
(1830, 'Passpartout: The Starving Artist', 'Passpartout vous met dans la peau d’un artiste Français essayant de trouver ses repères dans le magnifique et déroutant monde de l’art. Peignez et vendez vos œuvres pour survivre à votre à votre handicapante addiction au vin et à la baguette.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/582550/header.jpg?t=1717763868', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1829, 0),
(1831, 'Murky Divers', 'Éliminez les expériences ratées de votre employeur dans des laboratoires sous-marins abandonnés. Naviguez en sous-marin, évitez les horreurs abyssales et supprimez tous les cadavres avec votre équipage.', 'https://cfinder.xyz/uploads/MurkyDivers.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 2, 1830, 0),
(1832, 'Ghostbusters: Spirits Unleashed Ecto Edition', 'Il s\'agit d\'un jeu asymétrique de cache-cache. Dans la lignée des précédents titres d\'IllFonic, ce jeu propose un concept 4 contre 1, où les joueurs ont le choix entre jouer en tant qu\'équipe de nouveaux SOS Fantômes ou incarner un seul fantôme.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2383990/header.jpg?t=1716587603', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', NULL, 1831, 0),
(1833, 'Immortal Life', 'Embarquez pour un voyage magique dans ce jeu de simulation de vie captivant. Évadez-vous dans une vallée accueillante, cultivez des sorts et maîtrisez des compétences comme la pêche, l\'artisanat et la cuisine. Participez à des batailles épiques, renforcez les liens avec vos compagnons et construisez la maison de vos rêves pour atteindre la vie immortelle !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1201230/header.jpg?t=1721015591', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 2, 1832, 0),
(1834, 'Sailwind', 'Simulateur de voile présentant une physique de voile réaliste et un vaste monde ouvert à explorer. Embarquez pour des missions de livraison de marchandises, personnalisez votre bateau, essayez la pêche et la cuisine. Une journée de navigation relaxante ou un voyage océanique épique ? Votre aventure à la voile commence ici !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1764530/header.jpg?t=1721001854', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1833, 0),
(1835, 'The Legend of Zelda: Tears of the Kingdom', '« The Legend of Zelda: Tears of the Kingdom » se déroule dans un royaume enchanté appelé Hyrule, où la paix est menacée par une force maléfique. Link, le héros légendaire doit se lancer dans une quête épique pour retrouver les larmes sacrées dispersées à travers le royaume.', 'https://i.postimg.cc/rs29FWxn/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', NULL, 1834, 0),
(1836, 'Wondershare Filmora 13', 'Logiciel montage vidéo gratuit — Réalisez des montages vidéo au rendu professionnel en quelques minutes.', 'https://i.postimg.cc/cHtM06n9/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1835, 0),
(1837, 'Casino Simulator', 'Casino Simulator Expand Your Casino From Scratch, Hire Employees, Customize It, Gamble, Enjoy Your Own Casino', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2898270/header.jpg?t=1716485538', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1836, 0),
