(1839, 'IObit Uninstaller Pro', 'Chaque application est recherchée et effacée, ne laissant derrière elle aucun fichier inutile. Vous pouvez désinstaller le logiciel avec IObit Uninstaller Pro de différentes manières en fonction de votre situation spécifique, par exemple en utilisant la fonctionnalité Forcer la désinstallation ou la fonction Easy Uninstall.', 'https://i.pinimg.com/736x/1f/8a/e9/1f8ae99ff19b14c1089629b719d49888.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 2, 1838, 0),
(1840, 'Little Nightmares', 'Plongez dans le conte sombre et singulier de Little Nightmares et affrontez les terreurs de votre enfance ! Aidez Six à s\'échapper de l\'Antre, un vaste et mystérieux vaisseau peuplé d\'âmes corrompues en quête de leur prochain repas...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/424840/header.jpg?t=1701889428', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1839, 0),
(1841, 'A Dance of Fire and Ice', 'A Dance of Fire and Ice est un jeu strict. Concentrez-vous pendant que vous guidez deux planètes en orbite au travers d\'un chemin corsé, sans rompre leur équilibre parfait.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/977950/header.jpg?t=1703841289', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1840, 0),
(1842, 'Assassin\'s Creed', 'Assassin’s Creed™ est un jeu de nouvelle génération développé par Ubisoft Montréal qui redéfinit le genre du jeu d\'action. Alors que d\'autres jeux se réclament de la nouvelle génération en se basant sur le graphisme, Assassin’s Creed mélange lui technologie, design, thématique et émotion dans un monde où règne le chaos.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/15100/header.jpg?t=1602600542', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', NULL, 1841, 0),
(1843, 'Aska', 'Revendiquez des terres inexplorées et fondez une redoutable tribu viking. Créez la colonie ultime en solo ou avec jusqu\'à trois amis. Vénérez les dieux et le pouvoir de l\'Œil d\'Odin et invoquez des villageois PNJ intelligents qui vous réconforteront au fil de vos efforts pour survivre.', 'https://i.ibb.co/nkRB4tj/1898300-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1842, 0),
(1844, 'The Coffin of Andy and Leyley', 'Un jeu d\'aventure avec des énigmes légères. Un frère et une soeur pratiquent le cannibalisme après avoir été témoins d\'un rituel satanique raté.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2378900/header.jpg?t=1715511135', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 2, 1843, 0),
(1845, 'Tennis Manager 2024', 'Les courts ont besoin de vous, il est temps de signer votre comeback et de prouver que vous êtes le plus grand manager de tennis. Préparez-vous à élaborer des stratégies, entraîner vos nouvelles pépites, et conquérir les courts dans l\'expérience de gestion de tennis la plus immersive à ce jour !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2870110/header.jpg?t=1718869175', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1844, 0),
(1846, 'Granny: Chapter Two', 'You have to escape Granny and Grandpa...You have five days...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1205040/header.jpg?t=1687544039', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1845, 0),
(1847, 'Outpost Infinity Siege', 'Commandez l\'avant-poste mobile et aventurez-vous dans la zone interdite surveillée Signet avec le fusil XEN. Collectez des unités d\'armes uniques. Augmentez la puissance de l\'avant-poste qui se bat à vos côtés. C\'est un jeu FTD : FPS, la construction, la défense de tours et bien plus.', 'https://i.ibb.co/HDh3FWW/1566690-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', NULL, 1846, 0),
(1848, 'A plague tale : innocence', 'Vivez le récit déchirant d’Amicia et de son petit frère Hugo, livrés à eux-mêmes au cœur des heures les plus sombres de l’Histoire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/752590/header.jpg?t=1709320046', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:49', '2025-09-09 15:30:13', 1, 1847, 0),
(1849, 'Havocado: Ragdoll Fighter', 'Havocado est un jeu de combat ragdoll basé sur la physique, avec des armes à feu, des véhicules fous, des créatures bizarres et bien plus encore, où les erreurs ont des conséquences réelles. Parviendrez-vous à battre les autres combattants et à devenir le prochain champion ?', 'https://i.ibb.co/ZMgyQVK/995050-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1848, 0),
(1850, 'Anger Foot', 'Anger Foot est un FPS ultra-rapide dans lequel les seules choses plus dures que vos pieds sont les basses qui tabassent.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1978590/header.jpg?t=1721177420', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1849, 0),
(1851, 'Returnal', 'BRISEZ LE CYCLE Combattez pour votre survie dans ce jeu de tir à la troisième personne récompensé qui apporte l\'histoire de Selene sur PC. Affrontez les défis du genre roguelike. Faites face à vos ennemis dans un déluge de balles. Voyagez dans Returnal™ avec un autre joueur.', 'https://i.ibb.co/TcZwtxW/1649240-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1850, 0),
(1852, 'The Dark Pictures Anthology: The Devil in Me', 'Une équipe de documentaristes reçoit une mystérieuse invitation pour visiter une réplique du \"Château des meurtres\" du tueur en série H. H. Holmes. À leur arrivée, ils découvrent vite qu\'ils sont surveillés, manipulés, et qu\'il y a bien plus en jeu que leur taux d\'audience...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1567020/header.jpg?t=1676560649', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1851, 0),
(1853, 'Saints Row', 'Bienvenue à Santo Ileso, une ville fictive pleine d’animation située dans le sud-ouest américain. Dans ce monde rongé par le crime et où les factions en quête de pouvoir s’entretuent, une bande de jeunes amis partis de rien entame sa propre aventure criminelle pour la gloire et le succès.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/742420/header.jpg?t=1704729851', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1852, 0),
(1854, 'Granny', 'You have to escape Granny`s house...You have five days...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/962400/header.jpg?t=1687541775', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1853, 0),
(1855, 'Far cry Primal', 'La franchise à succès Far Cry revient avec un gameplay innovant en monde ouvert, rempli d\'énormes bêtes, d\'environnements incroyables et de rencontres sauvages. Bienvenue dans l\'Âge de Pierre, une époque extrêmement dangereuse.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/371660/header.jpg?t=1694554883', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1854, 0),
(1856, 'Lobotomy Corporation', 'A roguelite monster-management simulation inspired by the likes of the SCP Foundation, Cabin in the Woods, and Warehouse 13. Order your employees to perform work with the creatures and watch as it unfolds; harness greater energy, and expand the facility', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/568220/header.jpg?t=1636694188', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1855, 0),
(1857, 'Twelve Minutes', 'Un thriller interactif sur un homme enfermé dans une boucle temporelle. Avec James McAvoy, Daisy Ridley et Willem Dafoe.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1097200/header.jpg?t=1709320489', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1856, 0),
(1858, 'Sally Face', 'Plongez dans une aventure sombre en suivant un garçon au visage prothétique et au passé tragique. Démêlez les sinistres mystères du monde de Sally pour trouver la vérité qui se cache sous l’ombre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/541570/header.jpg?t=1667000571', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1857, 0),
(1859, 'Crysis 2', 'Revivez la campagne solo légendaire du classique jeu de tir à la première personne Crysis 2, optimisé pour les machines d’aujourd’hui dans Crysis 2 Remastered.Crysis 2', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2096600/header.jpg?t=1709652029', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1858, 0),
(1860, 'GoreBox', 'Jeu de bac à sable extrêmement violent basé sur la physique avec beaucoup de contenu personnalisé, une physique active de ragdoll et du gore pour s\'amuser, tuer le temps et soulager le stress.', 'https://i.ibb.co/j3qR2Rj/2027330-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1859, 0),
(1861, 'Crysis', 'Le jeu de tir en vue première personne classique de Crytek est de retour avec une jouabilité dynamique, un monde bac à sable et les combats épiques passionnants que vous avez adoré la première fois – maintenant avec des graphiques optimisés remastérisés pour une nouvelle génération de matériel.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1715130/header.jpg?t=1709651863', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1860, 0),
(1862, 'Chivalry 2', 'Retour sur l\'ultime champ de bataille médiéval. Chivalry 2 est un jeu d\'action multijoueur en vue à la première personne inspiré des combats épiques médiévaux. Les joueurs se plongeront dans l\'action de chaque situation emblématique de l\'époque : un affrontement à l\'épée et bien d\'autres encore.', 'https://i.ibb.co/W5Qy48g/1824220-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1861, 0),
(1863, 'Sailing Era', 'Dans Sailing Era, chaque voyage est une merveilleuse aventure de navigation ! Dirigez votre flotte, gérez une entreprise, faites une rencontre romantique à la taverne, capturez des pirates lors de batailles intenses, trouvez des trésors... et voguez sur les sept mers !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2161440/header.jpg?t=1711523525', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1862, 0),
(1864, 'Wondershare Recoverit', 'Wondershare Recoverit peut récupérer tout vos vidéos, photos, audios, e-mails, et d\'autres. perdus de disque dur, d\'ordinateur en panne, de système NAS et Linux. Il répare également les vidéos, photos et autres fichiers corrompus !\r\n', 'https://busilearn.fr/wp-content/uploads/2023/08/Wondershare-Recoverit-logo.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1863, 0),
(1865, 'Crysis 3', 'Vivez l’expérience solo de l’emblématique jeu de tir à la première personne Crysis 3, optimisé pour les machines d’aujourd’hui dans Crysis 3 Remastered.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2096610/header.jpg?t=1709652109', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 2, 1864, 0),
(1866, 'Bus Simulator 21', 'Bus Simulator 21 Next Stop propose la flotte de véhicules la plus exhaustive de la série avec 30 bus sous licence officielle. Pilotez vos bus sur deux cartes totalement différentes, seul ou avec un ami. Utilisez des éléments de gestion avancés ou passez simplement d\'agréables moments sur la route.', 'https://i.ibb.co/72xtBnW/976590-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1865, 0),
(1867, 'Need For Speed The run', 'Need for Speed : The Run est un jeu de courses sur PC où le joueur prend part à d\'intenses courses-poursuites. Orienté arcade, le titre vous transporte dans des environnements variés tels qu\'un étroit canyon ou une grande ville en effervescence.', 'https://gaming-cdn.com/images/products/36/orig/need-for-speed-the-run-pc-jeu-origin-cover.jpg?v=1649766407', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1866, 0),
(1868, 'Feed and Grow Fish ', 'Chassez et mangez d\'autres poissons - tout simplement, devenez de plus grandes bêtes !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/429050/header.jpg?t=1615737978', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1867, 0),
(1869, 'Train Sim world 4', 'Expérimentez une vélocité immense et faites preuve d\'une créativité sans pareille avec TSW4 ! Développez votre hobby ferroviaire et découvrez l\'émotion brute que procure la conduite sur un large éventail d\'itinéraires avec des trains emblématiques. Du centre de formation au col de montagne.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2362300/header_alt_assets_0.jpg?t=1720718974', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1868, 0),
(1870, 'Life is strange Remastered', 'Redécouvrez Life is Strange, le jeu récompensé aux BAFTA, en version superbement remastérisée avec graphismes refondus et animations sublimées grâce à la capture de mouvement.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1265920/header.jpg?t=1700217021', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1869, 0),
(1871, 'The Lord of the Rings: Return to Moria', 'Le seul jeu de survie qui se déroule au Quatrième Âge de la Terre du Milieu', 'https://i.ibb.co/X2j7fk6/2933130-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1870, 0),
(1872, 'Visage', 'Visage est un jeu d\'horreur psychologique à la première personne. Explorez une mystérieuse maison en perpétuelle mutation dans un monde envoûtant qui mêle des environnements étrangement réconfortants à d\'autres horriblement réalistes, et vivez une aventure authentiquement terrifiante.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/594330/header.jpg?t=1607559678', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1871, 0),
(1873, 'Senua’s Saga: Hellblade II', 'Dans cette suite du jeu aux multiples récompenses, Hellblade : Senua\'s Sacrifice, Senua reprend sa violente lutte pour survivre à travers les mythes et tourments de l\'Islande viking.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2461850/header.jpg?t=1718357385', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1872, 0),
(1874, 'Kingdom hearts III and Re ', 'Découvrez le pouvoir de l\'amitié avec Sora et ses amis alors qu\'ils se lancent dans une dangereuse aventure dans KINGDOM HEARTS III. Voyagez à travers divers mondes Disney et Pixar avec Sora, un jeune garçon qui détient sans le savoir un pouvoir extraordinaire. Avec l\'aide de Donald et Dingo, il doit empêcher les maléfiques Sans-Cœur d\'envahir l\'univers.\r\n\r\nGrâce au pouvoir de l\'amitié, Sora, Donald et Dingo font équipe avec des personnages Disney-Pixar cultes pour surmonter toutes les épreuves et tenir tête aux ténèbres qui menacent leurs mondes.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2552450/header.jpg?t=1721204121', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1873, 0),
(1875, 'South Park: The Fractured But Whole', 'Les créateurs de South Park, Trey Parker et Matt Stone, sont en passe d\'accoucher de South Park : L\'annale du destin, qui fait suite à South Park : Le Bâton de la Vérité, primé en 2014.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/488790/header.jpg?t=1680013571', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1874, 0),
(1876, 'Final Fantasy VI', 'La version originale de FINAL FANTASY VI prend vie grâce à de tout nouveaux graphismes et un nouveau son! Une version remodelée en 2D du quatrième opus de la célèbre franchise FINAL FANTASY ! Explorez une histoire indémodable à travers de charmants graphismes rétro.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1173820/header.jpg?t=1706631181', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1875, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1877, 'Supernatural', 'L\'inspecteur Wyatt est confronté à un mystère effrayant alors qu\'il enquête sur la disparition d\'une femme de ménage. Découvrez de sinistres secrets en naviguant dans une maison hantée, où chaque ombre cache une terreur cachée.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2093010/header.jpg?t=1721059245', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1876, 0),
(1878, 'Sonic Mania ', 'Sonic Mania est une aventure inédite de Sonic, Tails, et Knuckles, avec des boss uniques, des paysages défilant en 2D, et au mode de jeu classique palpitant.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/584400/header.jpg?t=1669906775', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1877, 0),
(1879, 'Eastward', 'Bienvenue dans le monde d\'Eastward ! Population : en déclin ! Découvrez une société sur le point de s\'effondrer, de charmantes villes, d\'étranges créatures et des gens plus étranges encore !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/977880/header_french.jpg?t=1716212345', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 2, 1878, 0),
(1880, 'Wolfenstein: Youngblood', 'Wolfenstein: Youngblood est la première aventure Wolfenstein moderne en coopération. Seul ou avec un ami, incarnez l\'une des jumelles de B.J. Blazkowicz armée d\'un arsenal de nouvelles armes, gadgets, et capacités pour libérer Paris.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1056960/header.jpg?t=1646757564', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1879, 0),
(1881, 'Kena: Bridge of Spirits', 'Un jeu d’action-aventure narratif combiné à de l’exploration et des combats effrénés. Dénouez le passé dans la peau de Kena, une jeune guide des esprits à la recherche du temple de la montagne sacrée.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1954200/header.jpg?t=1664298117', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1880, 0),
(1882, 'Ravenswatch', 'Héros déchus d’anciens contes et légendes, vous voici à l\'aube d\'un combat crucial contre le Cauchemar qui envahit et corrompt votre monde.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2071280/header.jpg?t=1713798294', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1881, 0),
(1883, 'What Remains of Edith Finch', 'What Remains of Edith Finch est une collection de contes étranges sur une famille de l’État de Washington. En incarnant Edith, vous allez explorer l’énorme demeure des Finch, à la recherche d’histoires sur le passé de cette famille et vous devrez découvrir pourquoi elle en est le dernier membre encore vivant.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/501300/header.jpg?t=1709320869', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1882, 0),
(1884, 'Action Sandbox', 'Un jeu de bac à sable physique pour les personnes qui aiment jouer avec des jouets numériques. Créez, contrôlez les jouets et définissez vos objectifs.\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1381650/header.jpg?t=1663146652', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', NULL, 1883, 0),
(1885, 'Bioshock Infinite', 'This pack combines the contents of the Industrial Revolution Pack and the Upgrade Pack, originally part of the Premium and Ultimate Songbird Editions of BioShock Infinite.  Start your game with 500 Silver Eagles (in-game currency), 5 Lock Picks to help you navigate through Columbia, and six unique Gear items.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/8870/header.jpg?t=1602794480', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1884, 0),
(1886, 'Welcome to Kowloon', 'Il s\'agit d\'un jeu d\'horreur indépendant à la première personne dans lequel vous vous retrouvez dans un quartier appelé Kowloon à la recherche d\'un logement bon marché. Les habitants de cet endroit semblent ordinaires au premier abord, mais en creusant un peu, on découvre leurs vrais visages.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2515240/header.jpg?t=1698336843', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1885, 0),
(1887, 'Dead cells', 'Dead Cells est un jeu d\'action/plateforme rogue-lite intégrant des éléments de Metroidvania. Explorez un château tentaculaire en perpétuelle évolution… Pas de points de contrôle. Tuer, mourir, apprendre, recommencer.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/588650/header.jpg?t=1717495895', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 2, 1886, 0),
(1888, 'The Thaumaturge', 'The Thaumaturge est un jeu RPG où l’ambiguïté morale accompagne tous vos choix. Il se déroule dans le cadre multiculturel du début du XXe siècle à Varsovie, où les thaumaturges sont les seuls à percevoir la vraie nature des salutors, qu’ils manipulent pour atteindre leurs objectifs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1684350/header.jpg?t=1720249305', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1887, 0),
(1889, ' The Quintessential Quintuplets Memories of a Quintessential Summer', 'Une escapade palpitante sur une île avec les quintuplées Nakano !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2507610/header.jpg?t=1716890790', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1888, 0),
(1890, 'Drug Dealer simulator', 'Avez-vous déjà pensé à développer votre propre empire du crime, sans les conséquences légales et morales ? SIMULEZ-LE ! Rampez dans les allées sombres du trafic de drogue. Maintenant avec SIX grandes mises à jour gratuites et une suite - DDS2 - sort MAINTENANT !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/682990/header.jpg?t=1718903787', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:50', '2025-09-09 15:30:13', 1, 1889, 0),
(1891, 'Drug Dealer Simulator 2', 'Pourquoi devient-on un dealer ? Comment le dealer se transforme en baron de la drogue ? Apprenez-le par DDS2, un simulateur première personne, avec un monde dynamique et ouvert. Faites un réseau de relations, créez des drogues et gérez votre cartel sur Isla Sombra où le pouvoir règne.', 'https://cfinder.xyz/uploads/DrugDealerSimulator2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', NULL, 1890, 0),
(1892, 'Gris', 'Jeune fille optimiste, mais hantée par une expérience douloureuse qui a ébranlé sa vie, Gris s\'est égarée dans le tréfonds d\'un monde qu\'elle a créé de toutes pièces.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/683320/header.jpg?t=1719981693', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1891, 0),
(1893, 'The Classroom', 'The Classrooms est un jeu procédural de survie-horreur, d’espace liminal et de \"found footage\". Explorez le jeu et découvrez les différentes anomalies : des entités malveillantes aux bizarreries inoffensives. Et souvenez-vous, l\'expérience change à chaque partie, rendant vos enregistrements...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2099110/header.jpg?t=1718478185', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', NULL, 1892, 0),
(1894, 'Fernbus Simulator', 'Fernbus Simulator : Autocar Longue Distance est la première simulation d’autobus interurbains actuellement très populaires. Grâce à la coopération avec FlixBus, Fernbus Simulator : Autocar Longue Distance vous fera découvrir le monde des caristes professionnel sur le réseau routier allemand avec un superbe réalisme.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/427100/header.jpg?t=1712125312', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1893, 0),
(1895, 'Skul: The hero slayer', 'Guide Skul dans sa quête solitaire pour affronter l\'armée impériale et sauver son roi de la captivité, dans un jeu de plateformes 2D plein d\'action et de rebondissements.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1147560/header.jpg?t=1719470538', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1894, 0),
(1896, 'Halo Infinite ', 'Issu de l’une des sagas les plus emblématiques du jeu vidéo, Halo est plus grand que jamais. Avec une vaste campagne en monde ouvert et une expérience multijoueur dynamique', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1240440/header.jpg?t=1719939671', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1895, 0),
(1897, 'Battlefield 4', 'Dominez le champ de bataille avec les bonus Premium', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1238860/header.jpg?t=1700043480', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1896, 0),
(1898, 'Pikuniku', 'Pikuniku est un jeu d’exploration et de puzzles merveilleusement absurde qui se déroule dans un univers joyeux et étrange à la fois.Aidez ses curieux héros à surmonter les épreuves, démasquer un sinistre complot et commencer une révolution dans cette étonnante aventure dystopique !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/572890/header.jpg?t=1719983069', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1897, 0),
(1899, 'The Witness', 'Vous vous réveillez seul, sur une île étrange remplie d\'énigmes qui vous mettront à l\'épreuve et vous surprendront.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/210970/header.jpg?t=1598383120', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1898, 0),
(1900, 'Wolfenstein: The New Order', 'Wolfenstein®: The New OrderTM remet au goût du jour la série qui a créé le genre du FPS. En cours de développement chez MachineGames, un studio composé d\'un collectif de développeurs aguerris et reconnus pour leurs travaux sur des jeux au scénario palpitant, Wolfenstein propose une histoire passionnante remplie d\'action ! ', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/201810/header.jpg?t=1691683281', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1899, 0),
(1901, 'Slay the Princess', 'Vous êtes là pour tuer la Princesse. Ne croyez pas ses mensonges.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1989270/header.jpg?t=1718210733', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1900, 0),
(1902, 'Arma Reforger', 'En pleine guerre froide, débarquez sur l\'île d\'Éveron au beau milieu de l\'Atlantique ainsi que sur le petit territoire d\'Arland. Tentez de vous imposer lors de combats réalistes, ou créez vos propres scénarios pour les autres joueurs en tant que Maître du jeu.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1874880/header.jpg?t=1719406453', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1901, 0),
(1903, 'Wolfenstein II: The New Colossus', 'États-Unis, 1961 : la victoire acquise en assassinant le général nazi dit Le Boucher n\'aura pas duré. Les nazis continuent de régner. Vous êtes B.J. Blazkowicz, dit \"Blazko le Barjo\", résistant, fléau de l\'empire nazi, et dernier espoir de l\'humanité.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/612880/header.jpg?t=1691683256', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1902, 0),
(1904, 'Wolfenstein: The Old Blood', 'Wolfenstein® : The Old Blood™ est une préquelle autonome du jeu de tir d\'action-aventure à la première personne acclamé par la critique, Wolfenstein® : The New Order. Cette aventure s\'étend sur huit chapitres et présente les caractéristiques de MachineGames : une action palpitante, une histoire immersive et des combats FPS intenses.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/350080/header.jpg?t=1699548921', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1903, 0),
(1905, 'Dead Space 2 ', 'LE CAUCHEMAR EST DE RETOUR', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/47780/header.jpg?t=1674071175', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1904, 0),
(1906, 'Scorn', 'Scorn est un jeu d\'aventure-horreur atmosphérique en vue subjective dans un univers cauchemardesque grouillant de formes étranges et de sombres tableaux.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/698670/header.jpg?t=1706178006', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1905, 0),
(1907, 'Alan Wake Remastered', 'Alan Wake, un écrivain torturé, part dans une quête désespérée pour retrouver Alice, sa femme. Après sa disparition mystérieuse dans Bright Falls, une petite ville du Nord-Ouest Pacifique, il découvre les pages d\'un roman d\'horreur qu\'il a supposément écrit, mais dont il n\'a aucun souvenir.', 'https://i.ibb.co/s3GDmHX/f5de4c346e02c86231f2c234460c02f7ef05a167ffd256baae8035e4da0d840b.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1906, 0),
(1908, 'Batman: Arkham City', 'Batman: Arkham City est un jeu vidéo d\'action-aventure avec des aspects de jeu d\'infiltration développé par Rocksteady Studios et édité par WB Games.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/200260/header.jpg?t=1702934622', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1907, 0),
(1909, 'Dead Island', 'Bienvenue à l\'expérience zombapocalyptique de votre vie, plus magnifique aujourd\'hui que jamais. Coincé au beau milieu d\'une infestation de zombies épique sur l\'île tropicale de Banoi, vous ne pensez qu\'à une chose : survivre !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/383150/header.jpg?t=1709650104', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1908, 0),
(1910, 'Need for Speed™ Most Wanted', 'Attachez votre ceinture et semez la pagaille.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1262560/header.jpg?t=1605151411', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1909, 0),
(1911, 'Fear & Hunger', 'Fear & Hunger est un jeu d\'exploration de donjons d\'horreur se déroulant dans les donjons sombres et désespérés de la peur et de la faim. Le jeu est un hybride des genres survival horror et dungeon crawler avec ses influences allant de Silent Hill à Nethack. Il y a des éléments roguelike dans le jeu ainsi qu\'une base solide d\'un j-RPG.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1002300/header.jpg?t=1621853752', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', NULL, 1910, 0),
(1912, 'Townscaper', 'Editeur de ville', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1291340/header.jpg?t=1716749881', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1911, 0),
(1913, 'Unpacking', 'Unpacking est un jeu de puzzle zen sur l\'expérience familière de sortir ses affaires de cartons et de les placer dans une nouvelle maison. Moitié puzzle de blocs, moitié décoration d\'intérieur, venez créer un espace de vie agréable tout en découvrant des indices sur la vie que vous déballez.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1135690/header.jpg?t=1718414626', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1912, 0),
(1914, 'Chants of Sennaar', 'Dans ce jeu primé d\'aventure à énigmes, vous incarnez le voyageur, un personnage cherchant à réunir les Peuples de la Tour. Observez, écoutez et déchiffrez des langues oubliées dans un univers fascinant qui s\'inspire du mythe de la Tour de Babel.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1931770/header.jpg?t=1718876040', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 2, 1913, 0),
(1915, 'Winter Resort Simulator 2', 'Winter Resort Simulator 2 est une simulation complète d\'un domaine skiable avec toutes ses installations techniques et ses véhicules.', 'https://i.ibb.co/r6LCgt7/1420770-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', NULL, 1914, 0),
(1916, 'Crypto Miner Tycoon Simulator', 'Construisez des plates-formes pour miner du bitcoin, de l\'ethereum et d\'autres crypto-monnaies. Effectuez des transactions sur le marché pour accroître votre richesse. Développez votre entreprise dans de nouveaux bureaux. Embauchez des employés qualifiés et assignez-leur des tâches.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1859290/header.jpg?t=1713968316', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1915, 0),
(1917, 'Chained Together', 'Depuis les profondeurs de l\'enfer, grimpez enchaîné à vos amis à travers plusieurs mondes. Seul ou en coopération, essayez d\'atteindre le sommet et découvrez ce qui vous y attend...', 'https://i.ibb.co/gD52h32/2567870-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 2, 1916, 0),
(1918, 'Mad Max', 'Incarnez Mad Max, survivant et héros malgré lui. Max désire plus que tout fuir le chaos et trouver la paix.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/234140/header.jpg?t=1634068672', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1917, 0),
(1919, 'Alone in the Dark', 'Retrouvez le manoir de Derceto dans cette revisite d\'Alone in the Dark, véritable lettre d\'amour au classique d\'horreur des années 90.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1310410/header.jpg?t=1711546287', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:51', '2025-09-09 15:30:13', 1, 1918, 0),
(1920, 'Heavy Rain', 'Découvrez un thriller psychologique aux nombreux rebondissements. Vous êtes à la poursuite du Tueur aux origamis. Alternez entre quatre personnages différents, chacun avec ses propres pistes, pour empêcher le tueur de faire une nouvelle victime.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/960910/header.jpg?t=1675271942', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1919, 0),
(1921, 'Necrobarista', 'Dans un café de ruelle, les morts se voient accorder une dernière nuit pour se mêler aux vivants. Necrobarista suit un groupe de personnages dynamiques et diversifiés qui naviguent dans la culture des cafés branchés de Melbourne, l\'éthique douteuse de la nécromancie et le processus du lâcher-prise.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/725270/header.jpg?t=1646642086', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 2, 1920, 0),
(1922, 'Need For speed undercover', 'Need for Speed: Undercover est un jeu vidéo de course automobile développé par EA Black Box et édité par Electronic Arts sorti en 2008. Le jeu est disponible sur PlayStation 2, PlayStation 3, Wii, Windows, Xbox 360, Nintendo DS, PlayStation Portable et téléphone portable. Il fait partie de la série Need For Speed.', 'https://shared.steamstatic.com/store_item_assets/steam/apps/17430/header.jpg?t=1633450349', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1921, 0),
(1923, 'Thymesia', 'JDR aux combats intenses, Thymesia se déroule dans un monde sinistre et propose un système d\'armes pestiférées original. Dans ce royaume où règne la mort, vous incarnez le mystérieux Corvus. Traquez vos ennemis, déchaînez des pouvoirs délétères et découvrez la vérité tapie dans vos souvenirs.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1343240/header.jpg?t=1683278336', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1922, 0),
(1924, ' Death Stranding Director\'s Cut', 'L\'expérience révolutionnaire du légendaire Hideo Kojima revient encore plus étoffée dans l\'édition ultime DIRECTOR\'S CUT. Sam Bridges a pour mission de donner de l\'espoir à l\'humanité en reconnectant tous les survivants d\'une Amérique décimée. Parviendrez-vous à réunifier ce monde déchiré ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1850570/header.jpg?t=1718100326', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1923, 0),
(1925, 'Space Engineers', 'Space Engineers est un jeu de sandbox à monde ouvert caractérisé par la créativité et l\'exploration.', 'https://i.ibb.co/CnmHhFP/244850-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', NULL, 1924, 0),
(1926, 'Age of Empires III', 'Age of Empires III: Definitive Edition offre aux joueurs un essai de cette expérience de jeu de stratégie en temps réel historique en solo et en multijoueur.', 'https://i.ibb.co/mt4Sj8k/933110-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', NULL, 1925, 0),
(1927, 'Age of Empires II: Definitive Edition', 'AoE II: DE comprend également \"Les derniers khans\" avec 3 nouvelles campagnes et 4 civilisations supplémentaires. Les mises à jour fréquentes incluent des événements, du contenu supplémentaire, de nouveaux modes de jeu et des fonctionnalités améliorées avec l\'ajout récent du mode coopération!', 'https://i.ibb.co/R9ZBnPk/capsule-616x353-17.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', NULL, 1926, 0),
(1928, 'Virtual Rides 3 - Funfair Simulator', 'DESIGN! CONTROL! RIDE! Virtual Rides III est enfin arrivé ! Découvrez une fête foraine plus grande, plus colorée et plus impressionnante que jamais ! Laissez-vous guider par votre imagination ! Concevez, contrôlez et montez dans plus de 15 attractions uniques !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/515260/header.jpg?t=1708941508', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1927, 0),
(1929, 'Deathloop', 'DEATHLOOP est un FPS next-gen d\'Arkane Lyon, le studio acclamé à l\'origine de Dishonored. Dans DEATHLOOP, deux assassins rivaux sont piégés dans une mystérieuse boucle temporelle sur l\'île de Blackreef, condamnés à répéter la même journée pour l\'éternité.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1252330/header.jpg?t=1705940190', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', NULL, 1928, 0),
(1930, 'Street Fighter V', 'Découvrez l\'intensité des combats face-à-face dans Street Fighter® V ! Choisissez parmi 16 personnages cultes, puis battez-vous contre vos amis en ligne et hors ligne avec une variété solide d\'options de combat.\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/310950/header.jpg?t=1705467952', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1929, 0),
(1931, 'Hotline Miami', 'Hotline Miami est un jeu à l\'action explosive qui déborde de brutalité brute, de fusillades et de combats rapprochés sanglants et violents.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/219150/header.jpg?t=1686261983', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1930, 0),
(1932, 'Surviving Mars', 'Bienvenue à la maison ! Le temps est venu de faire valoir vos droits sur la Planète rouge et de construire les premières colonies humaines fonctionnelles sur Mars ! Après quelques travaux de rénovation, cet endroit promet d\'être vraiment magnifique.\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/464920/header.jpg?t=1701955588', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1931, 0),
(1933, 'Deceit 2', 'Deceit 2 est un jeu d\'horreur de déduction social en ligne. Instillez la peur en tant que Terreur, jouez les détectives en incarnant un Innocent, ou semez le chaos en jouant un Maudit. Pris au piège avec des amis et des inconnus : à qui pourrez-vous vous fier pour vous échapper ?\r\n\r\n', 'https://i.postimg.cc/SNmrTZLT/2064870-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', NULL, 1932, 0),
(1934, '1000xRESIST', '1000xRESIST est une aventure de science-fiction palpitante. L\'année est inconnue, et une maladie propagée par une invasion extraterrestre vous maintient sous terre. Vous êtes un Observateur. Vous remplissez consciencieusement votre mission au service de ALLMOTHER, jusqu\'au jour où vous découvrez un secret choquant qui change tout.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1675830/header.jpg?t=1717631109', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1933, 0),
(1935, 'Cryptmaster', 'EXPRIMEZ-VOUS dans ce jeu d\'exploration de donjon insolite où les mots ont le pouvoir. Comblez les blancs à l\'oral ou à l\'écrit pour révéler des facultés perdues et résoudre des quêtes et des énigmes déconcertantes. Réussirez-vous à conquérir la crypte et percer le mystère de CRYPTMASTER ?\r\n\r\n', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1885110/header.jpg?t=1717112609', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 2, 1934, 0),
(1936, 'Planet Base', 'Aidez un groupe de colons de l\'espace à établir une base sur une planète lointaine. Cultivez de la nourriture, générez de l\'énergie, extrayez du métal, fabriquez des robots et construisez une base autonome.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/403190/header.jpg?t=1710757442', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 1, 1935, 0),
(1937, 'Age of Empires IV: Anniversary Edition', 'Pour célébrer son premier anniversaire, la franchise de jeu de stratégie à succès acclamée par la critique surprend ses millions de joueurs dans le monde avec Age of Empires IV : Édition Anniversaire, qui vous place VOUS au cœur d\'encore plus de batailles épiques qui ont façonnées l\'Histoire.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1466860/header.jpg?t=1708710025', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', 2, 1936, 0),
(1938, 'Bodycam', 'Bodycam est un jeu de tir à la première personne ultra-réaliste & multijoueur réalisé à l\'aide des dernières technologies d\'Unreal Engine 5. Préparez-vous à plonger dans des actions intenses où chaque balle compte et chaque choix peut décider de la victoire ou de la défaite de votre équipe.\r\n\r\n', 'https://i.postimg.cc/L61r15bx/2406770-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:52', '2025-09-09 15:30:13', NULL, 1937, 0),
(1939, 'PANICORE', 'PANICORE est un jeu de survie et d\'horreur qui mélange permadeath, monstres IA et expérience coopérative. Essayez de vous échapper et de ne pas vous faire prendre, mais attention : ils n\'entendent pas seulement vos pas, mais aussi votre voix.', 'https://i.postimg.cc/SNBRhrnY/2695940-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:53', '2025-09-09 15:30:13', NULL, 1938, 0),
(1940, 'Advanced System care pro', 'Advanced SystemCare Pro est une application capable de nettoyer et sécuriser votre PC pour améliorer sa performance et le protéger de menaces potentielles.', 'https://cdkeyprices.fr/images/software/advanced-systemcare-15-pro/advanced-systemcare-15-pro-logo.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:53', '2025-09-09 15:30:13', 1, 1939, 0),
(1941, 'Car Mechanic Simulator 2021', 'Travaillez à la création d\'un empire de la distribution. Mettez la main à la pâte dans un jeu de simulation très réaliste qui accorde une grande attention aux détails. Visitez une nouvelle salle des ventes et achetez des voitures dans différentes conditions.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1190000/header.jpg?t=1715085650', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:53', '2025-09-09 15:30:13', NULL, 1940, 0),
(1942, 'Half-Life: Opposing Force', 'Retournez au centre de recherche de Black Mesa en incarnant l\'un des spécialistes militaires chargés d\'éliminer Gordon Freeman. Découvrez un tout nouvel épisode en mode solo. Faites la connaissance d\'aliens plutôt coriaces et essayez des armes inédites.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/50/header.jpg?t=1579628243', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:53', '2025-09-09 15:30:13', 1, 1941, 0),
(1943, 'Sonic Generation', 'Célébrez les 20 ans de Sonic dans une toute nouvelle aventure qui offre une expérience exceptionnelle aux fans de Sonic, anciens ou nouveaux !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/71340/header.jpg?t=1704380608', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:53', '2025-09-09 15:30:13', 1, 1942, 0),
(1944, 'I Am Alive', 'I Am Alive place le joueur dans la peau d’un survivant esseulé dans un monde post-apocalyptique sombre, dangereux et crédible.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/214250/header.jpg?t=1680008041', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:53', '2025-09-09 15:30:13', 1, 1943, 0),
(1945, 'The Talos Principle 2', 'The Talos Principle 2 est un captivant jeu de puzzle à la première personne, dans lequel les thèmes philosophiques du premier titre sont approfondis sur fond d\'environnements époustouflants et de défis plus stimulants que jamais.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/835960/header.jpg?t=1709127230', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:54', '2025-09-09 15:30:13', 1, 1944, 0),
(1946, 'Inscryption', 'Inscryption est une odyssée personnelle qui prend la forme d\'un jeu de cartes d\'un noir d\'encre qui mélange le rogue-like, la création de deck, les énigmes des escape-room et l\'horreur psychologique. Mais ce n\'est pas tout, car les cartes renferment des secrets encore plus noirs...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1092790/header.jpg?t=1711709540', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:54', '2025-09-09 15:30:13', 1, 1945, 0),
(1947, 'The Surge', 'Bienvenue chez CREO, la méga-corporation qui va sauver le monde ! Une catastrophe inattendue survient lors de votre tout premier jour de travail, et vous vous réveillez, équipé d’un exosquelette industriel, au milieu du complexe en ruine.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/378540/header.jpg?t=1695811115', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:54', '2025-09-09 15:30:13', 2, 1946, 0),
(1948, 'Deus Ex: Human Revolution - Director\'s Cut', 'Vous incarnez Adam Jensen, un ancien du SWAT choisi pour superviser les besoins défensifs de l\'une des plus grosses sociétés de biotechnologie expérimentale des États-Unis. Votre mission consiste à protéger les secrets du groupe, mais lorsqu\'une équipe d\'agents espions parvient à entrer par effraction dans le bâtiment et assassine les...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/238010/header.jpg?t=1713292112', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:54', '2025-09-09 15:30:13', 1, 1947, 0),
(1949, 'Hospital 666', 'Hospital 666 est un jeu d\'évasion d\'horreur pour 1 à 4 joueurs. Parcourez d\'étranges niveaux d\'hôpital tout en observant l\'apparition d\'anomalies et en choisissant le bon ascenseur. Certains patrons anormaux vous poursuivront à mort et vous devrez trouver le bon moyen de leur échapper.', 'https://i.postimg.cc/DfjPQFqn/hospital-666.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:54', '2025-09-09 15:30:13', NULL, 1948, 0),
(1950, 'Bioshock II remastered', 'Dans BioShock 2, vous vous immergez dans la peau d\'une icône de Rapture, le Protecteur, vous explorez la magnifique ville déchue et traquez un ennemi invisible tout en tentant de chercher des réponses a vos questions et d\'assurer votre propre survie.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/409720/header.jpg?t=1603360893', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 1, 1949, 0),
(1951, 'Bioshock remastered', 'BioShock est un jeu de tir à mille lieux de tous les autres, proposant armes et stratégies parfaitement inédites. Vous aurez à votre disposition un arsenal complet, depuis le plus simple des revolvers jusqu\'au lance-grenades et au lanceur chimique, mais vous devrez également modifier votre ADN et ainsi créer une arme encore plus...', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/409710/header.jpg?t=1598321131', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 1, 1950, 0),
(1952, 'Goat Simulator', 'Goat Simulator est la dernière technologie de haute technologie en matière de simulation de chèvre.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/265930/header.jpg?t=1710940224', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 1, 1951, 0),
(1953, 'Sonic Forces', 'Le destin du monde de Sonic the Hedgehog est entre vos mains. Rejoignez la révolte !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/637100/header.jpg?t=1603129888', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', NULL, 1952, 0),
(1954, 'Battlefield V', 'Il s\'agit de l\'expérience Battlefield™ V ultime. Découvrez le plus grand conflit de l\'Histoire avec l\'arsenal complet, c\'est-à-dire l\'ensemble des armes, des véhicules et des gadgets, ainsi que les meilleurs éléments de personnalisation des années 1 et 2.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1238810/header.jpg?t=1701356409', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 2, 1953, 0),
(1955, 'Katana ZERO', 'Katana ZERO est un jeu de plate-formes à l\'ambiance très noire, bourré d\'action et de combats mortels. Faites parler votre lame et manipulez le temps pour découvrir votre passé dans un éblouissant ballet acrobatique et brutal. Des combats exceptionnels : Terrassez vos adversaires quelle que soit la situation.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/460950/header.jpg?t=1710763341', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 1, 1954, 0),
(1956, 'STRANGER OF PARADISE FINAL FANTASY ORIGIN', 'Développé par Square Enix en collaboration avec Team NINJA (Koei Tecmo Games), STRANGER OF PARADISE FINAL FANTASY ORIGIN est un action-RPG corsé qui donne une nouvelle direction à la série FINAL FANTASY. Faites l\'expérience de combats haletants les plus impitoyables de l\'histoire de la franchise.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1358700/header.jpg?t=1690435954', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', NULL, 1955, 0),
(1957, 'Food Truck Simulator', 'Rénovez, équipez et redonnez de l\'éclat au food truck qui appartenait à votre père. Créez des recettes, cuisinez des plats et servez les clients dans une ville entière. Personnalisez et améliorez votre food truck pour toucher plus de clients et élargir votre menu.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1160920/header.jpg?t=1711038901', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 1, 1956, 0),
(1958, 'Crusader Kings III', 'Aimez, luttez, planifiez et atteignez la grandeur. Déterminez l\'héritage de votre maison noble dans le jeu de grande stratégie tentaculaire de Crusader Kings III. La mort n\'est qu\'un début quand vous guidez votre dynastie dans cette riche simulation médiévale plus grande que nature.', 'https://cfinder.xyz/uploads/CrusaderKingsIII.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', NULL, 1957, 0),
(1959, 'OverDrift Festival', 'Devenez la star du festival de la culture automobile et du sport. Courses de drift et circuits Free Style Drift sur la voie publique avec circulation. Un monde de jeu immense, des pistes emblématiques. Collection unique de voitures. Large gamme d\'options de réglage et de style. Physique précise : une sensation de vitesse et de forces g latérales.', 'https://i.ibb.co/vDWVPd0/header-6.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', NULL, 1958, 0),
(1960, 'INDIKA', 'Ce jeu à la troisième personne se déroule dans la Russie alternative de la fin du XIXe siècle, où les visions religieuses se heurtent à la réalité. INDIKA raconte l\'histoire d\'une jeune nonne partie à la découverte d\'elle-même avec un compagnon insolite : le diable en personne.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1373960/header.jpg?t=1716911170', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 1, 1959, 0),
(1961, 'Wobbly Life', 'Wobbly Life est un jeu bac à sable en monde ouvert basé sur la physique. Joue avec tes amis en ligne ou en coop local et découvrez ensemble des jobs palpitants, des mini-jeux et des missions déjantées. Gagne de l\'argent pour acheter des habits, des véhicules et des maisons. Il y a tant à explorer !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/1211020/header.jpg?t=1713448566', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 1, 1960, 0),
(1962, 'Descenders', 'Descenders est un jeu de descente VTT extrême avec génération procédurale du terrain, et où les erreurs ont de réelles conséquences. Allez-vous mener votre équipe à la victoire et devenir le prochain Descender de légende ?', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/681280/header.jpg?t=1709308554', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', NULL, 1961, 0),
(1963, 'Brain Show: Party Quiz', 'Affronte tes amis dans un tout nouveau jeu de quiz (multijoueur en ligne). Participe à une émission de télévision délirante. Des explosions de dynamite, des copains qui sanglotent, des amitiés ruinées ! Ça a l\'air amusant ? Ce sera le cas avec Brain Show - jeu de questions-réponses !', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2235150/header.jpg?t=1715943404', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 1, 1962, 0),
(1964, 'Airships: Conquer the Skies', 'Concevez des navires célestes steampunk à partir de modules fonctionnels et partez à la conquête du ciel !', 'https://i.postimg.cc/L5kdqX7t/airship.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', 2, 1963, 0),
(1965, 'FOUNDRY', 'Construisez une usine optimisée à la perfection ou un chef-d\'œuvre artistique dans un monde en voxels infini. Extrayez et récoltez des ressources, automatisez vos lignes de production en expansion constante et gérez des systèmes complexes pour atteindre la maîtrise mécanique dans FOUNDRY.', 'https://i.postimg.cc/90y4rdCL/Foundry.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:55', '2025-09-09 15:30:13', NULL, 1964, 0),
(1966, 'REMNANT II', 'Remnant II® est la suite de Remnant: From the Ashes, la révélation vidéoludique où les survivants de l\'humanité sont confrontés à des créatures redoutables et des boss titanesques dans des mondes terrifiants.', 'https://cfinder.xyz/uploads/REMNANTII.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1965, 0),
(1967, 'Mechanic Heroes', 'Constituez votre équipe de mécaniciens et travaillez ensemble pour réparer et livrer le plus de voitures possible avant la fin du temps imparti. Jouable jusqu\'à 4 joueurs, en local ou en ligne, Mechanic Heroes vous fera aimer la mécanique ou tout simplement détester vos amis.', 'https://i.postimg.cc/SQ5FKBv1/Mechanic-Heroes.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1966, 0),
(1968, 'Unravel Two', ' Lorsque vous coupez les liens du passé, de nouveaux liens se forment.', 'https://i.postimg.cc/4dkPM1L5/Unravel-Two.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1967, 0),
(1969, 'Abiotic Factor', 'Jeu de survie en coop (1-6 joueurs) qui se déroule dans un centre menacé par des phénomènes paranormaux. Vous qui incarnez les scientifiques les plus brillants, vous devrez fabriquer des outils et des armes, et survivre de la seule manière qui vous est familière: tuez-les avec la science!', 'https://cfinder.xyz/uploads/AbioticFactor.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1968, 0),
(1970, 'V Rising', 'Réveille le vampire qui est en toi. Chasse le sang dans les colonies voisines pour retrouver tes forces et fuis le soleil brûlant pour survivre. Bâtis ton château et prospère dans un monde ouvert en constante évolution plein de mystère. Gagne des alliés en ligne et conquiers la terre des vivants.', 'https://i.postimg.cc/j2g7PQF7/V-rising.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1969, 0),
(1971, 'Agrou', 'Ton nouveau jeu de Loup garou favori ! Assieds-toi avec des amis autour du feu, incarne un villageois, un loup-garou ou d\'autres types de personnages et fais preuve de stratégie pour gagner !', 'https://i.ibb.co/YTnghgY/header.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1970, 0),
(1972, 'Forager', 'Le très populaire (et très loufoque) « idle game auquel on n\'a pas envie d\'arrêter de jouer ». Explorez, craftez, collectez et gérez vos ressources, trouvez des secrets et créez votre base à partir de rien ! Achetez des terres pour explorer et vous étendre !', 'https://i.postimg.cc/VNVvLGQq/Forager.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1971, 0),
(1973, 'Embr', 'Affrontez le feu pour le fun et l\'argent dans ce jeu multijoueur imprévisible et frénétique. Faites équipe avec vos amis, relevez les défis quotidiens et grimpez tout en haut de l\'échelle sociale des pompiers ! Il y a plus d\'une façon de devenir un héros !', 'https://i.postimg.cc/tCCK2XVg/embr.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1972, 0),
(1974, 'Premiere Pro 2024', 'Adobe Premiere Pro 2024 est une solution de montage vidéo de pointe pour professionnels, enrichie de nouvelles fonctionnalités intelligentes et d\'outils de productivité améliorés. Idéal pour les créateurs de contenu, les cinéastes et les professionnels du montage.', 'https://i.ibb.co/hWSsFDB/insider-tips-premiere-pro.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 1, 1973, 0),
(1975, 'Sniper Elite V2 remastered', 'À la fin de la Seconde Guerre mondiale, Berlin est en ruines. Une seule balle peut changer l’histoire… Le tireur d\'élite Karl Fairburne retourne au front dans la version remasterisée de ce jeu d\'infiltration primé, avec de nouvelles fonctions, des graphismes contemporains et du contenu exhaustif.', 'https://i.postimg.cc/MZr5JxFH/Sniper-Elite-V2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1974, 0),
(1976, 'Outlast 2', 'Vous êtes Blake Langermann, un caméraman travaillant avec sa femme, Lynn. Ensemble, vous vous êtes spécialisés dans le journalisme d\'enquête, et êtes prêts à tout risquer pour dévoiler les histoires que personne d\'autre n\'ose toucher.\r\n', 'https://i.ibb.co/svDWnzz/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1975, 0),
(1977, 'Fallout 76', 'Bethesda Game Studios vous présente Fallout 76. 25 ans se sont écoulés depuis le bombardement, lorsque vous et les autres résidents de l\'abri découvrez une Amérique post-nucléaire. Explorez des Terres désolées dans cet ajout multijoueur à Fallout.', 'https://i.postimg.cc/K8Kvp7g4/Fallout-76.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1976, 0),
(1978, 'Limbo', 'Incertain du sort de sa sœur, un garçon pénètre dans LIMBO', 'https://i.ibb.co/bH9JszZ/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 1, 1977, 0),
(1979, 'Fire Watch', 'Firewatch est un jeu plein de mystères pour un joueur à la première personne, qui se déroule dans le décor sauvage du Wyoming.\r\n', 'https://i.ibb.co/ZhXLbQj/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1978, 0),
(1980, 'Bomb Rush Cyberfunk', 'Affrontez des crews rivaux et combattez une police militarisée pour conquérir les cinq arrondissements de New Amsterdam. Devenez All City.', 'https://i.ibb.co/brZKdPg/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1979, 0),
(1981, 'Lethal League Blaze', 'Lethal League Blaze est un jeu de combat de projectiles déjanté et effréné, mêlant personnages uniques et sons époustouflants.\r\nVotre objectif : toucher votre ennemi avec une balle anti-gravité en utilisant frappes, amortis, parades, lancers et compétences spéciales.\r\nLes balles accélèrent à chaque coup et atteignent des vitesses vertigineuses.', 'https://i.ibb.co/0K65pjF/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1980, 0),
(1982, 'Sniper Elite 3', 'Dans Sniper Elite 3, le dernier chapitre de la franchise plusieurs fois récompensée, les joueurs se trouvent en plein conflit d’Afrique du Nord lors de la Deuxième Guerre mondiale, dans un environnement exotique mais difficile, affrontant un nouvel ennemi des plus redoutables.', 'https://i.postimg.cc/RVCCV8Xw/image-2024-05-19-184741835.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1981, 0),
(1983, 'Ghostwire: Tokyo', 'De redoutables forces surnaturelles invoquées par un dangereux maître de l\'occulte ont envahi Tokyo et causé en la disparition de sa population. Dans Ghostwire: Tokyo, scellez une alliance avec une puissante entité spectrale en quête de vengeance, et dévoilez ce qui se cache derrière cette disparition.', 'https://i.postimg.cc/9z5Z0qyS/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 1, 1982, 0),
(1984, 'Inside', 'Seul et pourchassé, un garçon se retrouve entraîné au cœur d\'un sombre projet.', 'https://i.ibb.co/tLbCdh2/header-1.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 2, 1983, 0),
(1985, 'Sea of Solitude', 'Quand les humains se sentent seuls, ils se transforment en monstres... Naviguez dans un monde magnifique et changeant entre lumière et obscurité et découvrez ce que signifie \"être humain\".', 'https://i.ibb.co/kVLQMbF/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1984, 0),
(1986, 'L.A. Noire. The Complete Edition', 'L.A. Noire est un thriller d\'une rare intensité. Cette édition intégrale de L.A. Noire inclut le jeu original complet et tous les contenus téléchargeables précédemment sortis.', 'https://i.ibb.co/ccVxCf4/header-1.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 1, 1985, 0),
(1987, 'Overcooked', 'Overcooked est un jeu de cuisine chaotique de coopération en local pour un à quatre joueurs. En travaillant en équipe, vos camarades cuisiniers et vous devez préparer, cuisiner et servir toute une variété de plats délicieux avant que le client affamé ne claque la porte.', 'https://i.postimg.cc/FRp4cw3X/Overcooked.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1986, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(1988, 'Resident Evil 2 Remake', 'Resident Evil 2, le chef-d\'œuvre qui a révolutionné le genre horreur et survie, est retour dans une version entièrement retravaillée pour une expérience inoubliable. Grâce au moteur RE de Capcom, Resident Evil 2 vous propose une nouvelle version du grand classique d\'horreur et de survie. Vous y découvrirez des graphismes aussi réalistes qu\'époustouflants, une bande-son à frémir d\'angoisse, un nouveau point de vue caméra à l\'épaule, des commandes modernisées et des modes de jeu du titre d\'origine.', 'https://i.postimg.cc/L8ZCDTFm/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 2, 1987, 0),
(1989, ' Resident evil 3 Remake', 'Jill Valentine fait partie des derniers témoins des atrocités commises par Umbrella à Raccoon City. Pour l\'empêcher de parler, Umbrella a fait appel à son arme secrète, Nemesis !', 'https://i.postimg.cc/26xSghvt/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 2, 1988, 0),
(1990, 'Call of Duty: Advanced Warfare', 'Call of Duty®: Advanced Warfare met en scène d\'impressionnants champs de bataille futuristes, où la technologie et les tactiques ont évolué, inaugurant une nouvelle ère pour la franchise.La puissance change tout', 'https://i.ibb.co/7CPVVfG/359171-call-of-duty-advanced-warfare-est-1200x0-1.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1989, 0),
(1991, 'Ghost of Tsushima Director\'s Cut ', 'À la fin du XIIIe siècle, l\'empire mongol a dévasté des nations entières lors de sa campagne pour la conquête de l\'Est. L\'île de Tsushima est le dernier rempart protégeant l\'archipel japonais d\'une invasion de l\'immense flotte mongole menée par Khotun Khan, un général aussi retors qu\'impitoyable.', 'https://i.ibb.co/c3rh7Yz/2215430-modified.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1990, 0),
(1992, 'Hydronner', 'Hydroneer est un jeu de minage et de construction de base dans un monde bac à sable. Creusez pour de l’or et d’autres ressources, tournez les en profits et améliorez vos opérations minières. Construisez une base, forgez des armes, allez pêcher et creuser toujours plus profond !', 'https://i.postimg.cc/Nj0BV8JX/hydroneer-landscape.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1991, 0),
(1993, 'Remnant: From the Ashes', 'Incarnant l\'un des derniers survivants, vous devrez lutter en solo ou en groupe avec jusqu\'à deux autres joueurs contre des hordes d\'ennemis redoutables et des boss épiques pour défendre vos positions, reconstruire et reprendre ce qui a été perdu.', 'https://i.postimg.cc/rp8ZFjCw/Remnant-From-the-Ashes.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1992, 0),
(1994, 'Biped', 'Biped est un jeu d\'action-aventure coopératif en 3D basé sur la physique. Il est fortement axé sur la collaboration momentanée entre deux joueurs.', 'https://i.postimg.cc/y6mHdQ0F/biped.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1993, 0),
(1995, 'The Walking Dead The Telltale', 'The Walking Dead: The Telltale Definitive Series regroupe les 4 saisons, 400 Days et The Walking Dead: Michonne, ce qui représente 50 heures de jeu réparties en 23 épisodes uniques.', 'https://i.postimg.cc/KjP4cVwq/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 1, 1994, 0),
(1996, 'Jurassic World Evolution 2', 'Jurassic World Evolution 2 est le successeur très attendu du jeu de gestion hautement acclamé Jurassic World Evolution, édité par Frontier en 2018. Toujours plus immersive et révolutionnaire, cette suite représente une nouvelle ère pour la franchise.', 'https://i.postimg.cc/Gt1JK1jj/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 1, 1995, 0),
(1997, 'SnowRunner', 'L\'expérience Off-Road nouvelle génération ! Partez à la conquête d\'environnements extrêmes simulés par un moteur physique ultra-réaliste, au volant de 40 monstres de puissance de marques iconiques.', 'https://cfinder.xyz/uploads/SnowRunner.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1996, 0),
(1998, 'Watch Dog 1', 'Dans notre monde hyper-connecté, la ville de Chicago est contrôlée par le système d\'exploitation le plus avancé du monde, le ctOS.', 'https://i.postimg.cc/SQ3LKmht/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1997, 0),
(1999, 'Valheim', 'Un jeu multijoueur brutal d\'exploration et de survie pour 1 à 10 joueurs, prenant place dans un purgatoire en génération procédurale inspiré par la culture viking. Combattez, bâtissez et accomplissez des exploits à la gloire d\'Odin!', 'https://cfinder.xyz/uploads/Valheim.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 1998, 0),
(2000, 'Hades II', 'Frayez-vous un chemin vers et au-delà des Enfers et affrontez le Titan du Temps dans ce deuxième volet ensorcelant du dungeon crawler de type rogue-like multiprimé.\r\n', 'https://i.postimg.cc/SQXjPFRH/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 1, 1999, 0),
(2001, 'Universe Sandbox', 'Create & destroy on an unimaginable scale with a realistic physics-based space simulator. Explore the beauty of our universe and the fragility of our planet. Use science to bend the laws of gravity, collide planets, boil away oceans, fire epic space lasers, and customize your universe. VR optional.\r\n', 'https://cdn.akamai.steamstatic.com/steam/apps/230290/header.jpg?t=1683136563', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 2000, 0),
(2002, 'Frostpunk', 'Frostpunk est le premier jeu de survie de société. À la tête de la dernière ville sur Terre, vous gérez ses citoyens et ses infrastructures. Que déciderez-vous pour que votre société survive ? Que ferez-vous lorsque vous serez poussé à bout ? Et surtout, qui allez-vous devenir ?\r\n', 'https://i.postimg.cc/nLgnL9bf/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 2001, 0),
(2003, 'Middle-earth: Shadow of War', 'Découvrez un monde ouvert épique animé par le système Nemesis récompensé. Forgez un nouvel Anneau de Pouvoir, prenez le contrôle des forteresses et dominez le Mordor avec votre armée orque personnelle dans La Terre du Milieu™ : L\'Ombre de la Guerre™.\r\n', 'https://i.postimg.cc/h45Z3P9T/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 2002, 0),
(2004, 'Motogp 23', 'Ouvrez les gaz, dépassez vos rivaux et terminez premier : ne rêvez plus d\'être le nouveau champion, devenez-le avec MotoGP™23, l\'opus le plus abouti de l\'histoire de la série !', 'https://i.postimg.cc/CKqhZy4Y/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', 1, 2003, 0),
(2005, 'Kill it with fire', 'Kill It With Fire est un jeu d\'action en vue subjective de chasse aux araignées et des dégâts collatéraux que cela implique.\r\n', 'https://i.postimg.cc/pXXfbk2R/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 2004, 0),
(2006, 'PixARK', 'Découvrez PixARK, un monde sauvage immense peuplé de dinosaures féroces, de créatures magiques, et source d\'aventure infinie!\r\n', 'https://i.postimg.cc/qvs8VF9b/Hearts-of-Iron-IV-3.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:56', '2025-09-09 15:30:13', NULL, 2005, 0),
(2007, 'Overcooked 2', 'Overcooked revient avec une toute nouvelle portion d\'action culinaire chaotique ! Retournez dans le royaume Oignon et réunissez votre équipe de chefs dans ce jeu de coopération locale ou en ligne jusqu\'à 4 joueurs. À vos tabliers... il est l\'heure de sauver le monde (encore une fois !)', 'https://i.postimg.cc/g2q457L2/Overcooked-2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2006, 0),
(2008, 'Sker Ritual', 'Sker Ritual est un jeu de survie en coop à la première personne et le successeur spirituel de Maid of Sker, jeu d\'horreur britannique à succès. Jouez seul ou jusqu\'à 4 joueurs pour survivre au massacre surnaturel des Silencieux.', 'https://i.postimg.cc/Kv7f74Js/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 2, 2007, 0),
(2009, 'Gas station simulator', 'Achetez une station-service abandonnée et redonnez-lui toute sa gloire. Rénovez, améliorez et développez les services offerts pour répondre aux demandes de vos clients.', 'https://i.postimg.cc/cJkXKjXx/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 1, 2008, 0),
(2010, 'Weed shop 3', 'CONSTRUISEZ VOTRE EMPIRE VIRTUEL DE LA WEED : Cultivez les variétés les plus populaires et croisez-en de nouvelles, roulez vos propres Blunts, vendez des Bongs, embauchez des cultivateurs, fabriquez des concentrés sans solvant, gérez des dealers rivaux, liez-vous d\'amitié avec des influenceurs, fumez des Dabs, chevauchez un dauphin, et bien plus encore ! BIENVENUE DANS WEED SHOP 3 !', 'https://i.postimg.cc/XNxQRRc2/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 1, 2009, 0),
(2011, 'In Silence', 'In Silence est un jeu d\'horreur multijoueur. Un joueur joue le rôle du monstre qui a des capacités auditives hypersensibles et presque complètement aveugle. Les autres joueurs (2-6) jouent en tant que survivants, essayant de s\'échapper ou de chasser le monstre.\r\n', 'https://i.postimg.cc/hPVDp0q1/Hearts-of-Iron-IV-2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2010, 0),
(2012, 'The walking dead destinies', 'Entamez votre voyage en incarnant Rick Grimes, parcourant seul les couloirs d\'un hôpital noyé au milieu des morts. Tissez des alliances et combattez ensemble les rôdeurs dans les endroits emblématiques de la franchise apocalyptique The Walking Dead, dont Atlanta, la ferme des Greene, la prison et Woodbury. Les choix que vous ferez aux moments cruciaux forgeront le destin de vos survivants issus de la série. Héros et monstres, morts et vivants… Il n\'appartient qu\'à vous de marcher dans les pas de la série d\'AMC The Walking Dead ou de suivre votre propre voie.', 'https://i.postimg.cc/BnNqfwyJ/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 1, 2011, 0),
(2013, 'Lego Batman', 'Les méchants de l\'asile d\'Arkham viennent de se faire la belle et seul le duo des super justiciers pourra sauver Gotham City. Les jeux LEGO et Batman s\'associent pour vous apporter une jouabilité originale dans LEGO Batman : le jeu vidéo.\r\n', 'https://i.postimg.cc/qRyS4NR2/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 1, 2012, 0),
(2014, 'ShieldWall', 'Shieldwall est un simulateur de bataille tactique amusant à la troisième personne, incorporant des éléments de stratégie, qui vous donne la sensation d\'être un chef de section sur le champ de bataille.\r\n', 'https://i.postimg.cc/DwHNtrgx/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 1, 2013, 0),
(2015, 'Jusant', 'Laissez-vous emporter par l\'ambiance méditative de Jusant, un jeu d\'escalade d\'action & puzzle. Défiez les hauteurs infinies d’une tour colossale et découvrez ses mystères aux côtés de votre compagnon constitué d\'eau.', 'https://i.postimg.cc/T3s8TMRq/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 1, 2014, 0),
(2016, 'Untitled goose game', 'ntitled Goose Game est un jeu d’infiltration de type « bac à sable » (action non linéaire) à l’humour burlesque, dans lequel vous êtes une oie en liberté dans un village qui ne se doute de rien. Parcourez le village, des jardins arrière des maisons aux boutiques de la rue principale en passant par le pré communal, en montant des canulars, en volant des chapeaux, en cacardant à tue-tête, bref en tapant sur les nerfs de tout le monde.', 'https://i.postimg.cc/5yK1hHjb/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2015, 0),
(2017, 'Just die already', 'Just Die Already est un jeu bac à sable sur un monde où les vieux sèment le chaos, créé par les concepteurs de Goat Simulator. Comment survivras-tu dans un monde qui ne souhaite que ta mort ?\r\n', 'https://i.postimg.cc/wBzKb5FD/Hearts-of-Iron-IV-1.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2016, 0),
(2018, 'Runbow', 'Le monde de Runbow change à chaque glissement d\'arrière-plan ; vous devrez donc rester vigilant(e) tandis que plateformes et obstacles disparaîtront -- si un élément n\'est pas visible, il n\'existe pas. L\'action rythmée, frénétique et incroyablement divertissante de Runbow peut accueillir jusqu\'à 9 joueurs, avec plein de modes et de contenu qui vous pousseront à revenir encore et encore :', 'https://i.postimg.cc/ZYjX1J8N/Hearts-of-Iron-IV.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2017, 0),
(2019, 'Planet of Lana', 'Une jeune fille et son ami partent pour une mission de sauvetage dans un monde coloré rempli de machines et de créatures inconnues. Planet of Lana est une aventure de réflexion à l’allure de film, encadrée par une saga épique de science-fiction qui s\'étend sur des siècles et des galaxies.\r\n\r\n', 'https://i.postimg.cc/G2D5cWHV/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2018, 0),
(2020, 'Smalland survive the wild', 'Avant l’arrivée des géants, nous menions une existence paisible sous le soleil et la lune. Des siècles se sont écoulés, mais ces histoires sur le monde à la surface ont été transmises de génération en génération. Aujourd’hui, les géants sont partis, et vous, l’avant-garde, devez retourner à la surface pour y mener une mission des plus urgente. Que le courage vous accompagne, et puissiez-vous ne pas fléchir... ', 'https://cfinder.xyz/uploads/Smallandsurvivethewild.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2019, 0),
(2021, 'Skullgirl 2nd encore', 'Une plongée dans l’univers de Skullgirls ! Avec 14 personnages animés à la main, un mode Histoire entièrement doublé, d’innombrables palettes ainsi qu’un netcode multijoueur sans pareil à base de GGPO.', 'https://i.postimg.cc/2jQBW0vD/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2020, 0),
(2022, 'A hat in time', 'A Hat in Time est un jeu de plateformes super-choupi où une petite fille doit tricoter ses propres chapeaux tous dotés de pouvoirs totalement déments ! Explore des mondes ouverts et retrouve les Fragments Temporels pour élargir ton horizon !', 'https://i.postimg.cc/L5dFD6Fy/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2021, 0),
(2023, 'Mafia III', 'Nous sommes en 1968 et les règles ont changé. Après plusieurs années au Vietnam, Lincoln Clay a compris une chose : la famille, ce n\'est pas ceux qui t\'ont vu naître. C\'est ceux pour qui t\'es prêt à mourir.\r\n', 'https://i.postimg.cc/G2gHmDY4/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 2, 2022, 0),
(2024, 'Mafia II', 'Vito Scaletta has started to make a name for himself on the streets of Empire Bay as someone who can be trusted to get a job done. Together with his buddy Joe, he is working to prove himself to the Mafia, quickly escalating up the family ladder with crimes of larger reward, status and consequence… the life as a wise guy isn’t quite as...\r\n', 'https://i.postimg.cc/sXYhfxmS/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 2, 2023, 0),
(2025, 'Mafia I', 'Nous sommes en 1930. Après un malencontreux accrochage avec la mafia, le chauffeur de taxi Tommy Angelo se retrouve contre son gré au beau milieu du monde du crime organisé. Au début, il apprécie peu de devoir s\'allier à la famille Salieri mais il se rend vite compte que le jeu en vaut la chandelle.\r\n', 'https://i.postimg.cc/50Lt5rFM/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2024, 0),
(2026, 'Armored Core VI: Fire of Rubicon', 'ARMORED CORE VI FIRES OF RUBICON propose une nouvelle expérience explosive pour la licence, en combinant la grande expertise de FromSoftware en matière de jeux de mechas et d\'action.', 'https://i.postimg.cc/NGDT2y8f/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2025, 0),
(2027, 'Black Ops 4 Ezz + Online', 'Black Ops est de retour avec des combats Multijoueur brutaux, fluides et ancrés au sol. Profitez du plus gros contenu Zombies jamais proposé dès la sortie avec trois aventures complètes venues d\'outre-tombe. Découvrez Blackout, un nouveau mode dans lequel l\'univers de Black Ops prend vie sous la forme d\'une bataille royale colossale et jouez sur la plus grande carte de toute l\'histoire de Call of Duty avec le système de combat, les personnages, les lieux et les armes propres à l\'histoire de Black Ops dans cette expérience de combat unique.\r\n', 'https://cfinder.xyz/uploads/BlackOps4ALLDLCs.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2026, 0),
(2028, 'Hearts of iron IV', 'La victoire est à votre portée! Votre capacité à diriger votre nation est votre arme suprême. Le jeu de stratégie Hearts of Iron IV vous permet de prendre les commandes de n\'importe quelle nation engagée dans la Seconde Guerre mondiale, le conflit le plus captivant de l\'histoire.\r\n', 'https://i.postimg.cc/B6NjjLtr/Hearts-of-Iron-IV.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 2, 2027, 0),
(2029, 'SuperHot', 'SUPERHOT est le premier FPS où le temps ne s\'écoule que lorsque vous bougez. Pas de santé qui se régénère. Pas de munitions à récupérer ici et là. Juste vous, face à des hordes d\'ennemis mieux armés que vous, à récupérer leurs armes pour les dézinguer, les découper et tenter de survivre au milieu d\'un torrent de balles en slow-motion.\r\n', 'https://i.postimg.cc/qBtD9hZD/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2028, 0),
(2030, 'Pumping Simulator', 'Simulateur de pompage En tant que membre actif d\'une station-service dans une grande ville du monde, vous pouvez jouer avec jusqu\'à 10 amis en mode coopératif multijoueur ou en mode solo pour vous aider à comprendre ce que les pompiers traversent, et peut-être vous rendra riche.\r\n', 'https://cfinder.xyz/uploads/PumpingSimulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2029, 0),
(2031, 'Yakuza like a dragon', 'Incarnez Ichiban Kasuga, jeune recrue des yakuzas, laissé pour mort par l\'homme en qui il avait le plus confiance. Armez-vous de votre batte légendaire et préparez-vous à éclater des têtes parmi les membres de la pègre au fil de combats RPG dynamiques, dans le Japon actuel.\r\n', 'https://i.postimg.cc/9MT0NKDb/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 1, 2030, 0),
(2032, 'It\'s only money', 'It\'s Only Money est un jeu de simulation à la 3ème personne en monde ouvert dans lequel vous incarnez un habitant d\'Undercity, quelqu\'un qui a été forcé de vivre dans les égouts et les métros par le méchant maire nouvellement élu.', 'https://i.ibb.co/vBP9Wk7/its-only-money.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2031, 0),
(2033, 'Human Fall Flat', 'Human Fall Flat est un jeu de plate-forme drôle et divertissant situé dans des paysages oniriques.\r\nChaque rêve offre un nouvel environnement à explorer : manoirs, châteaux, cités aztèques ou autres mondes nocturnes étranges, montagnes enneigées et sites industriels. Des chemins multiples et des puzzles très malins agrémentent l’exploration de chaque niveau, où l’ingénuité sera récompensée.', 'https://i.ibb.co/ynnMCyv/human-fall-flat.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2032, 0),
(2034, 'Manor Lords', 'Manor Lords est un jeu de stratégie médiéval où vous construisez des villes, menez des combats tactiques et réalisez des simulations économiques et sociales complexes. Gérez vos terres comme un seigneur : au fil des saisons et de la météo, les villes se développent et déclinent.\r\n', 'https://i.postimg.cc/zvc7qQX6/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', 2, 2033, 0),
(2035, 'SAND LAND', 'SAND LAND est un action RPG où vous incarnez Beelzebub, le prince de démons. Menez votre petite troupe de héros bigarrés et explorez le monde légendaire de SAND LAND, créé par Akira Toriyama.\r\n', 'https://i.postimg.cc/MH2Qg758/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2034, 0),
(2036, 'Infection Free Zone', 'Choisissez votre base d\'opérations, puis reconstruisez et adaptez les bâtiments autour de vous afin de créer une colonie autonome. Enfin, quand la nuit tombe… Défendez la zone contre les infectés ! Jouez dans N\'IMPORTE QUELLE VILLE AU MONDE grâce à des données géographiques', 'https://i.postimg.cc/XqX04cjy/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2035, 0),
(2037, 'Oh deer', 'Oh Deer est un jeu multijoueur de cache-cache où un joueur joue le rôle d\'un chasseur et jusqu\'à quatre autres jouent le rôle de cerfs.', 'https://i.postimg.cc/bNMSPK9C/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:57', '2025-09-09 15:30:13', NULL, 2036, 0),
(2038, 'Trek to Yomi', 'Le maître vient de mourir. Son élève, le jeune Hiroki a promis de protéger la ville et ses habitants contre toutes les menaces. Le cœur déchiré par le chagrin mais lié par sa promesse, le samouraï solitaire s\'exécute. Il va devoir voyager par-delà la vie et la mort pour aller au bout de lui-même et décider de la voie qu\'il souhaite emprunter.', 'https://i.postimg.cc/26FSBtvD/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2037, 0),
(2039, 'Anonymous Hacker Simulator', 'Immergez-vous dans un monde numérique captivant où chaque frappe de touche détient le pouvoir de dévoiler les secrets les plus profonds.\r\nCommencez votre voyage dans la sécurité de votre appartement caché, équipé d\'un arsenal de commandes simplifiées réalistes telles que Nmap, Harvester, Airocrack, Hping, Burp et bien d\'autres.', 'https://i.postimg.cc/6qsFwbSk/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2038, 0),
(2040, 'Bomber Crew', 'Formez et personnalisez votre propre équipage Bomber Crew. Les noms, compétences et histoires en génération procédurale assurent une expérience unique pour tous, mais soyez prudent, la mort est permanente.\r\n', 'https://i.postimg.cc/FR6KhvgT/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2039, 0),
(2041, 'Library Of Ruina', 'Devenez propriétaire de la Bibliothèque et recevez vos invités.\r\nVos bibliothécaires se battront pour la bibliothèque.\r\nLa bagarre entre les invités et les bibliothécaires éclate comme sur une scène.', 'https://i.postimg.cc/X7FZLZ4x/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2040, 0),
(2042, 'South Park: Snow Day', 'Rejoignez Cartman, Stan, Kyle et Kenny dans un glorieux univers en trois dimensions et célébrez le jour le plus magique de la vie d’un jeune enfant : un jour de neige ! Un immense blizzard a plongé la ville dans le chaos... et surtout, provoqué la fermeture de l’école !', 'https://i.postimg.cc/BbMJTxLb/Hearts-of-Iron-IV.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2041, 0),
(2043, 'Call of Duty: Infinite Warfare', 'Dans la Campagne, vous incarnez le capitaine Reyes, un pilote devenu commandant et chargé de mener les dernières forces de la coalition contre un ennemi impitoyable, au milieu d\'environnements spatiaux extrêmes et mortels.\r\nDans le mode Zombies, vous voyagez dans le temps pour affronter des morts-vivants dans un parc d\'attractions des années 80 jalonné de manèges, d\'une salle de jeux d\'arcade incroyable et de montagnes russes grandioses.', 'https://i.postimg.cc/4NJV16rq/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2042, 0),
(2044, 'DaVinci Resolve Studio', 'DaVinci Resolve est un logiciel de montage vidéo non linéaire, de mixage audio, de compositing et d\'étalonnage développé par la société Blackmagic Design', 'https://www.studiosport.fr/upload/image/davinci-resolve-studio---blackmagic--p-image-224995-grande.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2043, 0),
(2045, 'Judgment', 'Battez-vous pour la vérité et percez le mystère d\'un crime atroce qui agite les bas-fonds de Tokyo. Dans ce thriller juridique, la frontière entre justice et miséricorde est ténue.', 'https://i.postimg.cc/1XJmn2rk/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', 1, 2044, 0),
(2046, 'Ultimate Chicken Horse', 'Ultimate Chicken Horse est un jeu de plateformes festif qui vous permet de construire le niveau tout en jouant et en plaçant des pièges et autres dangers pour attraper vos amis tout en essayant de ne pas vous attraper vous-même.', 'https://i.ibb.co/CM7L8cz/ultimate-chicken-horse.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2045, 0),
(2047, 'Bot studio', 'Le moyen le plus facile de créer des bots Discord. Un éditeur de glisser-déposer le rend simple de créer le bot parfait pour vos serveurs, aucune programmation requise !', 'https://i.postimg.cc/qBKrntjm/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2046, 0),
(2048, 'Fallout 2', 'Fallout® 2 est la second volet du jeu récompensé par les critiques, qui a sorti le RPG des donjons pour le placer dans un rétro-futur dynamique et apocalyptique. Cela fait 80 longues années que vos ancêtres ont foulé le sol de ce désert', 'https://i.postimg.cc/D0zFTmds/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', 1, 2047, 0),
(2049, 'Blasphemous 2', 'Le Pénitent se réveille lorsque Blasphemous 2 le rejoint à nouveau dans une lutte sans fin contre le Miracle. Plongez dans un nouveau monde foisonnant de mystères et de secrets, et affrontez des ennemis farouchement déterminés à vous empêcher de mettre fin au cycle une bonne fois pour toutes.', 'https://i.postimg.cc/8zKc3QRj/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', 2, 2048, 0),
(2050, 'Plague Inc Evolved', 'Plague Inc: Evolved est un terrifiant mélange entre jeu de simulation réaliste et hautement stratégique. Votre agent pathogène vient d\'infecter le \"Patient Zero\" - vous devez désormais mettre un terme à l\'histoire de l\'humanité en développant une épidémie mortelle et globale, tout en vous adaptant contre', 'https://i.postimg.cc/Kz9fjdfg/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2049, 0),
(2051, 'Journey', 'Explorez l’ancien et mystérieux monde de Journey en volant par-dessus les ruines et en glissant sur les terres de sable pour découvrir ses secrets.', 'https://i.ibb.co/bjV0FkB/8-Bzw-Vl2lf7yree-T7f-K9c-SGcn.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2050, 0),
(2052, 'DAEMON X MACHINA', 'Pilotez votre mecha Arsenal entièrement personnalisable et unissez vos forces à celles de vos compagnons mercenaires pour défendre l\'humanité contre les robots géants et machines corrompues de ce jeu d\'action post-apocalyptique !', 'https://i.ibb.co/wM0Fcq5/capsule-616x353-15.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2051, 0),
(2053, 'Labyrinthine', 'Découvrez les sombres secrets d\'un labyrinthe envahi par la végétation avec des amis en ligne alors que vous essayez d\'échapper aux horreurs qui s\'y trouvent. Résolvez des énigmes, trouvez des objets et fuir les habitants assoiffés de sang du labyrinthe pour tenter d\'en sortir vivants...', 'https://cfinder.xyz/uploads/Labyrinthine.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2052, 0),
(2054, 'Blasphemous', 'Blasphemous est un jeu de plateforme-action punitif, avec des combats en hack’n slash impitoyables, au cœur du monde cauchemardesque de Cvstodia. Explorez, améliorez vos capacités et utilisez des exécutions barbares contre des hordes d\'ennemis pour réussir à échapper à la damnation éternelle.', 'https://i.postimg.cc/BZCCNxFz/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', 2, 2053, 0),
(2055, 'Tropico 6', 'El Presidente est de retour! Endossez une nouvelle fois le rôle de dictateur sans pitié ou d’homme d’État pacifique sur l’île de Tropico, et forgez la destinée de votre nation à travers 4 ères distinctes.', 'https://i.ibb.co/DzKsdWb/EGS-Tropico6-Limbic-Entertainment-S3-2560x1440-82bcd83b988a5c3230ff8f191113d9b2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2054, 0),
(2056, 'Process Lasso ', 'Bitsum Process Lasso Pro est un puissant utilitaire Windows qui fournit une optimisation et une automatisation du processeur en temps réel. Il vous donne un contrôle précis sur la façon dont vos processeurs sont alloués aux processus en cours d’exécution, ce qui vous permet d’améliorer les performances, la réactivité et la stabilité du système.', 'https://i.postimg.cc/QdrzBP4w/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2055, 0),
(2057, 'Risk of rain 2', 'Échappez à une planète étrangère chaotique en affrontant des hordes de monstres déchaînés, en solo ou entre amis. Combinez le butin de façon surprenante et maîtrisez chacun des personnages jusqu\'à devenir vous-même le chaos que vous craigniez tant lors de votre premier écrasement.', 'https://cfinder.xyz/uploads/Riskofrain2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2056, 0),
(2058, 'Metro Exodus', 'Échappez-vous des ruines du métro de Moscou et embarquez pour une aventure à travers le territoire russe dans un univers post-apocalyptique. Explorez des niveaux non linéaires, tentez de survivre dans un monde ouvert immersif.', 'https://i.postimg.cc/yYYv7MVj/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', 1, 2057, 0),
(2059, 'Gym simulator 24', 'Construisez Votre Empire de Fitness !Embarquez dans un voyage pour créer votre havre de fitness de rêve dans Gym Simulator 24.', 'https://i.postimg.cc/vmBk1R8G/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2058, 0),
(2060, 'Keep talking and nobody explodes', 'Vous vous retrouvez seul et piégé dans une salle avec une bombe qui ne vous attend pas. Vos amis ont le manuel qui permettent de la désamorcer, mais ils ne peuvent pas voir la bombe : vous allez devoir parler - et rapidement ! Ce jeu de coopération local requiert deux joueurs ou plus.', 'https://i.postimg.cc/yNhX0KBw/hero.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2059, 0),
(2061, 'Medieval Dynasty', 'Trouvez un terrain où vous pourriez construire votre maison. Vous commencez en tant que simple agriculteur ou chasseur, mais après avoir acquis plus d’expérience, appris et perfectionné vos compétences, vous pouvez devenir le chef d’une ville prospère. Concevez, construisez et améliorez votre maison - d’une simple cabane à une vaste ferme. Convainquez les gens de rejoindre votre village. Trouvez votre véritable amour et créez une famille, en assurant la continuité de votre dynastie.', 'https://cfinder.xyz/uploads/MedievalDynasty.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:58', '2025-09-09 15:30:13', NULL, 2060, 0),
(2062, 'Pummel party', 'Pummel Party est un jeu de type party game pour 4 à 8 joueurs en multijoueur en ligne et local. Roue tes amis ou les IA de coups à l\'aide d\'une série d\'objets absurdes dans le mode plateau et participe à la destruction d\'amitiés dans une collection unique de mini-jeux.\r\n', 'https://i.ibb.co/JHY1YVQ/capsule-616x353-16.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2061, 0),
(2063, 'Dune: Spice Wars', 'À la tête de votre faction, battez-vous pour établir votre suprématie sur l\'impitoyable planète désertique d\'Arrakis, le seul endroit où l\'on trouve la ressource la plus précieuse de l\'univers : l\'épice. Cette substance prolonge la vie, décuple les capacités mentales et rend le voyage interstellaire possible, des vertus miraculeuses qui attirent la convoitise des forces les plus influentes de l\'Empire...', 'https://i.postimg.cc/FKSfR3jZ/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2062, 0),
(2064, 'Teenage Mutant Ninja Turtles: Shredder\'s Revenge', 'Avec Bebop et Rocksteady qui prennent d’assaut Channel 6 et s’emparent de super-dispositifs ultra-complexes pour aider Krang et Shredder à exécuter leur plan machiavélique, Teenage Mutant Ninja Turtles: Shredder’s Revenge précipite nos tortues préférées dans des combats farouches au beau milieu des lieux intemporels les plus célèbres de TMNT.', 'https://i.ibb.co/BVnbLsb/826f5ddb992697b2fa73c452ebfa661781bad6a37e6447848ace31ae58502d1f.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2063, 0),
(2065, 'Lightyear Frontier', 'Construisez votre propre ferme interstellaire dans cette aventure agricole paisible en monde ouvert !\r\nÀ la tête de votre exoferme durable, cultivez des plantes extraterrestres, personnalisez votre mécha et familiarisez-vous avec un monde encore inexploré et rempli de mystères avec jusqu\'à trois de vos amis !', 'https://i.ibb.co/8snPKys/lightyear-frontier.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2064, 0),
(2066, 'Wo Long : Fallen Dynasty', 'An 184 après Jésus-Christ, Chine, fin de la dynastie Han. Le pays est submergé par le chaos et la destruction. La dynastie impériale, autrefois si prospère, est sur le point de s\'effondrer.', 'https://i.ibb.co/t493St1/wo-long.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2065, 0),
(2067, 'Green Hell', 'Green Hell est une lutte accablante pour votre survie au cœur de la forêt amazonienne. Tandis que le poids de la solitude fera plier son corps comme son esprit, le joueur devra s\'accrocher à la vie dans un périple qui le mettra à rude épreuve. Combien de temps survivrez-vous aux dangers de l\'inconnu ?\r\n', 'https://i.postimg.cc/LX9rzbR6/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2066, 0),
(2068, 'Besiege', 'Besiege est un jeu de simulation physique dans lequel vous construisez des machines pour attaquer des villages, des armées et des châteaux. Lancez-vous dans la campagne ou affrontez vos amis en multijoueur !\r\n', 'https://i.postimg.cc/g0LBWbD7/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2067, 0),
(2069, 'Black Ops III', 'Call of Duty : Black Ops III est un jeu de tir à la première personne de 2015 développé par Treyarch et publié par Activision. Il s’agit de la douzième entrée de la série Call of Duty et de la suite du jeu vidéo Call of Duty : Black Ops II de 2012.', 'https://i.ibb.co/SRwT0Xy/header-4.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2068, 0),
(2070, 'Tunic', 'Explorez une terre remplie de légendes perdues, d’anciens pouvoirs et de monstres féroces dans TUNIC, un jeu d’action isométrique sur un petit renard dans une grande aventure. Échoué dans une terre en ruine et armé de votre seule curiosité, vous affronterez des bêtes colossales, collecterez des objets étranges et puissants et percerez des secrets perdus depuis longtemps.', 'https://i.postimg.cc/8CR8tbQx/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2069, 0),
(2071, 'We happy few', 'We Happy Few » conte l\'histoire d\'un groupe intrépide de personnages modérément terrifiants qui tentent d\'échapper à une vie entière de joyeux déni dans la ville de Wellington Wells. Dans une Angleterre alternative des années 60 où le conformisme règne vous devrez vous battre ou vous fondre parmi d\'autres habitants ravagés par la drogue, qui généralement se montrent bien peu aimables envers ceux qui ne se plient pas à leurs étranges règles.', 'https://i.postimg.cc/gkrN4ncq/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', NULL, 2070, 0),
(2072, 'Adobe Photoshop 2024', 'Adobe Photoshop est un puissant logiciel de retouche photo qui vous permet de créer, retoucher et remixer vos photos.', 'https://www.adobe.com/content/dam/cc/us/en/products/photoshop/photoshop-1200x630.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', 2, 2071, 0),
(2073, 'Beyond: Two Souls', 'Jodie n\'est pas une jeune femme comme les autres, elle est liée à une mystérieuse et puissante entité depuis sa naissance.\r\nCe sont vos actions qui détermineront le destin de Jodie, qui devra faire face à des défis extraordinaires, des situations périlleuses et des pertes déchirantes au cours de cette quête pour découvrir la vérité sur son identité.', 'https://i.postimg.cc/dVX6gnfW/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', 2, 2072, 0),
(2074, 'FINAL FANTASY VII REMAKE INTERGRADE', 'Vivez l\'histoire passionnante de Cloud Strife à Midgar dans cette renaissance de l\'emblématique FINAL FANTASY VII à travers des graphismes de pointe, des combats épiques mêlant action et commandes classiques, et un épisode bonus consacré à Yuffie Kisaragi.\r\n', 'https://i.postimg.cc/9f2GTSwq/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', 1, 2073, 0),
(2075, 'ABLETON LIVE', 'Ableton Live vous permet de créer, produire et jouer de la musique facilement au sein d\'une interface intuitive. Live synchronise tout et fonctionne en temps réel pour que vous puissiez jouer et modifier vos idées musicales sans interrompre votre flux créatif.', 'https://i.postimg.cc/7YJbL6RB/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', 2, 2074, 0),
(2076, 'Mad Games Tycoon 2', 'Nous sommes en 1976, et quelques révolutionnaires se lancent dans l\'industrie du divertissement. Vous aussi, prenez le risque et fondez votre propre société de jeux dans un petit bureau peu impressionnant.', 'https://cdn.akamai.steamstatic.com/steam/apps/1342330/header.jpg?t=1712736190', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:29:59', '2025-09-09 15:30:13', 1, 2075, 0),
(2077, 'FINAL FANTASY XV WINDOWS EDITION', 'Vivez l’aventure en qualité ultime. Grâce à sa pléthore de contenus bonus et sa compatibilité avec les options graphiques en ultra haute résolution et HDR 10, vous pourrez explorer le superbe monde de FINAL FANTASY XV comme jamais auparavant.', 'https://cdn.akamai.steamstatic.com/steam/apps/637650/header.jpg?t=1592962568', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2076, 0),
(2078, 'The planet crafter', 'Survie en monde ouvert dans l\'espace, en solo ou avec 10 amis ! Survivez sur une planète hostile et transformez son écosystème pour y rendre possible la vie humaine. Récoltez des ressources et construisez votre base afin de développer l\'oxygène, la chaleur et la pression de cette nouvelle biosphère.\r\n', 'https://cfinder.xyz/uploads/Theplanetcrafter.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2077, 0),
(2079, 'The Exit 8', 'Vous êtes pris au piège dans un passage souterrain sans fin. Observez attentivement votre environnement pour atteindre la \"sortie 8\".\r\n', 'https://i.postimg.cc/sXrGfnsx/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2078, 0),
(2080, 'Martha is Dead', 'Martha Is Dead est un thriller sombre et psychologique à la première personne qui se déroule en 1944, et qui brouille les frontières entre la réalité, la superstition et la tragédie de la guerre.\r\n', 'https://i.postimg.cc/xdh77gwm/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', 1, 2079, 0),
(2081, 'Victoria 3', 'Paradox Development Studio vous invite à bâtir votre société idéale dans un 19e siècle tumultueux porteur de transformations. Trouvez un équilibre entre les intérêts divergents de votre société et gagnez votre place au soleil dans Victoria 3, l\'un des jeux les plus attendus de l\'histoire de Paradox.\r\n', 'https://i.postimg.cc/x8T5THKP/Design-sans-titre.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2080, 0),
(2082, 'Left 4 Dead 2', 'Situé dans un univers post-apocalyptique peuplé de zombies, Left 4 Dead 2 est la suite très attendue du meilleur jeu de coop de 2008. Ce jeu de tir d\'action et de coop à la première personne entraîne votre équipe dans les cimetières et marécages, de Savannah à La Nouvelle-Orléans en 5 campagnes.\r\n', 'https://cdn.akamai.steamstatic.com/steam/apps/550/header.jpg?t=1675801903', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2081, 0),
(2083, 'Rayman Legends', 'Rayman, le héros du jeu de plates-formes le plus acclamé et récompensé en 2011, revient sur PC dans Rayman Legends.Michel Ancel, célèbre créateur de Rayman®, Beyond Good et Evil® et des Lapins Crétins™ apporte encore une fois toute sa créativité au service d’une nouvelle aventure haute en couleur pour son personnage de Rayman.\r\n', 'https://cdn.akamai.steamstatic.com/steam/apps/242550/header.jpg?t=1680012063', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', 1, 2082, 0),
(2084, 'Gears 5', 'Héritier de l\'une des plus grandes sagas du jeu vidéo, Gears revient plus fort que jamais. Alors qu\'une guerre totale est sur le point d\'éclater, Kait Diaz se détache du groupe pour découvrir son lien avec l\'ennemi et comprendre le vrai danger qui plane sur Sera : elle-même.\r\n', 'https://cdn.akamai.steamstatic.com/steam/apps/1097840/header.jpg?t=1684425784', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2083, 0),
(2085, 'Pico park', 'PICO PARK est un jeu d\'action et de réflexion coopératif, en ligne ou en local, pour 2 à 8 joueurs.\r\n', 'https://i.ibb.co/5YrvJJ3/capsule-616x353-14.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2084, 0),
(2086, 'Thief simulator 2', 'La porte de votre carrière de voleur vous attend ! Il vous suffit de forcer la serrure à l\'aide d\'un pied de biche et de franchir le seuil. Apprenez des techniques, collectez des outils et devenez un maître du métier de voleur !\r\n', 'https://i.postimg.cc/cL9Nfz2X/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', 1, 2085, 0),
(2087, 'Hot lava', 'Le sol est en lave ! Courez, sautez, escaladez et surfez dans les lieux de votre enfance innondés de magma. Explorez les seul ou rejoignez des amis. Mais quoi qu\'il arrive, ne touchez jamais le sol !', 'https://i.ibb.co/R033rkV/capsule-616x353-13.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2086, 0),
(2088, 'We Were Here Expeditions: The FriendShip', 'Avec un ami, mettez votre amitié à l\'épreuve en ligne en résolvant ensemble les énigmes d\'un parc d\'attractions abandonné. Coopérez et surmontez les défis stimulants de cette expérience We Were Here indépendante.', 'https://i.ibb.co/Zfp3t8k/we-were-here-expeditions.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2087, 0),
(2089, 'Tekken 8 Ultimate Edition', 'Tenez-vous prêt pour le nouveau chapitre de la légendaire franchise de jeu de combat, TEKKEN 8.\r\n', 'https://i.postimg.cc/X7tqmHx4/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', 2, 2088, 0),
(2090, 'Balatro', 'Un jeu de poker roguelike. Balatro est un jeu de deckbuilding prenant où vous jouez des combinaisons de poker illégales, découvrez des jokers révolutionnaires et déclenchez des combos aussi palpitants que dévastateurs.\r\n', 'https://i.postimg.cc/Z51CYH0B/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2089, 0),
(2091, 'Content Warning', 'Filmez vos amis en train de faire des choses effrayantes pour devenir célèbre sur SpöökTube ! (fortement déconseillé d\'y aller seul)', 'https://i.ibb.co/bPWYFzX/capsule-616x353-12.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2090, 0),
(2092, 'Internet cafe simulator 1', 'Internet Cafe Simulator est un jeu de simulation d\'entreprise de cybercafé. Construisez le meilleur café Internet du monde!', 'https://i.postimg.cc/GhhNC7zm/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', 1, 2091, 0),
(2093, 'Halo The Master Chief Collection', 'Le parcours emblématique du Major comprend six jeux, conçus pour PC et regroupés au sein d\'une seule et même interface globale. Que vous soyez fan de la première heure ou que vous découvriez le Spartan 117 pour la première fois, La collection le Major constitue l\'expérience Halo ultime.', 'https://i.postimg.cc/HLXqvJsG/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2092, 0),
(2094, 'Bloons TD 6', 'Jeu de tower defense au succès foudroyant', 'https://cfinder.xyz/uploads/BloonsTD6.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2093, 0),
(2095, 'Ultimate Chicken Horse', 'Ultimate Chicken Horse est un jeu de plateformes festif permettant à vos amis et à vous-même de construire le niveau tout en jouant, et de placer des pièges mortels avant de tenter d\'atteindre la fin du niveau. Si vous y parvenez alors que vos amis n\'y parviennent pas, vous remportez un point !', 'https://i.postimg.cc/cLsNMByn/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2094, 0),
(2096, 'Pacific Drive', 'Pacific Drive est un jeu de survie et de conduite en vue subjective avec votre voiture pour seul compagnon. Parcourez une réinvention surréaliste du Nord-Ouest Pacifique et affrontez des dangers surnaturels en vous aventurant dans la Zone d\'Exclusion Olympique. Derrière sa structure de « road-like », chacune de vos excursions en pleine nature vous confrontera à des défis aussi uniques qu\'étranges, avec un objectif en tête : réparer et améliorer votre voiture dans le garage à l\'abandon qui vous sert de base. Récoltez de précieuses ressources et enquêtez sur ce qui reste de la Zone, résolvez un mystère oublié de longue date tout en découvrant si vous êtes de taille pour survivre à cet environnement imprévisible et hostile.', 'https://i.postimg.cc/Cx2G0JNy/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:00', '2025-09-09 15:30:13', NULL, 2095, 0),
(2097, 'WWE 2k24', 'WrestleMania est le plus grand événement sportif, et les Superstars y deviennent des Légendes WWE. Redécouvrez les plus grands moments de WrestleMania dans 2K Show des Immortels, et revivez certains matchs les plus marquants de votre carrière.', 'https://i.postimg.cc/NfR2WprP/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2096, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(2098, 'Sleeping Dogs', 'La métropole exotique et haute en couleur de Hong Kong, avec ses marchés fourmillants de monde et ses rues animées, abrite en son sein l’une des organisations criminelles les plus dangereuses au monde : les Triades. Vous incarnez Wei Shen un flic infiltré talentueux, chargé de démanteler les Triades de l’intérieur. Prouvez votre valeur tandis que vous évoluez à la force des poings dans la hiérarchie de la fameuse organisation criminelle sans exposer votre véritable identité.', 'https://i.postimg.cc/7PTBdrP1/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2097, 0),
(2099, 'The Front', 'The Front est un jeu de tir de survie et d\'artisanat en monde ouvert. Vous incarnez un résistant renvoyé dans le temps pour arrêter la montée d\'un empire tyrannique. Collectez des ressources, fabriquez de la technologie, construisez un abri et combattez des monstres pour mener à bien votre mission.', 'https://i.ibb.co/84WshkJ/the-front-1cfw8.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2098, 0),
(2100, 'Donut County', 'Donut County est un jeu de réflexion narratif, dans lequel vous manipulez un trou qui ne cesse de grandir dans le sol. Rencontrez des personnages adorables, volez leurs détritus et lancez-les dans le trou.', 'https://fs-prod-cdn.nintendo-europe.com/media/images/10_share_images/games_15/nintendo_switch_download_software_1/H2x1_NSwitchDS_DonutCounty_image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2099, 0),
(2101, 'Rayman Origins', 'Incarnez Rayman à travers un merveilleux périple solo, et proposez à 1, 2 ou 3 de vos amis de vous rejoindre à tout moment durant la partie pour jouer Globox ou l\'un des deux Ptizêtres. Ils pourront ensuite quitter dès qu’ils le souhaitent sans aucune conséquence sur la progression des autres.', 'https://cdn2.unrealengine.com/rayl-store-landscape-2560x1440-2560x1440-b43008c9c55b.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', 1, 2100, 0),
(2102, 'Mount & Blade II: Bannerlord', 'Un RPG d\'action et de stratégie. Créez un personnage, usez de diplomatie, commercez, créez et conquérez dans un large bac à sable médiéval. Levez des armées et combattez à leurs côtés dans de vastes batailles en temps réel utilisant un système de combat complet et intuitif basé sur les compétences.\r\n', 'https://i.ibb.co/YZHTrz9/header-3.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2101, 0),
(2103, 'Age of Empires', 'Pour célébrer son premier anniversaire, la franchise de jeu de stratégie à succès acclamée par la critique surprend ses millions de joueurs dans le monde avec Age of Empires IV : Édition Anniversaire, qui vous place VOUS au cœur d\'encore plus de batailles épiques qui ont façonnées l\'Histoire.\r\n', 'https://i.ibb.co/TBmLStM/capsule-616x353-11.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2102, 0),
(2104, 'Sunkenland', 'Préparez-vous pour un jeu de survie sur le thème de Waterworld avec construction modulaire de bases, fouille de cités submergées, artisanat, défense de base et invasions de clans de PNJ pour les ressources et le territoire. Prêt pour l\'apocalypse aquatique ?\r\n', 'https://i.postimg.cc/JhJzLfsp/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2103, 0),
(2105, 'Icarus', 'ICARUS est un jeu de survie PvE avec un mode en coopération jusqu\'à 8 joueurs et un mode solo. Explorez une nature sauvage en proie à la terraformation qui a mal tourné. Survivez et collectez des matières exotiques, puis retournez en orbite pour développer des technologies plus avancées.\r\n', 'https://i.postimg.cc/Kv9QyVLS/header.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2104, 0),
(2106, 'Ultimate Epic Battle Simulator', 'Voici un bac à sable pas comme les autres. Créez des batailles massives sans aucune limite. Vous voulez voir 10 000 poulets combattre une armée de Romains ? Bien sûr, pourquoi pas. Vous voulez voir une compagnie de soldats américains de la Seconde Guerre mondiale combattre 11 000 soldats médiévaux ? Il n’y a tout simplement aucune limite au carnage que vous pouvez réaliser dans l’UEBS.', 'https://cdn.akamai.steamstatic.com/steam/apps/616560/capsule_616x353.jpg?t=1612040435', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', 2, 2105, 0),
(2107, 'Horizon Forbidden West', 'Explorez des terres lointaines, affrontez des machines toujours plus imposantes et dévastatrices, et rencontrez de nouvelles tribus fascinantes lors de votre retour dans le monde d\'Horizon dépeignant un futur lointain post-apocalyptique.', 'https://i.postimg.cc/fT06Sb3d/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2106, 0),
(2108, 'Sword Art Online Fatal Bullet', 'Sword Art Online : Fatal Bullet est un jeu d\'action qui prend place dans le monde de Gun Gale Online, un jeu vidéo issu de l\'univers de Sword Art Online. Accompagné par une intelligence artificielle, vous devrez combattre les différents ennemis du jeu avec tout un arsenal d\'arme, allant du simple pistolet à des épées.', 'https://i.ibb.co/ZVyrCH5/capsule-616x353-7.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2107, 0),
(2109, 'SWORD ART ONLINE Last Recollection', 'Sword Art Online : Last Recollection se déroule dans l\'univers de l\'anime Sword Art Online. Le titre adapte les événements de l\'arc War of the Underworld dans lequel Kirito doit relever des défis redoutables avec ses nouveaux amis. Comme les précédents jeux issus de la franchise, le titre prend la forme d\'un jeu de rôle-action.', 'https://i.ibb.co/ZJX2SxL/t620x300-e5727e97a8075f62728265f19e53584f.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2108, 0),
(2110, 'Hand simulator', 'Hand Simulator est un jeu dans lequel vous contrôlez vos propres mains (vous n\'avez pas besoin d\'un casque VR, vous avez juste besoin d\'un clavier et d\'une souris). Il existe de nombreux niveaux différents où vous pourrez jouer avec des fileuses, vous plonger dans les subtilités du maniement des armes, traire une vache, participer à un duel mexicain avec vos amis, passer un bon moment à pêcher, jouer aux échecs ou simplement discuter dans un club anonyme. Hand Simulator est un jeu où chacun trouve du divertissement à son goût.', 'https://i.ibb.co/sPK6wzf/header-2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2109, 0),
(2111, 'Nioh 2', 'Nioh 2 est un action RPG développé par Team Ninja. L\'aventure prend place durant la période Sengoku au Japon. Qu\'ils soient des démons ou des humains, les obstacles se dressent au cours de l\'aventure et il faudra user divers armes pour s\'en défaire.', 'https://i.ibb.co/3SB6XFv/EGS-Nioh2-The-Complete-Edition-KOEITECMOGAMESCOLTD-S1-2560x1440-75a01e633df3a100d3981b1beedeaf6a.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2110, 0),
(2112, 'Tomb Raider I-III Remastered ', 'Partez à la découverte des aventures originales de Lara Croft, remastérisé avec fidélité.\r\nJouez aux trois aventures inédites de Tomb Raider : Explorez pour la toute première fois l’expérience intégrale, comprenant toutes les expansions et les niveaux secrets disponibles sur des plateformes modernes dans cette collection unique.\r\nDécelez les trésors de l’ancien monde en résolvant des puzzles et en décodant des mystères tombés dans l’oubli avec les dégâts causés par le temps.', 'https://i.postimg.cc/d3R5JBfH/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2111, 0),
(2113, 'Nioh', 'Nioh est un action RPG développé par Koei Tecmo. L\'aventure prend place durant la période Sengoku au Japon, époque ravagée par des guerres. Dans la peau du samouraï William, vous devrez combattre des adversaires tels que des démons ou des humains tout en utilisant divers armes comme des épées, des haches ou même des lances.', 'https://i.ibb.co/x7t4Z7z/4-Ia-Gvym-T2f3p-KPKUJ8d1d-Zp-T.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2112, 0),
(2114, 'Fallout 4', 'Fallout 4 est un RPG à la première personne se déroulant dans un univers post-apocalyptique. Dans un monde dévasté par les bombes, vous incarnez un personnage solitaire sortant d\'un abri anti-atomique qui doit se faire sa place dans la ville de Boston et de ses environs.', 'https://www.desktopbackground.org/download/1920x1080/2015/11/13/1041678_fallout-4-desktop-backgrounds-i-made-for-fans-like-myself-imgur_1920x1080_h.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', 2, 2113, 0),
(2115, 'Zombie army 4: Dead war', 'Les hordes d\'Hitler sont de retour dans ce jeu de tir à glacer le sang par les créateurs de Sniper Elite 4 ! Affrontez des ennemis occultes abominables et maniez des armes épiques dans une nouvelle campagne angoissante pour 1-4 joueurs dans l’Europe des années 1940, en luttant pour sauver l\'humanité d\'une apocalypse de morts-vivants !', 'https://i.ibb.co/6bVhPkw/hero.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2114, 0),
(2116, 'trader life simulator', 'Construisez votre propre supermarché en passant d\'un magasin vide à la plus grande entreprise de la ville ! personnalisez votre magasin, achetez de nouveaux véhicules et équipements, survivez, gérez l\'économie, achetez et vendez plus de 100 produits différents, agrandissez et personnalisez votre magasin avec différents équipements, meubles et murs, vous devez maintenir votre entreprise en activité et votre supermarché approvisionné, tout en gérant d\'autres aspects de la vie. sois prudent! La faillite pourrait être une option.', 'https://i.postimg.cc/nVY0mZYj/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2115, 0),
(2117, 'Nickelodeon All-Star Brawl 2', 'Mesurez-vous à tous les meilleurs combattants dans Nickelodeon All-Star Brawl 2, dont Bob l\'éponge, les Tortues Ninja, Carlo Tentacule, Jimmy Neutron et bien plus encore !\r\n\r\nChoisissez vos combattants préférés, maîtrisez leurs techniques personnelles et utilisez les nouvelles attaques ultimes pour achever les personnages de vos amis ou les adversaires rencontrés dans une campagne solo aux allures de roguelike !', 'https://i.ibb.co/nkbhpFB/5cb2937c61778f875da8f80adaebf3b856a2dd8d876d616eeaa9e79e4856ecd1.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2116, 0),
(2118, 'Melatonin', 'Au travers des niveaux uniques de ce jeu de rythme, Melatonin explore le lien entre les rêves de notre sommeil et les expériences de l\'éveil. Peu à peu, au fil des graphismes colorés, détaillés et dessinés à la main, en compagnie de la musique composée pour accompagner le gameplay et les images, vous dévoilerez des éléments du personnage principal en vous enfonçant de plus en plus profondément dans ses rêves nocturnes.', 'https://i.postimg.cc/C5yCyn4L/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2117, 0),
(2119, 'Devil may cry 5', 'e chasseur de démons ultime fait son grand retour dans le jeu que les fans d\'action attendent avec impatience ! Inclut désormais le contenu téléchargeable Personnage jouable : Vergil (également disponible séparément)\r\nNouveau titre de la légendaire série de jeux d\'action et d\'aventure, Devil May Cry 5 associe un rythme effréné et de fantastiques personnages originaux aux prouesses technologiques de Capcom, pour vous offrir un chef-d\'œuvre aux graphismes époustouflants.', 'https://i.postimg.cc/V6gndZqp/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:01', '2025-09-09 15:30:13', NULL, 2118, 0),
(2120, 'That\'s not my neighbor', 'Le Département de Détection Doppelganger (D.D.D.) a besoin de vous !\r\nIl y a un poste de portier vacant dans votre immeuble et comme vous avez besoin d\'argent et que vous ne trouvez pas d\'emploi, vous n\'avez pas le choix.\r\nNous sommes en 1955 et pour des raisons inconnues, les sosies sont plus courants que la normale, donc le D.D.D. a pris des mesures à ce sujet.\r\nVotre travail sera d\'autoriser ou de refuser l\'entrée des sujets qui demandent l\'entrée dans le bâtiment, cela semble facile, mais attention, vous ne pouvez négliger aucun détail car vous pourriez être de la nourriture pour des sosies.', 'https://i.postimg.cc/s2gX6HPV/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', 1, 2119, 0),
(2121, 'Scarlet Nexus', 'Scarlet Nexus est un RPG dans lequel vous jouez Yuito Sumeragi, un nouveau membre de l\'OSF. Le jeune homme veut utiliser ses dons de psycho-kinésie afin de devenir un psionique d\'élite, comme celui qui l\'avait sauvé par le passé.', 'https://i.postimg.cc/kgTk7TSY/scarlet-nexus-uhdpaper-com-hd-8-218.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', 1, 2120, 0),
(2122, 'Sniper Elite 4', 'Découvrez une liberté de tir inégalée dans un shooter extensif et sophistiqué sur fond de Seconde Guerre mondiale. Plongez-vous dans des combats tactiques à la troisième personne, faites vos propres choix et tentez des tirs à distance formidables tout en libérant l\'Italie du joug du fascisme en temps de guerre.\r\nReprenant là où son illustre prédécesseur nous avait laissés, Sniper Elite 4 plonge les joueurs au cœur de la superbe péninsule italienne, des villes côtières ensoleillées de la Méditerranée aux forêts anciennes, en passant par des vallées montagneuses et de colossales mégastructures nazies.\r\nL’agent d\'infiltration et tireur d’élite Karl Fairburne doit se battre aux côtés des hommes et des femmes courageux de la résistance italienne pour éliminer une nouvelle menace terrifiante risquant de mettre un terme à la contre-attaque alliée en Europe avant même qu’elle n’ait commencé.', 'https://i.ibb.co/D7S1GJ7/H2x1-NSwitch-Sniper-Elite4-image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', NULL, 2121, 0),
(2123, 'KinitoPET', 'Voudriez-vous un ami? Oui? Eh bien, j\'ai quelque chose de spécial pour toi.\r\nKinitoPET vous invite dans son monde merveilleux de plaisir et d\'excitation !\r\nOù il sera votre propre ami virtuel et assistant personnel !', 'https://i.postimg.cc/59LCFGnG/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', NULL, 2122, 0),
(2124, 'Taxi Life A City Driving Simulator', 'Prenez les commandes de votre voiture et de votre entreprise, transportez des passagers à travers Barcelone et faites prospérer votre affaire ! Parviendrez-vous à relever les défis d’une ville qui ne dort jamais ?', 'https://cdn.akamai.steamstatic.com/steam/apps/1351240/capsule_616x353.jpg?t=1710499739', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', 1, 2123, 0),
(2125, 'The Evil Within 2', 'L\'inspecteur Sebastian Castellanos a tout perdu, y compris sa fille Lily. Pour la sauver, il doit replonger dans le monde cauchemardesque du STEM. Des menaces terrifiantes l\'attendent à chaque recoin, et il devra réfléchir pour survivre. Pour se racheter, il n\'a pas d\'autre choix que de s\'échapper.', 'https://gaming-cdn.com/images/products/2133/orig/the-evil-within-2-pc-spel-steam-cover.jpg?v=1650450943', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', 2, 2124, 0),
(2126, 'The Evil Within', 'Développé par Shinji Mikami, créateur de la série phare des Resident Evil, et la talentueuse équipe de Tango Gameworks, The Evil Within incarne la quintessence du Survival Horror. ', 'https://cdn.akamai.steamstatic.com/steam/apps/268050/capsule_616x353.jpg?t=1704291837', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', NULL, 2125, 0),
(2127, 'Super Mario Odyssey', 'Le futur marié, qui ne manque pas de piquant, s\'est lancé dans un voyage autour du globe pour préparer les festivités. Mario doit le rattraper pour empêcher ce mariage à tout prix, mais les terribles Broodals ont bien l\'intention de lui compliquer la tâche !', 'https://assets.nintendo.com/image/upload/c_fill,w_1200/q_auto:best/f_auto/dpr_2.0/ncom/software/switch/70010000001130/c42553b4fd0312c31e70ec7468c6c9bccd739f340152925b9600631f2d29f8b5', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', 1, 2126, 0),
(2128, 'Internet Cafe Simulator 2', 'Internet Cafe Simulator 2 est un jeu de simulation d\'entreprise de cybercafé extrêmement complet et détaillé.', 'https://cdn.akamai.steamstatic.com/steam/apps/1563180/capsule_616x353.jpg?t=1688201539', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', 1, 2127, 0),
(2129, 'A Difficult Game About Climbing', 'Utilisez uniquement votre souris (ou votre manette de jeu) pour contrôler les mains de votre grimpeur et gravir une énorme montagne dangereuse, pleine de défis et de surprises. Faites attention aux surfaces glissantes lorsque vous vous dirigez vers le sommet. Une gloire éternelle et un merveilleux cadeau attendent tous les grimpeurs qui parviennent à atteindre le sommet !', 'https://i.postimg.cc/5tJ7K87R/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', NULL, 2128, 0),
(2130, 'Kebab Chefs! Restaurant Simulator', 'Kebab Chefs! est un jeu coopératif de cuisine et de gestion de restaurant pouvant accueillir jusqu\'à 4 joueurs. Préparez des plats délicieux, remplissez votre menu avec différentes recettes, nourrissez les clients et devenez le plus grand restaurant de kebab de la ville !', 'https://i.ibb.co/djYGwPb/capsule-616x353-10.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', NULL, 2129, 0),
(2131, 'Aragami', 'Vous êtes Aragami, un esprit vengeur possédant le pouvoir de contrôler les ombres. Vous avez été invoqué par Yamiko, une jeune femme prisonnière de la forteresse de Kyuryu. Lancez-vous dans une quête sanglante et pleine de secrets à la recherche de la vérité. Infiltrez la ville Kyuryu avec vos pouvoir surnaturels et combattez la Lumière avec les Ombres. Découvrez l\'histoire de deux âmes liées par un destin dépassant le temps et de la mémoire.', 'https://i.ibb.co/4MpPZ8D/t620x300-34d1bb519bc18d43f04c2007fcb63d21.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', NULL, 2130, 0),
(2132, 'Aragami 2', 'Vous êtes l’un des derniers guerriers d’élite de la sorte, l’Aragami. Victimes d’un mal surnaturel qui ronge le corps et dévore l’âme, les Aragami contrôlent l’essence de l’ombre, un pouvoir mystique qui leur donne la faculté de contrôler les ombres. Fort de ce pouvoir, l’Aragami s’engage dans sa quête d’assurer la survie de son village et de libérer les Aragami tenus en esclavage par les armées de l’envahisseur.', 'https://i.ibb.co/GHMGLBF/EGS-Aragami2-Lince-Works-S1-2560x1440-b9326f08e4151ab3e53e059872981ebf.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', NULL, 2131, 0),
(2133, 'Dealer simulator', 'Dealer Simulator offre une expérience réaliste de gestion d’entrepôt. Créez votre propre entreprise d\'entrepôt, transportez des marchandises intelligemment et plongez dans les subtilités de la gestion d\'entrepôt dans le monde des affaires. Commencez à développer votre entreprise et devenez un expert dans le monde de l\'entreposage avec Dealer Simulator !', 'https://i.postimg.cc/L60N5HQS/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', 1, 2132, 0),
(2134, 'Bendy and the ink machine revival', 'Bendy and the Dark Revival® est un jeu d\'horreur de survie à la première personne et la suite très attendue de Bendy and the Ink Machine®. Incarnez Audrey alors qu\'elle explore les profondeurs d\'un studio d\'animation curieusement effrayant qui est devenu complètement fou. Combattez des ennemis souillés d\'encre, résolvez des énigmes et échappez au démon de l\'encre toujours caché tout en cherchant votre chemin vers le monde réel. On ne sait jamais qui ou quoi se trouvera au prochain virage dans ce royaume délabré d’ombres et d’encre.', 'https://i.postimg.cc/HWSqyjyf/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', 1, 2133, 0),
(2135, 'Banishers: Ghosts of New Eden', 'New Eden, 1695. Les communautés de colons sont accablées par une terrible malédiction. En tant que bannisseurs, vous recevez pour mission d’enquêter sur la source du mal. Plongez dans le quotidien des habitants des lieux, révélez des mystères enfouis, explorez de multiples régions, et échangez avec des personnages inoubliables dont le destin est entre vos mains.', 'https://shared.fastly.steamstatic.com/store_item_assets/steam/apps/1493640/capsule_616x353.jpg?t=1754921815', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', NULL, 2134, 0),
(2136, 'Generation Zero', 'Generation Zero situe le joueur dans un monde ouvert, celui d’Östertörn en Suède. L’environnement connu n’en reste pas moins hostile. Votre foyer, autrefois paisible, a été envahi par de mystérieuses machines mortelles. Choisissez vos batailles avec sagesse en vous engageant dans une guérilla exaltante contre les forces mécaniques.', 'https://i.ibb.co/8P4MwJ9/capsule-616x353-6.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:02', '2025-09-09 15:30:13', NULL, 2135, 0),
(2137, 'Door kickers 2', 'Door Kickers 2 est un jeu de stratégie et de tactique descendant qui consiste à utiliser des ressources de renseignement et à contrôler des unités d\'opérations spéciales lors de raids audacieux pour neutraliser et capturer des terroristes dans le pays fictif de Nopheraki, au Moyen-Orient.', 'https://i.postimg.cc/fydh7MZX/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', NULL, 2136, 0),
(2138, 'Adobe After Effects 2025', 'Adobe After Effects ou After Effects est un logiciel, à l\'origine, de montage vidéo qui est devenu par la suite un outil de composition et d\'effets visuels, pionnier de l\'animation graphique sur ordinateur personnel, édité par la société Adobe Systems', 'https://i.postimg.cc/8PkYcww3/adobe-after2025.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 2, 2137, 0),
(2139, 'METAL GEAR RISING REVENGEANCE', 'Développé par Kojima Productions et PlatinumGames, METAL GEAR RISING: REVENGEANCE emmène la célèbre franchise METAL GEAR dans un nouveau territoire passionnant avec une toute nouvelle expérience d\'action.', 'https://cdn.cloudflare.steamstatic.com/steam/apps/235460/capsule_616x353.jpg?t=1690416005', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 1, 2138, 0),
(2140, 'Supermarket Simulator', 'Gérez votre propre supermarché. Approvisionnez les rayons, fixez les prix comme vous le souhaitez, encaissez les paiements, embauchez du personnel, agrandissez et aménagez votre magasin. Commandes et livraisons en ligne, voleurs à l\'étalage, sécurité, marché local sont à venir.', 'https://i.postimg.cc/J0BB4kfr/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', NULL, 2139, 0),
(2141, 'Prince of Persia: The Lost Crown', 'L\'action de Prince of Persia: The Lost Crown prend place dans un monde fictif inspiré de la mythologie perse. Le jeu met en scène Sargon, un guerrier membre des Immortels, une troupe de soldats d\'élite au service de la reine de Perse, qui est doué d\'une grande agilité et de capacités surhumaines.', 'https://i.postimg.cc/63Mtv1R6/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', NULL, 2140, 0),
(2142, 'Kingdoms Reborn', 'Kingdoms Reborn est un city-builder dans un monde ouvert jouable en multijoueur. Guidez vos citoyens. Passez d\'un petit village à une ville prospère. Améliorez vos maisons et vos technologies.', 'https://i.ibb.co/89BKs1r/capsule-616x353-9.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', NULL, 2141, 0),
(2143, 'The Invincible', 'Vous vous appelez Yasna et vous êtes une astro-biologiste hautement qualifiée, à l\'esprit vif. Entraînés dans une course à l\'espace, votre équipage et vous, vous retrouvez sur la planète inexplorée Regis III. Le voyage scientifique se transforme rapidement en une mission de recherche des membres d\'équipage perdus. Suivez sa trace, mais soyez pleinement conscient que chaque décision que vous prenez peut vous rapprocher du danger.', 'https://i.postimg.cc/CMRnccVH/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 2, 2142, 0),
(2144, 'Granblue Fantasy Relink', 'Une grande aventure céleste vous attend ! Formez un groupe de quatre navigateurs et frayez-vous un chemin à coups d\'épées, de balles ou de sorts dans cet action RPG. Participez à des quêtes en solo ou en coopération avec jusqu\'à trois autres joueurs !', 'https://cfinder.xyz/uploads/GranblueFantasyRelink.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', NULL, 2143, 0),
(2145, 'Dont scream', 'Si vous criez, vous recommencez. NE CRIEZ PAS est un petit jeu d\'horreur créé avec Unreal Engine 5 et inspiré des images filmées au caméscope dans les années 90. Créé par deux développeurs indés. Le défi est simple : explorez la mystérieuse forêt Pineview pendant 18 minutes sans crier.', 'https://i.postimg.cc/HkRkc2FB/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 2, 2144, 0),
(2146, 'Ori and the will of the wips', 'Le petit esprit Ori est habitué aux situations périlleuses. Mais lorsqu\'un coup du sort met la jeune chouette Kun en danger, il faudra faire preuve d\'une bravoure exceptionnelle pour rassembler une famille, soigner une terre tourmentée et découvrir la vraie destinée d\'Ori. Les créateurs d\'Ori and the Blind Forest, jeu d\'action et de plateforme plébiscité par la critique, reviennent avec la suite tant attendue de leur œuvre. Lancez-vous dans une toute nouvelle aventure, au cœur d\'un vaste monde regorgeant d\'amis et d\'ennemis dessinés à la main et plus vivants que jamais. Rythmé par une bande originale orchestrale, Ori and the Will of the Wisps perpétue le savoir-faire de Moon Studios en matière de plateforme haletante soutenue par une narration poignante.', 'https://i.postimg.cc/wMcwJ11B/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 2, 2145, 0),
(2147, 'Ori and the blind forest : Definitive Edition', 'La forêt de Nibel se meurt. À la suite d\'une terrible tempête ayant déclenché une série d\'événements tragiques, un petit héros des plus improbables doit se lancer dans un éprouvant périple. Armé de tout son courage, il devra affronter un sinistre adversaire et sauver sa terre natale. \"Ori and the Blind Forest\" relate l\'histoire d\'une jeune créature orpheline à la destinée héroïque, au travers d\'un jeu de plateforme et d\'action aux graphismes époustouflants, développé pour PC par Moon Studios. Découvrez un univers entièrement dessiné à la main dans lequel évoluent des personnages aux animations extrêmement soignées, sur une bande originale entièrement interprétée par un orchestre. \"Ori and the Blind Forest\" est une ode à l\'amour, au sacrifice et à l\'espoir qui brûle telle une flamme en chacun de nous.', 'https://i.postimg.cc/dQ5z1XKc/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 2, 2146, 0),
(2148, 'Half-life 2', 'Vous incarnez une nouvelle fois Gordon Freeman, un scientifique vivant sur une Terre infestée d\'extraterrestres et vidée de ses ressources et de sa population. Freeman se retrouve dans l\'obligation peu enviable de sauver le monde en réparant le mal qu\'il a fait à Black Mesa. Et un grand nombre de personnes qui lui sont chères comptent sur lui.', 'https://i.postimg.cc/DZj7dwR7/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', NULL, 2147, 0),
(2149, 'Battlefield 1', 'Rejoignez la communauté de Battlefield et découvrez la guerre totale à travers d\'intenses combats multijoueur et les Récits de guerre passionnants de la campagne.', 'https://i.postimg.cc/tCC5fmK7/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', NULL, 2148, 0),
(2150, 'Forza Motorsport', 'Écrase la concurrence dans une toute nouvelle carrière. Fais la course avec tes amis en multijoueur. Pilote plus de 500 voitures sur de célèbres circuits grâce à une IA de pointe et à une physique avancée.', 'https://cfinder.xyz/uploads/ForzaMotorsport.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 2, 2149, 0),
(2151, 'Europa Universalis IV', 'Quatre siècles d\'histoire prennent vie dans cet incontournable jeu de stratégie de Paradox. Menez une nation de la Renaissance à la Révolution dans cette simulation du monde à l\'aube de l\'ère moderne. Maîtrisez l\'art de la guerre, la diplomatie et le commerce et façonnez l\'histoire de votre nation!', 'https://cdn1.epicgames.com/salesEvent/salesEvent/EGS_EuropaUniversalisIV_ParadoxDevelopmentStudioParadoxTinto_S3_2560x1440-aa3002ec221d43dcd7e49f5458e74766', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 1, 2150, 0),
(2152, 'Road 96', 'Trace ta route en stop dans ce Road Trip procédural délirant créé par le studio indé français DigixArt. Personne ne prendra la même route !', 'https://fs-prod-cdn.nintendo-europe.com/media/images/10_share_images/games_15/nintendo_switch_download_software_1/H2x1_NSwitchDS_Road96.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 2, 2151, 0),
(2153, 'Life is Strange True Colors', 'Alex Chen est douée d\'un pouvoir d\'empathie qui lui permet d\'absorber et de manipuler les émotions des autres. Lorsque son frère meurt lors d\'un accident, Alex doit l\'utiliser pour découvrir la vérité, et révéler des secrets enfouis depuis longtemps.', 'https://image.api.playstation.com/vulcan/ap/rnd/202103/1012/cOcMiD7yXyYZo533GdPjpDF6.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 1, 2152, 0),
(2154, 'Half-life', 'Nommé « Jeu de l\'année » par plus de 50 magazines, ce titre de Valve mêle action et aventure grâce à une technologie primée et crée un monde au réalisme effrayant, où la survie des joueurs dépend de leur faculté de réflexion.', 'https://cdn.akamai.steamstatic.com/steam/apps/70/capsule_616x353.jpg?t=1700269108', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', 1, 2153, 0),
(2155, 'Titanfall 2', 'Inclut le contenu de l\'édition Deluxe Digitale, les améliorations et articles déverrouillés du Pack de démarrage, et la peinture de guerre Souterrain pour carabine R-201.', 'https://cdn.akamai.steamstatic.com/steam/apps/1237970/capsule_616x353.jpg?t=1668565264', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:03', '2025-09-09 15:30:13', NULL, 2154, 0),
(2156, 'Bayonetta', 'Le chef-d\'œuvre d\'action mondialement célèbre de PlatinumGames débarque enfin sur PC. Plongez dans une action délirante en 60 FPS dans des résolutions HD débloquées. La technique de jeu ultime : être méchant n\'a jamais fait autant de bien.', 'https://fs-prod-cdn.nintendo-europe.com/media/images/10_share_images/games_15/nintendo_switch_4/H2x1_NSwitch_Bayonetta1_image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 1, 2155, 0),
(2157, 'Futuremark 3DMark Professional', '3DMark est destiné aux gamers, aux adeptes de l’overclock et aux configurateurs de systèmes qui souhaitent tirer le meilleur parti de leur matériel. Avec sa large gamme de tests de référence, 3DMark a tout ce dont vous avez besoin pour tester les performances de votre PC.', 'https://cdn.akamai.steamstatic.com/steam/apps/223850/header.jpg?t=1702375525', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 2, 2156, 0),
(2158, 'Mortal Kombat Komplete Edition', 'Mortal Kombat est un jeu de combat gore issus de la fameuse série du même nom. Jouable à deux en coopération, cet épisode permet de faire des enchaînements magnifiques et des Fatalités ultra gores. Il est également possible de relever des centaines de défis ou de faire un mode Histoire réalisé comme un film interactif.', 'https://i.ibb.co/RpWvkzD/s-l1600.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2157, 0),
(2159, 'Adobe animate', 'Créez des animations interactives pour les jeux, les émissions télévisées et le web. Animez des dessins et des bannières publicitaires. Créez des gribouillages et des avatars animés. Dynamisez le contenu e-learning et les infographies. Avec Animate, publiez rapidement vos créations sur plusieurs plateformes dans le format de votre choix, et ciblez les spectateurs sur n\'importe quel écran.', 'https://d3f1iyfxxz8i1e.cloudfront.net/courses/course_image/bfe31a3f1c90.jpeg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2158, 0),
(2160, 'Lies of P: Overture', 'Lies of P est un jeu soulslike trépidant qui part de l\'histoire de Pinocchio et la détourne totalement en la déroulant dans le décor sombre et élégant de la Belle Époque.', 'https://shared.akamai.steamstatic.com/store_item_assets/steam/apps/2848330/header.jpg?t=1749246886', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2159, 0),
(2161, 'The LEGO NINJAGO Movie Video Game', 'Révèlez le ninja qui est en vous grâce au tout nouveau jeu LEGO NINJAGO, Le Film : Le Jeu Vidéo ! Incarnez vos ninjas préférés pour défendre Ninjago du maléfique Lord Garmadon.', 'https://fs-prod-cdn.nintendo-europe.com/media/images/10_share_images/games_15/nintendo_switch_4/H2x1_NSwitch_LegoNinjagoMovieVideoGame.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 2, 2160, 0),
(2162, 'Heretic\'s Fork', 'Cher candidat, nous avons le plaisir d\'accepter votre candidature au poste de responsable des Enfers, où vous châtierez les pécheurs à l\'aide de notre système informatique de construction de deck afin d\'édifier des tours infernales et de contenir les hordes impies. Bonne chance !', 'https://cdn.cloudflare.steamstatic.com/steam/apps/2181610/capsule_616x353.jpg?t=1703759706', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 2, 2161, 0),
(2163, 'Enshrouded', 'Vous êtes le Flameborn, dernier espoir d\'une race mourante. Survivez aux ravages d\'une brume corruptrice, et reconquérez votre royaume perdu. Jetez-vous dans un vaste monde, affrontez des boss redoutables, bâtissez votre fief et forgez votre destin dans ce jeu d’action-survival coopératif pour 1-16.', 'https://i.ibb.co/QHhX9Ws/enshrouded-pc-game-steam-cover.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2162, 0),
(2164, 'Jujutsu Kaisen Cursed Clash', 'Incarnez vos exorcistes et fléaux préférés ! Invitez un ami et plongez dans le monde de Jujutsu Kaisen dans ce jeu de combat 2 contre 2 exaltant !\r\nConstituez votre équipe et atteignez des sommets en tirant parti des caractéristiques de chacune de vos techniques ; déclenchez des attaques combinées et travaillez en harmonie pour dominer le combat !\r\n', 'https://i.ibb.co/CwwKBVV/jjk-cursed-clash.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2163, 0),
(2165, 'Tiny Tina\'s Wonderlands', 'Lancez-vous dans une aventure épique riche en émerveillement, fantaisie et armes surpuissantes ! Créez votre propre héros multiclasse, puis tirez, pillez, tranchez et lancez des sorts dans votre quête pour arrêter le Seigneur Dragon.', 'https://cfinder.xyz/uploads/TinyTinasWonderlands.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 2, 2164, 0),
(2166, 'Saints Row 2', 'Saints Row 2 vous apporte une liberté de jeu réelle. Les joueurs peuvent incarner qui ils veulent, jouer comment ils le veulent et avec qui ils veulent dans cette fameuse suite de Saints Row. Plusieurs années après le jeu initial, votre défi est de faire revenir les Saints sur le devant de la scène de Stilwater.', 'https://gaming-cdn.com/images/products/822/orig/saints-row-2-second-edition-pc-jeu-steam-cover.jpg?v=1664446746', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 2, 2165, 0),
(2167, 'Mario Kart 8 Deluxe', 'Que vous fassiez la course en famille, sur grand écran, dans votre salon, au parc ou en visite chez un ami, la Nintendo Switch vous permet de jouer à Mario Kart comme bon vous semble !', 'https://cfinder.xyz/uploads/MarioKart8Deluxe.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 2, 2166, 0),
(2168, 'GTFO', 'GTFO est un jeu de tir coopératif qui vous plongera dans une atmosphère d\'horreur, mêlant suspense haletant et action explosive à un rythme effréné. Discrétion, stratégie et collaboration vous seront essentielles pour survivre dans cette prison. Ensemble, vous combattrez… ou mourrez.', 'https://i.ibb.co/FVTmTYX/capsule-616x353-4.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2167, 0),
(2169, 'Six Days in Fallujah', 'Six Days in Fallujah est un jeu de tir tactique à la première personne basé sur les histoires vécues par les marines, soldats et citoyens irakiens pendant la bataille urbaine la plus ardue depuis 1968.', 'https://i.ibb.co/wcdMZMz/six-days-in-fallujah-pc-game-steam-cover.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2168, 0),
(2170, 'First Class Trouble', 'First Class Trouble est un jeu de fête où les joueurs doivent travailler ensemble et les uns contre les autres pour survivre à un désastre. Le but est d\'arrêter un A.I.', 'https://i.ibb.co/yP4tMcn/a2b33b90-ce49-40d7-9c28-cff27b990863.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2169, 0),
(2171, 'Paint the Town Red', 'Paint the Town Red est un jeu de combat au corps à corps chaotique à la première personne se déroulant dans différents lieux et périodes. Les ennemis basés sur le voxel peuvent être frappés, frappés, frappés, poignardés et tranchés de manière complètement dynamique en utilisant presque tout ce qui n\'est pas cloué.', 'https://i.ibb.co/WG61NmZ/H2x1-NSwitch-DS-Paint-The-Town-Red-image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2170, 0),
(2172, 'My Summer Car', 'My Summer Car est le simulateur ultime de possession, de construction, de réparation, de réglage, d\'entretien et de survie de la vie permanente. Vous commencez le jeu avec des centaines de pièces détachées et assemblez la voiture et le moteur.', 'https://cfinder.xyz/uploads/MySummerCar.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2171, 0),
(2173, 'Portal 2', 'L\'« initiative de tests perpétuels » a été étendue pour vous permettre de concevoir des casse-têtes coopératifs pour vous et vos contacts !', 'https://i.ibb.co/XJWmjpv/Portal-2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2172, 0),
(2174, 'Farming Simulator 22', 'Créez votre exploitation, et que la récolte soit bonne ! Cultivez vos plantes, occupez-vous des animaux, gérez vos productions et relevez les défis des saisons.', 'https://i.ibb.co/gZWV5w0/farming-simulator-22.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2173, 0),
(2175, 'State of Decay 2', 'Les morts se sont relevés et la civilisation s’est effondrée. Votre petit groupe de survivants doit récolter des ressources dans un monde ouvert et construire une base qui puisse résister à des hordes de zombies dans ce jeu hybride d’action/statégie/simulation.', 'https://cfinder.xyz/uploads/StateofDecay2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 2, 2174, 0),
(2176, 'Battle Field 5', 'Il s\'agit de l\'expérience Battlefield™ V ultime. Découvrez le plus grand conflit de l\'Histoire avec l\'arsenal complet, c\'est-à-dire l\'ensemble des armes, des véhicules et des gadgets, ainsi que les meilleurs éléments de personnalisation des années 1 et 2.', 'https://i.ibb.co/LZHHxSZ/Battlefield-5.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 1, 2175, 0),
(2177, 'Your Only Move is HUSTLE', 'À la fois expérience PVP au tour par tour en ligne profonde et enrichissante et bac à sable créatif pour créer des scènes de combat intenses et partageables, Your Only Move Is HUSTLE reprend la formule de combat classique et la renverse. Prenez le contrôle d\'un combattant surpuissant et utilisez le pouvoir de la précognition pour planifier chacun de vos mouvements, à chaque instant. Accessible de par sa conception, l’époque où il fallait mémoriser des combos compliqués en mode entraînement est révolue ; maintenant vous pouvez tous les exécuter du premier coup.', 'https://i.ibb.co/f2vv4bC/your-only-move-is-hustle.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2176, 0),
(2178, 'Hades', 'Hades est un rogue-like en mode dungeon crawler qui associe le meilleur des titres de Supergiant salués par la critique. Il combine l\'action effrénée de Bastion, la profondeur et l\'atmosphère très riche de Transistor, ainsi que la narration centrée sur les personnages qui caractérise Pyre.', 'https://i.postimg.cc/PfcbxySm/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2177, 0),
(2179, 'Who\'s Your Daddy', 'Who\'s Your Daddy est un jeu multijoueur décontracté mettant en scène un père sans indice tentant d\'empêcher son jeune fils de mourir. Jouez avec jusqu\'à 7 de vos amis (en ligne et en local) et testez vos compétences parentales dans une configuration compétitive avec une physique loufoque et plus de 69 objets ménagers potentiellement menaçants.', 'https://i.ibb.co/yWJJ3zQ/whos-your-daddy.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2178, 0),
(2180, 'Opération Tango', 'Opération : Tango est une aventure coopérative d\'espionnage qui vous met au défi, vous et un(e) ami(e), d\'accomplir de dangereuses missions autour du monde dans un futur proche de haute technologie. Formant une équipe de deux, vous deviendrez AGENT et HACKER et travaillerez ensemble pour infiltrer, enquêter et éradiquer les forces qui menacent le monde libre. Dans ce jeu, seule votre voix vous lie, rendant le travail d\'équipe et la communication essentiels !', 'https://i.postimg.cc/fR2kjFpT/Hearts-of-Iron-IV-1.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2179, 0),
(2181, 'Metal Gear Solid V: The phantom pain', 'Konami Digital Entertainment poursuit l\'expérience METAL GEAR SOLID V avec le dernier chapitre en date, METAL GEAR SOLID V: The Phantom Pain. Ouvrant une nouvelle ère pour la franchise avec la technologie de pointe du moteur Fox, MGSV: The Phantom Pain, offre aux joueurs une expérience de premier plan en leur donnant la liberté tactique de mener à bien leurs missions dans un monde ouvert.\r\n\r\nSe déroulant neuf ans après les événements de MGSV: Ground Zeroes et la destruction de Mother Base, Snake, Aussi appelé Big Boss, sort d\'un coma de près de dix ans. Nous sommes en 1984, à une époque où la guerre froide continue d\'alimenter les crises mondiales. Motivé par la vengeance, Snake établit une nouvelle armée privée et reprend les armes pour traquer un groupe secret, XOF.', 'https://i.postimg.cc/3x54vc5H/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', 2, 2180, 0),
(2182, 'GUILTY GEAR STRIVE', '« GUILTY GEAR -STRIVE- » est le tout nouvel opus de Guilty Gear, la série de jeux de combat acclamée par la critique. Créé par Daisuke Ishiwatari et développé par Arc System Works, « GUILTY GEAR -STRIVE- » est fidèle aux graphismes hybrides 2D/3D en cel-shading ainsi qu\'au gameplay intense et satisfaisant qui ont forgé la réputation de la série.\r\n\r\nDécouvrez un mode histoire intégralement doublé qui explore l\'univers de Guilty Gear en profondeur, des personnages nouveaux aux côtés d\'autres bien connus, ainsi qu\'un netcode rollback à toute épreuve.', 'https://cfinder.xyz/uploads/GUILTYGEARSTRIVE.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2181, 0),
(2183, 'Moving Out 1', 'Moving Out est un simulateur de déménagement loufoque et basé sur la physique qui donne un nouveau sens à la coop en local !\r\n\r\nUne carrière palpitante dans le mobilier, ça vous tente ? En tant que Professionnel d\'Emménagement Tout-terrain fraîchement diplômé, vous effectuerez des déménagements dans la ville très animée de Packmore. Smooth Moves n\'est pas une grande entreprise de déménagement, mais aucune tâche n\'est trop dangereuse ou trop étrange pour cette équipe de fonceurs. Développez votre entreprise, recrutez des personnages hauts en couleur et sauvez votre ville du péril mobilier !', 'https://i.ibb.co/bgTyY10/EGS-Moving-Out-SMGStudio-Devm-Games-S1-2560x1440-86272cbdeb4cc4b39f0760ab720ac585.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:04', '2025-09-09 15:30:13', NULL, 2182, 0),
(2184, 'Batman Arkham Origins', 'Batman: Arkham Origins est le nouvel opus de la franchise de jeux vidéo à succès Batman: Arkham.Développé par WB Games Montréal, le jeu nous plonge dans une Gotham City encore plus vaste et une histoire inédite se déroulant plusieurs années avant les événements de Batman: Arkham Asylum et de Batman: Arkham City', 'https://i.ibb.co/cvhmTLH/Batman-Arkham-Origin.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2183, 0),
(2185, 'Moving Out 2', 'Moving Out 2 est la suite déjantée du célèbre simulateur de déménagement tout en physique. Que vous exerciez votre activité de P.R.O.U.T. en indépendant ou avec vos amis déménageurs, il est temps d\'enfiler votre uniforme Smooth Moves et d\'aider les habitants de Packmore à faire leurs cartons (et à les bouger) !\r\n\r\n', 'https://i.ibb.co/qy7yfKz/2x1-NSwitch-Moving-Out2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2184, 0),
(2186, 'Bendy and the Ink Machine', '\"Bendy and the Ink Machine®\" est le jeu d\'horreur et d\'action à la première personne qui ruinera à jamais votre amour d\'enfance pour les dessins animés.', 'https://i.ibb.co/dtfMHn6/capsule-616x353-3.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', 1, 2185, 0),
(2187, 'Roboquest', 'Roboquest est un action-FPS Roguelite jouable en solo ou en coopération à deux joueurs. Foncez et combattez des hordes d\'ennemis dans des environnements générés aléatoirement, améliorez votre Gardien au fur et à mesure que vous progressez et détruisez les puissants boss qui se dressent sur votre route. Améliorez votre campement pour débloquer de nouvelles options de spécialisation pour votre Gardien et tenter d\'aller de plus en plus loin à chaque partie.', 'https://i.ibb.co/Gx3CYW4/roboquest.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2186, 0),
(2188, 'Ranch Simulator', 'Jadis, c\'était la plus grande fierté de votre grand-père. Depuis, votre ranch familial a connu des temps difficiles et c\'est à vous de changer la donne. Située dans une vallée forestière loin de toute civilisation, la propriété vétuste mettra toutes vos compétences à l\'épreuve tandis que vous tentez d\'en faire le ranch le plus prospère de la région. Vous pouvez vous lancer seul ou jusqu\'à 4 joueurs en coopération.', 'https://i.ibb.co/NNMv47f/ranch-simulator.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2187, 0),
(2189, 'House Flipper 2', 'Ressortez votre marteau ! La nouvelle version de House Flipper est là ! Achetez des maisons délabrées et rénovez-les ! Ou construisez-en de nouvelles si vous préférez ! Tout est possible !', 'https://cfinder.xyz/uploads/HouseFlipper2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', 2, 2188, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(2190, 'Outer wilds', 'Nommé Game of the Year 2019 par Giant Bomb, Polygon, Eurogamer et The Guardian, acclamé par la critique et récompensé par de nombreux prix, Outer Wilds est un jeu mystérieux en monde ouvert, mettant en scène un système solaire piégé dans une boucle temporelle infinie.', 'https://i.postimg.cc/sD1Pf7Vk/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', 2, 2189, 0),
(2191, 'Kerbal space program 2', 'Kerbal Space Program 2 est la suite du célèbre jeu de simulation spatiale Kerbal Space Program. Découvrez une nouvelle ère d\'exploration spatiale : nouvelles pièces, graphismes époustouflants, interface utilisateur et écran carte entièrement refaits et de nouveaux environnements spatiaux à explorer.', 'https://i.ibb.co/QdVVYt4/Kerbal-Space-Program-2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', 2, 2190, 0),
(2192, 'Buckshot Roulette', 'BUCKSHOT ROULETTE est un jeu d\'horreur sur table qui tente de repenser le tristement célèbre jeu de roulette russe, en remplaçant le revolver traditionnel par un véritable fusil à pompe de calibre 12. Cette puissance de feu supplémentaire, et plus important encore, les différentes mécaniques de maniement d\'un fusil de chasse par rapport à un revolver, offrent une nouvelle vision du jeu de hasard classique et mortel. Le jeu se déroule au sommet d\'une discothèque souterraine, où les grilles métalliques tremblent au rythme de boîtes à rythmes perdues depuis longtemps. Un revendeur d\'IA véreux vous attend. Les rencontrerez-vous ?', 'https://i.postimg.cc/K8MYJvNk/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2191, 0),
(2193, 'Palworld', 'Un tout nouveau jeu de survie multijoueur en monde ouvert où le but est de collectionner de mystérieuses créatures, les Pals, afin de les faire combattre, bâtir des structures, travailler dans les champs et faire tourner vos usines.', 'https://cfinder.xyz/uploads/Palworld.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2192, 0),
(2194, 'Jalopy', 'Construisez, réparez, faites le plein et conduisez une vieille voiture délabrée lors d\'un grand voyage à travers les territoires de l\'ancien bloc de l\'Est. Explorez l\'Allemagne, la CSFR, la Hongrie, la Yougoslavie et la Bulgarie', 'https://i.postimg.cc/kXhWyMbg/Jalopy.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2193, 0),
(2195, 'PowerWash Simulator + Online', 'Relâchez la pression avec PowerWash Simulator ! Éliminez vos soucis grâce aux sons apaisants de l\'eau sous haute pression. Allumez votre nettoyeur haute pression et éliminez toute la saleté et la crasse que vous pouvez trouver. Profitez du plaisir simple que procure le nettoyage à haute pression.', 'https://cfinder.xyz/uploads/PowerWashSimulatorOnline.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2194, 0),
(2196, 'CCleaner Professional', 'CCleaner, avec 20 ans d\'expérience, est un logiciel de nettoyage renommé. Il propose une variété de fonctionnalités, du nettoyage de cache à l\'analyse des registres, offrant une solution complète avec une version gratuite efficace. Disponible sur Windows, Android et autres plateformes, CCleaner de Piriform est un choix fiable pour maintenir votre système en bonne santé.', 'https://i.postimg.cc/BQz2BwG9/ccleaner-professional.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2195, 0),
(2197, 'Getting Over It', 'Getting Over It est un jeu d\'escalade éprouvant, un hommage au classique du B-Game 2002 de Jazzuo \"Sexy Hiking\". Vous déplacez le marteau avec la souris, et c\'est tout. Avec de la pratique, vous pourrez sauter, vous balancer, grimper et voler. De grands mystères et une merveilleuse récompense attendent les maîtres randonneurs qui atteignent le sommet de la montagne.', 'https://i.postimg.cc/qvmXSMKY/Getting-Over-It.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2196, 0),
(2198, 'Dead Island 2 + Online', 'Un virus mortel se répand dans L.A. et transforme les habitants en zombies. Vous avez été mordu mais vous êtes immunisé. Découvrez la vérité sur l\'épidémie et comprenez qui ou ce que vous êtes.', 'https://i.postimg.cc/GhFLh4hB/Dead-Island-2-Online.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2197, 0),
(2199, 'IObit Driver Booster Pro 10', 'IObit Driver Booster Pro 10 est un utilitaire qui vous permet d\'obtenir les dernières versions des pilotes de vos matériels et périphériques sur Windows. L\'éditeur iObit est réputé pour ses outils gratuits dédiés au système d\'exploitation de Microsoft, il propose aussi d\'autres logiciels.', 'https://i.postimg.cc/2j9gDrfs/Driver-Booster-Pro.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2198, 0),
(2200, 'Secret Neighbor + Online', 'Secret Neighbor est un jeu d\'horreur à suspense en multijoueur dans lequel des enfants veulent libérer leur amie du sous-sol du sinistre voisin. Le problème, c\'est que le voisin se fait justement passer pour l\'un d\'entre eux.', 'https://i.postimg.cc/zvG7QbBy/Secret-Neighbor.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2199, 0),
(2201, 'People Playground', 'Tirez, poignardez, brûlez, empoisonnez, déchirez, vaporisez ou écrasez des poupées de chiffon dans un grand espace ouvert.', 'https://i.postimg.cc/G3NjqNbJ/People-Playground.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2200, 0),
(2202, 'Castle Story + Online', 'Castle Story est un jeu de stratégie créatif en voxels dans lequel vous pouvez construire des châteaux une brique à la fois en utilisant une armée de petites créatures appelées Bricktrons. Concevez, construisez et étendez votre territoire dans un vaste paysage et défendez vos Bricktrons!', 'https://i.postimg.cc/XJj5YK4v/Castle-Story.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2201, 0),
(2203, 'Drift King', 'Prenez votre voiture préférée, réglez-la, défiez les joueurs dans des batailles PVP Drift en temps réel et devenez un DRIFT KING!', 'https://i.postimg.cc/J4myQc94/Drift-King.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:05', '2025-09-09 15:30:13', NULL, 2202, 0),
(2204, 'Lego Worlds', 'Joue dans une galaxie de mondes entièrement composés de briques LEGO. EXPLORE des paysages gigantesques, DÉCOUVRE d\'innombrables surprises et CRÉE tout ce que tu peux imaginer avec des briques LEGO.', 'https://i.postimg.cc/T13xH1G1/Lego-Worlds.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2203, 0),
(2205, 'Forspoken', 'Forspoken suit l\'aventure de Frey, une jeune New-Yorkaise catapultée dans le monde aussi beau que cruel d\'Athia. En quête du chemin du retour, Frey devra utiliser ses nouvelles compétences magiques pour traverser des paysages tentaculaires et affronter des créatures monstrueuses.', 'https://i.postimg.cc/zv5s4MkB/Forspoken.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2204, 0),
(2206, 'Ratchet And Clank Rift Apart', 'Lancez-vous dans une aventure interdimensionnelle avec Ratchet et Clank... désormais sur PC ! Aidez nos deux héros à combattre un empereur diabolique venu d\'une autre réalité en traversant à toute vitesse des mondes bourrés d\'action !.', 'https://i.postimg.cc/DZtrZkNv/Ratchet-And-Clank-Rift-Appart.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2205, 0),
(2207, 'ViewFinder', 'Défiez la perception, redéfinissez la réalité et remodelez le monde qui vous entoure avec un appareil photo instantané. Viewfinder est un nouveau jeu solo offrant aux joueurs des heures d\'expériences passionnantes et l\'occasion de percer des mystères oubliés.', 'https://i.postimg.cc/CKSLwB1m/View-Finder.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2206, 0),
(2208, 'We Were Here Forever + Online', 'Vous et votre partenaire êtes pris au piège de Castle Rock. Avez-vous été victimes d\'une trahison ? D\'une erreur de jugement ? Découvrez-le dans la nouvelle aventure remplie d\'énigmes de la série We Were Here ! Relèverez-vous le défi de ces forces ténébreuses ou resterez-vous ici... à jamais ?', 'https://i.postimg.cc/Dy1TmvRD/EGS-We-Were-Here-Forever.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2207, 0),
(2209, 'Borderlands 3', 'Vivez toute l\'expérience Borderlands avec cette collection tout-en-un qui comprend les six célèbres jeux de base, ainsi que les contenus additionnels pour Borderlands, Borderlands 2, Borderlands: The Pre-Sequel, Tales from the Borderlands, Borderlands 3, et New Tales from the Borderlands, dans un seul et même pack géant.', 'https://i.postimg.cc/kg7PSg3H/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2208, 0),
(2210, 'Among Us + Online', 'Travail d\'équipe et trahison sont les maîtres mots dans ce party-game local et en ligne pour 4 à 15 joueurs... dans l\'espace !', 'https://i.postimg.cc/RV7WmR0k/AmongUs.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2209, 0),
(2211, 'Park Beyond', 'Park Beyond est un jeu de simulation de parc d\'attractions dans lequel vous pouvez créer les parcs de vos rêves en toute liberté. Que vous adoriez gérer vos finances et l\'expérience de vos visiteurs, ou que vous aimiez créer des parcs à la fois fun et accueillants, Park Beyond a ce qu\'il vous faut !', 'https://i.postimg.cc/gc7CgK93/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2210, 0),
(2212, 'Arma 3', 'Découvrez une simulation militaire en monde ouvert. Avec plus de 20 véhicules, 40 armes et un éditeur sans limites pour vos créations, cette simulation militaire est ce qui se fait de mieux sur PC, en solo ou en multi. Authentique, variée et ouverte : repensez la guerre avec Arma 3.', 'https://i.postimg.cc/XJkvwD1K/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 1, 2211, 0),
(2213, 'Assassins Creed III Remastered', ' Le jeu est la suite de Assassin\'s Creed Revelations. Comme dans les autres opus de la série, le joueur contrôle Desmond Miles au xxie siècle. Cet homme peut revivre les souvenirs de ses ancêtres grâce à un appareil appelé « Animus », lui permettant de voyager dans le temps à travers leur mémoire génétique commune. La lutte que se livrent Assassins et Templiers a en effet survécu à toutes les époques depuis leur début pendant les Croisades : la poignée d\'Assassins qui résiste de nos jours (dont Desmond est le dernier descendant) est menacée par l\'entreprise multinationale Abstergo Industries qui embrasse les idées des Templiers.', 'https://i.postimg.cc/Yqy5yc68/ac3-remastered.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2212, 0),
(2214, 'Assassins Creed Rogue', 'Amérique du Nord. 18ème siècle. Alors que la Guerre de la Conquête fait rage, Shay Patrick Cormac, un jeune membre de la Confrérie des Assassins va sombrer dans les ténèbres et changer le destin des colonies Américaines.', 'https://i.postimg.cc/Mpqd5cGy/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2213, 0),
(2215, 'Contraband Police', 'Prenez la place d\'un inspecteur de la police des frontières dans un pays communiste dans les années 1980. La contrebande, la corruption et la falsification sont à l\'ordre du jour ici. Soyez vigilant et gagnez le respect de vos supérieurs.', 'https://i.postimg.cc/3Rv52t49/Contraband-Police.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2214, 0),
(2216, 'Black Mesa Definitive Edition', 'Black Mesa est un remake réalisé par des fans relatant le voyage historique de Gordon Freeman à travers le centre de recherche de Black Mesa. Revivez Half-Life, les débuts révolutionnaires de Valve Software et revivez le jeu qui a relevé la barre pour toute l\'industrie du jeu.', 'https://i.postimg.cc/YS2Dr4Kp/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 1, 2215, 0),
(2217, 'Demonologist', 'Demonologist est un jeu d\'horreur en coopération qui peut être joué avec au moins 1 et jusqu\'à 4 joueurs. Votre objectif est d\'identifier le type d\'esprit maléfique dans les lieux maudits et de l\'exorciser à l\'aide de votre équipement, seul ou en équipe.', 'https://i.postimg.cc/7YTVw351/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2216, 0),
(2218, 'Hello Neighbor 2', 'Jeu d\'horreur et d\'infiltration, Hello Neighbor 2 vous met au défi de déterrer les secrets de vos voisins sinistres. Seul hic : chacun de ces individus est contrôlé par une I.A. dernier cri ! Réussirez-vous à déjouer les stratagèmes des voisins et à découvrir ce qu\'ils cachent ?', 'https://i.postimg.cc/SQ1TyQD4/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2217, 0),
(2219, 'Mortal Kombat 11 + Online', 'Découvrez les toutes nouvelles variantes de personnages qui vous permettront de modifier vos Kombattants comme jamais auparavant. Grâce au nouveau moteur graphique, vous participerez à une expérience fracassante et criante de réalisme qui vous plongera au cœur du kombat. Et ce n\'est pas tout : avec sa liste de nouveaux Kombattants, le retour des Kombattants Klassiques et les cinématiques époustouflantes de son mode histoire, Mortal Kombat 11 réinvente avec brio la saga épique créée il y a plus de 25 ans.', 'https://i.postimg.cc/D0FDsBPV/Mortal-Kombat11.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2218, 0),
(2220, 'Payday 3', 'PAYDAY 3 est la suite très attendue d’un des jeux de tir en coop les plus populaires de tous les temps. Depuis la sortie du premier épisode, de nombreux joueurs ont goûté au frisson que procurent la planification et l’exécution minutieuses d’un casse.', 'https://cfinder.xyz/uploads/Payday3.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2219, 0),
(2221, 'House Flipper', 'House Flipper, c\'est l\'occasion unique de devenir une équipe de rénovation à vous tout seul. Achetez, réparez et rénovez des maisons en ruines pour leur donner une seconde vie et les vendre à profit !', 'https://i.postimg.cc/85TdbL5W/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2220, 0),
(2222, 'ARK Survival Evolved', 'En tant qu\'homme ou femme échoué nu, mourant de froid et de faim sur une île mystérieuse, vous devrez chasser, récolter, fabriquer des objets, faire pousser des plantes et construire des abris pour survivre.', 'https://i.postimg.cc/6QryzQxk/ark-survival-evolved.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2221, 0),
(2223, 'DOOM Eternal + Online', 'Les armées de l\'enfer ont envahi la Terre. Incarnez le Slayer dans une campagne en solo où vous terrasserez des démons et arrêterez la destruction de l\'humanité. La seule chose qui les effraie... c\'est vous.', 'https://cfinder.xyz/uploads/DOOMEternalOnline.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2222, 0),
(2224, 'MotoGP 22', 'Faites chauffer vos moteurs et vivez l\'expérience de jeu MotoGP™ la plus immersive et réaliste jamais créée ! Jamais le virtuel n\'aura été aussi proche du réel dans MotoGP™22 !', 'https://i.postimg.cc/3rDkN9dS/motogp-22.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2223, 0),
(2225, 'Wondershare Filmora 12', 'Transformez votre vidéo en une œuvre d\'art avec une simple interface et de puissants logiciels de montage !', 'https://i.postimg.cc/Hs49NT4C/Wondershare-Filmora-12.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2224, 0),
(2226, 'Fifa 23', 'FIFA 23 vous permet de vivre The World’s Game, avec la technologie HyperMotion2, les FIFA World Cup™ féminine et masculine, les clubs féminins et les fonctions Cross-PLay**, entre autres.', 'https://i.postimg.cc/T3LpB9nv/Fifa23.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2225, 0),
(2227, 'Starfield', 'Starfield est le premier nouvel univers en 25 ans de Bethesda Game Studios, les créateurs récompensés de The Elder Scrolls V: Skyrim et Fallout 4. Dans ce RPG nouvelle génération dans les étoiles, créez votre personnage et explorez avec une liberté sans précédent lors d\'une aventure épique pour résoudre le plus grand mystère de l\'humanité.', 'https://i.postimg.cc/NfxcFwDs/starfield.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2226, 0),
(2228, 'City Car Driving', 'City Car Driving – c’est un simulateur réaliste de conduite sur la route destiné à assimiler les acquis de base en matière de la conduite en différentes conditions routières en vous plongeant dans l’ambiance proche à la réalité au maximum.', 'https://i.postimg.cc/k4q9jhYX/City-Car-Driving.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2227, 0),
(2229, 'Portal', 'Portal™ est un nouveau jeu solo signé Valve. Avec pour décor les mystérieux laboratoires Aperture Science, Portal s\'impose par son côté innovant et garantit aux joueurs un gameplay et une longévité à toute épreuve.', 'https://i.postimg.cc/rpJ4yXk4/portal.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2228, 0),
(2230, 'Diablo III', 'Vingt ans se sont écoulés depuis que les Démons Primordiaux ont été vaincus et bannis du monde de Sanctuaire. Maintenant, vous devez retourner là où tout a commencé – la ville de Tristram – et enquêter sur les rumeurs concernant une étoile déchue, car c’est le premier signe de la renaissance du mal et un présage que la Fin des Temps a commencé.', 'https://i.postimg.cc/j5JpT0Kt/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2229, 0),
(2231, 'StoryTeller', 'Storyteller est un jeu d’énigmes récompensé, dans lequel vous devez créer des histoires. Commencez avec un titre, un cadre et des personnages et agencez les récits pour qu’ils correspondent aux titres proposés. Jouez sur fond d’amour, d’intrigue, avec des monstres et bien d’autres choses encore !', 'https://i.ibb.co/h8qTSs3/storyteller.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2230, 0),
(2232, 'Boris FX Sapphire Plug-ins', 'Les plugins Sapphire vous permettent de créer des looks organiques époustouflants inégalés par aucun outil d\'effets natifs hôte. Les fonctionnalités clés incluent plus de 270 effets et plus de 3 000 préréglages, un puissant générateur d\'effets et de transitions, ainsi qu\'un suivi et un masquage intégrés avec Mocha, lauréat d\'un Oscar. La qualité d\'image, le contrôle et la vitesse de rendu supérieurs de Sapphire offrent un gain de temps considérable, permettant aux créatifs de se concentrer sur ce qui compte le plus, produisant un impact qui incite le public à revenir.', 'https://i.postimg.cc/JhFxRs4B/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 1, 2231, 0),
(2233, 'DayZ', 'Survivrez-vous longtemps dans ce monde post-apocalyptique ? Un monde envahi de \"zombies\", où il faudra partager de maigres ressources avec les autres survivants. Vous allierez-vous à des inconnus pour faire front ? Survivrez-vous en solo pour éviter les trahisons ? DayZ, c\'est votre histoire.', 'https://cfinder.xyz/uploads/DayZ.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2232, 0),
(2234, 'Grand Mountain Adventure Wonderlands', 'Grand Mountain Adventure: Wonderlands vous invite à visiter librement et à votre rythme des stations de sport d’hiver et les montagnes aux alentours. Explorez tranquillement les lieux, lancez-vous dans des défis variés et gratifiants ou bien affrontez vos amis dans des courses multijoueurs amicales.', 'https://i.postimg.cc/yNHpwgx6/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 1, 2233, 0),
(2235, 'Voidtrain', 'Découvrez un monde peuplé de créatures, d\'ennemis et de lieux mystérieux. Améliorez et personnalisez votre train, rassemblez de nouveaux matériaux et créez de meilleures armes. Jouez en solo ou en coop en ligne jusqu\'à 4.', 'https://i.postimg.cc/59scL30B/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2234, 0),
(2236, 'Mario Party', 'Le jeu de plateau original a été agrémenté de nouveaux éléments stratégiques, comme les dés propres à chaque personnage. Le jeu propose également de toutes nouvelles manières de jouer, des mini-jeux spécialement conçus pour tirer parti des Joy-Con et de nouveaux modes pour s\'amuser en famille ou entre amis.', 'https://i.postimg.cc/SRkyRNgm/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2235, 0),
(2237, 'TrackDayR', 'Le simulateur de moto le plus complet qui vous permet de piloter tous les types de motos, y compris les VTT et les véhicules à trois roues. Défiez vos amis sur TrackDayR et grimpez dans les classements des joueurs du monde entier. TrackDayR, Trackday Everyday !', 'https://cfinder.xyz/uploads/TrackDayR.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2236, 0),
(2238, 'Stranded Deep + Online', 'Incarnez un survivant d\'un accident d\'avion bloqué quelque part dans l\'océan Pacifique. Faites face à certains des scénarios les plus dangereux qui se traduiront par une expérience différente à chaque fois que vous jouerez. Récupérer. découvrir. Survivre.', 'https://i.postimg.cc/R0D2BPM9/Stranded-Deep.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2237, 0),
(2239, 'Grand Theft Auto The Trilogy The Definitive Edition', 'Trois villes emblématiques, trois histoires exceptionnelles. Jouez aux classiques de la trilogie originale de Grand Theft Auto qui ont ouvert la voie au genre : Grand Theft Auto III, Grand Theft Auto: Vice City et Grand Theft Auto: San Andreas.', 'https://i.postimg.cc/jddHk4Gc/H2x1-NSwitch-Grand-Theft-Auto-The-Trilogy-The-Definitive-Edition-image1280w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', 2, 2238, 0),
(2240, 'Hitman 3', 'La mort attend. L\'agent 47 revient dans Hitman III, marquant la conclusion dramatique de la trilogie du monde de l\'assassinat.', 'https://i.postimg.cc/wM2CVQnZ/hitman-3-pc-jeu-epic-games-europe-cover.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2239, 0),
(2241, 'Astroneer + Online', 'Explorez et remodelez des mondes lointains ! Astroneer se passe lors de la ruée vers l\'or du XXVe siècle : les joueurs doivent explorer les confins de l\'espace, risquant leurs vies et leurs ressources dans un environnement hostile pour une chance de devenir millionnaire.', 'https://i.postimg.cc/Df9YbDDD/Astroneer.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2240, 0),
(2242, 'Oxygen Not Included', 'Oxygen Not Include est un jeu de simulation de colonie spatiale. Au plus profond d\'une roche spatiale extraterrestre, votre équipage assidu devra maîtriser la science, surmonter de nouvelles formes de vie étranges et exploiter une technologie spatiale incroyable pour survivre et peut-être prospérer.', 'https://i.postimg.cc/8PdJQvmX/oxygen-not-included-header-updated.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2241, 0),
(2243, 'Assassin’s Creed Syndicate', 'Prenant place dans le Londres de l\'époque victorienne, Assassin\'s Creed Syndicate est un jeu d\'action-aventure en monde ouvert. Parmi les nouveautés, on peut notamment citer la possibilité de se déplacer sur des éléments en mouvement (calèche par exemple).', 'https://i.postimg.cc/QMTfhSYZ/Assassin-s-Creed-Syndicate.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2242, 0),
(2244, 'One Piece Odyssey', 'Un RPG inédit qui reprend les décors du célèbre animé ONE PIECE ! Incarnez les membres de l\'équipage de Chapeau de paille et embarquez pour une aventure fantastique dans l\'univers de ONE PIECE !', 'https://i.postimg.cc/3JXJ6HFg/One-piece-odyssey.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:06', '2025-09-09 15:30:13', NULL, 2243, 0),
(2245, 'Assassin\'s Creed IV Black Flag', 'Assassin\'s Creed IV Black Flag débute en 1715, lorsque des pirates établissent une république anarchique dans les Caraïbes et dominent la terre et les mers. Ces hors-la-loi ont paralysé les marines, interrompu le commerce international et pillé de vastes fortunes. Ils ont menacé les structures de pouvoir qui dirigeaient l\'Europe, ont inspiré l\'imagination de millions de personnes et ont laissé un héritage qui perdure encore.', 'https://i.postimg.cc/y8t2BDPt/Assassin-s-Creed-IV-Black-Flag.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2244, 0),
(2246, 'Final Fantasy XIII', 'Final Fantasy XIII est un RPG dans lequel un groupe d\'humains affronte le destin, dans la cité suspendue de Cocoon et le monde primitif de Pulse. Suivez Lightning à travers des combats intenses. L\'aventure vous attend dans ce monde mystérieux...', 'https://i.postimg.cc/Y0pj4HGQ/Final-Fantasy-XIII.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2245, 0),
(2247, 'Marvel Avengers', 'Après le désastre du A-Day qui a détruit San Francisco et donné naissance aux Inhumains, les Avengers se sont séparés. En leur absence, l\'Advanced Idea Mechanics (AIM) a juré de protéger la population, du moins en apparence. Incarnez Kamala Khan, une ado fan des Avengers, qui tente d\'échapper à l\'AIM après avoir découvert un terrible secret dans ses serveurs. Après avoir réuni les Avengers, vous pourrez incarner chaque membre de l\'équipe et découvrir leur fonctionnement. Parcourez le globe dans la peau de chacun des Avengers pour qu\'ils reprennent confiance en eux avant que tout ne soit perdu.', 'https://i.postimg.cc/bvwpPKqZ/Marvels-Avengers.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 2, 2246, 0),
(2248, 'Psychonauts 2', 'Razputin Aquato, dit \"Raz\", puissant jeune médium et acrobate de talent, a réalisé le rêve de sa vie : rejoindre l\'organisation internationale d\'espionnage psychique qu\'on appelle les Psychonautes ! Mais tout n\'est pas rose chez les médiums. Leur meneur n\'est plus le même depuis qu\'il a été sauvé d\'un enlèvement, et pire encore, une taupe se cache dans leurs rangs. Entre missions loufoques et complots mystérieux, Psychonauts 2 est un jeu de plateforme-aventure au style cinématographique, offrant une ribambelle de pouvoirs psychiques à personnaliser.', 'https://i.postimg.cc/hPrQDR9n/Psychonauts-2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 2, 2247, 0),
(2249, 'Friday 13 The Game', 'Jason est de retour ! Jason Voorhees est déchaîné et traque les terres du Camp Crystal Lake ! Friday the 13th : The Game est l\'un des titres d\'horreur les plus attendus de tous les temps. Vous allez enfin pouvoir incarner Jason Voorhees et les conseillers du Camp Crystal Lake.', 'https://cfinder.xyz/uploads/Friday13TheGame.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2248, 0),
(2250, 'Sifu', 'Dans Sifu, vous incarnez un jeune apprenti du kung-fu en quête de vengeance, dans sa traque de ceux qui ont assassiné sa famille. Seul contre tous, personne ne peut l’aider et ses ennemis sont nombreux. Il devra compter sur sa maîtrise unique du kung-fu ainsi que sur un mystérieux pendentif pour surmonter les obstacles et préserver son héritage.', 'https://i.postimg.cc/VNnZnXb8/Sifu.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 2, 2249, 0),
(2251, 'Star Wars Jedi Fallen Order', 'Rassemblez les morceaux de votre passé brisé et terminez votre entraînement de Jedi. Développez de puissantes capacités de la Force et maîtrisez l\'art du sabre laser pour mener à bien votre mission : reconstruire l\'Ordre Jedi.', 'https://i.postimg.cc/W1m3hHb6/Star-Wars-Jedi-Fallen-Order.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2250, 0),
(2252, 'Incredibox', 'Incredibox est un jeu musical qui te permet de composer de la musique en manipulant une bande de beatboxers délirants.', 'https://i.postimg.cc/nhzDTJvw/Incredibox.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 2, 2251, 0),
(2253, 'Spotify Premium', 'Outil CLI puissant pour prendre le contrôle du client Spotify.', 'https://i.postimg.cc/Hx1zFRx1/Spotify-Premium.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2252, 0),
(2254, 'ARK Survival Ascended', 'Ark est repensé dans cette prochaine génération de technologie de jeux vidéo avec Unreal Engine 5! Formez une tribu, apprivoisant et reprochent des centaines de dinosaures uniques et de créatures primitives, explorez, élaborez et construisez votre chemin jusqu\'au sommet de la chaîne de nourriture.', 'https://cfinder.xyz/uploads/ARKSurvivalAscended.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2253, 0),
(2255, 'Alan Wake 2 Deluxe Edition', 'Saga Anderson arrive dans une petite ville afin d\'enquêter sur une série de meurtres rituels. Alan Wake écrit une histoire sombre afin de modifier la réalité. Un lien semble les unir. Peuvent-ils devenir les héros qu\'ils sont censés être ?', 'https://i.postimg.cc/C58p4WzB/Alan-Wake-II.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2254, 0),
(2256, 'Bully', 'Bully raconte l\'histoire de Jimmy Hopkins, 15 ans, espiègle, alors qu\'il traverse l\'hilarité et la maladresse de l\'adolescence. Battez les sportifs au ballon chasseur, faites des farces aux preppies, sauvez les nerds, embrassez la fille et naviguez dans la hiérarchie sociale dans la pire école du monde.', 'https://i.postimg.cc/y8qX505M/bully.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2255, 0),
(2257, 'Teardown', 'Préparez le casse parfait dans ce monde voxel simulé et entièrement destructible. Démolissez les murs avec des véhicules ou des explosifs pour créer des raccourcis. Empilez des objets pour atteindre plus haut. Utilisez l\'environnement à votre avantage de la manière la plus créative qui soit.', 'https://i.postimg.cc/W4P7gKd4/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 1, 2256, 0),
(2258, 'Adobe Lightroom Classic', 'Passez aisément de Lightroom à Photoshop et Photoshop sur iPad pour peaufiner vos photos.\r\n\r\n', 'https://i.postimg.cc/PqJxQRyT/Adobe-Lightroom.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 2, 2257, 0),
(2259, 'Hogwarts Legacy', 'Hogwarts Legacy : L\'Héritage de Poudlard est un RPG d\'action-aventure immersif en monde ouvert qui se déroule dans l’univers des livres Harry Potter. Pour la première fois, découvrez Poudlard dans les années 1800. Vous incarnez une élève détenant la clé d\'un ancien secret qui menace de déchirer le monde des sorciers. Vous pouvez maintenant prendre le contrôle de l\'action et être au centre de votre propre aventure dans le monde des sorciers. Votre héritage vous appartient.', 'https://i.postimg.cc/d1w4PXFf/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2258, 0),
(2260, 'Poly Bridge 3', 'Le meilleur du meilleur vient encore de s’améliorer ! Redécouvre ta créativité d’ingénieur dans ce chef-d’œuvre de résolution de casse-têtes et de construction de pont qui redéfinit le genre.', 'https://i.postimg.cc/CMPhMNsq/Poly-Bridge-3.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2259, 0),
(2261, 'Sons Of The Forest', 'En mission sur une île isolée pour retrouver un milliardaire porté disparu, vous découvrez un monde de cauchemar infesté de cannibales. Par vous-même ou avec l\'aide d\'amis, fabriquez, construisez et luttez pour votre survie dans ce jeu de simulation de survie horrifique.', 'https://i.postimg.cc/Y0XXxxJs/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2260, 0),
(2262, 'The Last of Us: Part I', 'Dans un monde dévasté où rôdent infectés et survivants endurcis, Joel, un protagoniste désabusé, est engagé pour faire sortir Ellie, 14 ans, d\'une zone de quarantaine militaire. Mais ce qui devait être une simple mission de routine se transforme vite en un dangereux périple à travers le pays.', 'https://i.postimg.cc/WbTjYpxm/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2261, 0),
(2263, 'NASCAR Heat 5 + Online', 'NASCAR Heat 5 vous met au défi de devenir le champion de la NASCAR Cup Series 2020. Présente toutes les équipes, pilotes et voitures officiels des trois NASCAR National Series ainsi que du Xtreme Dirt Tour, courant sur 39 pistes authentiques.', 'https://i.postimg.cc/x1PLqhxR/nascar-heat-5.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2262, 0),
(2264, 'Football Manager 23', 'Montez votre équipe de rêve, surpassez la concurrence et vivez les grands frissons des soirées européennes dans l\'UEFA Champions League. Votre épopée vers la gloire footballistique vous attend.', 'https://i.postimg.cc/qBQ2gqcg/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 1, 2263, 0),
(2265, 'My Gaming Club', 'Dans le jeu My Gaming Club, vous pouvez ressentir exactement ce que c\'est que de posséder un club de jeu, car le réalisme est l\'une des principales caractéristiques du jeu. Assemblez des PC, achetez des meubles, de la nourriture pour votre club et pour vos visiteurs. Ce jeu n\'est pas seulement un simulateur de club de jeu, ce jeu est un simulateur de vie réelle', 'https://i.postimg.cc/XvZskF82/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 1, 2264, 0),
(2266, 'TopazVideoAI', 'Boostez vos séquences avec la plateforme de montage IA à laquelle font confiance les grands studios de cinéma et les professionnels de la création du monde entier.', 'https://i.postimg.cc/2y9wKJvm/topaz-video-ai.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2265, 0),
(2267, 'Mafia - Definitive Edition', 'Une altercation avec la mafia plonge Tommy Angelo, un chauffeur de taxi, dans le crime organisé. D\'abord réticent à l\'idée de travailler pour Salieri, l\'appât du gain est finalement le plus fort.', 'https://i.postimg.cc/QdfzbjrM/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 2, 2266, 0),
(2268, 'Atomic Heart', 'Dans un monde dystopique aussi déjanté que sublime, armez-vous de votre gant de pouvoirs, de votre arsenal d’armes blanches et de votre artillerie à la pointe de la technologie, et lancez-vous dans des affrontements explosifs et mortellement nerveux.', 'https://i.postimg.cc/3J5Q4rK5/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 1, 2267, 0),
(2269, 'Ancestors The Humankind Odyssey', 'Ancestors: The Humankind Odyssey est un jeu de survie à la troisième personne en monde ouvert où vous devrez explorer votre environnement, développer votre territoire et faire évoluer votre clan à travers les générations dans cette nouvelle aventure palpitante de Panache Jeux Numériques', 'https://i.postimg.cc/Dz1XXDw0/Ancestors-The-Humankind-Odyssey.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2268, 0),
(2270, 'Minecraft Legends', 'Découvrez les mystères de Minecraft Legends, un nouveau jeu mêlant action et stratégie. Guidez vos alliés dans des combats héroïques pour défendre la Surface contre les Piglins destructeurs.', 'https://i.postimg.cc/L4qmg0Lf/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 1, 2269, 0),
(2271, 'Fears to Fathom', 'Fears to Fathom est un jeu d\'horreur psychologique épisodique où chaque épisode dévoile une courte histoire racontée par ceux qui ont survécu.', 'https://i.postimg.cc/vBR48v7y/Fears-to-Fathom.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2270, 0),
(2272, 'Resident Evil 4', 'La survie n\'est que le début. Avec un gameplay modernisé, une histoire revisitée et des graphismes ultra détaillés, Resident Evil 4 signe la renaissance d\'un monstre de l\'industrie. Replongez dans le cauchemar qui a révolutionné les jeux d\'horreur et de survie.', 'https://i.postimg.cc/LsBpRcdK/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 1, 2271, 0),
(2273, 'Lethal Company + Online', 'Une horreur coopérative sur la récupération des lunes abandonnées pour vendre de la ferraille à la société.', 'https://i.postimg.cc/Hx57bNWj/lethal-company-tetiere-file-e16ca8cf.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2272, 0),
(2274, 'We Were Here Together', 'Alors que nous explorons ces déserts gelés, le malheur frappe une fois de plus. À travers le blizzard intense, une fusée de détresse illumine le ciel, suivie par un appel à l\'aide à la radio, cassé, agonisant... Personne d\'autre ne peut venir les sauver. Mais nous pouvons rentrer... ensemble ?', 'https://i.postimg.cc/qB6138Rg/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 1, 2273, 0),
(2275, 'Spider man Shattered Dimensions', 'Spider-Man : Dimensions est un jeu vidéo d\'action-plates-formes développé par Beenox Studios et édité par Activision en 2010 sur PlayStation 3, Xbox 360, Wii et sous Windows. Parallèlement, Griptonite Games a développé une version sur Nintendo DS.', 'https://i.postimg.cc/mrVQvrgv/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 1, 2274, 0),
(2276, 'Fortnite OG', ' Fortnite OG est un logiciel qui vous permet de revisiter les versions précédentes de Fortnite. Fortnite OG accueille également des matchs multijoueurs, actuellement sur la saison 7.', 'https://i.postimg.cc/fWGD6FR8/Fortnite-Saison-7-Cover.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', NULL, 2275, 0),
(2277, 'Only Up', 'Embarquez pour un voyage passionnant dans \"Only UP !\". En explorant un vaste monde plein de secrets et de mystères, vous devez aller le plus haut possible, et le meilleur commence au-dessus des nuages...', 'https://i.postimg.cc/FKvptqgL/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 1, 2276, 0),
(2278, 'Diablo IV', 'La bataille entre les Cieux et les Enfers fait rage et le chaos menace de consumer Sanctuaire. Avec d’innombrables démons à massacrer, une multitude de capacités à maîtriser, des donjons cauchemardesques et des butins légendaires, ce vaste monde ouvert vous promet aventures et dévastation. Survivez et triomphez des ténèbres… ou sombrez dans l’oubli le plus profond.', 'https://i.postimg.cc/vZgk8pV2/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:07', '2025-09-09 15:30:13', 2, 2277, 0),
(2279, 'The Long Drive + Online', 'Jeu de conduite de voiture de survie semi-post-apocalyptique en monde ouvert généré aléatoirement.', 'https://i.postimg.cc/gkVGVDHr/the-long-drive.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2278, 0),
(2280, 'Plasma', 'Plasma est un bac à sable d\'ingénierie. Libérez votre créativité avec des outils de robotique, de physique et de programmation visuelle amusants et intuitifs.', 'https://i.postimg.cc/wTPSZsxL/Plasma.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2279, 0),
(2281, 'Celemony Melodyne 5 Studio', 'Melodyne 5 editor dispose de toutes les fonctions professionnelles de correction vocale. Plus le légendaire algorithme DNA pour les données polyphoniques.', 'https://i.postimg.cc/43MPhx9k/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2280, 0),
(2282, 'Assassin’s Creed Revelations', 'Ezio Auditore marche dans les pas de son mentor légendaire Altair. Partez pour un voyage périlleux fait de découvertes et de révélations.', 'https://i.postimg.cc/YCRCd4rg/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2281, 0),
(2283, 'Baldur\'s Gate 3', 'Constituez votre groupe et retournez aux Royaumes Oubliés dans une histoire d\'amitié, de trahison, de sacrifice et de survie, sur fond d\'attrait du pouvoir absolu.', 'https://i.postimg.cc/y8bT38Mh/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2282, 0),
(2284, 'WWE 2K23', 'Remontez sur le ring avec l\'icône internationale Bad Bunny dans WWE 2K23 Édition Bad Bunny. *Comprend un nouveau personnage jouable Bad Bunny basé sur son apparence de Backlash \'23 à Porto Rico et bien plus encore, ainsi que tout le contenu bonus de WWE 2K23 Édition Icône !', 'https://i.postimg.cc/Sx052VcN/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2283, 0),
(2285, 'LEGO City Undercover', 'Lancez-vous dans une folle course-poursuite ! Dans LEGO® CITY Undercover, incarnez Chase McCain, un policier infiltré qui est chargé de traquer le célèbre criminel Rex Fury, récemment échappé de prison, et de mettre fin à sa vague de crimes à travers la ville.', 'https://i.postimg.cc/Prnz17Vc/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2284, 0),
(2286, 'MX Bikes', 'MX Bikes est un simulateur de motocross réaliste, basé sur un moteur physique construit de toutes pièces qui simule avec précision la dynamique de la moto et les options de configuration.', 'https://i.postimg.cc/6qfXTRgQ/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2285, 0),
(2287, 'The Quarry', 'Alors que s\'achève la dernière journée de leur camp de vacances, neuf jeunes moniteurs vont vivre une nuit de cauchemar inattendue. Il n\'existe qu\'une chose pire que les inconnus couverts de sang et les créatures qui les traquent : les choix impossibles que vous devrez faire pour survivre.', 'https://i.postimg.cc/Jzwnscs1/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2286, 0),
(2288, 'Resident Evil 7 Biohazard', 'Le danger et l\'isolement menacent derrière les murs vétustes d\'une ferme abandonnée d\'Amérique du Sud. \"7\" marque le renouveau du jeu de survie et propose une perspective inédite pour le joueur avec la \"vue isolée\". Portée par le moteur RE, l\'horreur atteint de nouveaux sommets de réalisme.', 'https://i.postimg.cc/903SdMZq/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2287, 0),
(2289, 'The Hunter Call of the Wild', 'Découvrez un jeu de chasse immersif au monde ouvert enchanteur et réaliste qui est régulièrement mis à jour en collaboration avec la communauté. Profitez de la campagne en solo ou partagez une expérience de jeu conviviale avec vos amis.', 'https://i.postimg.cc/L5H58H5j/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2288, 0),
(2290, 'Oneshot', 'OneShot est un jeu d\'aventure/d\'énigmes surréaliste en vue du dessus et doté d\'un gameplay unique. Vous devez guider un enfant dans sa mission à travers un monde mystérieux : restaurer un soleil éteint depuis bien longtemps. Le monde vous attend.', 'https://i.postimg.cc/C1s9S0Wy/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2289, 0),
(2291, 'Fireworks Mania', 'FIREWORKS MANIA est un petit jeu de simulation d\'explosifs où vous jouez avec des feux d\'artifice, créez de magnifiques spectacles pyrotechniques ou faites simplement exploser des trucs.', 'https://i.postimg.cc/2Stv6B4m/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2290, 0),
(2292, 'Ready or Not', 'Apprenez à maîtriser les systèmes complexes de gestion des armes et des déplacements, qui vous offrent un contrôle sans précédent sur le terrain. Grâce aux commandes optimisées de Ready or Not, vous pourrez agir de façon intuitive et assurée, sans avoir à mémoriser des dizaines d\'assignations différentes.', 'https://cfinder.xyz/uploads/ReadyorNot.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2291, 0),
(2293, 'Dead Space', 'Isaac Clarke est le principal protagoniste de la série Dead Space. Alors qu\'il est un ingénieur spécialisé en astronautique, sa vie change brusquement lorsqu\'une simple mission de réparation sur un vaisseau (l\'USG Ishimura), se transforme en une lutte pour la survie face au fléau Nécromorphe.', 'https://i.ibb.co/LtwCBnr/Dead-Space.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2292, 0),
(2294, 'Spider-Man Web of Shadows', 'Spider-Man : Web of Shadows est un jeu d\'action sur Playstation 3. Le titre vous permet de pouvoir alterner entre l\'agilité du costume rouge ou la puissance du costume noir de Spider-Man. Vos choix ont un impact direct sur l\'histoire et sur la façon dont vous êtes vu par les habitants. Il est également possible de débloquer des pouvoirs surpuissants et de créer de nouveaux combos.', 'https://i.ibb.co/2vn69TM/SI-NDS-Spider-Man-Web-Of-Shadows-UKV-image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2293, 0),
(2295, 'JoJo\'s Bizarre Adventure All-Star Battle', 'Le chef-d\'œuvre de Hirohiko Araki prend vie sous forme de jeu de combat ! Incarnez 50 personnages maniant les Stands, l\'Onde et bien plus ! Découvrez comment des personnages qui ne se sont jamais croisés dans l\'histoire interagissent face à face !', 'https://i.ibb.co/9HTPjVp/2x1-NSwitch-Jojos-Bizarre-Adventure-All-Star-Battle-R-image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2294, 0),
(2296, 'Grand Theft Auto San Andreas', 'Il y a cinq ans, Carl Johnson s\'est échappé des pressions de la vie à Los Santos, San Andreas – une ville qui se déchire avec les problèmes de gangs, la drogue et la corruption. Où les stars de cinéma et les millionnaires font de leur mieux pour éviter les dealers et les gangbangers.', 'https://i.ibb.co/ww0dGMM/Grand-Theft-Auto-San-Andreas.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2295, 0),
(2297, 'Dead Rising 3', 'Dead Rising 3 Apocalypse Edition offre le meilleur jeu de zombies en monde ouvert qui soit ainsi que 4 packs d’extension de jeu téléchargeables. Faites équipe avec d’autres survivants et fuyez cette ville avant qu’une frappe militaire ne la raye de la carte. Profitez de cette apocalypse pour buter du zombie à tout-va.', 'https://gaming-cdn.com/images/products/447/orig/dead-rising-3-apocalypse-edition-apocalypse-edition-pc-jeu-steam-cover.jpg?v=1662460247', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2296, 0),
(2298, 'Project Zomboid', 'Project Zomboid est le summum de la survie des zombies. Seul ou en multijoueur : vous pillez, construisez, fabriquez, combattez, cultivez et pêchez dans une lutte pour survivre. Un ensemble de compétences RPG hardcore, une vaste carte, un bac à sable massivement personnalisable et un adorable raton laveur tutoriel attendent les imprudents. Alors, comment allez-vous mourir ? Il suffit d\'une bouchée..', 'https://i.ibb.co/YyLh3TX/project-zomboid.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2297, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(2299, 'WRC Generation + Online', 'Relevez tous les défis de la simulation de rallye la plus complète, réaliste et exigeante jamais développée. Plongez au cœur de l’action et pilotez toutes les voitures du championnat WRC 2022, y compris les nouveaux modèles hybrides.', 'https://i.ibb.co/RbcN4rR/wrc-generatio.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2298, 0),
(2300, 'Bread & Fred + Online', 'Demandez de l\'aide à votre meilleur ami dans ce nouveau défi coopératif pour aider deux adorables pingouins, Bread et Fred, à atteindre le sommet du sommet enneigé. Chronométrez vos sauts, accrochez-vous aux murs et franchissez les espaces pour voir jusqu\'où vous pouvez atteindre avant de redescendre la montagne.', 'https://i.postimg.cc/mgFb731m/bread-fred.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2299, 0),
(2301, 'LEGO MARVEL Super Heroes', 'LEGO® Marvel™ Super Heroes propose une histoire originale à travers l’univers Marvel tout entier. Les joueurs peuvent incarner Iron Man, Spider-Man, Hulk, Captain America, Wolverine et bien d’autres personnages Marvel, unis pour empêcher Loki et une horde d’autres super-vilains Marvel de créer une arme surpuissante capable de détruire le monde.', 'https://i.postimg.cc/7PgYWnKd/lego-marvel-super-heroes.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2300, 0),
(2302, 'Lords of the fallen', 'Un vaste monde vous attend dans Lords of the Fallen, un action-RPG de dark fantasy totalement inédit. Dans la peau d\'un des mythiques Noirs-Croisés, partez pour une quête épique qui vous opposera à Adyr, le dieu démon.', 'https://cfinder.xyz/uploads/LordsOfFallenOnline.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2301, 0),
(2303, 'Star Wars Battlefront II', 'Devenez le héros ultime des batailles Star Wars™ de vos rêves avec Star Wars™ Battlefront™ II: Édition Célébration ! Téléchargez Star WarsBattlefront II ainsi que la totalité des contenus de personnalisation disponibles dans la boutique en jeu dès son lancement, y compris les éléments inspirés de Star Wars™: L\'ASCENSION DE SKYWALKER™*.\r\n\r\n', 'https://i.postimg.cc/fyfFjpWc/starwarsbattlefrontii.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2302, 0),
(2304, 'Dishonored', 'Dishonored est un jeu d\'action immersif à la première personne dans lequel vous incarnez un assassin surnaturel animé par la vengeance. Grâce au système de combat flexible de Dishonored, éliminez vos cibles de manière créative en combinant les capacités surnaturelles, les armes et les gadgets inhabituels à votre disposition.\r\n\r\n', 'https://i.postimg.cc/XYbqvymt/EGS-Dishonored-Definitive-Edition.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2303, 0),
(2305, 'LEGO MARVEL Super Heroes 2 + Online', 'Incarnez les Gardiens de la Galaxie, Spider-Man, Thor, Hulk, La Panthère Noire, Captain Marvel, Dr Strange, Le Bouffon Vert et plusieurs dizaines de super-héros et super-vilains Marvel dans la bataille cosmique au sein de la ville futuriste de Chronopolis. Explorez des environnements variés, de l\'Égypte antique au Grand Ouest, en passant par Sakaar ou encore New York City en 2099, et transportez des objets et des personnages à travers les siècles.', 'https://i.postimg.cc/9FWx240Q/Lego-Marvel-Super-Heroes2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2304, 0),
(2306, 'The Dark Pictures Anthology House of Ashes', 'À la fin de la guerre d\'Irak, les Forces spéciales, à la recherche d\'armes de destruction massive, trouvent quelque chose de bien plus dangereux : un temple sumérien enfoui, où nichent des créatures. Pour survivre à cette nuit sous terre, ils doivent s\'allier avec leurs ennemis à la surface.', 'https://i.ibb.co/VVPMwyB/The-Dark-Pictures-Anthology-House-of-Ashes.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2305, 0),
(2307, 'One Piece Pirate Warriors 4 + Online', 'ONE PIECE : PIRATE WARRIORS 4 est le tout dernier opus des jeux d\'action PIRATE WARRIORS ! Plongez dans l\'univers de ONE PIECE, au cœur d\'un champ de bataille où les bâtiments s\'effondrent sous les attaques, dans des nuages de fumée et de poussière !', 'https://cfinder.xyz/uploads/OnePiecePirateWarriors4Online.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2306, 0),
(2308, 'Assetto Corsa', 'Assetto Corsa est un jeu vidéo de simulation de course automobile développé par Kunos Simulazioni, sorti sur Microsoft Windows le 19 décembre 2014 et sorti sur PlayStation 4 et Xbox One pour le 26 août 2016 en Europe', 'https://i.postimg.cc/CMCJ3r6T/assetto-corsa.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2307, 0),
(2309, 'The Texas Chain Saw Massacre', 'Dans The Texas Chain Saw Massacre, un jeu d\'horreur asymétrique à la troisième personne inspiré du film d\'horreur mythique et révolutionnaire de 1974, incarnez l\'un des célèbres membres de la Famille du Massacre ou l\'une de leurs victimes.', 'https://i.postimg.cc/BZgqzMqX/The-Texas-Chain-Saw-Massacre.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2308, 0),
(2310, 'Cities Skylines II', 'Bâtissez une ville et transformez-la en une métropole prospère grâce à un jeu de construction urbaine sans précédent. Utilisez votre créativité pour bâtir un monde sans limites et résoudre des problèmes dans une simulation profonde avec une économie vivante.', 'https://i.postimg.cc/g0KqfCrx/CITIES-SKYLINESII.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2309, 0),
(2311, 'Call of Duty Black Ops Cold War', 'Black Ops Cold War, la suite directe de Call of Duty®: Black Ops, va plonger les fans dans la guerre politique la plus étrange qui soit, au tout début des années 80.', 'https://i.postimg.cc/NMG2K9FG/call-of-duty-black-ops-cold-war-principal.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2310, 0),
(2312, 'Assassin\'s Creed Origins', 'Assassin\'s Creed® Origins, qui se déroule dans la mystérieuse Égypte ancienne, constitue un nouveau commencement. Découvrez une nouvelle façon de vous battre tout en explorant les grandes pyramides et les tombeaux cachés de l\'Égypte ancienne, rencontrez de nombreux personnages aux histoires mémorables au cours de votre périple, et découvrez l\'histoire des origines de la Confrérie des Assassins.', 'https://i.postimg.cc/NjDG2BFs/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2311, 0),
(2313, 'Geometry Dash', 'Geometry Dash est un jeu en défilement horizontal dans lequel le joueur dirige une icône qui glisse sur le sol et qui doit sauter pour éviter divers obstacles tels que des blocs, des pics, des scies circulaires, des monstres, des boules de feu et des rayons électriques, le plus souvent en rythme avec la musique utilisée dans le niveau. Le sens de déplacement est par défaut de la gauche vers la droite, et la gravité par défaut vers le bas. Les niveaux et phases de jeu sont graduellement de plus en plus difficiles.', 'https://i.postimg.cc/sfMzf55g/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2312, 0),
(2314, 'MICROSOFT FLIGHT SIMULATOR', 'Prenez de la hauteur et découvrez le plaisir de voler dans la nouvelle génération de Microsoft Flight Simulator. Le monde est à votre portée.Des avions légers aux gros-porteurs, pilotez des avions très détaillés et précis dans la nouvelle génération de Microsoft Flight Simulator. Testez vos compétences de pilotage dans des défis de vol de nuit, de simulation atmosphérique et de météo en temps réel dans un monde dynamique et vivant. Créez votre plan de vol et volez n\'importe où sur la planète. Le monde est à votre portée.', 'https://cfinder.xyz/uploads/MICROSOFTFLIGHTSIMULATOR.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2313, 0),
(2315, 'Move or Die', 'Move or Die est un party game complètement nerveux opposant 4 joueurs — en réseau ou sur le même ordinateur, et dont les règles changent toutes les 20 secondes. Le jeu parfait pour ruiner des amitiés !', 'https://i.postimg.cc/C1SD4v7S/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2314, 0),
(2316, 'NIER AUTOMATA', 'Nier Automata est un jeu d\'action de type RPG jouable en solo. Le titre amène le joueur dans un futur lointain où la Terre a été envahie par des formes extra-terrestres armées de \"bio-machines\". Après s\'être réfugiée sur la lune, l\'humanité envoie sur leur planète natale des androïdes capable de lutter avec les extra-terrestres et reconquérir la planète.', 'https://i.postimg.cc/HxVvTkGr/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2315, 0),
(2317, 'Tom Clancy’s Rainbow Six: Siege', 'Tom Clancy\'s Rainbow Six® Siege est un jeu de tir tactique réaliste qui se joue en équipe, où vous devrez allier talent et stratégie. Entre phases d\'attaque et de défense en 5c5, préparez-vous à des combats rapprochés intenses.', 'https://i.postimg.cc/ZnXcb88g/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2316, 0),
(2318, 'Satisfactory', 'Satisfactory est un jeu de construction d’usines en vue à la première personne dans un monde ouvert avec une touche d’exploration et de combats. Jouez seul ou entre amis, explorez une planète inconnue, construisez des usines à plusieurs niveaux et des tapis roulants à l’infini !', 'https://cfinder.xyz/uploads/Satisfactory.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', NULL, 2317, 0),
(2319, 'Vintage Story', 'Vintage Story est un jeu de survie sandbox développé et édité par Anego Studios. Les fondateurs d\'Anego Studios, Tyron et Irena Madlener, ont commencé le développement d\'une version autonome d\'un ancien mod pour Minecraft appelé Vintagecraft.', 'https://i.postimg.cc/YS5x7qbq/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2318, 0),
(2320, 'Just Cause 3', 'Découvrez plus de 1 000 km² de liberté totale, du ciel aux profondeurs de l\'océan : Rico Rodriguez est de retour et s\'apprête à semer le chaos des façons les plus imaginatives et explosives qui soient.', 'https://i.postimg.cc/VLpDYR7F/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 1, 2319, 0),
(2321, 'Payday 2', 'PAYDAY 2 est un jeu de tir coopératif bourré d\'action qui permet jusqu\'à quatre joueurs d\'incarner une fois de plus les braqueurs originaux du célèbre gang PAYDAY, Dallas, Hoxton, Wolf et Chains, qui débarquent à Washington DC pour une série de crimes épiques.', 'https://i.postimg.cc/qBnfVNBS/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:08', '2025-09-09 15:30:13', 2, 2320, 0),
(2322, 'Kovaak\'s', 'Le meilleur entraîneur de visée au monde, auquel font confiance les meilleurs pros, les streamers et les joueurs comme vous. Améliorez vos compétences en FPS avec plus de 21 000 scénarios créés par les joueurs, un éditeur de cartes en jeu, une personnalisation infinie, une physique de jeu clonée, des listes de lecture partageables, et bien plus encore. Devenez un aimbot humain !', 'https://i.postimg.cc/W4Qp2xB7/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2321, 0),
(2323, 'Nier Replicant', 'Ce jeu d\'action au rythme effrénné vous plonge dans un futur post-apocalyptique où la technologie a perdu tous ses droits. L’intrigue se déroule des milliers d\'années après notre ère et fait suite à « l\'incident du 12 juin 2003 », mis en scène dans la Fin E du premier Drakengard. L’humanité vit dorénavant de façon rudimentaire, dans une époque à l\'apparence moyenâgeuse. Cette dernière peine à faire face aux affres et maux du monde dans lequel elle dépérit, à savoir : une étrange maladie et des Ombres, des créatures qui sèment le chaos en se rapprochant des derniers abris de l’humanité.', 'https://i.postimg.cc/y8QTxTYd/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2322, 0),
(2324, 'Forza Horizon 3', 'Vous êtes responsable du festival Horizon. Personnalisez tout dans les moindres détails, recrutez et licenciez vos amis et explorez l\'Australie à bord de plus de 350 voitures figurant parmi les meilleures au monde. À vous de faire de votre Horizon le plus grand des festivals de voitures et de musique afin de célébrer votre passion de la route, quelle que soit la voie que vous emprunterez.', 'https://i.postimg.cc/przjBfHD/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2323, 0),
(2325, 'Grand Theft Auto IV ', 'Niko Bellic, Johnny Klebitz et Luis Lopez ont une chose en commun : ils vivent dans la ville la plus terrible d\'Amérique. Liberty City est une ville où l\'argent et le statut social règnent en maîtres. Un paradis pour ceux qui ont tout, un enfer pour les autres.', 'https://i.postimg.cc/Y9DDw3cQ/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2324, 0),
(2326, 'Evil West', 'Une sombre menace consume l’Ouest Américain. En solo ou en coop, chassez et éradiquez avec style des monstruosités assoiffées de sang. Éliminez les hordes démoniaques grâce à votre gantelet électrique et devenez le chasseur de monstres ultime !', 'https://i.postimg.cc/sX45RftS/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2325, 0),
(2327, 'Totally Accurate Battle Simulator', 'Dirigez des personnages flageolants bleus et rouges venant de terres anciennes, de lieux effrayants et de mondes fantastiques. Admirez-les se battre dans des simulations où la physique est totalement bancale.\r\n', 'https://i.postimg.cc/rmKfVrNW/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2326, 0),
(2328, 'Crosshair X', 'Superposez des réticules personnalisés sur chaque jeu que vous jouez. Choisissez parmi des milliers de réticules uniques créés par la communauté de Crosshair X ou concevez les vôtres à l\'aide du designer.\r\n', 'https://i.postimg.cc/HkCWm31h/Crosshair-X.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2327, 0),
(2329, 'Assassins Creed Brotherhood', 'Incarnez Ezio, un Maître Assassin légendaire, dans sa lutte contre le puissant ordre des Templiers.', 'https://i.postimg.cc/HsWGp582/Assassins-Creed-Brotherhood.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2328, 0),
(2330, 'Ghostrunner 2', 'Le sang va couler dans Ghostrunner 2, un jeu d\'action FPP hardcore se déroulant dans un monde futuriste cyberpunk. Devenez le cyberninja ultime et participez à des combats de boss épiques. Découvrez de nouveaux modes de jeu et une bande-son synthwave captivante.', 'https://i.postimg.cc/x1mjDMzd/ghostrunner-2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2329, 0),
(2331, 'The Last Hero of Nostalgaia', 'Nostalgaia, le monde des jeux vidéo, est en train de s\'effondrer dans une mystérieuse pixellisation, où chaque particule de haute fidélité se perd. Le néant semble attendre même nos souvenirs de jeu les plus chers. Alors que la lumière même commence à s\'affaiblir, que le nombre d\'images par seconde diminue et que le monde est au bord de l\'extinction, un espoir émerge.', 'https://i.postimg.cc/yxkbZhh4/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2330, 0),
(2332, 'Monster Hunter Stories 2', 'Notre aventure commence quand les Rathalos du monde entier disparaissent subitement. Vous rencontrez alors une jeune wyvérienne qui a connu votre illustre grand-père, Red. Elle est en possession d\'un œuf au contenu mystérieux. Tandis que plane l\'ombre de la fascinante légende des Ailes de la destruction, le destin du monde pourrait bien se jouer...', 'https://i.postimg.cc/ThMC5VNw/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2331, 0),
(2333, 'Assassin\'s Creed Odyssey', 'Embarquez pour un voyage épique qui vous emmènera de vos humbles débuts en tant que mercenaire spartiate banni à un héros grec légendaire et découvrez la vérité sur votre passé mystérieux en tant qu\'Alexios ou Kassandra. Naviguez jusqu\'aux confins de la mer Égée, formez des alliances et faites-vous des ennemis. En cours de route, vous rencontrerez des personnages historiques, des personnages mythiques et toute une série d\'autres qui auront un impact sur votre voyage.', 'https://i.postimg.cc/bJ90rXcZ/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2332, 0),
(2334, 'BIOMUTANT', 'Une épidémie sème la mort et l\'Arbre-de-Vie dépérit. Les tribus sont divisées. Explorez un monde en plein chaos et déterminez son avenir : serez-vous un sauveur ou le plongerez-vous vers un destin plus sombre encore ?', 'https://i.postimg.cc/X7WQc87K/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2333, 0),
(2335, 'Assassins Creed II', 'Jeu d\'action-aventure en monde ouvert, Assassin\'s Creed II prend place durant la Renaissance italienne. Le joueur incarne Ezio Auditore da Firenze, jeune noble italien de 17 ans, qui perd sa famille, assassinée sous ses yeux. Obnubilé par sa soif de vengeance, sa quête le ménera sur les traces des Templiers, en passant par de nombreuses villes emblématiques d\'Italie dont Venise et Florence.', 'https://i.postimg.cc/hhFFp7vz/ac2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2334, 0),
(2336, 'WATCH DOGS 2 GOLD EDITION', 'Incarnez Marcus Holloway, un jeune hacker surdoué vivant dans le berceau de la révolution technologique, la baie de San Francisco. Rejoignez le groupe de hackers DedSec et réalisez avec leur aide le plus gros hack de l’histoire : neutraliser définitivement le ctOS 2.0, un système de gestion informatisé utilisé par des criminels pour manipuler les comportements humains à grande échelle.', 'https://i.postimg.cc/BQ2tsZJB/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2335, 0),
(2337, 'SCP 5K + Online', 'SCP : 5K est un projet de jeu de tir d\'horreur tactique coopératif qui place les joueurs au milieu d\'une histoire inspirée de SCP-5000 de Tanhony. Alors que nous travaillons au développement du jeu et de l\'histoire, nous l\'avons publié en accès anticipé afin que les joueurs puissent découvrir le jeu à mesure qu\'il évolue.', 'https://i.postimg.cc/K8zbXR1W/SCP-5K.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2336, 0),
(2338, 'Doom', 'Les démons sont arrivés et tous les marines sont morts... sauf un. Vous êtes la dernière ligne de défense contre l\'Enfer.', 'https://i.postimg.cc/cJZmz8kq/Doom.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2337, 0),
(2339, 'My Dream Setup', 'My Dream Setup est un jeu de simulation qui consiste à construire la pièce dont vous avez toujours rêvé. Un large éventail de meubles, d\'ordinateurs et de leurs accessoires, de posters, de plantes et d\'autres détails d\'intérieur vous attendent. Essayez-les tous et créez l\'installation de vos rêves.', 'https://i.postimg.cc/FsykBCMR/My-Dream-Setup.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2338, 0),
(2340, 'Pumping Simulator 2', 'Un jeu de gestion de station-service. Commencez par vendre une voiture pour collecter des fonds et investir dans un terrain abandonné. Construisez, agrandissez, personnalisez et améliorez votre station-service, diversifiez les services. Et peut-être deviendrez-vous riche.', 'https://i.postimg.cc/Yq6tH525/Pumping-Simulator-2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2339, 0),
(2341, 'The Stanley Parable', 'The Stanley Parable est un jeu d\'exploration à la première personne. Vous jouerez en tant que Stanley, et vous ne jouerez pas en tant que Stanley. Vous suivrez une histoire, vous ne suivrez pas une histoire. Vous aurez le choix, vous n\'aurez pas le choix. Le jeu se terminera, le jeu ne finira jamais.', 'https://i.postimg.cc/3xygkxs4/The-Stanley-Parable.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2340, 0),
(2342, 'NARUTO X BORUTO Ultimate Ninja STORM CONNECTIONS + Online', 'Les ninjas légendaires se rassemblent dans le nouvel opus survolté de la série des STORM ! NARUTO X BORUTO Ultimate Ninja STORM CONNECTIONS est un jeu d\'action/combat proposant des combats de ninjas frénétiques et deux modes histoire différents.', 'https://cfinder.xyz/uploads/NARUTOXBORUTOUltimateNinjaSTORMCONNECTIONSOnline.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2341, 0),
(2343, 'The Binding of Isaac Rebirth', 'The Binding of Isaac: Rebirth est un jeu de tir action-RPG généré aléatoirement avec de lourds éléments de type Rogue. En suivant Isaac dans son voyage, les joueurs trouveront des trésors étranges qui changeront la forme d\'Isaac, lui donnant des capacités surhumaines et lui permettant de combattre des hordes de créatures mystérieuses et de découvrir des secrets.', 'https://i.postimg.cc/k41f8pgf/The-Binding-Of-Isaac-Rebirth.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2342, 0),
(2344, 'Wondershare Repairit', 'Ce programme est une réparation fiable bien faite. Réparez les formats de fichiers MOV, MP4, M4V, M2TS, MKV, MTS, 3GP, AVI et FLV corrompus et endommagés. Il répare les vidéos corrompues pendant le tournage, lors du transfert de fichiers, lors de l\'édition, de la conversion ou du traitement.', 'https://i.postimg.cc/DfN26fWP/wondershare-repairit.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2343, 0),
(2345, 'TOKYO GHOULre CALL to EXIST + Online', 'Ça manque peut-être de style, mais... Restez en vie.Mangez ou soyez mangés. TOKYO GHOUL:re [CALL to EXIST] est un jeu d\'action et survie en coopération qui vous emmène dans le monde excitant de Tokyo Ghoul et Tokyo Ghoul:re.', 'https://i.postimg.cc/5N5wvry1/Tokyo-Ghoul-re-Call-to-Exist.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2344, 0),
(2346, 'The Dark Pictures Anthology Man of Medan', 'L\'anthologie The Dark Pictures est une série de jeux d\'horreur autonomes à embranchements, également jouables en ligne avec un ami. Dans Man of Medan, cinq amis partent plonger en mer. Mais leurs vacances se transforment bientôt en cauchemar.', 'https://i.ibb.co/NjnM1Pb/The-Dark-Pictures-Anthology-Man-of-Medan.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2345, 0),
(2347, 'Cult of the Lamb', 'Montez votre propre culte dans un pays de faux prophètes, parcourez des régions étonnantes et mystérieuses pour faire croître une communauté d\'adeptes fidèles dans les bois et répandez la bonne parole pour devenir le seul culte véritable.', 'https://i.postimg.cc/j2mdnMbf/Cult-Of-The-Lamb.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2346, 0),
(2348, 'Worldbox', 'WorldBox est le jeu sandbox ULTIME de simulateur de Dieu. Créez votre propre monde ou détruisez-le en utilisant différents pouvoirs. Regardez les civilisations se développer et conquérir le monde. Guerre, paix, désastres… C\'est à vous de choisir entre aider les peuples ou les regarder se battre.', 'https://i.postimg.cc/W3qGJHRm/worldbox.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2347, 0),
(2349, 'Transport Fever 2', 'La famille des classiques du jeu de simulation de transport s\'agrandit avec Transport Fever 2. Découvrez un monde nouveau en parcourant des voies de transports terrestres, maritimes et aériennes. Que le progrès et la prospérité trouvent leur voie !', 'https://i.postimg.cc/05CZshCF/Transport-Fever-2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2348, 0),
(2350, 'Adobe media encoder', 'Ingérez, transcodez, créez des proxys et exportez dans presque tous les formats imaginables. Automatisez vos flux de travail avec des préréglages, des dossiers de surveillance et la publication de destination. Utilisez Time Tuner pour ajuster la durée de manière invisible et appliquer des corrections de LUT et de volume sans avoir à rouvrir les projets. L\'intégration étroite avec Adobe Premiere Pro, After Effects et d\'autres applications offre un flux de travail transparent.', 'https://i.postimg.cc/hvmdfRqT/Media-Encoder.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2349, 0),
(2351, 'The Dark Pictures Anthology Little Hope', 'L\'anthologie The Dark Pictures est une série de jeux d\'horreur autonomes à embranchements, également jouables en ligne avec un ami. Dans Man of Medan, cinq amis partent plonger en mer. Mais leurs vacances se transforment bientôt en cauchemar.', 'https://cfinder.xyz/uploads/TheDarkPicturesAnthologyLittleHope.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2350, 0),
(2352, 'Haven + Online', 'Seuls sur une planète isolée, deux amants ont tout quitté pour être ensemble. Glissez à travers de mystérieux paysages, explorez la planète morcelée et combattez ceux qui cherchent à vous séparer dans ce RPG sur l\'amour, la rébellion et la liberté.', 'https://i.postimg.cc/cCxW2Q4j/Haven.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2351, 0),
(2353, 'Choo-Choo Charles', 'Parcourez une île en monde ouvert à bord d\'un vieux train, améliorez-le, puis utilisez-le pour combattre un train-araignée maléfique du nom de Charles.', 'https://cdn1.epicgames.com/spt-assets/ce12d040c108495c89ccc6b2e8ebe3c4/choochoo-charles-77gm0.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2352, 0),
(2354, 'Esport Life Tycoon', 'Gérez votre propre équipe d\'esports jeu et battez des équipes légendaires pour devenir la meilleure équipe du monde !', 'https://i.postimg.cc/zBvpc6Sg/Esports-Life-Tycoon.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2353, 0),
(2355, 'LEGO Star Wars The Skywalker Saga', 'Jouez aux neuf films de la saga Star Wars dans un jeu vidéo LEGO unique en son genre. Avec plus de 300 personnages jouables, plus de 100 véhicules et 23 planètes à explorer, jamais une galaxie lointaine, très lointaine n\'aura été aussi amusante ! Comprend le personnage classique Obi-Wan Kenobi', 'https://cdn-ext.fanatical.com/production/product/1280x720/7d733c79-5bcd-4461-af28-3e1c5594a2d0.jpeg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2354, 0),
(2356, 'Dragon Ball FighterZ', 'DRAGON BALL FighterZ contient tout ce qui a fait de DRAGON BALL une série célèbre et adulée : des combats spectaculaires et des combattants surpuissants. ', 'https://i.ibb.co/0mqfmDZ/dragon-ball-fighterz-pc-jeu-steam-cover.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 2, 2355, 0),
(2357, 'Marvels Spider Man Miles Morales', 'Après les événements de Marvel’s Spider-Man Remastered, le jeune Miles Morales prend ses marques dans son nouveau foyer en marchant dans les pas de son mentor, Peter Parker, en tant que nouveau Spider-Man. Mais quand une lutte de pouvoir menace de détruire sa ville, le héros en devenir se rend compte qu\'un grand pouvoir implique de grandes responsabilités. ', '/storage/game_banners/marvels-spider-man-miles-morales-0af92f1f4b.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', NULL, 2356, 0),
(2358, 'The Elder Scrolls V Skyrim', 'L\'Empire de Tamriel va bientôt sombrer. Le Haut-Roi de Bordeciel a été assassiné. Les alliances se forment selon les prétendants au trône. Ce conflit a malheureusement réveillé un mal bien plus grand et plus dangereux. Les Dragons, depuis longtemps oubliés des Elder Scrolls, reviennent à Tamriel. ', 'https://fs-prod-cdn.nintendo-europe.com/media/images/10_share_images/games_15/nintendo_switch_4/H2x1_NSwitch_TheElderScrollsVSkyrim_image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2357, 0),
(2359, 'Far Cry 6', 'Far Cry 6 est un FPS qui se déroule sur l\'île tropicale fictive de Yara. Vous incarnez Dani Rojas, un membre de la guérilla locale qui lutte contre le régime oppressif du dictateur du pays, Anton Castillo, qui prépare son fils à prendre sa suite. Pour vous aider dans votre combat, vous pouvez compter sur vos alliés les Amigos et fabriquer vos propres armes et véhicules.', 'https://cdn1.epicgames.com/b4565296c22549e4830c13bc7506642d/offer/TETRA_PREORDER_STANDARD%20EDITION_EPIC_Store_Landscape_2560x1440-2560x1440-827a9d1823ad230a0ea5a2efc7936370.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2358, 0),
(2360, 'Dark Souls 2', 'Dans DARK SOULS™ II, la difficulté et les innovations désormais marque de fabrique de la franchise sont de retour, à la fois en solo et en multijoueur. Prenez part à ce sombre périple, affrontez de redoutables ennemis, bravez tous les dangers, et relevez les innombrables défis dont FROM SOFTWARE a le secret.', 'https://cdn-ext.fanatical.com/production/product/1280x720/747024b8-8413-49bd-8993-468170322b08.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2359, 0),
(2361, 'VTOL VR', 'VTOL VR est un jeu de vol de combat quasi futuriste conçu pour la réalité virtuelle. Pilotez des jets multi-rôles avancés, en utilisant vos mains pour actionner les interrupteurs, appuyer sur les boutons et manipuler les commandes de vol virtuelles.', 'https://cdn.akamai.steamstatic.com/steam/apps/667970/header.jpg?t=1703226033', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:09', '2025-09-09 15:30:13', 1, 2360, 0),
(2362, 'ONE PIECE World Seeker', 'Oubliez votre boussole et rejoignez Luffy dans une nouvelle aventure, où vous pourrez exploiter les pouvoirs du fruit du Gum Gum pour percer des secrets bien gardés sur une île totalement inédite ! Mettez les voiles !', 'https://cdn.cloudflare.steamstatic.com/steam/apps/755500/capsule_616x353.jpg?t=1701311545', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 1, 2361, 0),
(2363, 'Dying Light', 'Jeu d\'action-survie en vue subjective dans un open-world post-apocalyptique grouillant de zombies dévoreurs de chair. Explorez une ville dévastée par un mystérieux virus. Cherchez des ravitaillements, fabriquez des armes et affrontez les hordes d\'infectés.', 'https://cdn.akamai.steamstatic.com/steam/apps/239140/capsule_616x353.jpg?t=1696608765', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2362, 0),
(2364, 'Assetto Corsa Competizione', 'Assetto Corsa Competizione est le nouveau jeu vidéo officiel des Blancpain GT Series. Grâce à son extraordinaire qualité de simulation, le jeu vous permettra de découvrir la véritable atmosphère du Championnat FIA GT3 homologué avec les pilotes, les équipes, les voitures et les circuits officiels.', 'https://cdn.akamai.steamstatic.com/steam/apps/805550/header.jpg?t=1694451935', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 1, 2363, 0),
(2365, 'Sekiro', 'Dans Sekiro™: Shadows Die Twice, vous incarnez le \'loup à un bras\', un guerrier en disgrâce défiguré qui a frôle la mort. Assigné à la protection d\'un jeune seigneur, descendant d\'une lignée ancienne, vous devenez la cible d\'ennemis plus vicieux les uns que les autres, dont le dangereux clan Ashina.', 'https://www.tapestry.co.uk/wp-content/uploads/2019/06/reprographis_Sekiro_Activision_artwork.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2364, 0),
(2366, 'Psychonauts', 'Une odyssée psychique au travers des esprits des asociaux, des monstres et fous. Ce jeu de plateformes classique d\'action-aventure, issu des développeurs reconnus de Double Fine Productions, suit l\'histoire d\'un jeune psychique nommé Razputin.', 'https://cdn.akamai.steamstatic.com/steam/apps/3830/header.jpg?t=1700230487', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2365, 0),
(2367, 'Assassins Creed Valhalla', 'Incarnez Eivor, Viking dont l\'éducation a reposé sur le combat, et menez votre clan des terres désolées et glacées de Norvège à celles verdoyantes de l’Angleterre du IXe siècle. Fondez-y la colonie de votre peuple et partez à la conquête de territoires hostiles afin de gagner votre place au Valhalla. À l\'époque des Vikings, l\'Angleterre n\'est que petits domaines et royaumes guerroyant sans cesse. Mais elle offre des terres riches qui n\'attendent que d\'être conquises et unifiées. Y parviendrez-vous ?', 'https://i.postimg.cc/4Ntv25G3/assassin-s-creed-valhalla-complete-edition-complete-edition-pc-spel-ubisoft-connect-europe-cover.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2366, 0),
(2368, 'Galactic Civilizations IV', 'Vous commencez le jeu sur votre planète natale et devez partir à la recherche de nouvelles technologies, explorer la galaxie et coloniser de nouveaux mondes tout en vous assurant que votre peuple est heureux. Vous devrez également gérer les échanges, la diplomatie, organiser des complots et parfois partir en guerre avec d\'autres civilisations extraterrestres.', 'https://i.postimg.cc/2S2ckwKx/stray-key-art.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2367, 0),
(2369, 'Stray', 'Perdu, seul et séparé de sa famille, un chat errant doit démêler un ancien mystère pour s\'échapper d\'une cybercité oubliée depuis longtemps et retrouver le chemin du retour.', 'https://i.postimg.cc/8zJDM7gM/stray-key-art.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2368, 0),
(2370, 'Cyberpunk 2077', 'Roulez et combattez dans une Amérique post-pandémique mortelle. Incarnez Deacon St. John, un vagabond et chasseur de primes qui parcourt la route défoncée, se battant pour survivre tout en cherchant une raison de vivre dans ce jeu d\'action-aventure en monde ouvert.', 'https://i.postimg.cc/GmS8hn3m/planet-centuri.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2369, 0),
(2371, 'Red Dead Redemption 2', 'Suite du précédent volet multi récompensé, Red Dead Redemption II nous permet de nous replonger sur PS4 dans une ambiance western synonyme de vastes espaces sauvages et de villes malfamées. L\'histoire se déroule en 1899, avant le premier Red Dead Redemption, au moment où Arthur Morgan doit fuir avec sa bande à la suite d\'un braquage raté.', 'https://i.postimg.cc/26WzDPyM/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2370, 0),
(2372, 'Tom Clancys Ghost Recon Registered Wildlands', 'Tom Clancy\'s Ghost Recon Wildlands est un jeu vidéo de tir tactique en monde ouvert développé par Ubisoft Paris et édité par Ubisoft, sorti le 7 mars 2017 sur Microsoft Windows, PlayStation 4 et Xbox One', 'https://i.postimg.cc/c4mQQzhQ/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2371, 0),
(2373, 'Celeste', 'Aidez Madeline à survivre à ses démons intérieurs au mont Celeste, dans ce jeu de plateformes ultra relevé fait à la main, réalisé par les créateurs du classique TowerFall.', 'https://i.postimg.cc/5tXS3mKn/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2372, 0),
(2374, 'Wallpaper Engine', 'Utilisez d\'incroyables fonds d\'écran animés sur votre bureau Windows. Animez vos propres images pour créer de nouveaux fonds d\'écran ou importez des vidéos et des sites Internet afin de les partager avec d\'autres utilisateurs !', 'https://i.postimg.cc/DZ3p4sjm/Phasmophobia.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2373, 0),
(2375, 'Horizon Zero Dawn', 'Suivez la quête légendaire d\'Aloy et dévoilez les mystères d\'un monde dominé par de redoutables machines. Rejetée par sa tribu, elle se bat pour découvrir son passé et son destin, et stopper une catastrophe. Faites des attaques tactiques contre des machines et des tribus rivales, et explorez un monde rempli de bêtes sauvages et de dangers.', 'https://i.postimg.cc/nr9qZwxW/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2374, 0),
(2376, 'Dying Light 2 Stay Human', 'Il y a plus de vingt ans à Harran, nous avons affronté le virus... et perdu. Aujourd\'hui, la défaite nous guette à nouveau. La ville, l\'un des derniers grands refuges humains, est déchirée par les conflits. La civilisation est revenue au Moyen Âge. Pourtant, un espoir demeure.', 'https://i.postimg.cc/d1JnNPtM/Mario-Golf-Super-Rush.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2375, 0),
(2377, 'Subnautica Below Zero', 'Below Zero est une aventure sous-marine qui se déroule dans un monde océanique extraterrestre. Il constitue un nouveau chapitre de l’univers Subnautica développé par Unknown Worlds. Cette aventure inédite vous plongera dans une région de la planète 4546B où règne un froid glacial. Armée de vos neurones et d’un matériel de survie rudimentaire au début de votre voyage, vous êtes bien décidée à découvrir ce qui est arrivé à votre sœur...', 'https://i.postimg.cc/zXfLYQzX/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2376, 0),
(2378, 'Little Nightmares II', 'Redécouvrez un monde aussi charmant que terrifiant dans Little Nightmares II, un jeu d\'aventure plein de suspens dans lequel vous incarnez Mono, un petit garçon pris au piège dans un monde dénaturé par le bourdonnement d\'une transmission émanant d\'une tour lointaine.', 'https://i.postimg.cc/2y8s3hyh/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2377, 0),
(2379, 'Planet Zoo', 'Avec Planet Zoo, construisez un monde idéal pour nos amis les bêtes ! Les développeurs de Planet Coaster et de Zoo Tycoon vous proposent la simulation de zoo ultime ! Bâtissez des habitats, gérez votre parc zoologique et prenez soin des animaux intelligents et sensibles qui exploreront l\'univers que vous leur avez créé. La campagne vous emmènera aux quatre coins de la planète, tandis que le mode Bac à sable vous permettra de donner libre cours à votre imagination. Créez des habitats uniques et façonnez d\'immenses paysages, prenez des décisions cruciales, faites des choix importants, et veillez au bien-être de vos animaux tout en construisant et en gérant les zoos les plus exceptionnels au monde.', 'https://i.postimg.cc/fRFqfYPM/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2378, 0),
(2380, 'Elden Ring + Shadow of the Erdtree', 'Un monde immense aux environnements riches et variés, parsemé d\'obscurs et tortueux donjons tous reliés naturellement entre eux, vous assistez. Au fil de votre exploration, goûtez à l\'inconnu, bravez les menaces permanentes et accomplissez votre destinée.', 'https://i.ytimg.com/vi/qLZenOn7WUo/maxresdefault.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2379, 0),
(2381, 'Minecraft Story Mode', 'Minecraft: Story Mode se déroule dans une interprétation du monde de Minecraft, connu sous le nom de \"Overworld\", où le jeu est l\'étendue de l\'univers des personnages, et les personnages ignorent qu\'ils sont dans un jeu. Le personnage principal, Jesse, est un résident inexpérimenté dudit univers qui part en voyage avec ses amis dans le monde de Minecraft pour trouver l\'Ordre de la Pierre (Gabriel le Guerrier, Ellegaard l\'Ingénieur Redstone, Magnus le Voleur, Soren le Architect et Ivor le brasseur de potions et l\'enchanteur), cinq aventuriers légendaires qui ont sauvé le monde de Minecraft. Le jeu comprend des paramètres normalement difficiles d\'accès depuis Minecraft, notamment le Nether et l\'End.', 'https://i.postimg.cc/bJHsRH3M/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2380, 0),
(2382, 'Monster Hunter World Iceborne', 'Avec Monster Hunter World: Iceborne , les aventures de Monster Hunter: World atteignent des sommets glacés et inégalés. Fort de ses nouveaux monstres, environnements, quêtes, combos d\'armes et bien plus encore, Iceborne repousse les limites du gigantesque et phénoménal univers de Monster Hunter: World.', 'https://i.postimg.cc/ncYP63SN/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2381, 0),
(2383, 'Just Cause 4', 'Plongez dans un monde ouvert bourré d\'action et semez le chaos avec une grande variété d\'armes, de véhicules et d\'équipement. Enfilez votre wingsuit, équipez-vous de votre grappin entièrement personnalisable et préparez-vous à déchaîner les éléments !', 'https://i.postimg.cc/G2ZT09BS/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2382, 0),
(2384, 'No Man\'s Sky', 'Dans No Man\'s Sky, chaque étoile est la lumière d\'un soleil lointain, en orbite duquel se trouvent des planètes pleines de vie. Et vous pouvez aller où vous voulez. Volez sans interruption de l\'espace à la surface des planètes, sans écran de chargement ni limite. Dans cet univers infini généré de manière dynamique, vous découvrirez des lieux et des créatures qu\'aucun autre joueur n\'a jamais vus... et qui n\'existeront peut-être jamais ailleurs.', 'https://cfinder.xyz/uploads/NoMansSky.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2383, 0),
(2385, 'F1 22', 'F1 2022 est une simulation automobile développée par Codemasters et labellisée EA Sports. Comme le veut la tradition, il s\'agit d\'un jeu sous franchise Formula One officielle, permettant cette fois-ci de s\'immiscer dans la compétition avec les nouvelles règles du championnat, de nouvelles voitures hybrides et un week-end de course entièrement repensé.', 'https://i.postimg.cc/cHs9YVG8/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2384, 0),
(2386, 'Orange cast', 'Vous êtes l\'un des meilleurs soldats des forces spéciales spatiales. Un guerrier et un protecteur de l\'humanité. Embarquez pour une aventure héroïque et dangereuse parmi les étoiles. Explorez les planètes, défendez les colonies et soyez le premier à rencontrer l\'inconnu aux confins éloignés de notre galaxie!', 'https://i.postimg.cc/MK93y8gr/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2385, 0),
(2387, 'Dark Souls 3', 'Alors que les flammes vacillantes de votre feu de camp révèlent un monde en ruines, plongez dans un univers immense peuplé d\'ennemis colossaux. Découvrez un monde épique et sombre au gameplay nerveux et aux combats toujours plus intenses. Fans inconditionnels ou nouveaux joueurs, laissez-vous submerger par les graphismes et le gameplay époustouflants. Désormais, seules les braises subsistent. Préparez-vous à embrasser les ténèbres... encore une fois !', 'https://cfinder.xyz/uploads/DarkSouls3.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2386, 0),
(2388, 'Police Simulator Patrol Officers', 'Bienvenue à Brighton ! Rejoignez les forces de police de cette ville américaine fictive et découvrez la vie quotidienne d\'un agent de police. Commencez par dénoncer des infractions et distribuer des PV, puis grimpez les échelons afin d\'assumer davantage de responsabilités. Faites partie intégrante de la communauté de Brighton, apprenez à connaître votre quartier et à gérer diverses activités quotidiennes afin de combattre le crime pendant votre service. Soyez ferme, mais juste. Respectez la loi et gagnez plus d\'expérience pour débloquer des quartiers, des districts et des tâches à accomplir.\r\n', 'https://i.postimg.cc/Nf6PLHxY/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2387, 0),
(2389, 'Windows 10', 'Windows 10 est un système d\'exploitation de la famille Windows NT développé par la société américaine Microsoft. Officiellement présenté le 30 septembre 2014, il est disponible publiquement depuis le 29 juillet 2015. Bien que le système s\'appelle Windows 10, il s\'agit de la version NT 6.4 pour les versions jusqu’à la « Technical Preview », la première version de Windows NT 6 étant Windows Vista. Windows 10 est ainsi une ultime version de Windows NT 6.0 ; néanmoins, depuis la version finale, il porte bel et bien le numéro interne 10 en lieu et place de 6.4. Il est le successeur de Windows 8.1.', 'https://i.postimg.cc/25xFQQKF/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2388, 0),
(2390, 'The Witcher', 'The Witcher est un jeu de rôles dans un monde sombre et fantastique où règne l\'ambiguïté morale. Dépassant le clivage entre le bien et le mal, le jeu met l\'accent sur l\'histoire et le développement des personnages, tout en proposant un système de combat en temps réel d\'un grande richesse tactique.', 'https://i.postimg.cc/g2HYmj7B/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2389, 0),
(2391, 'Wondershare Filmora ', 'Transformez votre vidéo en une œuvre d\'art avec une simple interface et de puissants logiciels de montage !\r\n\r\nTELECHARGER', 'https://i.postimg.cc/fbC1g0PD/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2390, 0),
(2392, 'The Witcher 2', 'Une époque d\'indescriptible chaos s\'ouvre. Dans l\'ombre, des forces puissantes se disputent pouvoir et influence. Les royaumes du Nord se mobilisent pour la guerre. Mais les armées en marche ne suffiront pas à arrêter le complot sanglant…', 'https://i.postimg.cc/GmV4THK3/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2391, 0),
(2393, 'The Witcher 3', 'Alors que la guerre fait rage à travers les royaumes du Nord, vous acceptez le contrat de votre vie et partez à la recherche de l\'enfant de la prophétie, une arme vivante capable de changer le monde.', 'https://i.postimg.cc/wMqMYJq2/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2392, 0),
(2394, 'Clanfolk', 'Clanfolk est une simulation de colonie médiévale qui vous emmène dans les Highlands écossais et vous confronte à la nature elle-même. Votre famille et vous commencerez sur une parcelle de terrain vierge. Vous apprendrez à survivre tout en bâtissant votre foyer, en prenant soin de votre bétail, en récoltant vos cultures et en supportant le froid hivernal.', 'https://i.ibb.co/fvxXwh1/Clanfolk.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2393, 0),
(2395, 'GOD OF WAR', 'Pénétrez dans le royaume du nord. Sa vengeance contre les dieux de l\'Olympe étant bien derrière lui, Kratos vit désormais comme un simple habitant du royaume des dieux (et des monstres) nordiques. C\'est dans ce monde inhospitalier et cruel qu\'il doit combattre pour sa survie... et apprendre à son fils à en faire de même.', 'https://image.api.playstation.com/vulcan/img/rnd/202010/2217/ax0V5TYMax06mLzmkWeQMiwH.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 1, 2394, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(2396, 'Goat Simulator 3', 'Mais que serait la vie d\'une chèvre sans des amis biquettes avec qui gambader ? Goat Simulator 3 vous offre la possibilité de rassembler votre harde de compagnons, et de partir semer le chaos dans le monde, main dans la main (enfin, sabot)', 'https://i.ibb.co/dDYW2JN/goat-simulator-3-pc-spel-epic-games-europe-cover.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2395, 0),
(2397, 'Call of Duty Ghosts', 'NOUS SOMMES TOUT CE QUE NOUS AVONS. Ce nouveau chapitre de la franchise Call of Duty® présente une nouvelle dynamique, où les joueurs sont du côté d\'une nation paralysée, luttant non pas pour la liberté, mais simplement pour survivre. Les forces d\'opérations spéciales, un groupe mystérieux connu uniquement sous le nom de \"Ghosts\", mènent la bataille contre une puissance mondiale nouvellement apparue, technologiquement supérieure.', 'https://i.ibb.co/5BGjrfL/Call-Of-Duty-Ghost.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', NULL, 2396, 0),
(2398, 'The Escapists 2', 'Fabriquez, volez, bagarrez-vous et évadez-vous ! Il est temps de sortir des prisons les plus dures du monde alors que vous retournez à la vie d\'un détenu dans The Escapists 2, désormais en multijoueur ! Avez-vous ce qu\'il faut pour vous échapper?', 'https://i.ibb.co/bPVb6zZ/The-Escapist-2.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:10', '2025-09-09 15:30:13', 2, 2397, 0),
(2399, 'Undertale ', 'Bienvenue à UNDERTALE. Dans ce RPG, vous contrôlez un humain qui tombe sous terre dans le monde des monstres. Maintenant, vous devez trouver votre chemin… ou rester piégé pour toujours.', 'https://cdn.akamai.steamstatic.com/steam/apps/391540/header.jpg?t=1579096091', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 1, 2398, 0),
(2400, 'We Are Football', 'Menez votre club de football à travers les championnats nationaux et à la célébrité internationale. Prenez en charge une équipe masculine ou féminine établie de votre choix en tant que manager ou amenez une petite équipe dans la cour des grands.', '/storage/game_banners/we-are-football-b89947b248.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2399, 0),
(2401, 'PC Building Simulator', 'Créez et développez votre propre entreprise de réparation d\'ordinateurs, puis découvrez comment diagnostiquer, remettre en état et assembler des PC. À l\'aide de composants agréés et d\'une simulation complète des matériels et logiciels, imaginez et construisez le PC ultime dont vous rêvez.', 'https://i.postimg.cc/XvNhwJxY/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2400, 0),
(2402, '7 Days to Die', '7 Days est un pilier des jeux de survie dont les possibilités au niveau de la fabrication d\'objets et de construction de monde sont encore inégalées. Se déroulant dans un monde post-apocalyptique impitoyable et brutal infesté par les morts-vivants, 7 Days est un jeu à monde ouvert entre le jeu de tir à la première personne, le survival horror, le tower defense et le RPG. Il inclut de la fabrication, de l\'acquisition de butin, de l\'extraction minière, et de l\'exploration, et permet à votre personnage de progresser, ce qui lui a valu d\'être acclamé par bien des fans dans le monde entier. Jouez au tout premier RPG bac à sable de survie et de zombies ! Navezgane n\'attend que vous !', 'https://cfinder.xyz/uploads/7DaystoDie.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2401, 0),
(2403, 'Cities Skylines', 'Cities Skylines est une version moderne de la classique simulation de ville. Le jeu introduit de nouveaux éléments de gameplay pour reproduire les sensations et difficultés inhérentes à la création et à la gestion d\'une vraie ville tout en développant certains aspects établis de la construction de ville.', 'https://i.postimg.cc/SNjf747G/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2402, 0),
(2404, 'Watch Dogs Legion', 'Alors que l\'ancien espion Dalton Wolf, devenu membre de Dedsec, tente de désamorcer une bombe dans les sous-sols des Maisons du Parlement, il découvre que plusieurs autres bombes ont été placées dans des endroits stratégiques de la ville. Sur place, les autres membres de Dedsec, dont Sabine Brandt, s\'y rendent mais sont attaqués par un groupe d\'hommes en noir. Dalton n\'a guère de chance puisqu\'il se fait tuer par un de ces hommes en noir qui lui annonce : \"Zero Day commence maintenant !\" À la suite de l\'explosion des bombes restantes, le gouvernement démissionne et Nigel Cass, chef du groupe paramilitaire Albion prend le pouvoir.', 'https://i.postimg.cc/LX9cCGhV/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2403, 0),
(2405, 'Five Nights at Freddys Security Breach', 'Five Nights at Freddy’s: Security Breach est le dernier volet de la franchise vidéoludique horrifique adulée par des millions de joueurs à travers le monde. Incarnez Gregory, un jeune homme coincé pour la nuit dans le Freddy Fazbear’s Mega Pizzaplex. Avec l’aide de Freddy Fazbear en personne, Gregory doit survivre et échapper aux personnages de Five Nights at Freddy’s (réinventés et rejoints par de toutes nouvelles menaces effroyables) qui le traquent sans relâche.', 'https://i.postimg.cc/zG7ghgmP/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2404, 0),
(2406, 'CupHead', 'Cuphead, c\'est un jeu de plates-formes/action dans la pure veine « run and gun », avec un goût prononcé pour les combats de boss épiques. Inspirés des cartoons américains des années 30, la bande-son et les graphismes ont été créés en respectant scrupuleusement les techniques de l\'époque : animation traditionnelle dessinée à la main sur celluloïds, arrière-plans en aquarelle, compositions jazz originales...', 'https://i.postimg.cc/wv3QWk5r/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2405, 0),
(2407, 'Minecraft Story Mode II', 'Maintenant que Jesse et le gang ont vaincu le Wither Storm, sauvé le monde et sont devenus des héros totalement super célèbres, la vie est devenue un peu plus... compliquée. Avec plus de responsabilités et moins de temps pour l\'aventure, les vieilles amitiés ont commencé à s\'estomper - du moins jusqu\'à ce que la main de Jesse se coince dans un gant effrayant qui appartient à un ancien temple sous-marin. Avec d\'anciens amis et de nouveaux camarades, Jesse se lance dans un tout nouveau voyage rempli de choix difficiles, de bons moments et d\'au moins un lama capricieux.', 'https://i.postimg.cc/BnB7rXxT/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2406, 0),
(2408, 'Railgrade', 'Construisez des réseaux ferroviaires complexes et exploitez la puissance des trains pour permettre aux industries vitales d\'accéder aux ressources dont elles ont besoin. Gérez les entrées et les sorties pour optimiser la production, et créez des chaînes d\'approvisionnement efficaces à l\'aide de chemins de fer à plusieurs niveaux et d\'une variété de types de locomotives uniques en leur genre.', 'https://i.postimg.cc/66nw4Q9R/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2407, 0),
(2409, 'Slime Rancher', 'Slime Rancher est une charmante expérience sandbox à la première personne. Vous incarnez Beatrix LeBeau, une jeune éleveuse de Slimes courageuse, qui part vivre sa vie à plus de mille années-lumière de la Terre, sur Far, Far Ouest. Chaque jour sera synonyme de nouveaux défis et d\'opportunités risquées, tandis que vous tenterez de faire fortune dans le domaine de l\'élevage de Slime.', 'https://cdn1.epicgames.com/corydalis/offer/SlimeRancher-Keyart_Wishlist-Landscape-2560x1440-b2f7b22e6d19dff415daf5dbe4d8e78c.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 1, 2408, 0),
(2410, 'Demon Slayer Kimetsu no Yaiba', 'Nous sommes dans le Japon de l\'ère Taishô. Tanjirô est un jeune vendeur de charbon au grand cœur qui retrouve un jour toute sa famille massacrée par un démon. Pire encore, la seule survivante, sa petite sœur Nezuko, a été transformée en démon. Dévasté par le chagrin, Tanjirô décide néanmoins de devenir un pourfendeur afin de rendre son humanité à sa sœur et de tuer le démon qui a massacré les siens.', 'https://i.ibb.co/NW95m6g/2x1-NSwitch-Demon-Slayer-Kimetsu-No-Yaiba-The-Hinokami-Chronicles-image1600w.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 1, 2409, 0),
(2411, 'Marvels Spider Man Remastered', 'Marvel\'s Spider-Man Remastered pour PC a été développé par Insomniac Games en collaboration avec Marvel, et optimisé pour les PC par Nixxes Software. Vous y incarnez un Peter Parker aguerri combattant le crime contre des ennemis emblématiques dans le New York de Marvel.', 'https://image.api.playstation.com/vulcan/ap/rnd/202009/3021/QeJWAaLcYNOpCv7yCVZZEOY5.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2410, 0),
(2412, 'Subnautica', 'Subnautica est un jeu d\'aventure dans un monde ouvert sous-marin. Dans la peau d\'un scientifique échoué dans ce monde étranger situé sous l\'eau, vous allez devoir trouver comment survivre tout en faisant de nouvelles découvertes sur la nature de la faune locale.', 'https://i.ibb.co/W3DqWdN/Subnautica.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2411, 0),
(2413, 'Adobe Photoshop 2020', 'La référence professionnelle en matière de retouche d\'images numériques. ses outils de création produisent des résultats impressionnants. perfectionnez vos photos obtenez d\'excellents résultats en un temps record lorsque vous supprimez le bruit, accentuez le grain, réalisez des vignettes, corrigez les distorsions de l\'objectif, améliorez la netteté et créez des images hdr. ', 'https://i.ibb.co/JCjRb9v/Adobe-Photoshop.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 1, 2412, 0),
(2414, 'Saints Row 2022', 'Saints Row est le reboot de la saga éponyme : on y suivra la naissance des Saints dans la peau du boss, le personnage jouable, qui développera son empire à travers toute la zone de Santo Ileso, la plus grande map de toute l\'histoire de la franchise.', 'https://i.ibb.co/TtN1x1b/Saints-Row-2022.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2413, 0),
(2415, 'Minecraft Dungeons', 'Bravez les donjons seul ou faites équipe avec des amis ! Jusqu\'à quatre joueurs peuvent s\'affronter à travers des niveaux bourrés d\'action, remplis de trésors et extrêmement variés, le tout dans une quête épique pour sauver les villageois et vaincre le maléfique Arch-Illager !', 'https://cfinder.xyz/uploads/MinecraftDungeons.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2414, 0),
(2416, 'Euro Truck Simulator 2', 'Voyagez à travers l\'Europe en tant que roi de la route, un chauffeur routier qui livre d\'importantes cargaisons vers des destinations très lointaines ! Avec des douzaines de villes à explorer du Royaume-Uni, de Belgique, d\'Allemagne, d\'Italie, des Pays-Bas, de Pologne et de bien d\'autres pays, votre endurance, vos talents et votre rapidité seront poussés dans leur retranchements. Si vous avez les capacités pour être un pilote de poids-lourd d\'élite, trouvez un volant et prouvez-le !', 'https://cfinder.xyz/uploads/EuroTruckSimulator2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2415, 0),
(2417, 'Forza Horizon 5', 'L’aventure Horizon ultime vous attend ! Explorez les paysages vibrants et changeants du Mexique, des jungles luxuriantes aux déserts arides, en passant par des plages et des villes historiques. Amusez-vous sans limite au volant de centaines de voitures phénoménales, avec des options de personnalisation uniques. Vivez des courses palpitantes, relevez des défis de vitesse et de cascades, et participez à des événements saisonniers dynamiques.', 'https://cfinder.xyz/uploads/ForzaHorizon5.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2416, 0),
(2418, 'FL Studio', 'Nous fournissons FL Studio aux créateurs de musique, producteurs, DJ et autres artistes presque depuis sa sortie initiale - et cela fait longtemps ! FL Studio est l\'un des principaux produits pour la création musicale commerciale. En fait, le logiciel FL Studio est à l\'origine de nombreux succès dans différents genres. Si vous avez des questions, n\'hésitez pas à nous contacter, et nous serons plus qu\'heureux de vous aider !', 'https://i.postimg.cc/438519Td/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2417, 0),
(2419, 'Hitman II', 'Parcourez le monde et traquez vos cibles dans les lieux exotiques du jeu HITMAN™ 2. Des rues baignées de soleil aux sombres et dangereuses forêts tropicales, aucun endroit n\'échappe à l\'assassin le plus créatif du monde : l\'Agent 47.', 'https://i.postimg.cc/9Q3D3NJH/Phasmophobia.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2418, 0),
(2420, 'Rimworld', 'RimWorld suit trois survivants d’un écrasement de vaisseau spatial pendant qu’ils bâtissent leur colonie sur une planète à la frontière de l’espace exploré. Inspiré du genre space western de Firefly, la simulation profonde de Dwarf Fortress, et l’échelle grandiose de Dune et Warhammer 40,000.', 'https://i.postimg.cc/LXQYg4Sr/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2419, 0),
(2421, 'Escape the Backrooms', 'Explorez l\'étendue apparemment infinie de niveaux étrangement familiers dans les arrière-salles basées sur la tradition populaire des creepypasta. Chaque niveau propose différentes façons d\'échapper au danger en cours de route.', 'https://i.ibb.co/fNfV9P3/Escape-The-Backrooms.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2420, 0),
(2422, 'Life Is Strange Before the Storm Remastered', 'Le titre se déroule trois ans avant Life is Strange et permet d\'incarner une Chloe Price de seize ans qui se lie d\'amitié avec Rachel Amber, jeune fille populaire et promise à une belle carrière. Lorsque Rachel découvre un secret sur sa famille susceptible de détruire sa vie, c\'est cette nouvelle amitié qui lui donne la force de tenir. Ensemble, les jeunes filles doivent affronter leurs démons et les exorciser.', 'https://i.ibb.co/FmLTqJ4/LIFE-IS-STRANGE-BEFORE-THE-STORM.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 1, 2421, 0),
(2423, 'Dragon Ball Xenoverse 2', 'Un an après le premier opus, Dragon Ball Xenoverse revient dans un nouveau jeu qui revendique l\'univers le plus détaillé de tous les jeux Dragon Ball. Le jeu reprend la recette du premier Dragon Ball Xenoverse avec des bases de MMORPG et le retour des policiers du temps qui doivent protéger l\'histoire.', 'https://i.ibb.co/N1n89bx/Dragon-Ball-Z-Xenoverse-2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2422, 0),
(2424, 'Detroit: Become Human', 'Détroit, 2038. L\'évolution de la technologie a créé un monde où les robots androïdes sont partout. Ils parlent, se déplacent et se comportent comme des humains, mais ce ne sont que des machines au service de ces derniers. À travers les yeux de trois androïdes, découvrez un monde au bord du chaos. Prenez des décisions, tout en sachant qu\'elles auront un immense impact sur l\'incroyable histoire du jeu et ses différentes intrigues.', 'https://cdn2.unrealengine.com/Diesel%2Fproductv2%2Fdetroit-become-human%2Fhome%2FDetroit_PC_Carousel-1920x1080-6e90610a5d314ce0c12860770cc38c1b23213000.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 1, 2423, 0),
(2425, 'Dark Souls Remastered', 'Vint alors l\'avènement du Feu... Redécouvrez le jeu de référence salué par la critique. Dans cette splendide version remastérisée, retrouvez Lordran et ses décors époustouflants en haute définition et en 60 fps.', 'https://fs-prod-cdn.nintendo-europe.com/media/images/10_share_images/games_15/nintendo_switch_4/H2x1_NSwitch_DarkSoulsRemastered_image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2424, 0),
(2426, 'Forza Horizon 4', 'Les saisons dynamiques changent tout sur le plus grand festival automobile au monde. En solo ou en équipe, explorez les magnifiques paysages du Royaume-Uni historique dans un monde ouvert partagé. Collectionnez, modifiez et pilotez plus de 450 voitures.', 'https://cfinder.xyz/uploads/ForzaHorizon4.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2425, 0),
(2427, 'Grand Theft Auto V', 'Lorsqu\'un jeune arnaqueur, un braqueur de banque à la retraite et un terrifiant psychopathe se retrouvent piégés par de grands criminels, le gouvernement américain et l\'industrie du divertissement, ils décident de se lancer dans une série de braquages pour survivre dans une ville sans pitié, où ils ne peuvent se fier à personne, même entre eux.', 'https://i.ibb.co/Yd5Vp4x/Grand-Theft-Auto.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 1, 2426, 0),
(2428, 'Uncharted Legacy of Thieves Collection', 'Défiez votre destin et laissez votre empreinte sur la carte dans UNCHARTED: Legacy of Thieves Collection. Découvrez une expérience narrative et cinématique, et plongez dans les plus grandes scènes d\'action de la série UNCHARTED, avec tous les moments ingénieux et exubérants de Nathan Drake et Chloe Frazer, nos deux voleurs préférés.', 'https://i.postimg.cc/XYDSg8nK/Phasmophobia.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2427, 0),
(2429, 'Slime Rancher 2', 'Slime Rancher 2 est la suite du jeu au succès fracassant et aux nombreuses récompenses que 15 millions de fans ont adoré dans le monde entier. Reprenez les aventures de Beatrix LeBeau, tandis qu\'elle traverse la Mer des Slimes pour rejoindre l\'Île Arc-en-Ciel, une terre qui regorge d\'ancienne technologie, de ressources naturelles encore inconnues et d\'une avalanche de nouveaux slimes frétillants à découvrir. Alors que Beatrix tente de découvrir les mystères de l\'île ainsi que son véritable but, elle construira et élèvera des créatures dans une magnifique serre aux murs de verre étincelants, qui donnera vue sur toute cette île prismatique sur laquelle elle vit désormais.', 'https://cfinder.xyz/uploads/SlimeRancher2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2428, 0),
(2430, 'PC Building Simulator 2', 'Développez votre empire et passez au niveau supérieur en apprenant à réparer, assembler et personnaliser des PC. Découvrez une simulation encore plus riche, un mode carrière amélioré et de nouvelles fonctionnalités de personnalisation puissantes. Utilisez des pièces réalistes de plus de 40 marques de matériel informatique pour construire le PC ultime dont vous rêvez.', 'https://i.postimg.cc/B6NKdxrZ/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2429, 0),
(2431, 'Far Cry 4 - Gold Edition V1.10 - FitGirl Repack', 'Lors de son retour sur ses terres natales, Ajay se retrouve au cœur d\'une rébellion contre le dictateur Pagan Min, rébellion à laquelle il prend part. Dans ce quatrième volet, un mode multijoueur compétitif et un éditeur de carte sont également de la partie.', 'https://i.postimg.cc/QM4KwWdD/far-cry-wallpaper-20.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 1, 2430, 0),
(2432, 'Ultrakill', 'ULTRAKILL est un fast-FPS rétro ultraviolent au rythme effréné, combinant le style basé sur les compétences des jeux d\'action avec un carnage pur et simple inspiré des meilleurs jeux de tir des années 90. Déchirez vos ennemis avec des armes destructrices variées et baignez-les dans leur sang pour regagner votre santé.', 'https://i.postimg.cc/fbDZ0XNK/Design-sans-titre-2.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2431, 0),
(2433, 'Microsoft Office 2019', 'Office 2019 est une version du logiciel de productivité de Microsoft disponible en achat unique auprès d’un magasin de détail ou via un contrat de licence en volume.', 'https://www.noeva.com/wp-content/uploads/sites/8/2019/03/msft-office-2019.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2432, 0),
(2434, 'Far Cry 5 - Gold Edition V1.011 + 5 DLCS -FitGirl Repack', 'Bienvenue à Hope County dans le Montana, terre de liberté et de bravoure qui abrite un culte fanatique prêchant la fin du monde : Eden’s Gate. Défiez son chef, Joseph Seed, et ses frères et soeur, et libérez les citoyens.', 'https://i0.wp.com/tempslibre.ca/wp-content/uploads/2018/05/120162_01.jpg?fit=1141%2C888&ssl=1', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2433, 0),
(2435, 'High on life Update 1 - Dodi Repack', 'High On Life sort tout droit de l\'imagination de Justin Roiland. L\'humanité est menacée par un cartel extraterrestre qui entend l\'exploiter comme une drogue. C\'est à vous qu\'il incombe de secourir et coopérer avec des armes parlantes, de vaincre Garmantuous et son groupe et de sauver le monde.', '/storage/game_banners/high-on-life-update-1-dodi-repack-6df814adf0.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2434, 0),
(2436, 'Batman: Arkham Knight v1.6.2.0 - Dodi Repack', 'Batman™: Arkham Knight marque le dénouement épique de la trilogie primée Arkham, créée par les studios Rocksteady. Développé exclusivement pour les consoles nouvelle génération, Batman: Arkham Knight introduit une version unique de la Batmobile, créée par Rocksteady. Ce véhicule légendaire, associé au gameplay plébiscité de la série Batman Arkham, offre aux joueurs l\'expérience de jeu Batman la plus complète. Roulez à toute allure dans les rues de Gotham City et élancez-vous au-dessus des toits.', 'https://i.ibb.co/rfDkNkb/batman-arkham-knight-pc-jeu-steam-cover.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2435, 0),
(2437, 'Gotham Knights + Online', 'Batman est mort. Un nouveau monde criminel et étendu a envahi les rues de Gotham City. Il appartient maintenant à la Batman Family (Batgirl, Nightwing, Red Hood et Robin) de protéger Gotham, de donner de l\'espoir à ses citoyens, de la discipline à ses policiers et d’inspirer la peur à ses criminels. De la résolution de mystères qui lient les chapitres les plus sombres de l\'histoire de la ville en passant par le triomphe face à de célèbres vilains dans des affrontements épiques, vous devrez devenir le nouveau Chevalier Noir et sauver les rues du chaos.', 'https://i.postimg.cc/PJkLtHgr/Phasmophobia.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2436, 0),
(2438, 'Need for Speed Hot Pursuit Remastered', 'Ressentez le frisson de la poursuite et l’adrénaline de l’évasion dans Need for Speed Hot Pursuit Remastered sur PC. Laissez parler votre sens de la vitesse en tant que flic ou hors-la-loi au volant des voitures haute performance les plus rapides au monde. Échappez à la pression ou arrêtez les hors-la-loi. Utilisez votre arsenal tactique dans une expérience de course palpitante, compétitive et sociale. ', '/storage/game_banners/need-for-speed-hot-pursuit-remastered-f7106deaa7.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2437, 0),
(2439, 'Pacify', 'Vous venez de vous connecter à Paranormal Activity Helpers Incorporated, PAH Inc., ça semble banal, mais ça paie très bien. Ils ont déclaré que vous ne courriez jamais de vrai danger, et ils ont beaucoup de travail en ce moment. Ton premier travail est dans une vieille maison hantée. Il y a un courtier qui veut mettre la maison en vente mais, comme tout le monde dans la ville répand des rumeurs sur le démon qui habite à l\'intérieur de la maison, il a besoin d\'une preuve que la maison est sûre.', 'https://i.ibb.co/bs7jQRz/Pacify.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2438, 0),
(2440, 'Adobe Premiere Pro 2021', 'Créez des titres, des introductions, et des transitions cinématographiques. Retirez un objet d’un plan. Animez un logo ou un personnage. Faites la pluie et le beau temps. Enfin, créez et explorez dans l’espace 3D. Avec After Effects, l’application d’animation et d’effets spéciaux de référence, vous pouvez faire bouger les idées.', 'https://i.ibb.co/KD3YPmK/Couverture-Formation-adobe-premiere-pro.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2439, 0),
(2441, 'It Takes Two', 'Embarquez pour le voyage le plus fou de votre vie dans It Takes Two. Invitez un ami à participer gratuitement avec Friend\'s Pass* et travaillez ensemble sur une grande variété de défis de jeu joyeusement perturbants.', 'https://i.postimg.cc/3NPMtXK0/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2440, 0),
(2442, 'Jump Force', 'Les héros de Manga les plus célèbres sont jetés dans un tout nouveau champ de bataille : notre monde. S\'unissant pour combattre la menace la plus dangereuse, la Jump Force portera le sort de l\'humanité tout entière.\r\n\r\n', 'https://i.postimg.cc/jjGjJ7f2/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', 2, 2441, 0),
(2443, 'Jurassic World Evolution', 'Placez-vous au cœur de la franchise Jurassic et construisez votre propre Jurassic World. Des dinosaures bio-ingénieurs qui pensent, ressentent et réagissent intelligemment au monde qui les entoure et font face aux menaces posées par l\'espionnage, les évasions et les tempêtes tropicales dévastatrices dans un monde incertain où la vie trouve toujours son chemin.', 'https://i.postimg.cc/Ss3xCzzj/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:11', '2025-09-09 15:30:13', NULL, 2442, 0),
(2444, 'King of Seas', 'King of Seas est un jeu de rôle d\'action se déroulant dans un monde de pirates procédural. Une aventure épique vous attend dans un monde fantastique, parsemé de combats, d\'îles perdues et de trésors. Un univers qui vous gardera ancré alors que vous vous battez pour devenir le roi de tous les pirates.', 'https://i.postimg.cc/MHVr5hXV/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2443, 0),
(2445, 'Attack on Titan 2', 'Combattez les Titans avec le Harnais de manœuvre tridimensionnelle. Le combat libre dans les airs n\'a jamais été aussi grisant ! Nous avons ajouté des mouvements qui vous permettent, entre autres, de vous rapprocher instantanément des Titans et de les découper avec les \"Attaques-surprises\", ou encore de les contourner rapidement et de leur infliger d\'importants dégâts avec les \"Coups de grappin\". Utilisez un Harnais de manœuvre tridimensionnelle plus évolué et polyvalent.', 'https://i.postimg.cc/k5s1hQnY/Attack-on-titan-2.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 1, 2444, 0),
(2446, 'Levi Chronicles', 'Leviticus Coleman et son équipage ont disparu… est-ce que vous et votre équipage êtes en mesure de découvrir ce qui est arrivé à Levi ?', 'https://i.postimg.cc/qRgT1Zx7/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2445, 0),
(2447, 'Les Sims 4', 'Les Sims 4 est le jeu de simulation de vie très attendu qui vous permet de jouer avec la vie comme jamais auparavant. Contrôlez des Sims plus intelligents avec des apparences, des personnalités, des comportements et des émotions uniques. Découvrez de nouveaux niveaux de créativité lorsque vous sculptez des Sims avec le puissant Créer un Sim et concevez de belles maisons avec le mode Construction tactile et basé sur la pièce.', 'https://i.postimg.cc/NGTVQcFc/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2446, 0),
(2448, 'Mario Golf Super Rush', 'Rejoignez vos personnages préférés du Royaume Champignon pour une partie de golf dans Mario Golf: Super Rush !Amusez-vous en jouant au speed golf, un mode où tout le monde joue son coup de départ en même temps puis fait la course pour entrer sa balle le plus vite possible...', 'https://i.postimg.cc/fbBmhJnb/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2447, 0),
(2449, 'Naruto Shippuden Ultimate Ninja Storm 4', 'Dans un tout nouveau village de feuilles cachées, vivez les aventures de Boruto, le fils de Naruto ! Pendant que vous faites de votre mieux pour réussir l\'examen chunnin, une nouvelle menace menace le monde shinobi. Serez-vous assez puissant pour le vaincre ? .', 'https://i.postimg.cc/dtvX5xBj/Phasmophobia.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2448, 0),
(2450, 'Outlast', 'ell est une expérience à laquelle vous ne pouvez pas survivre dans Outlast, un jeu d\'horreur de survie à la première personne développé par des vétérans de certaines des plus grandes franchises de jeux de l\'histoire. Dans la peau du journaliste d\'investigation Miles Upshur, explorez Mount Massive Asylum et tentez de survivre assez longtemps pour découvrir son terrible secret…', 'https://i.postimg.cc/hjdbnKSQ/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 2, 2449, 0),
(2451, 'Papers Please', 'Votre nom a été sélectionné lors de la loterie du Ministère du Travail du mois d\'octobre.Pour prendre vos fonctions, présentez-vous immédiatement au Ministère des Admissions du poste-frontière de Grestin.Un appartement de classe 8 vous a été affecté à Grestin Est. Vous pourrez vous y installer avec votre famille.Gloire à l\'Arstotzka..', 'https://i.postimg.cc/SxSXdk37/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2450, 0),
(2452, 'Phasmophobia', 'Phasmophobia est un jeu d\'horreur psychologique coopératif en ligne à 4 joueurs. L\'activité paranormale est en augmentation et c\'est à vous et à votre équipe d\'utiliser tout l\'équipement de chasse aux fantômes à votre disposition afin de rassembler autant de preuves que possible.', 'https://cfinder.xyz/uploads/Phasmophobia.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2451, 0),
(2453, 'Planet Coaster', 'Laissez-vous inspirer par les autres et inspirez-les en retour en créant, gérant et partageant les parcs les plus incroyables avec vos amis et des créateurs de contenu des quatre coins du monde. Surprenez et émerveillez vos visiteurs, et offrez-leur des sensations fortes tout en bâtissant votre empire du divertissement. Les seules limites sont celles de votre imagination avec la nouvelle référence des simulations de parcs d\'attractions.', 'https://i.postimg.cc/XqPN46xm/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 2, 2452, 0),
(2454, 'Planet Centauri + Online', 'Embarquez pour votre plus grande aventure sur la planète Centauri ! Découvrez de nouveaux biomes, explorez des donjons cachés, capturez et apprivoisez des monstres, construisez et protégez une communauté de PNJ, fabriquez vos propres armes et créez vos propres sorts magiques ! Sauvez et protégez les espèces chloriniennes indigènes des méchants Night Walkers ! Développez et élevez la planète Centauri vers les cieux en tant que berceau d\'une nouvelle civilisation !', 'https://i.postimg.cc/DwVpDYnz/planet-centuri.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 2, 2453, 0),
(2455, 'Prison Architect', 'Construisez et gérez une prison à sécurité maximale. Alors que le soleil projette ses premiers rayons de soleil sur une belle parcelle de campagne, le temps commence à tourner. Vous devez craquer et construire une cellule de détention pour détenir le lot de prisonniers à sécurité maximale qui se dirigent vers votre future prison dans leur bus jaune. Pendant que vos ouvriers posent la dernière brique, vous n\'avez pas un moment pour les laisser se reposer car ils doivent commencer par le premier bloc de cellules approprié afin que vous puissiez faire de la place pour la prochaine admission de prisonniers.', 'https://i.postimg.cc/zG0WWVt1/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2454, 0),
(2456, 'Rust', 'Le seul but dans Rust est de survivre. Pour ce faire, vous devrez surmonter des luttes telles que la faim, la soif et le froid. Faire un feu. Construisez un abri. Tuez les animaux pour la viande. Protégez-vous des autres joueurs et tuez-les pour de la viande. Créez des alliances avec d\'autres joueurs et formez une ville.', 'https://cfinder.xyz/uploads/Rust.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2455, 0),
(2457, 'Raft', 'Raft vous plonge, vous et vos amis, dans une aventure épique au large, avec le objectif de rester en vie, de rassembler des ressources et de vous construire une maison flottante digne de survie.', 'https://cfinder.xyz/uploads/Raft.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2456, 0),
(2458, 'Soundpad', 'Lisez des sons haute qualité dans les chats vocaux. Ajoutez des sons et des musiques à votre signal micro pour que les autres puissent les entendre.', 'https://i.postimg.cc/XYqQGc2W/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2457, 0),
(2459, 'SimCasino', 'Simulation de magnat du casino moderne en pleine gloire 3D. Construisez le casino. Fixez les cotes. Développez-vous dans un hôtel/casino de luxe ou optez pour un bon marché et extrayez un maximum de profits. Gardez le coffre-fort sécurisé à tout moment et méfiez-vous des criminels et des tricheurs !!', 'https://i.postimg.cc/cCvczdPz/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2458, 0),
(2460, 'Stardew Valley', 'Vous avez hérité de l\'ancienne parcelle agricole de votre grand-père à Stardew Valley. Armé d\'outils pratiques et de quelques pièces de monnaie, vous vous apprêtez à commencer votre nouvelle vie. Pouvez-vous apprendre à vivre de la terre et transformer ces champs envahis par la végétation en une maison prospère ?', 'https://i.postimg.cc/j25H9tFV/Hearts-of-Iron-IV.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 2, 2459, 0),
(2461, 'BIGFOOT', 'BIGFOOT est un jeu d\'horreur de survie sur la chasse au Bigfoot. Il existe 2 modes disponibles : vous pouvez jouer contre Bigfoot contrôlé par l\'IA, ou un autre joueur peut jouer le rôle du monstre.', 'https://i.postimg.cc/0yBB5H0D/image.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 2, 2460, 0),
(2462, 'Stellaris', 'Explorez et découvrez un univers spectaculaire et en constante évolution ! Paradox Development Studio, créateur des séries Europa Universalis et Crusader Kings, et éditeurs du best-seller Cities: Skylines, présente Stellaris, faisant avancer le genre de la grande stratégie jusqu\'aux confins de l\'univers.', 'https://i.postimg.cc/cHKwcXp7/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2461, 0),
(2463, 'Five Nights at Freddys 1', 'Bienvenue dans votre nouvel emploi d\'été chez Freddy Fazbear\'s Pizza, où enfants et parents viennent se divertir et se restaurer à perte de vue ! L\'attraction principale est Freddy Fazbear, bien sûr ; et ses deux amis. Ce sont des robots animatroniques, programmés pour plaire aux foules ! Cependant, le comportement des robots est devenu quelque peu imprévisible la nuit, et il était beaucoup moins cher de vous engager comme agent de sécurité que de trouver un réparateur.', 'https://i.postimg.cc/qq0YVHBx/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2462, 0),
(2464, 'Five Nights at Freddys 2', 'Bienvenue dans votre nouvel emploi d\'été chez Freddy Fazbear\'s Pizza, où enfants et parents viennent se divertir et se restaurer à perte de vue ! L\'attraction principale est Freddy Fazbear, bien sûr ; et ses deux amis. Ce sont des robots animatroniques, programmés pour plaire aux foules ! Cependant, le comportement des robots est devenu quelque peu imprévisible la nuit, et il était beaucoup moins cher de vous engager comme agent de sécurité que de trouver un réparateur.', 'https://i.postimg.cc/0246Vkym/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2463, 0),
(2465, 'Cinema4D R23', 'Cinema 4D est une solution logicielle professionnelle de modélisation, d\'animation, de simulation et de rendu 3D. Ses outils rapides, puissants, flexibles et stables rendent les flux de travail 3D plus accessibles et plus efficaces pour les professionnels de la conception, de l\'animation, des effets spéciaux, de la réalité virtuelle, du développement de jeux vidéos et de tous les types de visualisation. Cinema 4D produit des résultats époustouflants, que vous travailliez seul ou en équipe.', 'https://i.ibb.co/MNcKndV/2020908-Splash-C4-D-R23.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2464, 0),
(2466, 'Five Nights at Freddys 3', 'Bienvenue dans votre nouvel emploi d\'été chez Freddy Fazbear\'s Pizza, où enfants et parents viennent se divertir et se restaurer à perte de vue ! L\'attraction principale est Freddy Fazbear, bien sûr ; et ses deux amis. Ce sont des robots animatroniques, programmés pour plaire aux foules ! Cependant, le comportement des robots est devenu quelque peu imprévisible la nuit, et il était beaucoup moins cher de vous engager comme agent de sécurité que de trouver un réparateur.', 'https://i.postimg.cc/4NP7V6r8/FIVE-NIGHTS-AT-FREDDY-S-4.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2465, 0),
