(2468, 'Captain Tsubasa', 'Captain Tsubasa Rise of New Champions est un jeu de football d\'arcade apportant un regard rafraîchissant sur le genre du football avec l\'action exaltante et les meilleurs clichés qui ont rendu la licence célèbre.', 'https://i.ibb.co/svrqyK6/capsule-616x353.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2467, 0),
(2469, 'Five Nights at Freddys Sister Location', 'Bienvenue dans votre nouvel emploi d\'été chez Freddy Fazbear\'s Pizza, où enfants et parents viennent se divertir et se restaurer à perte de vue ! L\'attraction principale est Freddy Fazbear, bien sûr ; et ses deux amis. Ce sont des robots animatroniques, programmés pour plaire aux foules ! Cependant, le comportement des robots est devenu quelque peu imprévisible la nuit, et il était beaucoup moins cher de vous engager comme agent de sécurité que de trouver un réparateur.', 'https://i.postimg.cc/fRySM3JJ/FIVE-NIGHTS-AT-FREDDY-S-SISTER-LOCATION.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2468, 0),
(2470, 'Rebel Inc Escalation', 'Dans Rebel Inc: Escalation, la guerre est \"terminée\", mais on sait tous que ça ne veut rien dire. Afin de stabiliser un pays ravagé par la guerre, vous devez trouver le bon équilibre entre priorités militaires et civiles pour plaire au peuple, tout en empêchant une force insurrectionnelle de s\'emparer du pouvoir !', 'https://i.ibb.co/rvq19y9/rebel-inc-escalation.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 1, 2469, 0),
(2471, 'CarX Drift Racing', 'CarX Drift Racing est un simulateur de course où « drifting » est le maître mot ! Au programme des hostilités sur la version PC de ce hit pour mobile : bolides légendaires, réglages détaillés et mode multijoueur en temps réel, avec en prime le Full HD et 60 images par seconde !', 'https://i.ibb.co/3fZg2F3/Carx-Drift-Racing-online.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2470, 0),
(2472, 'Five Nights at Freddys Help Wanted', 'Bienvenue dans votre nouvel emploi d\'été chez Freddy Fazbear\'s Pizza, où enfants et parents viennent se divertir et se restaurer à perte de vue ! L\'attraction principale est Freddy Fazbear, bien sûr ; et ses deux amis. Ce sont des robots animatroniques, programmés pour plaire aux foules ! Cependant, le comportement des robots est devenu quelque peu imprévisible la nuit, et il était beaucoup moins cher de vous engager comme agent de sécurité que de trouver un réparateur.', 'https://i.postimg.cc/6pct3z40/FIVE-NIGHTS-AT-FREDDY-S-VR-HELP-WANTED.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2471, 0),
(2473, 'Call of Duty Black Ops II', 'Repoussant les limites de ce que les fans attendent de la franchise de divertissement record, Call of Duty®: Black Ops II propulse les joueurs dans un futur proche de la guerre froide', 'https://i.ibb.co/RPMPJd8/capsule-616x353.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2472, 0),
(2474, 'The forest + Online', 'En tant que seul survivant d\'un accident d\'avion de ligne, vous vous retrouvez dans une forêt mystérieuse luttant pour rester en vie contre une société de mutants cannibales. Construisez, explorez, survivez dans ce terrifiant simulateur d\'horreur de survie à la première personne.', 'https://i.postimg.cc/8zsnR5fv/THE-FOREST.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2473, 0),
(2475, 'Camping Simulator', 'Camping Simulator vous permet de découvrir ce que signifie camper en préparant judicieusement votre sac à dos pour des conditions naturelles difficiles. Vous pouvez jouer à toutes les expériences avec jusqu\'à quatre amis en mode multijoueur ou en mode solo.', 'https://i.ibb.co/Vj4tmhk/Camping-Simulator.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2474, 0),
(2476, 'Adobe Illustrator 2020', 'Créez rapidement et simplement du contenu en vous appuyant sur des outils intuitifs et des fonctionnalités optimisées par la technologie IA d’Adobe Sensei. Recolorez vos dessins en un clic, créez des effets personnalisés et bien plus encore.', 'https://i.postimg.cc/L407QLkX/adobe-illustrator.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2475, 0),
(2477, 'DREDGE', 'DREDGE est une aventure solo de pêche en eau trouble. Vendez votre prix, améliorez votre bateau et faites glisser les profondeurs pour y dénicher des secrets enfouis depuis la nuit des temps.', 'https://image.api.playstation.com/vulcan/ap/rnd/202303/0116/90966f8c33926d1ffd144b560322873f9435f480d29606d8.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2476, 0),
(2478, 'Devour', 'DEVOUR est un jeu de survie d\'horreur coopératif pour 1 à 4 joueurs. Arrêtez un chef de secte possédé avant qu\'elle ne vous entraîne en enfer avec elle. Courir. Pousser un cri. Cacher. Ne vous faites pas prendre.', 'https://i.ibb.co/JpkQMHR/header-2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2477, 0),
(2479, 'Days Gone', 'Roulez et combattez dans une Amérique post-pandémique mortelle. Incarnez Deacon St. John, un vagabond et chasseur de primes qui parcourt la route défoncée, se battant pour survivre tout en cherchant une raison de vivre dans ce jeu d\'action-aventure en monde ouvert.', 'https://i.ibb.co/L13VGfP/0124536-days-gone-row.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2478, 0),
(2480, 'Control', 'Une présence maléfique a envahi le Bureau Fédéral de Contrôle… Vous seul pouvez l\'arrêter. Prenez possession du monde mystérieux qui vous entoure pour vaincre cet enemi implacable. Le confinement a été brisé, l\'humanité est en danger. Reprendrez-vous le contrôle ? Lauréat de plus de 80 prix et récompenses, Control est un jeu d\'action-aventure à la 3ème personne qui vous tiendra en haleine. Combinant des environnements ouverts au célèbre savoir-faire du studio Remedy Entertainment en termes de narration et de création d\'univers, Control propose une expérience de jeu unique, aussi immersive qu\'intense.', 'https://i.postimg.cc/59Fq1zdj/control.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 2, 2479, 0),
(2481, 'Resident Evil Village', 'Quelques années après les événements effroyables de Resident Evil 7: Biohazard, le jeu encensé par la critique, Ethan Winters et son épouse Mia coulent des jours heureux dans un petit village, loin de leurs anciens cauchemars, loin de se douter que la tragédie guette à nouveau.', 'https://xxboxnews.blob.core.windows.net/prod/sites/5/2021/01/Village-Key-Art-1_1920x1080.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 2, 2480, 0),
(2482, 'Farming Simulator 17 ', 'Incarnez un agriculteur moderne dans Farming Simulator 17 ! Explorez les possibilités agricoles dans un nouvel environnement nord-américain. Conduisez plus de 250 véhicules et équipements agricoles de plus de 75 fabricants, y compris de nouvelles marques telles que Challenger, Fendt, Valtra ou Massey Ferguson.', 'https://i.ibb.co/x3kydQW/gi-Wxlv4-Omi-QKWg9b-DZAPCP8x-ESk9-Nchy.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2481, 0),
(2483, 'OMORI', 'Explorez un monde étrange plein d\'amis et d\'ennemis colorés. Le moment venu, le chemin que vous avez choisi déterminera votre destin... et peut-être aussi celui des autres.', 'https://fs-prod-cdn.nintendo-europe.com/media/images/10_share_images/games_15/nintendo_switch_4/2x1_NSwitch_Omori_image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2482, 0),
(2484, 'Dinkum', 'Préparez-vous à commencer une nouvelle vie de Dinkum équitable et à construire une maison sur une île inspirée de l\'arrière-pays australien sauvage. Explorez les forêts tropicales d\'eucalyptus, survivez aux déserts brûlants, détendez-vous dans des billabongs frais et découvrez la garrigue remplie d\'adorables animaux sauvages d\'inspiration australienne.', 'https://i.ibb.co/4f9hg3f/Dinkum.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 2, 2483, 0),
(2485, 'Totally Reliable Delivery', 'Tentative de livraison. C\'est la garantie d\'un service de livraison totalement fiable ! T.R.D.S. est une simulation physique ragdoll sur les terribles coursiers de livraison de colis. Travaillez ensemble en utilisant des machines étranges, des gadgets utiles et les merveilles de la physique pour livrer de manière fiable les colis à leur destination.', 'https://i.postimg.cc/4Nhg60Ss/Mario-Golf-Super-Rush.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', 2, 2484, 0);
INSERT INTO `games` (`id`, `title`, `description`, `banner_url`, `zip_password`, `is_vip`, `access_level`, `category_id`, `platform`, `specifications`, `year`, `created_at`, `updated_at`, `default_badge_id`, `primary_media_id`, `views`) VALUES
(2486, 'Forts', 'Dans Forts, le joueur établit sa base tout en se défendant et acquiert des armes au travers d\'arbres de technologies qui lui permettent de détruire son adversaire.\r\n\r\nTELECHARGER', 'https://i.ibb.co/vDdLYcX/capsule-616x353.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:12', '2025-09-09 15:30:13', NULL, 2485, 0),
(2487, 'Hollow Knight', 'Choisissez votre destin dans Hollow Knight ! Une aventure épique et pleine d’action, qui vous plongera dans un vaste royaume en ruine peuplé d’insectes et de héros. Dans un monde en 2D classique, dessiné à la main.', '/storage/game_banners/hollow-knight-45608c3eea.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', NULL, 2486, 0),
(2488, 'Inside the Backrooms', 'Inside the Backrooms est un jeu multijoueur d\'horreur mélangé à différentes mécaniques qui vous fera passer une nuit intense entre amis. Explorez, réfléchissez, interagissez, mais attention, il se murmure que plusieurs entités souhaitent vous retrouver…', 'https://i.ibb.co/vC9qFVs/Inside-the-Backrooms.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', 2, 2487, 0),
(2489, 'Factorio', 'Factorio est un jeu dans lequel vous construisez et maintenez des chaines de production.Vous minerez des ressources, élaborerez des technologies, mettrez en place des infrastructures, automatiserez votre production et combattrez des ennemis.', 'https://i.postimg.cc/yNBYTx36/Design-sans-titre-1.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', NULL, 2488, 0),
(2490, 'Youtubers Life 2', 'Créez votre propre chaîne et décidez quel est le meilleur contenu à couvrir : jeux vidéo tendance, streamings improvisés, critiques professionnelles... Ou bien tous ! Collectez des cartes pour créer le meilleur contenu et choisissez la réaction la plus appropriée pour chaque vidéo et chaque situation.', 'https://fs-prod-cdn.nintendo-europe.com/media/images/10_share_images/games_15/nintendo_switch_download_software_1/H2x1_NSwitchDS_YoutubersLife2.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', 2, 2489, 0),
(2491, 'Gang Beasts ', 'Gang Beasts est un jeu de société multijoueur idiot avec des personnages gélatineux hargneux, des séquences de combat brutales et des environnements dangereux absurdes, se déroulant dans les rues méchantes de Beef City.', 'https://i.ibb.co/hdJ7bSS/04e13ca17a27aad6c8fe171aca4bcd9731cf04121542958fa4d09d2b49c4c154.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', 2, 2490, 0),
(2492, 'Grounded', 'Le monde est un endroit vaste, beau et dangereux, surtout lorsque vous avez été réduit à la taille d\'une fourmi. Pouvez-vous prospérer aux côtés des hordes d\'insectes géants, luttant pour survivre aux périls de l\'arrière-cour ?', 'https://cfinder.xyz/uploads/Grounded.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', NULL, 2491, 0),
(2493, 'Youtubers Life', 'Youtubers Life est le jeu vidéo ultime de simulation/gestion dans lequel vous devenez le plus grand créateur de contenu de l\'histoire en éditant des vidéos, en augmentant le nombre de fans et en devenant riche.', 'https://i.ibb.co/Qrt4bgb/Youtubers-Life.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', 1, 2492, 0),
(2494, 'Ghostrunner', 'Ghostrunner est un slasher FPP hardcore rempli d\'action ultra-rapide, situé dans une mégastructure sinistre et cyberpunk. Grimpez la Tour du Dharma, le dernier refuge de l\'humanité, après un cataclysme mondial. Partez d\'en bas pour aller en haut, affrontez le Maître des clés tyrannique et prenez votre revanche.', 'https://i.ibb.co/GJNnbNp/H2x1-NSwitch-DS-Ghostrunner.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', 2, 2493, 0),
(2495, 'Hello Neighbor', 'Hello Neighbor est un jeu d\'horreur furtif qui consiste à se faufiler dans la maison de votre voisin pour découvrir quels horribles secrets il cache dans le sous-sol. Vous jouez contre une IA avancée qui apprend de chacun de vos mouvements. Vous aimez vraiment grimper par la fenêtre de votre jardin ? Attendez-vous à un piège à ours là-bas. Se faufiler par la porte d\'entrée ? Il y aura bientôt des caméras. Essayer d\'échapper? Le voisin trouvera un raccourci et vous attrapera.', 'https://i.ibb.co/nf9zGxH/apps-51702-64273675158289496-8166c900-b6f7-4a0d-9d1d-f96dc540827c.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', 2, 2494, 0),
(2496, 'Scrap Mechanic', 'Entrez dans le paradis créatif de Scrap Mechanic ! Construisez des machines fantastiques, partez à l\'aventure avec vos amis et défendez-vous contre des vagues de Farmbots diaboliques dans ce bac à sable de survie multijoueur imaginatif.', 'https://i.ibb.co/XJrjrYg/SCRAP-MECHANIC.webp', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', NULL, 2495, 0),
(2497, 'Super Meat Boy Forever', 'La suite de Super Meat Boy est là ! Meat Boy et Bandage Girl doivent courir, glisser, tacler, sauter, frapper et se frayer un chemin à travers plus de 7 000 niveaux pour sauver leur fille Nugget du Dr Fetus. ', 'https://fs-prod-cdn.nintendo-europe.com/media/images/10_share_images/games_15/nintendo_switch_download_software_1/H2x1_NSwitchDS_SuperMeatBoyForever_image1600w.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', 1, 2496, 0),
(2498, 'Halo 4', 'Commencez aujourd\'hui votre carrière de Spartan avec le célèbre Halo: Reach. Revivez une campagne mythique et la bataille décisive pour la planète Reach tandis que l\'équipe Noble lutte pour sauver le dernier bastion de l\'humanité. Retrouvez l\'expérience multijoueur et sa personnalisation de personnage, ses cartes et ses modes de jeu inoubliables, avec entre autres Baptême du feu, qui vous permet d\'affronter seul ou avec votre escouade des vagues d\'ennemis successives à la puissance croissante.', 'https://i.ibb.co/CW66yL9/apps-34314-14094852858730120-8475f7cf-0333-4f77-934d-36aa19e18c42.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', NULL, 2497, 0),
(2499, 'Terraria', 'Creusez, combattez, explorez, construisez ! Rien n\'est impossible dans ce jeu d\'aventure bourré d\'action. Pack de quatre également disponible !', 'https://i.postimg.cc/G2DRpvj5/Design-sans-titre.png', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', NULL, 2498, 0),
(2500, 'Adobe After Effect 2021', 'Créez des titres, des introductions, et des transitions cinématographiques. Retirez un objet d’un plan. Animez un logo ou un personnage. Faites la pluie et le beau temps. Enfin, créez et explorez dans l’espace 3D. Avec After Effects, l’application d’animation et d’effets spéciaux de référence, vous pouvez faire bouger les idées.', 'https://dreamityourselfmusician.com/wp-content/uploads/2021/03/adobe-after-effects.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:34:29', 1, 2499, 1),
(2501, 'Adblock Youtube', 'Ce référentiel contient un script utilisateur conçu pour supprimer la fenêtre contextuelle ennuyeuse « Les bloqueurs de publicités ne sont pas autorisés sur Youtube ». Suivez les instructions ci-dessous pour commencer. Nous disposons également d\'un moyen non détecté d\'ignorer les publicités si vous êtes bloqué sur le lecteur vidéo.', 'https://i.ibb.co/WshG7wM/Adblock-Youtube-1.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:43:35', 1, 2500, 2),
(2502, 'Assassins Creed Unity ', 'Assassin\'s Creed® Unity est un jeu d\'action-aventure en monde ouvert qui se déroule à Paris pendant la Révolution Française. Vous pourrez maintenant personnaliser votre héros, Arno, en choisissant son équipement. Cela aura un impact sur l\'aspect visuel, mais aussi sur le gameplay. En plus de la campagne solo, Assassin\'s Creed Unity permet de jouer à 4 dans des missions additionnelles scénarisées. Assistez aux moments clés de l\'Histoire de France, dans le monde ouvert le plus crédible et vivant jamais créé.', 'https://cdn2.unrealengine.com/Diesel%2Fproductv2%2Fassassins-creed-unity%2Fhome%2FACU_UCS14913_EGST_BannerBundle_US_Store_Landscape_2580x1450-2580x1450-24a0303665904010909579042262c383124ad3c1.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', NULL, 2501, 0),
(2503, 'A Plague Tale Requiem', 'Embarquez dans la suite bouleversante de A Plague Tale: Innocence, le jeu aux multiples récompenses ! Aux côtés d’Amicia et Hugo, surmontez tous les dangers et vivez une nouvelle aventure à couper le souffle dans un monde brutal et cruel.', 'https://cdn1.epicgames.com/salesEvent/salesEvent/PlagueTale2_2560x1440-f5840bd8286204cb20ae573e160c29f3', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', 2, 2502, 0),
(2504, 'A Way Out + ONLINE', 'Leo Caruso et Vincent Moretti sont deux prisonniers qui doivent apprendre à se connaître et à travailler ensemble pour pouvoir s\'évader de leur lieu de détention et mener à bien leur cavale pour vivre une amitié unique.', 'https://i.ibb.co/hYv13nZ/A-Way-Outjpg.jpg', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:30:13', 2, 2503, 0),
(2505, '60 Seconds', 'Dans 60 Seconds! Reatomized, Dolores, Ted, Mary Jane et Timmy sont de retour pour affronter l\'apocalypse nucléaire dans cette nouvelle édition remasterisée de l\'aventure atomique classique avec une prise en charge 4K, des graphismes 2D revisités et des textures 3D peintes à la main, un nouveau menu interactif, une interface améliorée, une actualisation technique, et... du nouveau contenu !', 'https://cdn.akamai.steamstatic.com/steam/apps/1012880/header.jpg?t=1684147568', NULL, 0, 'free', NULL, 'Windows', NULL, NULL, '2025-09-09 15:30:13', '2025-09-09 15:33:54', NULL, 2504, 1);
