DELIMITER $$
CREATE TRIGGER `update_review_helpful_count` AFTER INSERT ON `review_reactions` FOR EACH ROW BEGIN
    UPDATE article_reviews 
    SET helpful_count = (
        SELECT COUNT(*) 
        FROM review_reactions 
        WHERE review_id = NEW.review_id AND reaction_type = 'helpful'
    )
    WHERE id = NEW.review_id$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_review_helpful_count_delete` AFTER DELETE ON `review_reactions` FOR EACH ROW BEGIN
    UPDATE article_reviews 
    SET helpful_count = (
        SELECT COUNT(*) 
        FROM review_reactions 
        WHERE review_id = OLD.review_id AND reaction_type = 'helpful'
    )
    WHERE id = OLD.review_id$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_review_helpful_count_update` AFTER UPDATE ON `review_reactions` FOR EACH ROW BEGIN
    -- Mettre à jour l'ancien avis si l'ID a changé
    IF OLD.review_id != NEW.review_id THEN
        UPDATE article_reviews 
        SET helpful_count = (
            SELECT COUNT(*) 
            FROM review_reactions 
            WHERE review_id = OLD.review_id AND reaction_type = 'helpful'
        )
        WHERE id = OLD.review_id$$
DELIMITER ;

